(25, 1, 1, '2008-04-19 19:33:33', '2007-12-09 00:00:00', 'article', 'Willkommen bei den Handballern!', '<p>Liebe Handballfreunde</p>\r\n<p>Nachdem die Jugendmannschaften nun ihre Saison beendet haben, stehen auf unserer Website wieder ein paar Änderungen an. Die neue Saison wird eingerichtet und ist bereits links oben auswählbar.</p>\r\n<p>Willkommen auf der Homepage der Griesheimer Handballer, auf der wir Ihnen Informationen über die Spiele unserer Mannschaften und aus dem Abteilungsgeschehen bereitstellen. Beim Lesen der Berichte und beim Betrachten der Bilder wünschen wir Ihnen gute Unterhaltung und freuen uns natürlich auch über jeden Beitrag und Eintrag in unser Gästebuch.</p>\r\n<p>Für alle Trainer, Eltern und Freiwillige, die noch keinen Account zum Erstellen und Bearbeiten von Berichten haben:<br />Mit einer Mail an die unten genannte Adresse könnt ihr mir euren Namen, Mailadresse und die eigene Mannschaft mitteilen.</p>\r\n<p align="left">Diese Daten benötige ich dann, um den Account zu erstellen.  Das Erstellen des Accounts wird durch eine Mail, die auch das Passwort enthält, bestätigt.</p>\r\n<p align="left">Fehler und Bugs bitte an <a href="mailto:handball@tusgriesheim.de">handball@tusgriesheim.de</a> oder über das <a href="index.php?module=contact">Kontaktformular.</a></p>', '84.59.12.132'),
(29, 7, 10, '2008-04-14 20:57:41', '2007-09-16 00:00:00', 'article', 'Alte Herren im Kletterwald', '<p><img alt="Alte Herren im Grohe" height="534" src="http://handball.griesm.de/images/gallery/2007/alte_herren/misc/ah_im_grohe.jpg" title="Alte Herren im Grohe" width="745" /></p><p>Gemütliches Beisammensein nach einer Radtour. </p>', '84.58.194.95'),
(19, 4, 1, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Schiedsrichter: Benedikt Lauer', 'Benedikt Lauer erlernte bereits mit 6 Jahren beim TuS bei den Handball - Minis das Handball spielen. Ab der C-Jugend bemerkte er sein Talent als Torwart und spielt seitdem auf dieser Position. <br />Auch er legte 2006 die Prüfung zum Jung-Schiedsrichter ab und verstärkt ebenfalls den Schiri-Kader beim TUS. Er entschied sich für dieses Amt aus Interesse, einmal eine andere Perspektive und andere Aspekte des Handballsports kennen zu lernen. <br />Der TUS wünscht ihm für seine Schiri-Laufbahn viel Glück.', '84.58.216.122'),
(27, 9, 12, '2008-04-16 11:01:57', '2007-09-13 00:00:00', 'article', 'A-Jugend in der Oberliga', '<p>Seit langer Zeit konnte sich eine A-Jugend des TuS Griesheim wieder einmal für die hessische Oberliga qualifizieren. Dies bestätigt den positiven Trend in der Griesheim Jugendarbeit. Denn neben der A-Jugend konnten sich auch die B- und C-Jugend für die höchste hessische Spielklasse qualifizieren. Die neun Gegner der AQ-Jugend sind die JSG Odenwald und die HSG Langen aus Südhessen, die JSG Bürgel, TV Breckenheim, TSG Münster und TV Petterweil aus dem Großraum Frankfurt, MJSG Linden bei Gießen und die HSG Gensungen/Felsberg und HSG Baunatal bei Kassel. Viele hessische Handballhochburgen mit guter Jugendarbeit in die sich der TuS Griesheim wieder eingereiht hat.</p>\r\n<div style="text-align: center"><img src="http://handball.griesm.de/images/gallery/2007/ma_jugend/misc/a_jugend.jpg" alt="A-Jugend Saison 07/08" title="A-Jugend" width="760" height="410" /></div>\r\n<p>Nach der Qualifikation belegte man nach den favorisierten Teams des TV Kirchzell, der JSG Odenwald und der TSG Bürgel den vierten Platz. In einem Entscheidungsspiel gegen TV Gelnhausen konnte sich das Team von Trainer Uwe Rinschen mit einem beeindruckenden 41: 30 Sieg für die Oberliga qualifizieren. Für die kommende Saison schloss sich Björn Ehmke der Mannschaft an. Aus Pfungstadt sind wie schon letztes Jahr während der B-Jugend-Spielgemeinschaft Miro Hinkel, Benjamin von Stein und Yannick Hassenzahl nun für den TuS am Start. Der Rest sind Eigengewächse aus Griesheim: Steffen Vogel und Tim Ulmrich im Tor, Daniel Arenz, Lucas Baier, Emanuel Berge, Tim Patrzalek, Christoph Rampelt, Tim Rinschen, Kevin Herr, Ricardo Posocco, Stefan Siebert und Dennis Bork. Die letzten vier genannten des 16-köpfigen Kaders sind Jahrgang 1989, spielen also Ihre letzte A-Jugendsaison, die anderen zwölf sind allesamt Jahrgang 1990. Nach den Leistungsvergleichen in der Qualifikation darf man wohl noch nicht mit einem Spitzenplatz in der kommenden Saison rechnen, aber wie gesagt ist die Truppe noch jung, engagiert und wird Ihre volle Stärke erst nächstes Jahr erreichen. Dafür muss man aber reichlich Erfahrung sammeln. Ferner bekommen alle Spieler die Möglichkeit, regelmäßig im Erwachsenenbereich bei der Landesliga-Mannschaft des TuS mitzutrainieren und gelegentlich in den Meisterschaftsspielen eingesetzt zu werden. Besonders den älteren Spielern des Jahrganges 1989 soll so der Wechsel in die 1. Mannschaft im kommenden Jahr erleichtert werden.</p>', '192.166.56.36'),
(62, 13, 6, '2008-04-13 22:26:48', '2007-09-23 00:00:00', 'outwards', 'JSG Crumstadt/Goddelau - wJugendC	2:38', '<p>Im zweiten Saisonspiel traten die Griesheimer Mädchen bei der JSG Crusmstadt/Goddelau an. Schnell wurde deutlich, dass die überforderten Gastgeberinnen die Abwehr nur selten überwinden würden; über viele Gegenstöße wurde in der 1. Halbzeit eine deutliche Führung erspielt (1:17), die auch nach der Pause kontinuierlich ausgebaut wurde.</p><p>Es spielten: Justine Liebald, Kim Becker; Denise Großheim (8), Katharina Schuldt (8), Deborah Berge (9), Katrin Feldmann (4), Mayra Janssen (1), Lea Jung (5), Tanja Birli (3), Chiara Janssen, Lea-Maria Wenzel, Fabienne Suhe und Mara König.</p>', '217.224.15.50'),
(16, 10, 5, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'outwards', 'TSG Oberursel - mJugendB	25:30', 'Gelungener Start der B-Jugend in der Oberliga<br /> In einem abwechslungsreichen Spiel gewann die B-Jugend ihr erstes Spiel <br /> in der hess. Oberliga. Griesheim hatte den besseren Start und führte<br /> schnell mit 3:0 Toren. Danach schlichen sich im Angriff Nachlässigkeiten<br /> ein, unter anderem wurden zwei 7m vergeben und Oberursel konnte mit<br /> Gegenstoßtoren bis zur Halbzeit mit 15:11 in Führung gehen. Gestützt auf<br /> eine gute Abwehr und mit einer konzentrierten Leistung im Angriff wurde<br /> mit 18: 18 erstmals  der Ausgleich erzielt. Mit 23:20  konnte man dann <br /> mit 3 Toren in Führung gehen. Dieser Spielstand wurde gegen den<br /> konditionell nachlassenden Gegner bis zum Schlusspfiff auf 30:25<br /> ausgebaut wobei sich auf Griesheimer Seite alle Spieler als Torschützen<br /> eintragen konnten. <br /> Es spielten: Andreas Gerhard und Christian Kindermann im Tor, Arseniy<br /> Zankov (6), Jan Eidemüller (7), Fabian Seigfried (4), Marvin Gernandt<br /> (6), Jan Tachtler (3), Jan Döll (3) und Patrick Pollner (1).<br /> <br /> Manfred Lohnes', '84.167.77.57'),
(3, 7, 9, '2008-07-27 10:33:12', '2007-08-02 00:00:00', 'article', 'Die AH des TuS Griesheims', '<p><img src="http://handball.griesm.de/images/gallery/2007/alte_herren/misc/alte_herren.jpg" alt="Mannschaftsfoto der AH" title="Mannschaftsfoto der AH" width="745" height="468" /><br />Die Alten Herren feiern 2007 ihr zwanzigjähriges Bestehen (hintere Reihe, v. l. n. r.): Andreas Bork, Thilo Stütze, Manfred Hamel, Thomas Vogel, Ludwig Merker, Werner Müller, Werner Gernand; mittlere Reihe; Manfred Lohnes, Dieter Gernand, Werner Gerhard, Freddy Naschert, Peter Killer, Jürgen Sporleder, Martin Wurdak; Michael Schroer-Becker; vordere reihe; Sebastian Naschert, René Groß, Gerhard Groß, Matthias Busch, Klaus Döll, Andreas Stösel, Helmut Schupp. Nicht auf dem Bild: Marcus Bars, Lothar Best, Dieter Belt, Heinz Diefenbach und Volker Sahr. Fotos: dg</p>', '84.58.211.255'),
(4, 5, 3, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Mit eigener Jugend weiterhin an der Landesligaspitze', '<p>Liebe Handballfreunde,</p><div align="justify">die Saison 2006/2007 wurde wie im Vorjahr auf einem guten 5. Tabellenplatz beendet. Dies gelang uns mit einem relativ kleinen Kader, auf Grund dessen Spiele teils mit nur einem Auswechselspieler bestritten werden mussten. Umso mehr gewinnt dieser Tabellenplatz an Bedeutung. <br /><br />In der hervorragende Vorrunde, wo sogar mit um die Meisterschaft gespielt wurde, wurden dann jedoch die Spitzenspiele gegen Reinheim und Pfungstadt verloren, sodass man Boden nach oben verlor. Die Rückrunde verlief dann aufgrund von verschiedenen Ausfällen weniger gut und es wurde immer klarer, dass Reinheim die Nase auch am Ende vorne behalten würde.</div><div style="text-align: center"><img alt="Mannschaftsfoto der Herren 1" height="436" src="http://handball.griesm.de/images/gallery/2007/herren_1/misc/erste.jpg" title="Mannschaftsfoto der Herren 1" vspace="5" width="659" /></div><div align="justify">In der kommenden Saison hat die Mannschaft ein etwas anderes Gesicht. Zu dem verbliebenen Stamm mit den Torhütern Oliver Schmand und Marcus Kuhnke sowie den Feldspielern Benjamin Sirker, Damir Zarko, Sebastian Müller, Timo Müller, David Max, Daniel Mehring und Nicholas Wurth konnten wir neue Spieler für unseren Kader gewinnen. Das sind: Simon Bär (talentierter Torhüter der TGB), Julian Vogt (TV Lorsch), Stefan Hamel (zurück vom Auslandsaufenthalt), Till Brandenburger (signalisierte Bereitschaft in Notfällen), Ralf Höhl (2. Mannschaft der TuS), Tim Rinschen (talentierter A-Jugendlicher mit Doppelspielrecht für den aktiven Bereich) und Thomas Mischler (TV Groß-Zimmern, momentan verweigerte Freigabe).<br /><br />Nicht mehr im Kader sind: Ingo Höschler (sportliche Weiterentwicklung in Reinheim), Dennis Götz (trotz Zusage Wechsel nach Pfungstadt), Florian Zimmer (SKG Roßdorf), Marc Otte, Daniel Gernand (mangelnde Leistungsbereitschaft) und Tim Nothnagel (Umzug). Mein Ziel ist es, den erfolgreichen und begeisternden Tempohandball fortzuführen und weiterhin auf höchstem Landesliganiveau Ihnen, liebe Zuschauerinnen und Zuschauer attraktiven Handball zu zeigen.<br /><br />Meine Favoriten für die Landesligameisterschaft sind Modau, Pfungstadt und Büttelborn.<br /></div><p> Ihr/Euer<br />Klaus Feldmann</p><table border="0"><tbody><tr><td>Trainingszeiten: <br /></td><td>&nbsp;Dienstag</td><td>&nbsp;19:00-20:30  </td></tr><tr><td>&nbsp;</td><td>&nbsp;Mittwoch</td><td>&nbsp;19:00-20:30</td></tr><tr><td>&nbsp;</td><td>&nbsp;Freitag</td><td>&nbsp;19:30-21:00</td></tr></tbody></table>', '81.210.135.191'),
(5, 10, 2, '2008-04-14 21:04:47', '2007-08-02 00:00:00', 'article', 'B-Jugend spielt in der hessischen Oberliga', '<p>Die Spieler des Jahrgangs 92 und 93 spielten schon als C-Jugendliche in der vergangenen Saison in der Staffel Süd der hessischen Oberliga und belegten dort gegen so renommierte Mannschaften wie Obernburg, Gelnhausen und Kahl-Kleinostheim einen hervorragenden 3. Platz. Für die erste Spielzeit in der B-Jugend standen zwei Qualifikationsrunden mit dem Ziel, Aufstieg in die Bezirksoberliga bzw. Regionalliga/Oberliga an. In der ersten Qualifikation auf Bezirksebene konnte man sich ungeschlagen durchsetzen und hatte damit die Voraussetzungen für die Qualifikationsspiele  zur Regionalliga bzw. Oberliga geschafft. In einer einfachen Runde jeder gegen jeden musste man unbedingt den dritten Tabellenplatz erreichen, um das Ziel Oberliga zu schaffen. Mit Siegen gegen Bürgel und Bonsweiher verschaffte man sich eine gute Ausgangsposition. Allerdings gab im weiteren Verlauf zwei deprimierende Niederlagen gegen die starken Mannschaften aus Obernburg/Erlenbach und gegen die JSG Nieder Roden. Im Schlüsselspiel gegen Bürgstadt gab es dann, trotz vieler Blessuren und Verletzungen, einen klaren Sieg und somit wurde das Ziel, das Erreichen der hessischen Oberliga geschafft. Die Leistung ist um so höher einzuschätzen, da man sich als Jahrgang 92 gegen teilweise ältere Spieler und hochgehandelte Spielgemeinschaften durchsetzen konnte.</p><p><br /><img alt="Mannschaftsfoto der mJugendB" height="510" src="http://handball.griesm.de/images/gallery/2007/mb_jugend/misc/b_jugend.jpg" title="Mannschaftsfoto der mJugendB" width="766" /></p><p>In der erfolgreichen Mannschaft spielen:<br />Andreas Gerhard und Christian Kindermann im Tor, Jan Eidemüller, Arseniy Zankov, Andreas Margarit, Fabian Seigfried, Simon Lauer, Erik Neumann, Marvin Gernandt, Tim Nothnagel und Jan Tachtler. Hinzu kommen noch die Spieler Jan Döll, Sven Rinschen, Kai Feldmann, Darren Weber und Patrick Pollner vom Jahrgang 93, die in den Qualispielen zum Einsatz kamen. <br /><br />Manfred Lohnes</p>', '217.224.102.114'),
(6, 11, 1, '2008-04-28 16:28:48', '2007-08-02 00:00:00', 'article', 'Handball-Talente.de - die männliche C-Jugend', '<p>Für die Spielrunde 2007/08 wurde die männlich C-Jugend neu zusammengestellt. Mit Max Schielke, Patrick Pollner, Ricardo Wilhelm, Darren Weber und Sebastian Groll haben sich Spieler nach Griesheim orientiert, die leistungsorientiert trainieren und spielen wollen. Im kleinen, aber feinen Kader gehören nun fast alle Spieler in ihrer Alterstufe zum Kader der Bezirksauswahl; zwei Jungs wurden nach der Sichtung für die Hessenauswahl zum regelmäßigen Stützpunkttraining des HHV eingeladen.<br /><br />Die Qualifikation für die hessische Oberliga konnte sicher geschafft werden. In der Saison warten nun die Nachwuchsteams der Leistungsvereine aus den Bezirken Offenbach/Hanau und Odenwald/Spessart. Da Ziel ist es, gegen diese Teams aus Gelnhausen, Obenburg und Kirchzell eine vordere Platzierung zu erreichen.<br /><br />Informationen, Spielberichte und Fotos können Interessierte auf der Internetseite <a href="http://www.Handball-Talente.de" target="_blank">www.Handball-Talente.de</a> finden.</p>\r\n<p><img style="width: 739px; height: 567px;" src="http://handball.griesm.de/images/gallery/2007/mc1_jugend/misc/c1_jugend.jpg" alt="Mannschaftsfoto der mJugendC1" title="Mannschaftsfoto der mJugendC1" width="800" height="600" /></p>\r\n<p>Teamfoto:<br />hintere Reihe v.l.n.r.: Lars Birkenbach, Sebastian Groll, Marc Keller, Max Schielke, Darren Weber, Sven Rinschen, Patrick Pollner, Kai Feldmann<br />sitzend v.l.n.r.: Max Eidemüller, Ricardo Wilhelm, Jan Döll</p>', '84.58.254.23'),
(7, 12, 1, '2008-04-14 21:04:47', '2007-08-02 00:00:00', 'article', 'männliche C2 Jugend', '<p>Die neue männl. C II- Jugend zeigte in der abgelaufenen Saison sehr gute Leistungen und wurde Meister der Bezirkliga D-Jugend vor ihrem langjährigen Konkurrenten SG Arheilgen.<br />Nachdem die TuS&acute;ler in der ersten Begegnung gegen Arheilgen noch klar verloren, versuchte man durch hartes Training, die aufgetretenen Defizite auszubessern. <br />Mit Erfolg, denn im Rückspiel zeigten die Griesheimer starken Handball und gewannen sicher mit 23:14.<br />Somit war die Meisterschaft entschieden, da keiner der beiden Mannschaften weitere Punkte verlor.<br />Nach dieser positiven Entwicklung der Mannschaft wechselt man geschlossen in die C-Jugend und versucht hier weiterhin die Talente zu fördern und den tollen Teamgeist der Griesheimer beizubehalten.<br />Obwohl über 2/3 der Mannschaft aus den jüngeren Jahrgängen bestehen, brauchen sich die Spieler nicht zu versteckten: Dies zeigte das Turnier in Crumstadt, wo man gegen teilweise 2-Jahre ältere Spieler ordentliche Leistungen zeigte.<br /><br /><img alt="Mannschaftsfoto der mJugendC2" height="512" src="http://handball.griesm.de/images/gallery/2007/mc2_jugend/misc/c2_jugend.jpg" title="Mannschaftsfoto der mJugendC2" width="769" /></p>', '127.0.0.1'),
(8, 13, 1, '2008-04-14 21:04:47', '2007-08-02 00:00:00', 'article', 'Balljäger.de - die weibliche C-Jugend', '<p>In der vergangenen Saison 2006/07 spielten die Mädchen als weibliche D-Jugend eine erfolgreiche Saison; in der Bezirksoberliga wurde kein Punkt abgegeben und fast alle Spiele konnten aufgrund der aktiven Spielweise und des ausgeglichenen Kaders deutlich gewonnen werden. Für die Spielrunde 2007/08 steht der übergang in die weibliche C-Jugend an. Die nun ein Jahr älteren Gegner sind körperlich überlegen, was in der Qualifikation für die Hallenrunde deutlich wurde. <br /><br />Erfreulich ist, dass die Mannschaft über einen kompletten, homogen Kader verfügt, nachdem mit Katharina Schuldt, Nadja Spilok, Justine Liebald und Denise Großheim vier engagierte Spielerinnen nach Griesheim gewechselt sind. Fast alle Spielerinnen gehören in ihrer Alterstufe zum Kader der Bezirksauswahl; fünf Mädchen wurden nach der Sichtung für die Hessenauswahl zum regelmäßigen Stützpunkttraining des HHV eingeladen.<br /><br />In der Hallenrunde 2007/08 soll in der Bezirksoberliga der eingeschlagene Weg fortgesetzt werden, so dass in der kommenden Spielrunde dann wie hessische Oberliga angestrebt werden kann.<br /><br />Informationen, Spielberichte und Fotos können Interessierte auf der Internetseite <a href="http://www.balljäger.de" target="_blank">www.Balljäger.de</a>  finden.<br /><br /><img alt="Mannschaftsfoto der wJugendC" height="561" src="http://handball.griesm.de/images/gallery/2007/wc_jugend/misc/cw_jugend.jpg" title="Mannschaftsfoto der wJugendC" width="748" /></p><p>Teamfoto:<br />hintere Reihe v.l.n.r.: Deborah Berge, Katrin Feldmann, Denise Großheim, Nadja Spilok, Chiara Janssen, Lena Kuhl, Tanja Birli<br />sitzend v.l.n.r.: Mayra Janssen, Justine Liebald, Katharina Schuldt, Lea Jung, Lea-Maria Wenzel, Fabienne Suhe, Mara König, Kim Becker</p>', '127.0.0.1'),
(9, 8, 1, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Wir sind wieder hier, in unserem Revier', '<p>Das ist wohl der Leitspruch für die Handballerinnen des TUS Griesheim für die neue Saison.<br />Hatte man im April noch über den sicherlich guten dritten Platz in der Bezirksliga A, aber den verpassten Aufstieg gehadert, gab es um die Pfingstzeit herum die freudige Kunde doch noch den Aufstieg in die Bezirksoberliga geschafft zu haben.<br />Von dort vor zwei Jahren noch abgestiegen, hatten  sich das neue Team und der neue Trainer in dieser Saison vorgenommen wieder Anzugreifen und sich für die BOL zu Qualifizieren.<br />So herrscht natürlich nun große Freude schon jetzt oben angekommen zu sein.<br />Mit neuem Trainer, Christian Matzel aus Griesheim, der vorher schon zwei Jahre die <br />Nauheimer Damen trainierte und mit Ihnen in die BOL aufsteigen konnte und einer mit vielen neuen Gesichtern veränderten Mannschaft will man sich nun in der höheren Spielklasse etablieren und auch dort sportliche Erfolge feiern.</p><p>&nbsp;</p><div style="text-align: center"><img alt="Mannschaftsfoto der Damen" height="486" src="http://handball.griesm.de/images/gallery/2007/damen/misc/damen.jpg" title="Mannschaftsfoto der Damen" width="730" /></div><p>&nbsp;</p><p>Die drei Torfrauen, Stefanie Rau, Nicole Spiller, Tina Thiele sollten auch in dieser Klasse mit Ihren Paraden den Angreifern den Zahl ziehen. <br />Die Rückraumpositionen sind mit Silke Drechsler, Marion Feldmann, Sandra Ribbe, Susen Schäfer, Brigitte Suchland und Petra Woitich gut besetzt, <br />Als Aufbauspielerinnen und gute Kreisläuferinnen stehen Laura Posteraro, Tina Schwanz, Paula Vladimirov zur Verfügung, Die Aussenpositionen besetzen Claudia Domes, Meike Dornbach, Vanessa Gandenberger. Später stoßen noch noch die pausierende Gaby Jäger, Schwanger und die verletzte Carolin Rau zur Mannschaft.<br />Trainer Christian Matzel &bdquo; Sicherlich müssen wir uns noch finden und einspielen, doch ich traue der Mannschaft auch in der Bezirksoberliga einen Platz im vorderen Drittel zu.&ldquo;<br />Mit schnellem und schönem Handball wollen wir unsere Fans erfreuen um dann gemeinsam Erfolge zu feiern.<br /><br />Christian Matzel</p><table border="0"><tbody><tr><td>Trainingszeiten: <br /></td><td>Montag</td><td> 19:00-20:30  </td></tr><tr><td>&nbsp;</td><td> Donnerstag</td><td> 20:30-21:00</td></tr></tbody></table><p>&nbsp;</p>', '127.0.0.1'),
(10, 17, 1, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Die Minis stellen sich vor', 'Bei den Minis spielen Mädchen und Jungs im Alter von sechs bis neun Jahren und brennen darauf, etwas zu lernen. Die Kinder machen begeistert mit bei allen Spielen, die Trainer Frank Ritter anbietet. An Ehrgeiz und Spielwitz kann sich hier so mancher erwachsener noch eine Scheibe abschneiden.<br />Im Training steht an erster Stelle immer der Spaßfaktor. Schwerpunkt des Trainings ist das Erlernen von koordinativen und motorischen Fähigkeiten, hierzu gibt es individuelle Ballarbeit, Staffeln und viele Spiele.<br />Höhepunkte bilden immer Turniere, die in regelmäßigen Abständen bei verschiedenen Vereinen stattfinden. Aus etlichen dieser Turniere gingen die Minis I als ungeschlagener Sieger hervor. Aber auch die Minis II schlagen sich trotz einiger Niederlagen sehr tapfer.<br />Da in den übungsstunden im sehr viele Kinder anwesend sind, wird Trainer Frank von Ricardo Posocco aus der A-Jugend unterstützt. Dafür sei ihm herzlich gedankt. Ein Dankeschön geht auch Claudia Faust, die bei Terminüberschneidungen einige Turniere betreute.<br />Die Minis trainieren Dienstags von 15 bis 16.30 Uhr und donnerstags von 14.30 bis 16 Uhr in der Kirschberghalle. Interessierte Kinder sind jederzeit willkommen.', '84.58.224.123'),
(11, 15, 14, '2008-04-14 21:04:47', '2007-08-02 00:00:00', 'article', 'E1-Jugend startet in höchster Spielklasse', '<div style="text-align: center"><img src="http://handball.griesm.de/images/gallery/2007/me_jugend/misc/e_jugend.jpg" alt="Mannschaftsfoto der männlichen E1-Jugend 2007" title="E-Jugend" width="707" height="600" /></div> <p>12 Spieler und Spielerinnen der Jahrgänge 1997 und 1998 bilden diese Saison das Team der â€žmännlichen E1-Jugendâ€œ. Wieder einmal muss sich eine Handballerin unter den männlichen Handballern zurechtfinden. Dies stellt für Lisa Jacquot aber kein Problem dar, da sie sich seit dem ersten Training, mit viel Engagement, gut in die Mannschaft eingebracht und sich somit einen Stammplatz erkämpft hat. </p><p>Die E1-Jugend des TuS Griesheim spielt die folgende Saison in der Bezirksliga A. Vor jeder Runde müssen sich die Handballer auf einem Orientierungsturnier für eine ihren Leistungen entsprechende Klasse qualifizieren. Die Mannschaft um Trainer Christian Rechner hat sich bei diesem gut besetzten Turnier gegen alle Mannschaften durchgesetzt und startet nun in der höchsten E-Jugend Spielklasse. Deutliche Siege gab es gegen die HSG Bensheim/Auerbach, die SG Arheilgen und gegen die TGB Darmstadt, lediglich der Sieg gegen die JSG Bischofsheim/Gustavsburg viel etwas knapper aus.</p><p>Die Rundenspiele verlaufen zweigeteilt, in der ersten Halbzeit wird â€žZweimal 3 gegen 3â€œ gespielt. Bei dieser Spielform agieren jeweils 3 Angreifer und 3 Verteidiger in jeder Spielfeldhälfte, sie dürfen die Mittellinie nicht überlaufen. Daraus resultiert eine Abwehrhälfte und eine Angriffshälfte. Die Abwehrhälfte muss, durch eine 3er-Gruppe einer Mannschaft, gegen 3 Angreifer verteidigt werden. Nach Ballgewinn wird der Ball in die gegenüberliegende Angriffshälfte gespielt. Diese Spielvariante stellt eine effektive Möglichkeit dar, das individuelle Spielverhalten in der Kleingruppe zu verbessern. Zusätzlich werden bei dieser Spielform auch die Wahrnehmung und das Zusammenspiel gefördert. In der zweiten Halbzeit wird nach bekannten Regeln 6 gegen 6 gespielt.</p><p>Die Handballer, die Eltern und die hoffentlich vielen Zuschauer freuen sich schon auf spannende Duelle in der kommenden Saison.</p><p>&nbsp;</p><p align="center"><u>Trainingszeiten:</u> </p><p align="center">Dienstag, 16:00 - 17:30 Uhr, GHS-Großsporthalle </p><p align="center">und</p><p align="center">Donnerstag, 16:00 - 17:30 Uhr, Kirschberghalle</p><p>&nbsp;</p>', '84.58.239.210'),
(269, 6, 5, '2008-04-13 22:26:48', '2008-03-15 00:00:00', 'outwards', 'TV Lampertheim - TUS Griesheim II  	23:17', '<p>Die 2. Mannschaft des TuS Griesheim war am Sonntag, 9. März, mit einer Rumpftruppe zum Tabellenführer TV Lampertheim gereist. In einer starken ersten Halbzeit ließen die Griesheimer ihrem Gegner keine Möglichkeit ihr schnelles Spiel aufzuziehen. Und was noch an Würfen auf das Tor kam wurde meist die sichere Beute des stark aufspielenden Torhüters Marcus Kuhnke. Bis zur 20 Minuten hatten sich das Team einen Drei-Tore-Vorsprung (4:7) herausgespielt. Da aber auch die Lampertheimer nicht locker ließen, ging man mit einem 9:9 in die Kabine. In der zweiten Halbzeit mussten die Griesheimer ihrer dünnen Personaldecke Tribut zollen. Trotzdem konnte sich der Gegner bis 10 Minuten vor dem Ende nicht deutlich absetzen. Erst in den Schlussminuten als den Griesheimern die Luft ausging, konnte der TV Lampertheim den Toreabstand noch nach oben schrauben. Doch den Schlusspunkt setzte Christian Döll vom TuS, der den 23:17 Endstand markierte.</p><p>Es spielten: Marcus Kuhnke, Michael Helfmann (im Tor); Ronald Bausch (5), Dirk Höhl (4/1), Martin Simmermacher (4/2), Dennis Killer (2), Christian Döll (1) und Uwe Drechsler (1) </p>', '84.167.90.234'),
(12, 16, 1, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Die E2 Jugend', 'Für die meisten Spieler der Mannschaft ist es das erste Jahr in der E-Jugend. Fast alle haben durch die Zeit bei den Minis und in der F-Jugend schon jahrelange Erfahrung mit dem Handball. Und doch ändert sich einiges mit dem Schritt in die E-Jugend: das Spielfeld ist größer, die Tore sind größer, der Schiedsrichter schaut genauer hin- zu viele Schritte, Doppeldribbling, was in der F-Jugend noch oft toleriert wurde, wird jetzt abgepfiffen- und natürlich die neue Spielform 2x 3 gegen 3, nach der jeweils die erste Halbzeit eines Spiels organisiert ist. Hierbei ist das Spielfeld in 2 Hälften aufgeteilt, die Spieler sind entweder Angreifer und bewegen sich nur in der Angriffshälfte oder Abwehrspieler, dann dürfen sie nicht aus der eigenen Abwehrhälfte hinaus. Natürlich möchte jeder gerne im Angriff spielen und Tore erzielen, aber die Mannschaft braucht immer auch Spieler, die sich in ihren Dienst stellen, Torerfolge des Gegners verhindern und durch gute Pässe den eigenen Angriff ins Spiel bringen. In der 2. Halbzeit wird dann 6 gegen 6 gespielt, wie man es von den übrigen Jugendklassen und im Erwachsenenbereich kennt. Die ersten Spiele und damit die ersten Wettkampferfahrungen mit allen Neuheiten der E-Jugend hat die E2 bei Orientierungsturnier in Heppenheim gemacht. Nachdem das erste Spiel deutlich verloren ging, konnte die Mannschaft bei den zwei folgenden bedeutend besser mitspielen auch wenn diese ebenfalls verloren wurden. Das letzte Spiel jedoch wurde gewonnen, der erste Sieg in der E-Jugend, an den sich hoffentlich im Laufe der Saison weitere anschließen werden. Saisonbeginn ist voraussichtlich am 08.08.2007 mit einem Heimspiel. Viel Erfolg! ', '84.58.224.123'),
(18, 4, 1, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Schiedsrichter: Tim Rinschen', 'Tim Rinschen wechselte 2003 im Alter von 13 Jahren zum TuS in die Handball C-Jugend, weil er leidenschaftlich gerne Handball spielt. 2006 legte er die Prüfung zum Jung-Schiedsrichter ab und verstärkt nunmehr mit 17 Jahren als jüngster Schiri beim TUS, den Schiri-Kader. Er entschied sich für dieses Amt aus Interesse und deshalb, eine Familientradition weiter zu pflegen; denn auch sein Vater und Großvater stehen noch im Dienst &bdquo;an der Pfeife&ldquo;. Der TUS wünscht ihm für seine Schiri-Laufbahn viel Erfolg.', '84.58.216.122'),
(14, 6, 3, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', '	"Mission impossible 3.0" - Die 2. Mannschaft greift wieder in der Bezirksliga A an', '<p>- Rück und Ausblick von Mannschaftskapitän Kay Grund<br /><br />Die letzte Saison könnte man unter dem geflügeltem Wort vom &bdquo;Phönix aus der Asche&ldquo; zusammenfassen. Nach der Hinrunde hätte wohl kaum ein englischer Buchmacher einen Cent auf den Klassenerhalt unserer Mannschaft gewettet. Auch der Optimismus einiger Spieler hatte einige Dämpfer bekommen, denn die schlechteste Hinrunde der letzten zehn Jahre hatte wir gespielt. Hoffnung keimte zum Rückrundenauftakt in Pfungstadt noch einmal auf. Nach einer kämpferischen Partie konnte in letzter Sekunde der Ausgleich markiert werden. Aber eine wirkliche Wende wollte einfach nicht eintreten. Die &bdquo;rote Laterne&ldquo; in der Tabelle, die die Mannschaft am dritten Spieltag übernommen hatte, konnte einfach nicht abgegeben werden. Gute Spiele konnten nicht gewonnen werden, schlechte erst recht nicht, bis zum vorletzten Spieltag. Mit neun Pluspunkten im Gepäck fuhren wir zur TG Eberstadt, um die letzte Möglichkeit, nicht als &bdquo;Letzter&ldquo; abzusteigen, zu nutzen. Mit einer guten kämpferischen Einstellung über die gesamte Spielzeit kehrte auch das Glück wieder zurück. Das Spiel wurde gewonnen, und die &bdquo;rote Laterne&ldquo; konnte aufgrund des besseren Torverhältnisses im direkten Vergleich an die MSG Darmstadt abgegeben werden. Die Ergebnisse am letzten Spieltag änderten nichts mehr daran. Der Abstieg war haarscharf verhindert worden. </p><p><br /><img alt="Mannschaftsfoto der Herren 2" height="514" src="http://handball.griesm.de/images/gallery/2007/herren_2/misc/zweite.jpg" title="Mannschaftsfoto der Herren 2" width="751" /></p><p>Gründe für den sehr schlechten Verlauf der vergangenen Saison gibt es viele. Da ist die unregelmäßige Trainingsteilnahme (sei es aus beruflichen,  privaten oder gesundheitlichen Gründen) die eine effektive Trainingsarbeit im Mannschaftskreis unmöglich gemacht hat. Ein anderer Punkt mag kurz vor dem Saisonstart das Ausscheiden von Spielmacher Oliver Lücke sein, der sein Engagement für alle ziemlich überraschend zurückzog. Und trotz des überstandenen Abstiegkampfes in der vorangegangenen Saison, glaubte keiner in und um die Mannschaft daran, dass man wieder in Abstiegsstrudel rutschen würde, und deutete die Zeichen lange Zeit falsch. <br /><br />Mit dem Bewusstsein, dass es in dieser Saison für uns um den Klassenerhalt geht, werden wir in die neue Saison 2007/2008 gehen. Der Kader ist gleich geblieben. Einziger Neuzugang ist Christian Döll aus der eigenen Jugend. Ob Spieler aus dem Kader der ersten Mannschaft hinzu kommen werden, steht noch nicht fest. Nach der Vorbereitung und mit den vielen Trainingseinheiten, wird die Spielzeit am 15.09.2007 in Eberstadt starten. Weitere Nachbarschaftsderbys gegen Pfungstadt, Erfelden oder Dornheim stehen auf dem Spielplan.<br /><br />Unser Dank an dieser Stelle gilt besonders unseren Fans, die uns in der Vergangenheit unterstützt und in der vergangenen Saison mit uns gelitten haben. Mit unseren Fans im Rücken werden wir den Klassenerhalt in dieser Saison erreichen. Für die neue Saison wünschen wir uns und für unsere Fans und Anhänger viele gute und siegreiche Spiele. <br /><br />Ihr &bdquo;Käp&acute;ten&ldquo; Kay Grund</p><p>&nbsp;</p><table border="0"><tbody><tr><td>Trainingszeiten: <br /></td><td> Dienstag</td><td> 20:30-21:00  </td></tr><tr><td>&nbsp;</td><td> Donnerstag</td><td> 19:00-20:30</td></tr></tbody></table><p>&nbsp;</p>', '81.210.133.225'),
(15, 4, 15, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Die Schiedsrichter', '<p>60 Minuten Handball "pur" ! auch im Spieljahr 2007/2008<br /><br />Aber: Ohne Schiedsrichter ist dies natürlich kaum möglich. Überall, wo Entscheidungen getroffen werden, muss jemand da sein, der diese Entscheidungen nach vorgegebenen Regeln trifft. Beim Handballspiel ist dies der Schiri, der nach einem (komplizierten) Regelwerk darüber wacht, dass die entsprechenden Regeln eingehalten werden. <br />In dieses Regelwerk ist auch der Schiri eingebunden. Schiedsrichter erleben im Spiel ebenso Höhen und Tiefen wie Spieler und Trainer. Allerdings haben sie Entscheidungsgewalt und müssen einen enormen psychischen Druck standhalten. <br />Meckernde Zuschauer, Trainer und Spieler sind oftmals der Hauptgrund, dass vor allem junge Schiedsrichter nach recht kurzer Zeit aufhören <br />Denn: Schiedsrichter zu werden ist nicht schwer, ein guter Schiri zu sein dagegen sehr. <br /><br />Wo bleibt das Fair play? Ein Spieler kann ausgewechselt werden, ein Schiri muss durchhalten und gegen alle Fairness auch ggf. noch Beschimpfungen der Zuschauer ertragen!<br /><br />An dieser Stelle herzlichen Dank an alle Vereinsschiedsrichter des TUS Griesheim, die wir Ihnen nachfolgend näher vorstellen, und allen Schiedsrichterkollegen, die dieses nicht immer leichte, aber schöne Amt als Schiedsrichter übernommen haben.<br /><br />Für das Amt als Schiedsrichter haben drei junge Handballfreunde, Tim Rinschen, und Bennedikt Lauer, die Prüfung abgelegt und mit Erfolg bestanden. Sie verstärken seit 2006 den Schiri-Kader beim TUS und haben ihre ersten Spiele ab September 2006 mit Erfolg geleitet und sind auch weiterhin mit großen Arrangement dabei. <br /><br />Angespornt durch dieses Arrangement, verstärkt in diesem Jahr der dritte Jung-Schiedsrichter, Ricardo Posocco Malleiro, nach erfolgreich bestandener Prüfung den Schiedsrichterkader des TUS Griesheim. Damit erfüllt die Handballabteilung knapp das â€œSOLL gemäß der Schiedsrichterordnung des HHVâ€œ.<br />Knapp wird es jedoch wieder, wenn die Routiniers Norbert Türke und Walter Rinschen aus Altergründen im nächsten Jahr das Schiedsrichteramt nicht mehr wahrnehmen. <br /><br />Jedoch: Die Handballabteilung hat auch eine Damenmannschaften im Spielbetrieb. Dort wird immer noch auf die erste mutige Schiedsrichterin beim TUS gewartet.</p><p><br />Quizfrage: <u>Wer wird das sein?<br /></u><br />Sportsfreundinnen und -freunde, die sich für das Schiri-Amt interessieren, können sich an den Schiri-Obmann des TUS wenden. <br /><br />Walter Rinschen</p>', '84.167.253.19'),
(105, 13, 6, '2008-04-13 22:26:48', '2007-10-28 00:00:00', 'outwards', 'HSG Langen - wJugendC	15:40', 'HSG Langen - wC\r\n\r\n15 : 40 (8 : 24)\r\n\r\n \r\n\r\n28.10.2007 - 13.30 Uhr\r\n\r\n \r\n\r\n\r\nAuch im vierten Spiel der Saison konnten sich die Balljäger sehr deutlich durchsetzen. Die aufmerksame Abwehr konnte anfangs viele Bälle abfangen, di eper Gegenstoß ins gegnerische Tor befördert wurden. In der 2. Halbzeit ließ die Konzentration phasenweise nach; der Gegner hielt den Ball recht lange ud das Spiel verflachte.\r\nEs spielten: Kim Becker, Justine Liebald; Katharina Schuldt (8 Tore), Katrin Feldmann (8 Tore), Deborah Berge (4 Tore), Denise Großheim (8 Tore), Mayra Janssen, Lena Kuhl, Fabienne Suhe (1 Tor), Mara König, Chiara Janssen, Nadja Spilok (3 Tore) und Lea Jung (8 Tore).', '84.58.197.42'),
(20, 4, 1, '2008-04-13 22:26:48', '2007-08-02 00:00:00', 'article', 'Schiedsrichter: Ricardo Posocco Malleiro', 'Ricardo Posocco Malleiro erlernte bereits mit 6 Jahren beim TuS bei den Handball&ndash;Minis das Handballspielen. Er hat als Spieler alle Jugendmannschaften durchlaufen und spielt in unserer A-Jugendoberligamannschaft im rechten und linken Rückraum.<br />Er legte 2007 die Prüfung zum Jung-Schiedsrichter ab und verstärkt ab 2008 ebenfalls den Schiri-Kader beim TUS. Er entschied sich für dieses Amt aus Interesse und um einmal eine andere Perspektive des Handballsports kennen zu lernen. <br />Der TUS wünscht ihm für seine Schiri-Laufbahn viel Glück.', '84.58.216.122'),
(23, 8, 2, '2008-04-13 22:26:48', '2007-09-12 00:00:00', 'article', 'Damen schließen Runde mit gutem 3. Tabellenplatz ab!', 'Mit neu besetzten Positionen und neuer Spieltatik konnte Christian Mentges zusammen mit den Handballdamen die Saison mit einem guten dritten Tabellenplatz beenden. Den Aufstieg in die Bezirksoberliga verpassten die Damen leider knapp und somit steht das Ziel für die nächste Saison und den neuen Trainer Christian Matzel bereits fest, nämlich: &quot;Den Aufstieg in die Bezirksoberliga zu erreichen&quot;.<br /><br /><br />Leider verlässt Christian Mentges die Damen und wechselt für die neue Saison 2007/2008 zum Landesligisten BSC-Kelsterbach (Damen). Auf diesem Wege wünschen wir ihm viel Glück!<br /><br />Zum Glück der Mädels mit Biss konnten sie aufatmen, den es wurde schnell ein gleichwürdiger Nachfolger für die Damen gefunden. Christian Matzel der zuvor die Damen von TV Nauheim (Bezirksoberliga) trainierte, wird jetzt die neue Herausforderung annehmen und kann nun mit einer neuen Mannschaft durchstarten.<br /><br />Leider verlässt Bets Kern die Mannschaft, da sie sich während der Runde schwer am Knie verletzte und entschied ihre aktive Laufbahn zu beenden. Sie wird eine große Lücke hinterlassen, als eine der erfahrensten Spielerin. Sie konnte mit ihrer langjährigen Erfahrung die Mannschaft und die jüngeren Spielerinnen stets führen und motivieren. Auf diesem Wege wünschen wir Ihr alles gute und hoffen sie öfters in der Halle zu sehen und vielleicht wenn mal Not am Mann ist auf sie zählen zu können. An dieser Stellen noch ein großen Dank an Bets Kern die dem TuS mehr als 10 Jahre die Treue hielt.<br /><br />Mit Kathrin Rochna und Michele Bang verlassen zwei weitere junge Spielerinnen den Verein um eine kreative Auszeit zu nehmen, wir hoffen und denken das sie beide bald wieder zu uns zurück finden werden.<br /><br />Dafür konnte die Damenmannschaft drei neue Spielerinnen vom TSV Pfungstadt gewinnen: Sandra Ribbe, Vanessa Gandenberger und Meike Dornbach.<br /><br />Wir hoffen auf eine gute und erfolgreiche Saison wie im letzten Jahr und das vielleicht ein paar mehr Zuschauer den Weg in die Sporthalle finden. Die Heimspiele der kommenden Saison werden Samstags um 18.00 Uhr in der GHS Sporthalle angepfiffen.', '217.224.67.198'),
(24, 2, 3, '2008-04-13 22:26:48', '2007-09-12 00:00:00', 'article', 'Der Abteilungsleiter zur neuen Saison', '<p>Liebe Handballfreunde, meine Damen und Herren,</p><p align="justify"><img align="left" alt="Vorstand" height="145" hspace="5" src="http://handball.griesm.de/images/gallery/2007/vorstand/misc/lohnes.jpg" title="Vorstand" vspace="3" width="102" />Für die Saison 2007/2008 möchte ich sie kurz über Ziele, Vorhaben und Probleme in der Handballabteilung informieren. Gemeinsames Ziel der Abteilungsleitung und des Vorstandes ist es, soweit als möglich für alle Altersklassen die Möglichkeiten zu schaffen, dem Handballspiel nachzukommen. Dass dies nicht immer leicht ist, kann man sich vorstellen. Unsere Arbeit steigt und fällt mit den ehrenamtlichen Helfern und der Arbeit der Trainer. Alles in allem sind wir in der Abteilung gut aufgestellt. Bei den Jugendmannschaften haben die männliche C- und B und A-Jugend jeweils die Qualifikation für die Oberliga Hessen geschafft und stehen hier vor großen Herausforderungen. Bei den aktiven Mannschaften hat die erste Mannschaft 2006/2007 eine gute Saison in der Landesliga gespielt. Für die neue Saison gestaltete sich die Weichenstellung deutlich schwieriger. Den Abgängen von Ingo Höschler (Tor), Florian Zimmer und Dennis Götz sowie dem Ausscheiden von Marc Otte und Daniel Gernand stehen als Neuzugänge bisher Simon Bär und Markus Kunke im Tor sowie Julian Vogt aus Lorsch und Thomas Mischler aus Groß Zimmern entgegen. Da Linkshänder Damir Zarko aus beruflichen Gründen nicht immer zur Verfügung stehen kann, wird die neue Saison eine harte Bewährungsprobe für die Mannschaft um das Trainergespann Klaus Feldmann und Wolfgang Ittner. Ziel ist es hier, soweit als möglich mit den eigenen jungen Leuten den erfolgreichen Weg der letzten Jahre weiterzuführen. Hier werden auch die talentierten A-Jugendlichen mit Doppelspiel-berechtigung im Kader aushelfen. Die zweite. Mannschaft ist knapp dem Abstieg aus der Bezirksliga A knapp entgangen. Hier geht der Umbruch zu jüngeren Spielern weiter. Mit dem nötigen Training und Einstellung sollte auch im nächsten Jahr die Klasse gehalten werden, bevor in der übernächsten Saison wieder Spieler aus der A-Jugend nachrücken werden. Eine dritte Mannschaft wird es in dieser Saison leider nicht mehr geben. Unsere Frauenmannschaft ist überraschend als Tabellendritter wieder in die Bezirksoberliga aufgestiegen. Hier gab einen Wechsel beim Trainer. Für Christian Mentges wurde für die neue Saison Christian Matzel verpflichtet. Man muss abwarten wie sich die Mannschaft in der Bezirksoberliga schlagen wird. Hier haben wir leider das Problem, dass unsere Frauen-mannschaft z. Z. eine Insellösung in der Abteilung darstellt, da im weiblichen Bereich nur eine C-Jugend an einer Spielrunde teilnimmt. An dieser Stelle möchte ich mich bei Ihnen für ihr Interesse an der Handballabteilung bedanken und wünschen Ihnen viele gute erfolgreiche Spiele unserer Mannschaften.</p><p align="justify"> Manfred Lohnes</p>', '81.210.134.220'),
(30, 13, 1, '2008-04-13 22:26:48', '2007-09-15 00:00:00', 'home', 'wJugendC - HSG Dornheim/Groß-Gerau	28:17', '<pre><span style="font-family: Arial; font-size: 12px">Mit einem klaren 28:17-Sieg gegen die HSG Dornheim/Groß-Gerau starteten die<br />Griesheimer Mädchen in die Saison. Nachdem die Anfangsphase<br />verschlafen wurde, steigerte sich Abwehr, so dass zur Halbzeit (16:10) eine<br />Vorentscheidung gefallen war.  Nach der Pause kam auch das Tempospiel<br />in Fahrt; bei besserer Chancenverwertung von der Außenpositionen wäre<br />sogar ein noch höherer Erfolg möglich gewesen.<br />Es spielten: Justine Liebald; Denise Großheim (6), Katharina Schuldt (8),<br />Deborah Berge (4), Katrin Feldmann (4), Mayra Janssen, Lea Jung (2),<br />Tanja Birli (1), Nadja Spilok (19, Lea-Maria Wenzel, Fabienne Suhe (2) und Mara König</span></pre>', '84.58.249.69'),
(31, 5, 3, '2008-04-13 22:26:48', '2007-09-17 00:00:00', 'outwards', 'SKG Roßdorf - Herren 1	30:25', '<p style="margin-bottom: 0cm"><strong>Griesheim schwach - Roßdorf solide </strong></p><p style="margin-bottom: 0cm">Griesheim startete gut in das erste Saisonspiel und konnte sich schnell mit 6:3 (8. Minute) absetzen. Nun kamen aber Ungenauigkeiten im Abschluss sowie technische Fehler ins Spiel, die das Team bis in die 60. Minute begleiten sollten. Roßdorf kam nun immer besser ins Spiel auch wenn sich an der Deckung der Griesheimer Jungs zu knabbern hatten. Gegen Ende der ersten Halbzeit wurde es nun turbulent und Griesheim sah in kürzester Zeit drei Zeitstrafen, konnte aber ein 11:11 noch in die Kabine retten.</p> <p style="margin-bottom: 0cm">Nach der Pausenansprache von Klaus Feldmann kamen die Jungs zu dritt aufs Feld und mussten zusehen wie die Roßdorfer souverän ihre überzahl verwerteten und mit 3 Toren wegzogen. Die Angriffe der Griesheimer wurden nun vermehrt von Einzelaktionen bestimmt, kurz der Ball lief nicht Rund. Auch die Abwehr wurde zunehmend löchriger, so dass Roßdorf leichtes Spiel hatte und den Abstand auf 5 Tore ausbaute.</p> <p style="margin-bottom: 0cm">In der 52. Minute schien es, dass die Griesheimer durch Kampf wieder ins Spiel kommen. Sie verkürzten auf ein 20:22. Nun wurde aber Großchancen vor dem Tor ausgelassen. 3 verworfene 7-Meter und 3 Tempogegenstöße hätten eine Führung bedeutet. Roßdorf hingegen nutze diese Unsicherheiten und Gewann das Spiel mit einer soliden Leistung (30:25).</p>', '81.210.132.181'),
(34, 6, 5, '2008-04-13 22:26:48', '2007-09-15 00:00:00', 'article', 'Eberstadt - Herren II	24:19', '<p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman"><strong>Niederlage zum Saisonstart</strong></span></p><p style="margin: 0cm 0cm 0pt">&nbsp;</p><span style="font-size: small"></span><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Zum Saisonstart verlor die 2. Mannschaft ihr Auftaktspiel gegen Eberstadt mit 19:24, Halbzeit 10:11. Die erste Halbzeit begann sehr positiv. In der Abwehr stand man gut und ließ dem Gegner wenig Möglichkeiten. Über Gegenstöße und gutes Positionsspiel konnte man bis zur 20. Min mit 8:5 und 9:6 in Führung gehen. Danach schlichen sich Fehler ein und Eberstadt konnte zur Halbzeit mit 11:10 in Führung gehen. Nachlassende Kondition, Fehler und Frustfauls in der 2. Spielhälfte führten zu einer klaren Führung der Eberstädter mit 19:12.</span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Erst in den letzten 10 Minuten kam man mit 16:19 wieder etwas heran. Hier wurden dann allerdings gute Chancen beim Gegenstoß nicht genutzt, sodass es zu der deutlichen Niederlage mit 19:24 kam.</span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Es spielten:</span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Grund und Helfmann im Tor, Schecker 1, Maschkow 9, Rauschkolb 1, Simmermacher 1, Lehmkühler 1, Bausch 2, Killer 2, Döll 1, Drechsler und Feldmann.</span></p>', '84.167.108.31'),
(41, 15, 14, '2008-04-13 22:26:48', '2007-09-16 00:00:00', 'home', 'mJugendE1 - JSG Bischofsheim/Gustavsburg	28:29', '<span style="font-size: 12pt"><font face="Times New Roman">Am vergangenen Wochenende gastierte die Vertretung der JSG Bischofsheim/Gustavsburg in der Großsporthalle. Die letzte Begegnung im Qualifikationsturnier konnte von den Heimischen noch knapp gewonnen werden. Es war also klar, dass dieses Spiel sehr spannend werden würde. </font></span><span style="font-size: 12pt"><font face="Times New Roman">&nbsp;</font></span><span style="font-size: 12pt"><font face="Times New Roman">Die Gäste, mit zwei körperlich sehr starken Spielern angereist, hielten von Beginn an das Spiel offen. Der TuS schaffte es nicht, sich durch die spielerische überlegenheit entscheidende Vorteile zu verschaffen. So gingen die Teams mit einem 16:14 aus Sicht der Griesheimer in die Halbzeitpause. </font></span><span style="font-size: 12pt"><font face="Times New Roman">&nbsp;</font></span><span style="font-size: 12pt"><font face="Times New Roman">Im zweiten Spielabschnitt wurde es sehr spannend.<span>&nbsp; </span>Die JSG konnte den Rückstand schnell ausgleichen und ging sogar in Führung. Fortan wechselte die Führung ständig. Keine Mannschaft konnte sich absetzen. Letztendlich hatten die Gäste knapp die Nase vorne und nutzten ihre körperliche überlegenheit, die sie immer wieder erfolgreich einsetzen konnten. Das Spiel endete 28:29 und hätte bei besserer Chancenverwertung sicher auch gewonnen werden können. </font></span><span style="font-size: 12pt"><font face="Times New Roman">&nbsp;</font></span><span style="font-size: 12pt"><font face="Times New Roman">Es spielten: Leichtweis (Torwart), Becker, Birli, Blum (3 Tore), Feldmann (5), Jacquot (7), Posocco, Reuter, Schupp (8) und Türke (5)</font></span>', '84.58.238.77');
INSERT INTO `articles` (`id`, `cat_id`, `editor_id`, `last_update`, `date`, `type`, `title`, `text`, `ip`) VALUES
(47, 8, 13, '2008-04-13 22:26:48', '2007-09-16 00:00:00', 'home', 'Damen - SVC Gernsheim	18:17', '<p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Die Handballerinnen des TuS Griesheim starteten mit einem 18:17 Heimsieg (Halbzeit 8:5) in die Bezirksoberliga.</font></p><p style="margin: 0cm 0cm 0pt"><font size="3"><font face="Times New Roman">Nachdem die beiden Schiedsrichter nicht kamen einigten sich die Verantwortlichen auf Manfred Lohnes als Unparteiischen &hellip; und er machte seine Sache gut.<span>&nbsp; </span></font></font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Die Mädels aus Griesheim legten sich von Beginn an mächtig ins Zeug und auch wenn Paola Vladimirov das 1:0 erst in der 5 Minute erzielte hatten die Gastgeber schon 3-mal mit Pfostenwürfen Pech. Erst in der 9 Minute fiel der Ausgleich und kurz darauf sogar die Führung für die Gäste. Silke Drechsler verwertete einen schönen Spielzug zum 2:2 und kurz darauf traf Susen Schäfer per Tempogegenstoß zum 3:2. Doch die agile Mittelspielerin der Schöfferstädter traf zum erneuten Ausgleich, 3:3.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Jetzt hatte Griesheim die Nervosität gänzlich abgelegt und<span>&nbsp; </span>traf doppelt zum 5:3. Dreimal in Folge klatschte jetzt der Ball wieder an Pfosten und Latte der Gäste, dennoch schaffte es Griesheim bis zum Halbzeitpfiff durch Tore von Brigitte Suchland 2 mal und wiederum durch S. Schäfer auf<span>&nbsp; </span>8:5 davon zu ziehen.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Auch die zweite Hälfte kamen die TuS Mädels um Trainer Christian Matzel gut ins Spiel.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">10:6 und 11:7 waren die Zwischenstände nach gespielten 37 Minuten. </font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Vielleicht wiegten sich die Griesheimerinnen schon zu sicher. </font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Die Gäste arbeiteten sich akribisch wieder heran und gingen gar durch Tore in Folge ihrerseits mit 11:12 in Führung. Nach fast 50 Minuten egalisierte Vanessa Gandenberger die sich auf der linken Außenbahn sehr schön durchsetzten konnte. Und jetzt ging bei Griesheim noch einmal so richtig die Post ab. Angetrieben von der überragenden Susen Schäfer die erst 2 Tore zum 14:12 erzielte dann zum 15:13 traf<span>&nbsp; </span>waren die Gastgeberinnen auf der Siegerstraße. B. Suchland traf zum 16:14 und wieder waren es Pfosten und Latte die in Folge zweimal getroffen wurden. S. Schäfer und V. Gandenberger trafen schließlich zum Griesheimer 18:16 und damit zu einem erfolgreichen Saisonauftakt.</font></p><font face="Times New Roman" size="3">&nbsp;</font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Nach dem Zwiebelmartkwochenende sind die Griesheimer Damen zu Gast bei der FSG Roßdorf / TG 75 Darmstadt. Das Spiel ist am 29.09.2007 um 16:00 in der Heinz-Reinhard-Halle (Ziegelbusch) in Darmstadt.</font></p><font face="Times New Roman" size="3">&nbsp;</font><font face="Times New Roman" size="3">Es spielten:</font><font face="Times New Roman" size="3">&nbsp;</font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Tina Thiele, Nicole Spiller im Tor,&nbsp;</font><font face="Times New Roman" size="3">Silke Drechsler (1), </font><font face="Times New Roman" size="3">Brigitte Suchland (3), </font><font face="Times New Roman" size="3">Susen Schäfer (7/1), </font><font face="Times New Roman" size="3">Paola Vladimirov (3), </font><font face="Times New Roman" size="3">Meike Dornbach (1), </font><font face="Times New Roman" size="3">Vanessa Gandenberger (2), M</font><font face="Times New Roman" size="3">arion Feldmann (1), </font><font face="Times New Roman" size="3">Claudia Domes und </font><font face="Times New Roman" size="3">Laura Posteraro</font></p><font face="Times New Roman" size="3">&nbsp;</font><span lang="EN-GB"><font face="Times New Roman" size="3">&nbsp;</font></span>', '149.239.206.50'),
(137, 15, 14, '2008-04-13 22:26:48', '2007-11-17 00:00:00', 'article', 'mJugendE1 - TG Eberstadt	27:11', '<p>Am Samstag empfingen die Handball-Kids der E1 die TG Eberstadt. In gewohnter Manier gingen die TuSler gleich mit 5:0 in Führung, ehe die Gäste richtig im Spiel waren. Die Schützlinge von Christian Rechner konnten den Vorsprung bis zur Pause auf 15:5 ausbauen. </p><p>Nach dem Wechsel zeigten sich wieder die üblichen Schwächen beim TuS. Anstatt den Ball immer schnelldem nächsten Mitspieler abzugeben, wurde zuviel geprellt oder das Glück mit langen Pässen probiert. Die körperlich stärkeren Eberstädter konnten einige Bälle herausfangen und selbst gefährlich nach vorne spielen. Allerdings war die technische Überlegenheit der TuS-Kids zu groß. Das Spiel endete 27:11 für die Heimischen. Schön war diesmal, dass sich fast alle Feldspieler am Torsegen beteiligen konnten.</p><p>Es spielten: Leichtweis (Torwart), Becker (2 Tore), Birli (1), Blum (2), Feldmann (6), Flügger, Hartmann (2), Psocco (2), Schupp (5) und Türke (7)</p>', '84.59.31.172'),
(97, 8, 11, '2008-04-13 22:26:48', '2007-10-20 00:00:00', 'home', 'Damen - SG Egelsbach	11:25', ' <p><strong>Spielbericht TUS Griesheim Damen</strong></p><p>Die Handballerinnen des TUS Griesheim hatten in Ihrem Heimspiel gegen die SG Egelsbach beim 11:25 an diesem Tag keine Chance und mussten ihre erst Heimniederlage hinnehmen. Schon zur Halbzeit stand es 3:12 für die Gäste. Die Heimsieben begann schwungvoll und gingen im ersten Angriff durch Marion Feldmann mit 1:0 in Führung. Dann tat sich lange sieben Minuten nicht mehr viel auf beiden Seiten und die Keeper konnten ihre Tore sauber halten. Nun waren es die Gäste die zweimal trafen. Wieder M. Feldmann glich dann zum 2:2 aus. Nach einer viertel Stunde erarbeiteten sich die großgewachsenen Gäste ein übergewicht und trafen in Serie zum 2:8. Die taktische Disziplin der Griesheimerinnen ging nun völlig verloren. Zwar gelang Paola Vladimirov noch das 3:8 doch das war''s dann mit den TUS Mädels die auch diesmal wieder die erkrankte Susen Schäfer schmerzlich vermissten. Die Gäste kamen immer wieder zu freien Würfen und erhöhten die Führung bis zur Halbzeit auf 3:12. Die zweite Hälfte sollten die TUS Mädels um Trainer Christian Matzel nun endlich wieder zu ihrem guten Spiel zurückfinden. Doch man hatte die Rechnung ohne die Gäste gemacht, die innerhalb von nur drei Minuten auf 3:15 erhöhten. Das 4:15 erzielte Silke Drechsler die dann auch zum 6:17 traf. Nun fanden zwei 7 Meter Chancen der Griesheimerinnen nicht das Ziel und der Rückstand wuchs auf 6:19. P. Vladimirov und beste TUS Werferin M. Feldmann verkürzten zum 8:19. Wieder M. Feldmann mit einem Doppelpack sowie Laura Posteraro auf ihrer ungewohnten Rückraumposition trafen dann zum 10:20. Die Gäste wechselten munter durch und kamen immer wieder zu freien Würfen. Nachdem Goalie Nicole Spiller, die in der zweiten Hälfte Tina Thiele im Tor ablöste, ihren zweiten 7 Meter parierte kamen die Griesheimerinnen durch M. Feldmann noch zum 11:21. Doch jetzt trafen nur noch die Gäste und erhöhten noch zum 11:25 Endstand.</p><p>Am kommenden Wochenende kommt es zum reizvollen Derby bei der FSG Büttelborn. Das Spiel ist am 28.10.2007 und wird um 16:15 in der Sporthalle in Büttelborn angepfiffen.</p><p>Das TUS Team um Trainer Christian Matzel spielte mit</p><p>Tina Thiele und Nicole Spiller im Tor</p><p>Silke Drechsler 2</p><p>Brigitte Suchland </p><p>Paola Vladimirov 3</p><p>Marion Feldmann 5</p><p>Meike Dornbach </p><p>Vanessa Gandenberger </p><p>Laura Posteraro 1</p><p>Sandra Ribbe</p><p>Claudia Domes</p>', '89.12.113.198'),
(150, 15, 14, '2008-04-13 22:26:48', '2007-11-25 00:00:00', 'outwards', 'HSG Dornheim/Groß-Gerau - mJugendE1	17:29', '<p>Am vergangenen Wochenende gastierte die E1-Jugend der TuS-Handballer bei der HSG Dornheim/Groß-Gerau. Die Handball-Kids konnten diesmal bis zur Pausesehr überzeugend spielen. In der Spielaufstellung &quot;2 x 3 gegen 3&quot;ließen die Griesheimer die HSG oft minutenlangden Ball nicht in deren Angriffshälfte abspielen. Die Defensivaufgaben wurden von allen Mannschaftsteilen hervorragend gelöst undviele Bälle konnten schon die Angreifer erkämpfen.Die Torausbeute hättebei besserer Konzentration allerdings noch ein wenig besser ausfallen können. So ging man mit 19:7 für den TuS in die Pause.</p><p>In der zweiten Spielhälfte kam die HSG besser ins Spiel. Die TuS-Kids scheiterten in Serie am Keeper der Gastgeber, die Deckungsaufgaben wurden vernachlässigtund einige Abspielfehler brachten der HSG Vorteile. So konnten die Griesheimer den Vorsprung nicht weiter ausbauen, weshalb das Spiel letztendlich auch mit 29:17 für den TuS endete. </p><p>Es spielten: Leichtweis (Torwart), Birli, Feldmann (5 Tore), Fritzsche (9, Hartmann (1), Jacquot (4), Posocco, Schupp (8) und Türke (2)</p>', '84.58.208.119'),
(104, 11, 6, '2008-04-13 22:26:48', '2007-10-28 00:00:00', 'home', 'mJugendC1 - JSG Obernburg/Erlenbach	33:23', 'mC - JSG Obernburg/Erlenbach\r\n\r\n33 : 23 (18 : 14)\r\n\r\n \r\n\r\n28.10.2007 - 10.00 Uhr\r\n\r\n\r\nIm zweiten Heimspiel benötigten die Griesheimer eine Halbzeit, um sich auf den Gegner einzustellen. Abstimmungsprobleme und individuelle Fehler in der Abwehr ermöglichtem dem Gegner einfache Tore und im Angriff wurden gute Chancen nicht verwertet. Nach der Pause konnten diese Mängel abgestelt werden. Ein verdienter Sieg, an dem alle Positionen und alle Spieler beteiligt waren, war der Lohn.\r\n\r\nEs spielten: Max Schielke; Malte Just (1 Tor), Sven Rinschen (8 Tore), Kai Feldmann (5 Tore), Darren Weber (2 Tore), Ricardo Wilhelm (2 Tore), Jan Döll (7 Tore), Lukas Katzenmeier (1 Tor), Max Eidemüller (2 Tore) und Patrick Pollner (5 Tore).', '84.58.197.42'),
(53, 9, 12, '2008-04-13 22:26:48', '2007-09-22 00:00:00', 'outwards', 'MJSG Linden (Gießen) - mJugendA	32:26', '<p>Im ersten Spiel in der hessischen Oberliga unterlag die A-Jugend bei der MJSG Linden mit 32:26. Von Beginn an war es eine Begegnung zweier gleichwertigen Mannschaften. So wechselte die Führung ständig hin und her. Nach der 11:14 Führung der Griesheimer riss der Pfaden und die Spieler der MJSG Linden konnten mit 16:15 in die Halbzeit gehen. Auch nach der Halbzeit blieb es weiter spannend. Erst nach dem 22:21 konnte das Team von Trainer Uwe Rinschen nicht mehr mithalten. Trotz eines guten Einsatzwillens und dem guten Torhüter Yannick Hassenzahl konnte die Niederlage nicht abgewendet werden. Zu viele Fehlwürfe , Entscheidungsfehler in Angriff&nbsp;und Fehler in der Abwehr brachten das Team auf die Verliererstraße.</p><p>Es spielten: Steffen Vogel und Yannick Hassenzahl im Tor, Stefan Siebert (1), Dennis Bork (2), Benjamin v. Stein (1), Tim Patrazlek (1), Ricardo Posocco, Lucas Baier (4), Björn Ehmke (9), Christoph Rampelt, Kevin Herr, Tim Rinschen (8) und Miro Hinkel</p>', '217.224.65.25'),
(54, 15, 5, '2008-04-13 22:26:48', '2007-09-23 00:00:00', 'article', 'HSG Bensheim/Auerbach - mJugendE1	14:27', 'Am Zwiebelmarktsonntag gastierte die E1 der Handballer bei der HSG Bensheim/Auerbach. In der ersten Halbzeit konnten die Gastgeber das Spiel noch einigermaßen offen gestalten. Zur Pause hieß es 13:10 für den TuS. Nach dem Wechsel drehten die Griesheimer Handball-Kids richtig auf. Die beiden stärksten Spieler der HSG wurden gut abgedeckt, so dass diese nicht mehr recht ins Spiel fanden. Der TuS konnte sich immer wieder gut in Szene setzen und sogar der Tempogegenstoß klappte prima. So endete das Spiel 27:14 aus Sicht der Griesheimer. Es spielten: Leichtweis (Torwart), Becker (1), Birli, Blum (5), Feldmann (1), Hartmann (3), Jacqout (4), Posocco, Schupp (5) und Türke (8)', '84.167.104.83'),
(63, 11, 6, '2008-04-13 22:26:48', '2007-09-23 00:00:00', 'outwards', 'JSG Crumstadt/Goddelau - mJugendC1	13:35', '<p>Zum Rundenauftakt in der Oberliga gab es für die mC-Jugend einen deutlichen Sieg bei, der durch eine solide Abwehrleistung mit einem sicheren Torwart Max Schielke begründet wurde. Während vor der Pause im Angriff die Abstimmung und die Chancenverwertung zu wünschen übrig ließen, steigerte sich das Team in der Offensive nach der Pause. Einen gelungenen Einstand feierte auch Neuzugang Malte Just mit drei Toren.</p><p>&nbsp;</p><p>Es spielten: Max Schielke; Sven Rinschen, Kai Feldmann (7 Tore), Darren Weber (6 Tore), Ricardo Wilhelm (6 Tore), Jan Döll (6 Tore), Sebastian Groll, Malte Just (3 Tore) und Patrick Pollner (7 Tore).</p>', '217.224.15.50'),
(65, 10, 5, '2008-04-13 22:26:48', '2007-09-22 00:00:00', 'article', 'TV Hersfeld - mJugendB	27:32', '<p>&nbsp;</p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">B-Jugend siegt in Bad Hersfeld</font></p><font size="3"><font face="Times New Roman"> </font></font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Nach einer zerfahrenen ersten Halbzeit gewann die B-Jugend auch ihr zweites Spiel in der Oberliga. Hersfeld hatte den besseren Start und lag immer in Führung. Fehler in der Abwehr und das Auslassen von guten Chancen im Angriff ermöglichten dem Gegner eine 13:8 Führung bis zur 20 Minute. Mit einer konzentrierten Leistung in den letzten Minuten der ersten Halbzeit gelang es den Rückstand auf 12:13 zu verkürzen. Die Entscheidung fiel beim Spielstand von 24:24 mit dem erstmaligen Ausgleich in der zweiten Halbzeit. Eine Umstellung in der Abwehr und Manndeckung gegen den rechten Rückraumspieler führten bei Hersfeld verstärkt zu Ballverlusten die erstmals eine 27:24 Führung ermöglichte. Gegenstöße und gut herausgespielte Tore führten schließlich doch noch zum deutlichen 32:27 Sieg gegen einen in der 2. Halbzeit spielerisch und konditionell nachlassenden Gegner. </font></p><p><span style="font-size: 12pt; font-family: ''Times New Roman''">Es spielten: Andreas Gerhard und Christian Kindermann im Tor, Arseniy Zankov (2), Jan Eidemüller (9), Fabian Seigfried (4), Marvin Gernandt (7), Jan Tachtler, Jan Döll (6), Erik Neumann (4) und Kai Feldmann.<br /><br /></span></p>', '84.167.104.83'),
(67, 8, 11, '2008-04-13 22:26:48', '2007-09-30 00:00:00', 'outwards', 'FSG Roßdorf/TG 75 Darmstadt - Damen	14:17', '<strong><u><font size="3"><font face="Times New Roman">Spielbericht TUS Griesheim Handball Damen</font></font></u></strong><font face="Times New Roman" size="3">&nbsp;</font><strong><font size="3"><font face="Times New Roman">Tus Damen gewinnen Ihr Auswärtsspiel</font></font></strong><strong><font face="Times New Roman" size="3">&nbsp;</font></strong> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Die Handballerinnen des TUS Griesheim gewannen auch ihre zweite Begegnung, diesmal Auswärts, bei der FSG Roßdorf/TG 75 Darmstadt mit 17:14 Toren, Halbzeit 10:6, in der Bezirksoberliga.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Die Mädels aus Griesheim legten los wie die Feuerwehr und gingen durch drei Treffer von Brigitte Suchland, Susen Schäfer und Paola Vladimirov binnen 2 Minuten mit 3:0 in Führung. Auch wenn die überragende Tina Thiele im Tor, den 3:2 Anschluss nicht verhindern konnte, blieben die Gäste weiterhin die Spielbestimmende Mannschaft. B. Suchland und S. Schäfer erhöhten den Vorsprung auf 5:2. Noch waren in dieser schnellen Anfangsphase keine 10 Minute vorüber und die FSG kam wieder auf ein Tor heran, 5:4. Marion Feldmann traf zum 6:4 und T. Thiele fischt sich ihren zweiten 7 Meter. Die Heimstarken Gastgeber schafften es dennoch zum 6:6 auszugleichen. </font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Doch jetzt begann die Galavorstellung der besten Griesheimer Werferin.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Susen Schäfer verwandelte erst einen 7 Meter, dann konnte sie zwei schnelle Gegenstöße verwerten um schließlich mit einem weiteren 7 Meter den 10:6 Halbzeitstand zu erzielen.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Warnende deutliche Worte fand Trainer Christian Matzel in der Pause, so wusste man doch von den starken zweiten Halbzeiten der FSG.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Doch zunächst machte Griesheim weiter wie es aufgehört hatte.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Ein weiterer Siebener von S. Schäfer sowie ein Tor von Silke Drechsler und die Gäste führten 12:6. Wie schon im ersten Saisonspiel nahm sich Griesheim nun eine Auszeit.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Zwischen der 37 und 47 Minute und fast permanenter Unterzahl fielen nun Gegentore am laufenden Band und im Sturm war die Kiste wie vernagelt. Nach drei 7 Metern in Folge, kamen die Gastgeber zum 13:13 Ausgleich nach 47 Minuten.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Wieder komplett übernahmen nun die Gäste wieder das Kommando.</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">T. Thiele hielt ihren dritten 7 Meter und angetrieben von der überragenden Susan Schäfer die jetzt 2 Tore zum 15:13 erzielte, setzte sich Griesheim wieder ab. Claudia Domes kam über links zum 16:13. Den letzten Treffer der Gastgeber beantwortete P. Vladimirov mit einem Gegenstoß zum 17:14, dem Endstand.</font></p><p style="margin: 0cm 0cm 0pt"><span><font face="Times New Roman" size="3"></font></span></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Am nächsten Wochenende erwarten die Griesheimer Damen und ihr Trainer den TV Nauheim. Das sicher sehr spannende Spiel, so war der Coach Christian Matzel zuletzt zwei Jahre in Nauheim tätig, <span>&nbsp;</span>ist am 07.10.2007 um 18:00 in der Griesheimer GHS Halle.</font></p><font face="Times New Roman" size="3">&nbsp;</font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Das TUS Team spielte mit</font></p><font face="Times New Roman" size="3">&nbsp;</font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Tina Thiele im Tor</font></p><font face="Times New Roman" size="3">&nbsp;</font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Silke Drechsler 1</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Brigitte Suchland 2</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Susen Schäfer 10/5</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Paola Vladimirov 2</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Claudia Domes 1</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Marion Feldmann 1</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Meike Dornbach </font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Vanessa Gandenberger </font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Laura Posteraro</font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Sandra Ribbe </font></p><font face="Times New Roman" size="3">&nbsp;</font><span lang="EN-GB"><font face="Times New Roman" size="3">&nbsp;</font></span>', '89.13.93.163'),
(68, 15, 14, '2008-04-13 22:26:48', '2007-09-30 00:00:00', 'home', 'mJugendE1 - TGB Darmstadt	26:12', '<p style="margin: 0cm 0cm 0pt"><font size="2"><font face="Times New Roman"><strong><u>E1 schlägt die TGB</u></strong><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></font></font></p><font size="2"><font face="Times New Roman">&nbsp;</font></font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="2">Am vergangenen Sonntag hatten die E1-Handballer die TGB Darmstadt zu Gast. Die Griesheimer Handballkids gingen favorisiert in die Begegnung. Leider hatten die Schützlinge von Christian Rechner nicht ihren besten Tag erwischt. Mit Abspiel- und Fangfehlern machten sie sich das Leben selbst schwer. So konnten Sie nicht wie üblich schnell einen klaren Vorsprung herauswerfen. Zur Pause stand es dann aber doch schon 12:4 für den TuS.</font></p><font size="2"><font face="Times New Roman">&nbsp;</font></font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="2">Auch nach dem Wechsel konnten die Griesheimer leider die technischen Fehler nicht abstellen. Trotzdem gelang es, den Vorsprung weiter auszubauen. Am Ende hieß es dann 26:12 für die Heimischen.</font></p><font size="2"><font face="Times New Roman">&nbsp;</font></font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="2">Es spielten: Leichtweis (Torwart), Becker (3 Tore), Birli, Feldmann (2), Hartmann (1), Jacquot (5), Posocco, Schupp (5) und Türke (8)</font></p><font size="2"><font face="Times New Roman">&nbsp;</font></font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="2">Bereits am kommenden Mittwoch trifft die E1 im Schlagerspiel auf die HSG Weiterstadt/Braunshardt. Das Spiel wird um 13.00 Uhr in der Braunshardter<span>&nbsp; </span>Sporthalle angepfiffen. </font></p>', '84.58.226.123'),
(69, 5, 3, '2008-04-13 22:26:48', '2007-09-29 00:00:00', 'outwards', 'TV Büttelborn - Herren 1	29:29', 'als Handballfan nur wünschen kann. Die Griesheim Jungs wollten sich und den Fans beweisen, dass mehr in Ihnen steckt als in Roßdorf gezeigt wurde. Auch die Verletzung von Benjamin Sirker (Mittelhandbruch), durfte kein Grund sein hier nicht mit Siegeswille in das Spiel zu starten.</p>  <p style="margin-bottom: 0cm">In einer gut besetzten Halle, sahen die Griesheimer Fans eine selbstbewusst aufspielende Mannschaft, die schnell mit 4:9 (11. Minute) in Führung ging. Von dem Tempospiel der Griesheimer waren die Büttelborner sichtlich überrascht. Auch die starke Torhüterleistung von Neuzugang Simon Bär, zu Beginn des Spieles, soll hier erwähnt werden. In der 12. Spielminute musste man sich einer 6:4 Unterzahlsituation stellen. Diese nutzte der Gegner zu einer Aufholjagd zum 9:9. Nun entwickelte sich eine sehr packende und enge Begegnung die durch schöne Spielzüge und schnellen Handball auf sehr hohem Niveau geführt wurde. Mit dem Schlusspfiff der ersten Halbzeit gingen die Büttelborner in Führung (17:16).</p>  <p style="margin-bottom: 0cm">Die Griesheimer kamen nach der Halbzeit gut aus der Kabine und schafften es, gegen die sich scheinbar noch in der Kabine befindlichen Büttelborner, trotz Unterzahl in Führung zu gehen. Ein überagend Spielender Darmir Zarko (13/6 Tore) setzte zu diesem Zeitpunkt viele Akzente. Das Derby fieberte nun seinem Höhepunkt, der Schlussphase entgegen. Die Büttelborner Jungs erkämpften sich nach einem 20:23 Rückstand in der 48. Minute wieder das Unentschieden. Ab hier entwickelte sich nun ein offener Schlagabtausch, der aber von beiden Mannschaften ohne übertriebene Härte geführt wurde. Bis zur 54.Minute konnte Griesheim mithalten (27:27), dann schien es so, dass die Büttelborner den Sack zumachen wollen. Sie zogen mit 29:27 davon (57. Minute).</p>  <p style="margin-bottom: 0cm">Die Griesheimer ließen den Kopf nicht hängen. Auch als auf 7-Meter gegen Sie entschieden wurde. Die Schlüsselszene in diesem Spiel. Der in der 45. Minute eingewechselte Oliver Schmand stand nun für Griesheim im Kasten und konnte schon zuvor mit schönen Paraden glänzen. Bis zu diesem Zeitpunkt verwandelten beide Mannschaften souverän alle 7-Meter. Doch dieser vorentscheidende wurde durch Oliver Schmand pariert. Die Fans und die Mannschaft witterten noch eine Chance. Sie erzielten wiederum durch einen 7-Meter, verwandelt durch Darmir Zarko, den Anschlusstreffer in der 59. Spielminute.</p>  <p style="margin-bottom: 0cm">Die Griesheimer konnte sich im Anschluss noch zweimal den Ball erobern, da die Büttelborner nun das Tor nicht mehr trafen. Der erste Angriff wurde jedoch überhastet abgeschlossen. Der zweite Angriff war mehr ein Gegenstoß in den letzten Sekunden des Spieles. Sebastian Müller konnte unter starker Bedrängnis den Ball noch zu Timo Müller abspielen, der den entscheidenden Wurf über die linke Außenposition einnetzen konnte. Die Uhr zeigte in diesem Moment 59:57. Kurz darauf erfolgte der Schlusspfiff und Griesheim freute sich über einen gewonnenen Punkt, welchen die mitgereisten Fans frenetisch feierten.</p>  <p style="margin-bottom: 0cm">Das Unentschieden entsprach auch dem gesamten Spielverlauf, auch wenn Büttelborn am ende den Sack hätte zumachen müssen.  </p>    <p style="margin-bottom: 0cm">Tore: Timo Müller (2), Sebastian Mülller (4), Nicholas Wurth (1), David Max (4), Stefan Hamel (1), Daniel Mehring (3/1), Damir Zarko (13/6), Thomas Mischler (1).</p> ', '81.210.132.64'),
(70, 9, 12, '2008-04-13 22:26:48', '2007-09-30 00:00:00', 'article', 'mJugendA - TSG Bürgel	32:28', '<p>Zum ersten Heimspiel der Oberligasaison 07/08 begrüßte die A-Jugend zur besten Handballzeit am Sonntag um 18.00 die TSG Bürgel. Der Gegner war noch aus der Qualifikation bestens bekannt. Damals unterlag man chancenlos mit 23:34. Mit dieser Kenntnis ließ Trainer Uwe Rinschen Bürgels gefährlichsten Rückraumspieler von Anfang an kurz decken. Das zahlte sich aus und mit konsequenter Spielweise im Angriff konnte man binnen 10 Minuten mit 7:1 in Führung gehen. Danach gab es einen Einbruch, weil man länger im Angriff überhastet seine Chancen suchte doch zur Halbzeit konnte man dennoch mit 16:11 in die Kabine gehen. Auch in der zweiten Hälfte war man zwar immer in Führung doch der Vorsprung variierte zwischen 2-8 Toren. Erst kurz vor Schluß konnte man sich entscheidend absetzen, so daß man schließlich verdient mit 32:28 siegte. </p><p>Es spielten: Lucas Baier (3), Tim Rinschen (9), Dennis Bork (3), Björn Ehmke (12), Kevin Herr, Benjamin von Stein (1), Daniel Arenz (1), Tim Patrzalek (1), Miro Hinkel (2), Stefan Siebert und im Tor: Tim Ulmrich, Yannick Hassenzahl,Steffen Vogel.</p>', '217.224.113.239'),
(93, 8, 11, '2008-04-13 22:26:48', '2007-10-14 00:00:00', 'article', 'TG Biblis - Damen	36:19', ' <p><strong><u>Spielbericht TUS Griesheim Handball Damen</u></strong></p><p><strong>Tus Damen kommen Auswärts mächtig unter die Räder</strong></p><p>&nbsp;</p><p>Die Handballerinnen des TUS Griesheim kamen bei der Heimstarken TG Biblis mit 19:36 Toren zu ihrer ersten Niederlage in dieser Saison. </p><p>Ohne die erkrankte Susen Schäfer, Marion Feldmann und Vanessa Gandenberger, beide Urlaub, präsentierten sich die Griesheimer Mädels Auswärts ohne die nötige Einstellung vor allem in der Abwehrarbeit.</p><p>Biblis legte sofort vor ehe die beste Griesheimerin Paola Vladimirov zum 1:2 verkürzte. Die Mädels aus Griesheim schafften es in den ersten Minuten durch Laura Posterero und wieder P. Vladimirov die Partie offen zu halten und zum 3:3 auszugleichen.</p><p>Dann brachen bei den Gästen mit ihrer sonst so starken Defensive alle Dämme und die Gastgeber erhöhten auf 9:3 ehe Claudia Domes auf der linken Seite zum vierten mal für Griesheim traf. Zum 5:11 traf wieder P.Vladmirov per 7 Meter.</p><p>Das war es dann aus Sicht der Gäste in den ersten 30 Minuten. Denn einzig die Gastgeber spielten und trafen beinahe nach belieben und den sonst so bärenstarken Goalies Tina Thiele und Nicole Spiller blieb ein ums andere mal das Nachsehen.</p><p>5:16 aus Griesheimer Sicht war dann der Halbzeitstand.</p><p>Deutliche Worte fand Trainer Christian Matzel in der Pause, doch es änderte sich vor allem in der Defensivenstellung seiner Mädels nicht viel.</p><p>Auf 5:18 wuchs der Rückstand ehe P.Vladimirov, Brigitte Suchland und Meike Dornbach auf 8:19 Verkürzten.</p><p>In doppelter Unterzahl wuchs der Rückstand gar auf 10:23 an.</p><p>Biblis hielt das Tempo hoch und schaffte sich immer wieder Freiräume die sie auch zu nutzen wussten. 13:27 und 14:31 waren die weiteren Spielstände. Nun wurde auch bei den Gastgebern fleißig durchgewechselt und vor allem die agile Paola Vladimirov fand jetzt immer wieder die Lücken und verwertete ihre Chancen bis zum 19:36 Endstand. </p><p>Am nächsten Wochenende brennen die Griesheimer Damen und ihr Trainer auf Wiedergutmachung. Zu Gast ist die die SG Egelsbach, eine spielstarke und wurfgewaltige Mannschaft. Das Spiel, ist am 20.10.2007 um 18:00 in der Griesheimer GHS Halle.</p><p>Das TUS Team spielte mit</p><p>Tina Thiele und Nicole Spiller im Tor</p><p>Silke Drechsler 2</p><p>Brigitte Suchland 3</p><p>Paola Vladimirov 10/4</p><p>Claudia Domes 1</p><p>Meike Dornbach 2</p><p>Laura Posteraro 1</p><p>Sandra Ribbe </p><p>Isabell Haym </p>', '89.12.119.242'),
(71, 13, 6, '2008-04-13 22:26:48', '2007-09-30 00:00:00', 'article', 'wJugendC - HSG Fürth/Krumbach52:9', '<p><strong><span style="color: #ff6600; font-family: Comic Sans MS; font-size: 24px">wC - HSG Fürth/Krumbach</span></strong></p><p><strong><span style="color: #ff6600; font-family: Comic Sans MS; font-size: 24px">52 : 9 (22 : 6)</span></strong></p><p><span style="font-family: Times; font-size: 16px; font-weight: bold"><span style="color: #ff6600; font-family: Comic Sans MS; font-weight: normal">30.09.2007 - 11.30 Uhr</span></span></p><p><span style="font-family: Times; font-size: 16px"><span style="color: #ff6600; font-family: Comic Sans MS">Im dritten Spiel der Saison konnte mit 52:9 ein sehr deutlicher Sieg erspielt werden. Die offensive Abwehr verhinderte zeitraubende Angriff der überforderten Gäste, die dem Griesheimer Tempospiel nichts entgegensetzen konnten und wollten.</span></span></p><p><span style="font-family: Times; font-size: 16px"><span style="color: #ff6600; font-family: Comic Sans MS">Es spielten: Kim Becker, Justine Liebald; Katharina Schuldt (5 Tore), Katrin Feldmann (7 Tore), Deborah Berge (8 Tore), Denise Großheim (12 Tore), Mayra Janssen (2 Tore), Tanja Birli (5 Tore), Fabienne Suhe (2 Tore), Mara König, Chiara Janssen, Nadja Spilok (6 Tore), Lea Jung (3 Tore) und Lea-Maria Wenzel (2 Tore).</span></span></p>', '84.58.212.106'),
(72, 6, 5, '2008-04-13 22:26:48', '2007-09-30 00:00:00', 'article', 'HSG Erfelden - Herren II 30:22', '<p><span style="font-size: small; font-family: Times New Roman"><strong>Niederlage der 2. Mannschaft gegen Erfelden</strong></span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Verletzungs- und krankheitsbedingt trat die Griesheimer Mannschaft nur mit 2 Wechselspielern gegen die komplett auflaufende Mannschaft von Erfelden an. </span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Erfelden hatte den besseren Start und führt schnell mit 4:0. Danach kam Griesheim aber besser ins Spiel und bis zur Pause konnte der Rückstand bis auf ein Tor aufgeholt werden.</span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Beim Stand von 13:14 wurden aus Griesheimer Sicht die Seiten gewechselt. Nach der Pause das gleiche Spiel. Erfelden legte Tor um Tor vor während sich bei Griesheim, auch bedingt durch den kleinen Kader, sich Konditionsprobleme einstellten. Im Gegensatz zur ersten Halbzeit konnte man den Rückstand nicht mehr aufholen und so stand am Schluss eine doch deutliche 22:30 Niederlage im Raum. </span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Es spielten: </span></p><p style="margin: 0cm 0cm 0pt"><span style="font-size: small; font-family: Times New Roman">Kay Grund und Christian Simmermacher im Tor, Alex Maschkow 7, Marcel Feldmann 1, Dirk Höhl 5, Martin Simmermacher 3, Jan Rauschkolb 3, Ronald Bausch 1, Christian Döll 1 und Dennis Killer 2</span></p><p>&nbsp;</p>', '84.167.108.31'),
(73, 10, 5, '2008-04-13 22:26:48', '2007-09-30 00:00:00', 'home', 'mJugendB - JSG Gersprenztal	25:38', '<p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">B-Jugend verliert deutlich gegen Gersprenztal</font></p><font size="3"><font face="Times New Roman">&nbsp;</font></font> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Gegen die JSG Gersprenztal konnte die B-Jugend nur bis zum 10:10 mithalten. Danach setzte sich das robustere Spiel der Mannschaft aus Groß Bieberau immer mehr durch. Im Angriff konnte man sich zwar immer wieder gut in Szene setzen, hatte aber in der Abwehr gegen großen Rückraumspieler des öfteren das Nachsehen und so lag man zur Pause schon mit 6<span>&nbsp; </span>Toren im Rückstand. Auch in der 2. Spielhälfte gaben sich die durchweg älteren Spieler der JSG keine Blöße und so stand am Schluss eine deutliche Niederlage mit 25:38 zu Buche. </font></p><p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="3">Auf Griesheimer Seite spielten:</font></p><span style="font-size: 12pt; font-family: ''Times New Roman''">Christian Kindermann im Tor, Arseniy Zankov (8), Jan Eidemüller (3), Fabian Seigfried (3), Marvin Gernandt (3), Patrick Pollner (1) Jan Döll (3), Erik Neumann (4), Simon Lauer und Kai Feldmann.<br /><br /></span>', '84.167.107.72'),
(82, 6, 5, '2008-04-13 22:26:48', '2007-10-03 00:00:00', 'article', 'Herren II - HSG Langen	21:23', '<p><strong>2. Mannschaft verliert auch gegen Langen</strong></p><p>Gegen Langen kam man in der ersten Halbzeit nur schwer ins Spiel. In der Abwehr hatte man gegen den linken Rückraumspieler aus Langen große Probleme und auch im Angriff lief nicht viel zusammen. Zur Halbzeit lag die Mannschaft mit 9:14 Toren im Rückstand. Nach dem Wechsel kam man besser ins Spiel. Abschlussschwächen auf Seiten von Langen wurden jetzt mit Gegenstößen besser genutzt und dank der kämpferisch guten Einstellung gelang der Mannschaft trotz vieler Zeitstrafen und Unterzahlspiel 3 gegen 6 beim Stand von 19:19 erstmals der Ausgleich. In der hektischen Schlussphase wurde allerdings eine Punkteteilung durch das Auslassen von guten Möglichkeiten verpasst. So wurde das Spiel mit 21:23 verloren. Gut in das Spiel der Mannschaft eingefunden haben sich die A-Jugendlichen Kevin. Herr und Dennis Bork bzw. Ricardo Posocco (er leider ohne Spielanteile).</p><p>Es spielten: Kay Grund und Michael Helfmann im Tor, Alex Maschkow 2, Marcel Feldmann 4, Dirk Höhl 2, Dennis Bork 1, Jan Rauschkolb 5, Ronald Bausch 5, Christian Döll 2, und Dennis Killer, Kevin Herr und Ricardo Posocco.</p>', '84.167.108.31'),
(75, 15, 14, '2008-04-13 22:26:48', '2007-10-03 00:00:00', 'outwards', 'HSG Weiterstadt/Braunshardt - mJugendE1	25:18', '<h1 style="margin: 0cm 0cm 0pt; text-align: justify"><u><font face="Times New Roman" size="5">E1-Handballer verlieren<span>&nbsp; </span>Spitzenspiel</font></u></h1><strong><span style="font-size: 16pt"><u><font face="Times New Roman">&nbsp;</font></u></span></strong> <p style="margin: 0cm 0cm 0pt; text-align: justify"><font face="Times New Roman" size="5">Relativ deutlich, aber der Höhe nach verdient, unterlagen die Handball-Kids bei der HSG Weiterstadt/Braunshardt. Die Gastgeber gingen in Führung und waren zu keinem Zeitpunkt des Spieles in Gefahr, die Punkte abgeben zu müssen. Auch wenn der TuS es schaffte, mal den Abstand auf ein Tor zu verkürzen, so konnten die wacher und cleverer agierenden HSG-Spieler die Tordifferenz gleich wieder ausbauen. Zur Pause stand es 10:14 aus Sicht des TuS.</font></p><span style="font-size: 14pt"><font face="Times New Roman">&nbsp;</font></span><span style="font-size: 14pt"><font face="Times New Roman">Die Griesheimer waren an diesem Tag läuferisch einfach unterlegen und leisteten sich dadurch verhältnismäßig viele Abspielfehler, die durch die vorbildliche Deckungsarbeit der HSG provoziert wurden. Hier gilt es in nächster Zeit im Training anzusetzen. Außerdem wurden klare Torchancen nicht genutzt. Ein Luxus, den sich die Gastgeber aber gegen den starken Michael Leichtweis im TuS-Kasten auch leisteten. </font></span><span style="font-size: 14pt"><font face="Times New Roman">&nbsp;</font></span><span style="font-size: 14pt"><font face="Times New Roman">Insgesamt merkte man dem Spiel große Nervosität an. Schließlich trafen hier die beiden stärksten E-Jugendmannschaften des Bezirkes Darmstadt aufeinander. Am Ende verloren die Griesheimer mit 25:18 die umkämpften Punkte. Die Zuschauer hatten aber sichtlich Freude an dieser Begegnung und werden<span>&nbsp; </span>auf das Rückspiel in Griesheim sicher sehr gespannt sein. Bis dahin heißt es für die Schützlinge von Christian Rechner fleißig trainieren. </font></span><span style="font-size: 14pt"><font face="Times New Roman">&nbsp;</font></span> <p style="margin: 0cm 0cm 0pt"><font face="Times New Roman" size="5">Es spielten:<span>&nbsp; </span>Leichtweis, Becker, Birli, Blum, Feldmann (1), Fritzsche (7), Hartmann, Jacquot (2), Posocco, Schupp (7) und Türke (1)</font></p>', '84.58.253.16'),
(87, 8, 1, '2008-04-13 22:26:48', '2007-10-07 00:00:00', 'article', 'Damen - TV Nauheim	16:14', '<p><strong>Spielbericht TUS Griesheim Damen</strong></p><p>Die Handballerinnen des TUS Griesheim behielten auch am dritten Spieltag ihre weiße Weste und gewannen gegen den favorisierten TV Nauheim mit 16:14 Toren und stehen nun erstmals als Aufsteiger in die Bezirksoberliga mit 6:0 Punkten auf dem ersten Tabellenplatz. Die Mädels aus Griesheim sahen sich zu Beginn erst einmal einer starken Gästemannschaft gegenüber. Die zweimalige Führung der Gäste glich jeweils Brigitte Suchland zum 2:2 aus. Nach 10 Minuten griff nun auch das taktische Konzept der Griesheimerinnen die sich nun Chancen am Fliesband erarbeiteten. Die Abwehr um die wieder überragende Tina Thiele im Tor machte nun dicht und mit je zwei Toren von Paola Vladimirov und Susen Schäfer und Griesheim führte 6:3. Mit einem schnellen Gegenstoß schaffte wieder S.Schäfer das 7:3. Nach einer Unaufmerksamkeit und dem 7:4 brachen beim Gast nun alle Dämme. Griesheim erhöhte nochmals den Druck und traf schließlich durch Marion Feldmann sowie durch einen erneuten Doppelpack von P. Vladimirov zum 10:4 Halbzeitstand. Auch die zweite Hälfte kamen die TUS Mädels um Trainer Christian Matzel wieder gut ins Spiel. Das 11:4 und das 12:6 erzielt wieder die starke B. Suchland aus dem Rückraum. Zum 13:6 war M. Feldmann dann per 7 Meter erfolgreich, da waren gerade mal 40 Minuten gespielt. Jetzt verloren die bis dahin sehr starken Griesheimerinnen ihre Spielordnung und auch das Abwehrspiel war nicht mehr so konsequent. Die Gäste arbeiteten sich akribisch wieder heran und verkürzten auf 13:9. P. Vladimirov und Silke Drechseler trafen dann doppelt zum 15:9. Unerklärlicherweise begann jetzt bei der TUS das große Zittern. Vorne wurde nun nicht mehr getroffen und der TV Nauheim kam nochmals auf und verkürzte erst auf 15:11 und bei Griesheimer Unterzahl auf 15:13. Nach 58 Minuten noch ein weiteres Gegentor per 7 Meter doch die guten Paola Vladimirov verwandelte sicher einen 7 Meter zum viel umjubelten 16:14 Endstand. Am kommenden Wochenende sind die Griesheimer Damen zu Gast bei der TG Bilbis die mit 6:2 Punkten ebenfalls ganz vorne steht und in dieser Runde auch noch kein Spiel verloren hat. </p><p style="margin: 0cm 0cm 0pt">Das Spiel ist am 14.10.2007 um 16:00 in der Sporthalle in der Pfaffenau in Biblis.</p> <p style="margin: 0cm 0cm 0pt">Das TUS Team um Trainer Christian Matzel spielte mit</p> <p style="margin: 0cm 0cm 0pt">Tina Thiele, Nicole Spiller im Tor<br /><br />Silke Drechsler 1<br />Brigitte Suchland 4<br />Susen Schäfer 3<br />Paola Vladimirov 6/1<br />Marion Feldmann 2/1<br />Meike Dornbach <br />Vanessa Gandenberger <br />Laura Posteraro<br />Sandra Ribbe</p>', '127.0.0.1'),
(83, 10, 1, '2008-04-13 22:26:48', '2007-10-04 00:00:00', 'article', 'HSG Nieder Roden - mJugendB	35:26', '<p>Gegen die HSG Nieder Roden führte Griesheim nach 15 Minuten mit 12:11 Toren. Schwächen in der Abwehr konnte man mit einer guten Leistung um Angriff ausgleichen. Eine 10 minütige Schwächeperiode im Angriff mit unnötigen Ballverlusten und überhasteten Torwürfen ermöglichte es Nieder Roden mit einfachen Gegenstoßtoren bis zu Halbzeit auf 13:21 davonzuziehen. Nach dem Wechsel konnten die Griesheimer Jungs das Spiel ausgeglichen gestalten. Den hohen Rückstand aus der ersten Halbzeit konnten sie gegen den starken Gegner aber nicht mehr aufholen und so stand am Schluss doch eine deutliche 36:25 Niederlage im Raum.</p><p>Es spielten: Christian Kindermann im Tor, Arseniy Zankov (2), Jan Eidemüller (8), Fabian Seigfried (4), Marvin Gernandt (2), Jan Döll (3), Erik Neumann (4), Jan Tachtler  (1),Kai Feldmann (1)und Andreas Margarit.</p>', '84.58.233.201'),
(84, 11, 1, '2008-04-13 22:26:48', '2007-10-04 00:00:00', 'article', 'TSG Bürgel - mJugendC1	26:33', '<p>26 : 33 (14 : 16)<br />04.10.2007 - 19.00 Uhr</p><p>Im zweiten Auswärtsspiel reichte es für die Griesheimer zu einem schmeichelhaften 26:33. In der Abwehr unkonzentriert und leidenschaftslos, im Angriff mit mangelhafter Chancenauswertung - so konnte über das gesamte Spiel kein deutlicher Vorsprung erzeugt werden. Lichtblicke waren die gelungenen Aktionen von Ricardo Wilhelm und Patrick Pollner.</p><p>Es spielten: Max Schielke; Sven Rinschen (5 Tore), Kai Feldmann (4 Tore), Darren Weber (5 Tore), Ricardo Wilhelm (7 Tore), Jan Döll (3 Tore), Max Eidemüller (1 Tor), Malte Just (1 Tor) und Patrick Pollner (7 Tore).</p>', '84.58.233.201'),
(85, 5, 3, '2008-04-13 22:26:48', '2007-10-03 00:00:00', 'home', 'Herren 1 - HSG Maintal	22:27', '  <p style="font-size: 10pt; font-family: Arial">Niederlage gegen Spitzenreiter</p>  <p style="font-size: 10pt; font-family: Arial">Bei der Heimspielpremiere am Tag der deutschen Einheit verloren die Handballer vom TuS Griesheim gegen den ungeschlagenen Tabellenführer der Landesliga Süd HSG Maintal trotz einer kämpferischen Leistung mit 22:27 (10:13).</p>  <p style="font-size: 10pt; font-family: Arial">Nach dem hart erkämpften Unentschieden gegen Büttelborn wollten die Griesheimer vor eigenem Publikum eine ähnlich starke Leistung abrufen. Zwar konnte der Gast schon zu Beginn des Spiels in Führung gehen (0:2, 4. Minute), doch Griesheim hielt den Rückstand stets in Grenzen.</p>  <p style="font-size: 10pt; font-family: Arial">Mit einer offensiven und aggressiven Abwehr gelang es den Spielfluss der HSG Maintal zu stören. Leider wurden einige Gegenstoßmöglichkeiten vergeben und daher liefen die Griesheimer immer einem knappen Rückstand hinterher. Beim Stand von 10:13 wurden die Seiten gewechselt.</p>  <p style="font-size: 10pt; font-family: Arial">Griesheim kam kämpferisch aus der Kabine und das Spiel gestaltete sich weiterhin offen. Mitte der zweiten Hälfte gelang sogar der Ausgleich zum 19:19 und eine Wende schien möglich. Doch dann geriet der Angriff der Griesheimer ins Stocken, es kam kein druckvolles Spiel mehr zu Stande. Es gelang nur noch selten, gute Wurfmöglichkeiten herauszuspielen, und diese wurden auch noch meist vergeben. So konnte sich der Tabellenführer Tor um Tor bis zum 19:24 absetzen. Zwar versuchten die Griesheimer weiter zu kämpfen, doch nun machte sich auch der Kraftakt vom Wochenende gegen Büttelborn bemerkbar. Schließlich konnte Maintal das Spiel mit 22:27 verdient gewinnen.</p>  <p style="font-size: 10pt; font-family: Arial">Nun gilt es am kommenden am kommenden Sonntag um 18:00 beim Auswärtsspiel gegen die HSG Mörfelden/Walldorf, die in der Tabelle einen Punkt vor dem Tus liegt, zu punkten.</p>  <p><span style="font-size: 10pt; font-family: Arial"></span>Torschützen: Zarko 7, Max 5, Mehring 4, S.Müller 3, T.Müller 1, Hamel 1, Wurth 1</p>    ', '81.210.134.34'),
(90, 5, 3, '2008-04-13 22:26:48', '2007-10-07 00:00:00', 'article', 'SKV Mörfelden/Walldorf - Herren 1	23:29', '<p><strong>TuS mit erstem Saisonsieg</strong></p>  <p align="justify">Ihren ersten Sieg der Saison konnten die Handballer des TuS bei der SKV Mörfelden feiern. Nach einer umkämpften Partie setzte man sich verdient mit 29:23 (17:11) durch.</p><div align="justify">   </div><p align="justify">Griesheim startete konzentriert in das Spiel, schnell konnte man sich mit 3:0 absetzen (4. Minute). Dieser Vorsprung wurde durch eine homogene Angriffsleistung bis in die Mitte der ersten Hälfte gehalten (12:9). Ein anschließendes Überzahlspiel wurde durch den Rechtsaußen des TuS, Thomas Mischler, zum Ausbauen der Führung genutzt, so dass man mit einem 6-Tore-Vorsprung in die Kabine ging<br /><br /> </p><div align="justify"> </div><p align="justify">Dieser Vorsprung hielt zunächst auch zu Beginn der zweiten Hälfte, die nochmals an Spannung und Dramatik zulegen sollte. Beim Stand von 20:14 für den TuS versickerten die Angriffsbemühungen zunehmend in Einzelaktionen. Zusätzlich sah Rückraumspieler Max eine rote Karte und der zweite etatmäßige Halb-Linke Wurth verletzte sich am Oberschenkel. Da zu diesem Zeitpunkt kein weiterer Rückraumspieler auf dieser Position zur Verfügung stand musste Wurth angeschlagen weiterspielen. Diese Schwächephase konnten die Gastgeber und kamen bis auf 2 Tore heran (18:20). Dass das Spiel nicht komplett aus der Hand gegeben wurde, lag zum Großteil am wieder einmal prächtig aufgelegten Torhüter Bär, der einige Hochkaräter entschärfte. Gestützt von dem Rückhalt des Torhüters lief es in den Angriffsaktionen wieder besser und man konnte sich vorentscheidend auf 26:22 absetzen. Die anschließende offene Deckung der Mörfeldener spielte der flinken Griesheimer Mannschaft in die Karten, so dass man den Vorsprung weiter ausbauen und das Spiel letztlich mit 29:23 gewinnen konnte.</p><div align="justify">   </div><p align="justify">Nach durchwachsenem Saisonstart mit 1:5 Punkten konnte man durch den Sieg wieder Anschluss an das Mittelfeld erreichen (3:5 Punkte, Platz 8). Das nächste Spiel steht am kommenden Sonntag gegen den passabel gestarteten Aufsteiger HSG Nieder-Roden II an. Anpfiff in der Sporthalle der GHS ist wie gewohnt um 18.00<br /> </p>   <p>Torschützen: S. Müller, Zarko (je 6), Mehring (5/4), Max, T. Müller (je 3), Wurth, Hamel, Mischler (je 2)<br /><br />sh</p> <p><br /><br /> </p> ', '81.210.135.107'),
(91, 6, 5, '2008-04-13 22:26:48', '2007-10-07 00:00:00', 'article', 'HSG Mörfelden/Walldorf II - Herren II	16:20', '<strong>2. Mannschaft gewinnt erstes Spiel</strong> <p>In einem von beiden Mannschaften schwach geführten Spiel konnte sich die 2. Mannschaft gegen Mörfelden/Walldorf mit 20:16 durchsetzen. In der Abwehr stand man in der ersten Halbzeit stabil und ließ nur 5 Gegentore zu. Man versäumte aber im Angriff eine klare Führung herauszuspielen und so wurden die Seiten beim 10:5 gewechselt. Auch nach dem Wechsel setzte sich das zerfahrene Spiel bei beiden Mannschaften fort und am Schluss konnte man nur über den ersten Sieg mit 20:16 froh sein. </p><p>Es spielten: Kay Grund und Michael Helfmann im Tor, Alex Maschkow 1, Marcel Feldmann 1, Mario Schecker 6,Jan Rauschkolb 2, Ronald Bausch 1, Christian Döll 1, Martin Simmermacher 3, Dennis Killer und aus der A-Jugend: Kevin Herr 3, Tim Rinschen 2 und Dennis Bork.</p>', '84.167.108.31'),
(88, 11, 6, '2008-04-13 22:26:48', '2007-10-07 00:00:00', 'home', 'mJugendC1 - TV Kirchzell	31:32', '<p><strong><span style="font-family: Comic Sans MS; font-size: 24px"><span style="color: #339933">mC - TV Kirchzell</span></span></strong></p><p><span style="font-weight: bold"><span style="color: #339933; font-family: Comic Sans MS; font-size: 24px">31 : 32 (16 : 14)</span></span></p><p><span style="font-family: Times; font-size: 16px; font-weight: bold">&nbsp;</span></p><p><span style="font-size: 16px"><span style="color: #339933; font-family: Comic Sans MS">07.10.2007 - 14.00 Uhr</span></span></p><p><span style="font-family: Times; font-size: 16px"><span style="color: #339933; font-family: Comic Sans MS"><br /></span><span style="color: #339933; font-family: Comic Sans MS">Das erste Heimspiel mußte ohne etatmäßigen Torwart und mit nur einem Auswechselspieler denkbar knapp abgegeben werden. Die Mannschaft kämpfte trotz vorbildlich; insbesondere Patrick Pollner hatte einen starken Tag.</span></span></p><p><span style="font-size: 16px"><span style="color: #339933; font-family: Comic Sans MS">Es spielten: Malte Just; Sven Rinschen (10 Tore), Kai Feldmann (1 Tor), Darren Weber (6 Tore), Ricardo Wilhelm (1 Tor), Jan Döll (2 Tore), Marc Keller und Patrick Pollner (11 Tore).</span></span></p>', '84.58.215.236'),
(92, 9, 12, '2008-04-13 22:26:48', '2007-10-10 00:00:00', 'outwards', 'TSG Friesenheim - mJugendA	33:33', 'In einem Freundschaftsspiel gegendie TSG Friesenheim trennte sich die A-Jugend leistungsgerecht 33:33. In einem freundschaftlich geführten Spiel versuchten beide Mannschaften ihre spielerische Linie zu finden. Die Griesheimer taten sich mit dem harzverschmierten Ball zunächst schwer, fanden dann aber immer besser ins Spiel. So konnte sich das Team zur Halbzeit mit 2 Toren absetzen. Auch in der zweiten Halbzeit lagen die Griesheimer im vorne. Zum Schluß wurden aber gute Tormöglichkeiten nicht genutzt und die TSG konnte den Ausgleich erzielen. Den in der Schlusssekunde erhaltenen 7m-Wurf konnten die TuSÂ´ler aber nicht zum Siegtreffer nutzen. ', '217.224.113.239');
INSERT INTO `articles` (`id`, `cat_id`, `editor_id`, `last_update`, `date`, `type`, `title`, `text`, `ip`) VALUES
(94, 6, 5, '2008-04-13 22:26:48', '2007-10-14 00:00:00', 'article', 'Herren II - TV Groß Rohrheim	28:29', ' <p><strong>Knappe Niederlage der 2. Mannschaft</strong></p><p>Gegen Groß Rohrheim kam man die ersten 20 Minuten gut ins Spiel. Die 1:0 Führung durch Groß Rohrheim und auch die 2:1 Führung konnten schnell ausgeglichen werden in der Folgezeit konnte man selbst einen 4-Torevorsprung bis zur 20 Minute herausspielen. Mangelnde Konzentration in der Abwehr und leichte Fehler im Angriff brachten den Gegner allerdings wieder ins Spiel und mit 13.15 wurden die Seiten gewechselt. Nach dem Wechsel schaffte es die Mannschaft nach dem erstmaligen Gleichstand von 20:20 mit 22:20Toren in Führung zu gehen. Mangelnde Chancenauswertung und vermeidbare Fehler in der Abwehr brachten allerdings Groß Rohrheim wieder ins Spiel und am Schluss stand mit 28:29 die zweite knappe Heimspielniederlage zu Buche.</p><p>Es spielten: </p><p>Michael Helfmann und Christian Simmermacher im Tor, Alex Maschkow 9, Marcel Feldmann , Dirk Höhl 3, Martin Simmermacher 4, Jan Rauschkolb 2, Christian Döll 3, Dennis Killer 2, Tim Rinschen 2, Dennis Bork 3, Kevin Herr, Uwe Drechsler</p>', '84.167.88.43'),
(95, 3, 12, '2008-04-13 22:26:48', '2007-10-17 00:00:00', 'article', 'Herzlich Willkommen beim Griesheimer Jugendhandball', '<p><br /><br />Hallo, herzlich willkommen auf unserer Jugendseite! <br /><br /> Wir werden in die kommende Saison 2008/2009 mit 9 Jugendmannschaften starten.\r\nWieder möchten sich unsere Jungs der A-, B- und C-Jugend wie auch unsere Mädchen der C-Jugend für die hessische Oberliga qualifizieren. Die männliche E1-Jugend verliert aus beruflichen Gründen leider ihren langjährigen Trainer Christian Rechner - Danke Christian für die engagierte Jugendarbeit.\r\nAls "neuen" Trainer haben wir Klaus Feldmann gewinnen können, der das Team ab dem 07.04.2008 übernehmen wrid.\r\nAuch in der männlichen D-Jugend hat sich etwas verändert. Mit Manfred Lohnes\r\nübernimmt auch hier ein neuer Trainer das Team, der durch Martin Wurdak unterstützt\r\nwird. <br /> Für die männliche C-Jugend haben wir mit Thomas Weber einen neuen Trainer, mit Klaus Döll einen neuen Betreuer, gewonnen.\r\nKlaus Feldmann und Uwe Rinschen übernehmen die männliche B-Jugend. Nachdem nun die Spieler des Jg. 93 wieder mit den Spielern des Jg. 92 zusammengeführt wurden,\r\nwird das 92/93 Team mit dem ihnen vertraute Trainergespann wieder in die Erfolgsspur zurückkehren.\r\nDie männlicheA-Jugend, die weiterhin Uwe Rinschen trainiert wird, bekommt mit Dennis\r\nBork einen neuen Betreuer. Das Team wird, aufgrund der guten Erfahrungen der vergangenen Saison, auch zukünftig eine gemeinsame Trainingseinheit mit der ersten\r\nMännermannschaft absolvieren. Für die Torhüterinnen und Torhüter wird Axel Sturm in bekannter toller Weise weiterhin ein „Torwartstraining“ anbieten. Bei den Minis, der E2-, mC2- und der wC-Jugend hat sich hinsichtlich des Trainerstabs keine Veränderung gegeben.\r\nDiese Seite und die eingerichteten Links sollen Informationen zu allen Jugendteams vermitteln. Neue Handballerinnen und Handballer sind uns immer gern willkommen.\r\n<br /> <br />Viele Grüße<br /> Uwe Rinschen\r\n<br /></p>\r\n<p></p>\r\n<p>Griesheimer Handballjugend mit sehr guten Saisonergebnissen<br /><br /> Nachdem alle Jugendmannschaften die Saison 2007/2008 beendet haben, zog Jugendleiter Uwe Rinschen eine sehr zufriedenstellende\r\nBilanz.  Alle drei in der hessischen Oberliga gestarteten Mannschaften haben eine gute\r\nSaison gespielt. Die A-Jugend, die sich bis zur Saisonmitte einen guten 3.\r\nPlatz erspielte, musste sich am Ende mit einem 8. Platz zufrieden geben. Sicher\r\nist diese Platzierung, man steht punktgleich mit dem Tabellensechsten, auch auf\r\ndie erforderlichen Doppelansetzungen im Erwachsenenbereich zurückzuführen. Im Gegenzug\r\ndurften die Spieler aber auch wichtige Erfahrungen aus diesen Einsetzen\r\nmitnehmen und werden sicher davon in der kommenden Saison provitieren. Die B-Jugend,\r\ndie vom Verletzungspechs verfolgt wurde, konnte im letzten Spiel noch den 7. Platz der Oberliga erreichen.\r\nDie männliche C-Jugend schloss die Saison mit einem sehr guten 2. Platz ab. Wäre\r\ndas unsportliche Verhalten des TV Kirchzell nicht gewesen, hätte die Mannschaft\r\nvielleicht noch einen besseren Saisonabschluß feiern können. In einem tollen\r\nSpiel schlug das Team die JSG Wallstadt, den späteren Hessenmeister, mit 30:21\r\nund fügte so den Wallstädtern die einzigste Saisonniederlage zu. In der\r\nBezirksoberliga der weiblichen C-Jugend war die Mannschaft des TuS\r\nunbezwingbar. Alle Spiele konnten deutlich gewonnen werden. So gewannen die\r\nMädchen verdient die Bezirksoberliga und durften die Ehrung vom\r\nBezirksjugendwart entgegennehmen. Die Jungs der männlichen C2 hielten sich\r\nwacker in der Bezirksliga und erreichten einen guten vierten Platz. Die Jungs\r\nder E1 haben ebenfalls eine toll verlustpunktfreie 2. Saisonhälfte gespielt und\r\nstehen so verdient auf dem ersten Tabellenplatz. Die E2 hat in der 2.\r\nSaisonhälfte in einer anderen Gruppe spielen dürfen und konnten so auch ihre\r\nErfolgserlebnisse feiern. \r\nAn dieser Stelle möchte die Jugendleitung\r\nden Trainern, Eltern und Fans wie natürlich auch allen Spielerinnen und\r\nSpielern für ihren Einsatz in der Saison 2007/2008 ganz herzlich danken.</p>', '192.166.56.36'),
(96, 3, 12, '2008-04-13 22:26:48', '2007-10-17 00:00:00', 'article', 'Trainingszeiten der Handballjugend', '<p>Ab dem 07.04.2008 gelten für die Minis bis zur A-Jugend neue Trainingszeiten:</p>\r\n<p><span style="text-decoration: underline;">Mini</span></p>\r\n<p>Trainer: Manfred Lohnes<br />Freitag, 14:30 - 16:00 (GHS)</p>\r\n<p><span style="text-decoration: underline;">F-Jugend - Jg. 00/01</span></p>\r\n<p>Trainer: Frank Ritter<br />Dienstag, 15:30 - 17:00 (GHS)<br />Donnerstag, 14:30 - 16:00 (GHS)</p>\r\n<p><span style="text-decoration: underline;">E1-Jugend - Jg. 98/99</span></p>\r\n<p>Trainer: Klaus Feldmann<br />Montag, 15:30 - 17:00 (GHS)<br />Mittwoch, 15:30 - 17:00 (KBH)</p>\r\n<p><span style="text-decoration: underline;">E2-Jugend - Jg. 98/99</span></p>\r\n<p>Trainer: Christian Lehmkühler<br />Montag, 15:30 - 17:00 (GHS)<br />Mittwoch, 15:30 - 17:00 (KBH)</p>\r\n<p><span style="text-decoration: underline;">D-Jugend - Jg. 96/97</span></p>\r\n<p>Trainer: Manfred Lohnes und Martin Wurdak<br />Dienstag, 17:30 - 19:00 (KBH)<br />Donnerstag, 16:00 - 17:30 (KBH)</p>\r\n<p><span style="text-decoration: underline;">mC2-Jugend - Jg. 94/95 </span></p>\r\n<p>Trainer: Sascha Gleißner <br />Dienstag, 16:00 - 17:30 (KBH)<br />Freitag, 15:00 - 16:30 (GHS)</p>\r\n<p><span style="text-decoration: underline;">wC-Jugend - Jg. 94/95 </span></p>\r\n<p>Trainer: Klaus Feldmann <br />Mittwoch, 17:00 - 19:00 (GHS)<br />Freitag, 16:00 - 17:45 (GHS)</p>\r\n<p><span style="text-decoration: underline;">mC1-Jugend - Jg. 94/95 </span></p>\r\n<p>Trainer: Thomas Weber und Klaus Döll<br />Dienstag, 17:00 - 19:00 (GHS)<br />Freitag, 17:45 - 19:30 (GHS)</p>\r\n<p><span style="text-decoration: underline;">B-Jugend - Jg. 92/93</span></p>\r\n<p>Trainer: Klaus Feldmann und Uwe Rinschen <br />Montag, 17:00 - 18:30 (GHS)<br />Donnerstag, 17:30 - 19:00 (KBH)<br />Freitag, 19:30 - 21:00 (GHS)</p>\r\n<p><br /><span style="text-decoration: underline;">A-Jugend - Jg. 90/91 </span></p>\r\n<p>Trainer: Uwe Rinschen <br />Montag, 18:30 - 20:00 (GHS) <br />Donnerstag, 19:00 - 21:00 (KBH)<br />Freitag, 19:30 - 21:00 (GHS)</p>\r\n<p><br /><span style="text-decoration: underline;">Kontakt zu den Handballern: <br /></span><br />Für Mini-, F-, E- und D-Jugend:<br />Stellvertr. Jugendleiterin Claudia Döll, Tel. 06155/836515<br />E-Mail: claudia@asd-schaefer.de<br /><br />Für A-, B- und C-Jugend:<br />Jugendleiter Uwe Rinschen, Tel. 06155/79197 <br />E-Mail: tusgriesheim.jugendleiter@t-online.de <br /><br />Abteilungsleiter Manfred Lohnes, Tel. 06155/4506</p>', '217.224.73.242'),
(98, 9, 9, '2008-04-13 22:26:48', '2007-10-21 00:00:00', 'home', 'mJugendA - TV Petterweil	33:32', '<p>Die A-Jugend hatte den in der Tabelle direkt hinter Ihnen liegende TV Petterweil zu Gast. Schon in der Vorbereitung hatte man sich mit Ihnen gemessen und knapp verloren. Mit einer im Gegensatz zum Gegner voll besetzten Auswechselbank machten die TUSÂ´ler von Anfang an Dampf, doch konnte man sich trotz einer kleinen Überlegenheit bis zum 12:11 nicht absetzen. Dann aber lief es Dank Zeitstrafen des Gegners besser für den TUS und zur Halbzeit konnte man mit 17:12 in Führung gehen. Die zweite Hälfte begann mit einem schnellen Torreigen auf beiden Seiten, doch derVorsprung blieb bis zum 28:23 gewahrt. Danach begann eine sehr hektische Phase bis ca. 5 Minuten vor Schluß, in der es etliche fragwürdige aber auch berechtigte Zeitstrafen auf beiden Seiten gab, diePetterweil jedoch besser nutze und zum 32:32 kurz vor Schluß ausgleichen konnte. Schließlich hatte Tim Rinschen in der letzten Spielminute den Treffer zum 33:32 Endstand erzielen können. Ein Gegenangriffließ alle nocheinmal zittern, blieb aber zum Glück erfolglos. Trotz des knappen Ergebnisses war der Sieg verdient. Mit 4:2 Punkten befindet man sich nun in der oberen Tabellenhälfte.</p><p>Es spielten: Steffen Vogel, Tim Ulmrichund Yannick Hassenzahl im Tor, Daniel Arenz (1), Stefan Siebert, Dennis Bork, Benjamin v. Stein (1), Tim Patrazlek (3), Lucas Baier (5), Björn Ehmke (6/3), Kevin Herr (3), Tim Rinschen (12/1) und Miro Hinkel (2)</p>', '84.58.196.32'),
(99, 5, 3, '2008-04-13 22:26:48', '2007-10-21 00:00:00', 'article', 'Herren 1 - TV Groß Zimmern	32:28', '<p><strong>Ein Spiel in dem nur </strong><strong>Punkte zählen</strong><br />TuS Griesheim - TV Groß-Zimmern (Hz. 17:14) 32:28</p><p align="justify">Im dritten Heimspiel der Griesheimer Jungs sollte endlich der erste Heimsieg gegen den TV Groß-Zimmern gefeiert werden. Vor Beginn der Saison hätte jeder, der sich ein bisschen mit der Landesliga Süd auskennt auf einen klaren Sieg der Griesheimer getippt. Doch nach den ersten Spielen der 1. Mannschaft des TuS Griesheim muss man sich eingestehen, dass es ein sehr durchwachsender Saisonstart war, vor allem das verlorenen Spiel gegen SKG Roßdorf und die schwachen Vorstellungen in eigener Halle. So war der Ausgang dieses Spiel völlig offen.    </p><p><strong>Nun galt es für die Spieler den Kopf frei zu machen um einen Sieg einzufahren, egal wie!</strong></p>      <p align="justify">Die Personaldecke der Mannschaft ist weiterhin eng. So musste man ohne die Verletzten Ralf Höhl, Benjamin Sirker und berufliche verhinderten Damir Zarko und Marcus Kuhnke auskommen. Die Mannschaft wurde jedoch ergänzt durch zwei Spieler aus der A-Jugend Tim Rinschen &amp; Dennis Bork sowie Till Brandenburger.</p><div align="justify">  </div><p align="justify">Das Spiel begann gut für Griesheim, die sich schnell mit 2-3 Toren absetzen konnten, im Rückraum und über die Außen konnten Akzente gesetzt werden. Jedoch stand die Abwehr, vor allem der Mittelblock nicht so wie er sollte. Der Trainer reagierte und brachte Dennis Bork ins Spiel, der von beginn an die Abwehr sichtlich verstärkte. Oliver Schmand konnte durch zwei parierte 7-Meter den Vorsprung verteidigen. Das Tempospiel der Griesheimer funktionierte besser wie in den vorigen Spielen, so dass die erste Halbzeit mit 17:14 an Griesheim ging.</p><div align="justify">    </div><p align="justify">Der Start in die zweite Hälfte gelang den Griesheimer Jungs nicht wirklich. Das Spiel wurde enger und enger, bis TV Groß-Zimmer in der 45. Spielminute erstmal in Führung ging 22:23.</p><div align="justify">      </div><p align="justify">Die Griesheimer spielten im Angriff ohne Idee, weder Rückraum noch Kreis konnten sich Torgelegenheiten erarbeiten. Aber auch Groß-Zimmern tat sich schwer und konnte gegen die nun wieder besser stehende Abwehr keine guten Aktionen landen. Griesheim fand langsam wieder zu seinem Spiel im Angriff, auch Till Brandenburger setzte nun wichtige Treffer. Der Gegner baute nun konditionell ab und wurde sichtlich unsicherer, welches sich in technischen Fehlern widerspiegelte. TuS Griesheim konnte diese Fehler nutzen und einen 5 Tore Vorsprung herausspielen. Dieser wurde in den letzten Minuten sicher verwaltet. Das Spiel endete mit 32:28 für TuS Griesheim. </p><div align="justify">  </div><p align="justify">Das Spiel war kein schönes Spiel, jedoch waren die zwei Punkte umso wichtiger für das Selbstbewusstsein und für das kommende Auswärtsspiel in Babenhausen.</p>  ', '195.212.29.187'),
(100, 10, 5, '2008-04-13 22:26:48', '2007-10-21 00:00:00', 'home', 'mJugendB - HSG Hochheim/Wicker	29:25', ' <p><strong>B-Jugend gewinnt gegen Hochheim/Wicker</strong></p><p>Hochheim/Wicker hatte den besseren Start und konnte durch schnelle Tore des rechten Rückraumspielers mit 3:1 in Führung gehen. Bis zum 5:5 war das Spiel dann ausgeglichen bevor sich der Gegner auf 9:5 absetzen konnte. Ein Wechsel in der Abwehr und Einzelaktionen von Marvin Gernandt auf Linksaußen brachte die Mannschaft wieder heran und zur Pause führte man mit 14:13 Toren. In der 2. Spielhälfte konnte die Führung konstant ausgebaut werden und beim Stand von 25:19 führte man erstmals mit 6 Toren Vorsprung. Mangelnde Chancenverwertung in den Schlussminuten verhinderte ein höheres Ergebnis und am Schluss gab es einen verdienten Sieg mit 29:25 Toren. </p><p>Es spielten:</p><p>Christian Kindermann im Tor, Erik Neumann 6, Andreas Margarit, Arseniy Zankov 3, Jan Eidemüller 2, Fabian Seigfried 1, Marvin Gernandt 8, Jan Tachtler, Sven Rinschen 1, Jan Döll 7 und Kai Feldmann 1.</p>', '84.167.96.47'),
(101, 6, 5, '2008-04-13 22:26:48', '2007-10-21 00:00:00', 'article', 'Herren II - TV Lampertheim	18:30', ' <p><strong>2. Mannschaft kommt unter die Räder</strong></p><p>Gegen Lampertheim hatte die 2. Mannschaft Probleme mit dem schnellen Spiel der Gäste.In der Anfangsphase agierte man in der Abwehr zu offensiv und so konnten sich die Spieler aus Lampertheim immer wieder über den Kreis und mit 1gegen 1 Aktionen gut in Szene setzen. Da man auch im Angriff die nötige Durchschlagskraft vermissen ließ, stand es zur Pause 17:9 für die Gäste. Eine Umstellung in der Abwehr von 3:2:1 auf 6:0 brachte dann mehr Stabilität in die Aktionen der TUS konnte aber die deutliche 18:30 Niederlage nicht abwenden. </p><p>Es spielten:</p>Kay Grund, Christian Simmermacher und Michael Helfmann im Tor, Martin Simmermacher 5, Dennis Killer 3, Marcel Feldmann 1, Uwe Drechsler 2, Christian Döll 1, Dirk Höhl 2, Ronald Bausch 3, Sascha Weikert 1, Jan Rauschkolb und Heiner Lenkering', '84.167.89.8'),
(102, 5, 3, '2008-04-13 22:26:48', '2007-10-23 00:00:00', 'article', 'Vorbericht: SG Rot-Weiß Babenhausen - TuS Griesheim 28.10.2007 18:30 Uhr', '<div align="justify">Die 1. Mannschaft des TuS Griesheim reist am kommenden Samstag zum Auswärtsspiel nach Babenhausen, trainiert von Josef Seidel. Der Gegner ist gut in die Runde gestartet. Die Spielstärke des Gegners spiegelt sich in den Ergebnissen wieder, ein Unentschieden gegen den TSV Pfungstadt sowie der deutliche Sieg gegen Nider-Roden II. Es gilt für die Griesheimer weiter an sich zu Arbeiten und im Rückraum sowie am Kreis zurück zu Ihrer Form zu finden. Die letzten zwei Begegnungen gegen Babenhausen konnten die Griesheimer für sich entscheiden, wobei beide Begegnungen in der letzten Runde sehr umkämpft waren. Ein Sieg würde Griesheim nicht nur in der Tabelle ein gutes Stück nach vorne bringen.<br /></div><p>Weiterhin Verletzungsbedingt nicht dabei Benjamin Sirker &amp; Ralf Höhl</p>  ', '195.212.29.179'),
(318, 14, 5, '2008-04-28 11:28:17', '2008-04-24 00:00:00', 'article', 'D-Jugend 2008/2009', '<p>Die D-Jugend der Handballer hat sich neu formiert. Der Jahrgang 1997 ist aus der E-Jugend aufgerückt und somit ist wieder ein starkes Team zusammen.</p>\r\n<p>Trainingszeiten:</p>\r\n<p>Dienstag     17.00 Uhr bis 19.00 Uhr</p>\r\n<p>Donnerstag 16.00 Uhr bis 17.30 Uhr</p>\r\n<p>jeweils in der Kirchberghalle.</p>\r\n<p>Die Truppe startet in Kürze mit der Qualifikation zur Bezirksoberliga. Bilder und Berichte folgen.</p>', '84.167.82.15'),
(352, 52, 5, '2008-08-07 12:27:38', '2008-08-07 00:00:00', 'article', 'Ein Lehrjahr für unsere D-Jugendmannschaften', '<p> Im April dieses Jahres formierten sich die Jahrgänge 1996/1997 wieder zu einer schlagkräftigen Mannschaft zusammen.  Leider konnte in der letzen Saison keine D-Jugend am Spielbetrieb teilnehmen, da der Jahrgang 95 schon in die C-Jugend aufgerückt war und der verbliebene Rest somit kein vollständiges Team stellen konnte. Dies änderte sich aber im Frühjahr, als dann 14 Kids aus der E-Jugend aufrückten. Zusammen wollte man versuchen, die Qualifikation für die Bezirksoberliga zu erreichen. Dieses Ziel konnte leider nicht erreicht werden, traf man doch überwiegend auf körperlich deutlich überlegene Gegner. </p>\r\n<p>Erfreulicherweise stehen jedoch in der kommenden Saison dem Trainergespann Manfred Lohnes und Martin Wurdak so viele Kids zur Verfügung, dass sogar zwei Teams in der Bezirksliga antreten können. Voraussichtlich wird es eine spielerisch stärkere Mannschaft geben und eine Zweite, bei der man durch mehr Spielpraxis das Leistungsniveau schnell fördern will. Jedenfalls kann man getrost sagen, dass die Spielzeit 2008/2009 für alle Beteiligten ein Lehrjahr darstellt.</p>\r\n<p>Nach der verpassten Qualifikation spielte die D-Jugend einige Turniere mit den unterschiedlichsten Ergebnissen. Auch zur Saisonvorbereitung standen Turniere und Testspiele an. Es ist davon auszugehen, dass die Trainer bis zum Saisonstart vor allem in punkto Kraft und Athletik  weiter nach vorne bringen, um auch gegen körperlich starke Mannschaften bestehen zu können. Allerdings wird auch der Umgang mit dem Ball nicht vernachlässigt. Sollte es gelingen, Laufbereitschaft und Kampfkraft mit Ballsicherheit und Spielverständnis zu kombinieren, sind sicher viele Erfolge möglich.</p>\r\n<p>Auch außerhalb der Sporthalle ist sicher wieder der eine oder andere Event geplant. Die rührige Elternschaft versucht stets im Hintergrund, den Teamgeist weiter zu fördern. So steht bestimmt wieder der Besuch eines Bundesligaspiels oder beispielsweise ein Abenteuerausflug auf dem Programm.</p>', '84.167.113.60'),
(319, 47, 9, '2008-04-27 22:51:14', '2008-04-27 00:00:00', 'home', 'mA Jugend - SG Arheilgen	34:35', '<p>Im vorletzten Qualifikationsspiel auf Bezirksebene hatte die A-Jugend die SG Arheilgen zu Gast. Das Spiel begann zerfahren mit vielen vergebenen Chancen auf beiden Seiten bis nach einer 2 Minuten-Strafe gegen Torhüter Hassenzahl wegen Meckerns Steffen Vogel eingewechselt wurde und gleich einen 7m Strafstoß parierte. Von einem 9:8 konnte man sich dann  auf 14:9 absetzen. Über eine 17:14 Halbzeitführung kam es um die 38. Spielminute zu gleich drei Zeistrafen gegen Arheilgen, eine davon als rote Karte gegen den bereits zuvor bestraften Trainer. Doch die Griesheimer konnten diesen Vorteil nicht nutzen und die Gäste konnten gar zum 26:26 ausgleichen. In den verbleibenden 15 Minuten wechselte sich die Führung ab doch zum Schluß war Arheilgen in einem spannenden Spiel mit 34:35 der glückliche Gewinner. Auch wenn das Spiel seitens der Gäste recht hart geführt wurde, hätte man von den Griesheimern mehr erwarten müssen. Trotz der Niederlage führt man die Tabelle weiter an und spielt am nächsten Mittwoch auswärts gegen Bonsweiher.  </p>\r\n<p>Es spielten: Yannick Hassenzahl und Steffen Vogel im Tor, Daniel Arenz, Benjamin v. Stein (4), Tim Patrzalek (4), Maximilian Bopp (2), Lukas Baier (2), Björn Ehmke (3), Jan Tachtler (2), Christoph Rampelt (3), Tim Rinschen (9), Miro Hinkel (4) und Marvin Haller (1) - TV</p>', '84.59.11.144'),
(108, 8, 11, '2008-04-13 22:26:48', '2007-10-28 00:00:00', 'outwards', 'FSG Büttelborn - Damen	20:24', ' <p><strong><u>Spielbericht TUS Griesheim Handball Damen</u></strong></p><p><strong>TUS Damen gewinnen das Derby in Büttelborn</strong></p><p>Die Handballerinnen des TUS Griesheim kamen im Derby bei der FSG Büttelborn zu einem 24:20 Auswärtserfolg. Nach einem schnellen 0:2 Rückstand, fanden sich die Büttelborner Mädels ins Spiel und die wiedergenesene Susen Schäfer konnte zum 2:2 ausgleichen. Marion Feldmann und wieder S. Schäfer brachten die Griesheimerinnen mit 4:2 in Front, doch die Freude warte nicht lange, den die Gastgeberinnen konterten prompt und glichen zum 4:4 aus. Wiederum die starke S. Schäfer traf zum 5:4 mit einem Wurf aus der Distanz. Jetzt kam eine tolle Phase von Nicole Spiller im Tor der TUS die ihren ersten 7 Meter halten konnte, Dann klatschten zwei 7 Meter, diesmal für Griesheim, an den Pfosten und ins Seitenaus, ehe S.Schäfer auf 6:4 erhöhte. N. Spiller fischte noch einen Siebener und Paola Vladimirov traf zum 7:4. Die kampfstarken Gastgeber konterten und kamen zum 7:6 Anschluss und schafften den 8:8 Ausgleich. Griesheim traf nicht ins Tor in dieser Phase, so dass die Büttelbornerinnen sogar auf 10:8 davonzogen. Zwei weitere 7 Meter, diesmal sicher verwandelt durch S. Schäfer brachten den 10:10 Halbzeitstand. Weiter so kämpfen im Defensivverbund und druckvoll auf die Abwehr das waren die Vorgaben von Griesheims Trainer Christian Matzel in der Pause. S. Schäfers 7 Meter traf noch nicht den Kasten, doch schon wenig später zappelte der Ball durch die gleiche Spielerin zum 11:10 im Netz. Nun legten die Gastgeberinnen vor um kamen zum 13:11. Doch die Griesheimerinnen hatten sich heute einiges vorgenommen. Sie fighteten weiter und kamen durch Brigitte Suchland und P. Vladimirov zum 13:13 Ausgleich. Das 14:14 warf wieder B. Suchland, die sich nun immer besser in Szene setzen konnte. Bei den Gästen stand nun Tina Thiele im Tor die gleich einen weiteren 7 Meter abgriff. Griesheim erhöhte nun wieder das Tempo und zwei Tore von S. Schäfer sowie P. Vladimirov und die Gäste führten mit 17:14 Toren. Zum18:15 traf B. Suchland aus dem linken Rückraum und zum 19:16 Vanessa Gandenberger von der linken Außenbahn. S. Schäfer erhöhte auf 20:16 doch jetzt kämpften sich die Büttelbornerinnen wieder heran und verkürzten af 20:18 ehe S.Schäfe und B. Suchland mit dem 22:19 die Vorentscheidung brachten. Griesheims Treffer zum 24:20 Endstand erzielte P. Vladimirov mit einem Doppelpack.</p><p>Dieser schöne Auswärtssieg wird sehr getrübt durch die schweren?! Verletzungen von Marion Feldmann und Nicole Spiller jeweils Fuß und Silke Drechsler am Knie. <strong>Den Mädels wünschen wir alles Gute</strong>.</p><p>So kommt die kleine Pause für Griesheim am kommenden Wochenende zum richtigen Zeitpunkt. Am 11.11.2007 kommen die starken Gäste aus Fürth/Krumbach nach Griesheim. Das Spiel, ist schon um 14:00 in der Griesheimer GHS Halle.</p><p>Das TUS Team um Trainer Christian Matzel spielte mit</p><p>Tina Thiele und Nicole Spiller im Tor</p><p>Silke Drechsler, Brigitte Suchland 4, Paola Vladimirov 5</p><p>Meike Dornbach, Laura Posteraro, Sandra Ribbe, </p><p>Susen Schäfer 13/5, Vanessa Gandenberger 1, Marion Feldmann 1 </p>', '89.12.124.6'),
(109, 5, 17, '2008-04-13 22:26:48', '2007-10-28 00:00:00', 'outwards', 'SG Babenhausen - Herren 1	29:29', '  <p><span><span style="font-size: 10.5pt">Gute Leistung wird nur mit einem Punkt belohnt</span></span></p>  <p><em>Mangelnde Disziplin kostet einen Punkt</em></p>  <p>&nbsp;</p>  <p>In einem Landesligaspiel auf gutem Niveau trennten sich die Handballmannschaften des TUS Griesheim und der SG Babenhausen unentschieden mit 29:29 Toren. Die Griesheimer lagen über weite Strecken des Spiels knapp in Führung, doch einige Konzentrationsfehler und undiszipliniertes Verhalten kosteten am Ende den Sieg.</p>  <p>&nbsp;</p>  <p>Griesheim fand schnell ins Spiel. Die Abwehr war gut auf den Gegner eingestellt und konnte die Angriffe der SG Babenhausen häufig unterbinden. Außerdem hatten die Mannschaft mit Oliver Schmand einen sehr starken Rückhalt, der über das ganze Spiel viele gute Gelegenheiten der SG entschärfen konnte. Aus der stabilen Abwehr heraus kamen die Griesheimer einige Male per Tempogegenstoß zum Torerfolg und auch im Postionsspiel lief es gut. So konnten sich die Griesheimer gegen Ende der ersten Hälfte auf 14:10 absetzen. Doch nun ließ die Konzentration der Griesheimer nach, unnötige Ballverluste und vergebene Chancen waren die Folge. Dadurch schaffte es Babenhausen innerhalb weniger Minuten zum Halbzeitsstand von 14:14 auszugleichen.</p>  <p>&nbsp;</p>  <p>Zum Glück ließen sich die Griesheimer dadurch nicht beeindrucken und fanden zu Beginn der zweiten Halbzeit schnell ins Spiel zurück. Die beiden Mannschaften schenkten sich nichts und es entwickelte sich ein spannendes Spiel. Gegen Mitte der zweiten Halbzeit sah Thomas Mischler die rote Karte und durch eine weitere 2-Minuten-Strafe waren die Griesheimer in doppelter Unterzahl. Aber auch in dieser Phase kämpften die Griesheimer weiter und konnten durch David Max sogar in Unterzahl einen Treffer erzielen. Der weitere Spielverlauf gestaltete sich ausgeglichen, wobei Griesheim immer ein Tor vorlegte. Doch in den letzten Minuten schlichen sich wieder unnötige Fehler ein, freie Chance wurden vergeben und man handelte sich eine komplett überflüssige Hinausstellung ein. Hierdurch wurde verhindert, dass man sich vorentscheidend absetzen konnte. Dennoch schafften es die Griesheimer durch Kampf auch 60 Sekunden vor Schluss bei eigenem Ballbesitz mit einem Tor in Führung zu legen.</p>  <p>&nbsp;</p>  <p>Doch der Ball wurde durch einen riskanten Pass 40 Sekunden vor Schluss verloren und so hatte Babenhausen den letzten Angriff. Die SG setzte alles auf eine Karte und wechselte für den Torhüter einen siebten Feldspieler ein. Wenige Sekunden vor dem Ende der Partie bekam die SG Babenhausen einen Siebenmeter zugesprochen, den sie zum letztlich verdienten Unentschieden verwandeln konnten (29:29).</p>  <p>&nbsp;</p>  <p>Die Griesheimer boten eine engagierte und gute Leistung. aber leider kosteten mangelnde Disziplin und unnötige Fehler einen Punkt.</p>  <p>&nbsp;</p>  <p>Torschützen: Mehring (8/2), S. Müller (6), Zarko (5/1), Max (4), Wurth (4) und Hamel (2)</p>  ', '89.60.213.121'),
(110, 6, 5, '2008-04-13 22:26:48', '2007-10-28 00:00:00', 'article', 'HSG Bensheim/Auerbach - Herren II	25:31', ' <p><strong>Überraschender Sieg der 2. Mannschaft in Bensheim</strong></p><p>Im Abschlusstraining am Donnerstag war noch nicht klar, wer zum Spiel gegen Bensheim/Auerbach auflaufen wird. Um so erfreulicher, dass die Mannschaft mit einer konzentrierten Leistung über 60 Minuten den 2. Saisonsieg einfahren konnte. Das Spiel in Bensheim begann mit Vorteilen für die Gastgeber. Mit Gegenstößen und schnellen Ballpassagen konnten sie Benheim/Auerbach im wieder gut in Szene setzen. Mit zunehmender Spieldauer und über eine stabile Abwehr kam Griesheimdann aberbesser ins Spiel und führte zur Halbzeit mit 2 Toren (15:13). Nach dem Seitenwechsel war das Spiel lange Zeit ausgeglichen. Erst in den letzten 10 Minuten gelang es gegen die jetzt immer offensiver spielenden Gastgeber in 1gegen 1 Aktionen und schnellen Kontern die Führung auszubauen und mit 31: 25 den 2. Auswärtssieg klar zu machen. Gut in die Mannschaft eingeführt hat sich Neuzugang Sven Schürer mit 4 wichtigen Toren aus dem Rückraum.</p><p>Es spielten: </p><p>Kay Grund im Tor, Dirk Höhl 7, Ronald Bausch 8, Christian Döll 2, Christian Lehmkühler 1, Sven Schürer 4, Sascha Weikert 2, Kevin Herr 2, Dennis Killer 4 und Heiner Lenkering 1</p>', '84.167.89.8'),
(111, 10, 5, '2008-04-13 22:26:48', '2007-10-28 00:00:00', 'article', 'HSG Dutenhofen/Münchholzhausen - mJugendB	34:28', ' <p><strong>Vermeidbare Niederlage der B-Jugend gegen Dutenhofen/Münchholzhausen</strong></p><p>Die B-Jugend trat ohne die verletzten bzw. erkrankten Jan Eidemüller und Kai Feldmann gegen den Tabellennachbarn aus Dutenhofen/Münchholzhausen an. Nach anfänglichen Vorteilen auf Seiten der Gastgeber kam Griesheim über eine gute Abwehr und diszipliniertem Angriffsspiel besser ins Spiel und konnte gegen die körperlich robusten Spieler des Gegners mit 17:13 zur Halbzeit in Führung gehen. Nach dem Wechsel erhöhte der Gegner das Spieltempo und konnte beim Stand von 19:19 erstmals ausgleichen. Unnötige und überhastete Wurfversuche sowie technische Fehler im Angriff führten zu schnellen Toren des Gasgebers. Da man auch in der Abwehr nicht mehr so konsequent stand, wurde das Spiel in den Schlussminuten noch deutlich mit 34:28 verloren.</p><p>Es spielten:</p><p>Christian Kindermann und Andreas Gerhard im Tor, Erik Neumann 7, Andreas Margarit 3, Arseniy Zankov 6, Fabian Seigfried 3, Marvin Gernandt 4, Jan Tachtler 1, Sven Rinschen 2 und Jan Döll 2 </p>', '84.167.89.8'),
(139, 13, 6, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'home', 'wJugendC - SG Arheilgen	46:17', 'wC - SG Arheilgen\r\n\r\n46 : 17 (19 : 14)\r\n\r\n \r\n\r\n18.11.2007 - 12.00 Uhr\r\n\r\n \r\n\r\n\r\nIm Heimspiel gegen Arheilgen wurde in der 1. Halbzeit das Abwehrspiel vernachlässigt, so dass der Gegner zu einfachen Treffern kam. Nach der Pause waren dann alle Mannschaftsteile gleich stark.\r\nEs spielten: Lea-Maria Wenzel (4 Tore), Katharina Schuldt (9 Tore), Katrin Feldmann (9 Tore), Denise Großheim (8 Tore), Mayra Janssen (1 Tor), Lena Kuhl (5 Tore), Fabienne Suhe (1 Tor), Chiara Janssen, Nadja Spilok (3 Tore), Mara König, Tanja Birli (5 Tore) und Lea Jung (1 Tor).', '217.224.60.175'),
(113, 9, 12, '2008-04-13 22:26:48', '2007-10-30 00:00:00', 'article', 'Vorschau: mAJ - JSG Odenwald/TSG Münster', '<p>In dieser Woche stehen gleich zwei schwere Spiele der A-Jugend in der Handball-Oberliga an. Mit der JSG Odenwald steht am Donnerstag in Kirchbrombach ein bereits aus der Qualifikation bekannter Gegner auf dem Feld. Das erste Spiel gegen die Odenwälder wurde mit 19:21 verloren, somit rechnet sich das Griesheimer Team zumindest ein gutes Ergebnis aus.</p><p>Am Sonntag, um 14:00 Uhr, wird die Nachwuchsmannschaft des 2. Bundesligisten TSG Münster in der GHS erwartet. Gegen den verlustpunktfreien Tabellenführerwurde bereits auf einem Turnier gespielt. Damals konnten die Griesheimer bereits einiges vom schnellen Spiel der Taunusstädter lernen. Auch diesmal wird im Vordergrund stehen, das Ergebnis so lange wie möglich offen zu halten, vom Gegner zu lernen und sich als Mannschaft zu präsentieren.</p>', '217.224.65.14'),
(114, 9, 12, '2008-04-13 22:26:48', '2007-11-01 00:00:00', 'article', 'JSG Odenwald - mJugendA	29:25', '<p>In einem spannenden Spiel in der Handball Oberliga unterlag die A-Jugend 29:25 bei der JSG Odenwald. In der Qualifikation verlor das Team von Uwe Rinschen bereits gegen die starken Odenwälder und wollte sich revanchieren. Konzentriert wurde das Spiel angegangen und so konnte eine leichte Führung erarbeitet werden. Es entwickelte sich ein ausgeglichenes Spielin dem dieJSG Odenwald zur Halbzeitmit 14:13 in Führung ging. Auch nach der Halbzeit blieb der Spielverlauf spannend. Keine der Mannschaften konnte sich entscheidend absetzen. Gerade in der Phase, in der die Odenwälder Tim Rinschen in Manndeckung nahmen, glänzte Benjamin v. Stein nicht nur als Anspieler, sondern erzielte wichtige Tore. 2 Minuten vor Schluß, beim Spielstand von 25:23 versuchten die Griesheimer mit sehr schnellen Abschlüssen und einer offenen Deckung wenigstens noch einen Punkt aus dem Odenwald mitzunehmen. Leider war das Glücknicht mit den Griesheimern und so verlor man am Ende 29:25. Dennoch war der Trainer und die mitgereisten Fans mit der Leistung ihres Teams sehr zufrieden, zumal 4 Spieler verletzt fehlten. An dieser Stelle ein Dank an Fabian Seigfried aus der B-Jugend, der die Mannschaft unterstützte. Es spielten: Steffen Vogel und Yannick Hassenzahl im Tor, Stefan Siebert (1), Daniel Arenz (1), Dennis Bork (2), Benjamin v. Stein (6), Tim Patrzalek (3), Fabian Seigfried, Kevin Herr (1), Tim Rinschen (9) undMiro Hinkel (2).</p>', '217.224.122.115'),
(115, 15, 14, '2008-04-13 22:26:48', '2007-11-03 00:00:00', 'home', 'mJugendE1 - HSG Erfelden	31:8', ' <h1>E1 ohne Probleme</h1><p>&nbsp;</p><p>Am vergangenen Wochenende hatte die E1 der Handballjugend die HSG Erfelden zu gast. Ohne Probleme konnte diese Begegnung mit 31:8 gewonnen werden. Bereits zur Halbzeit führten die Griesheimer Kids mit 17:5 und kamen zu keiner Zeit des Spieles in Bedrängnis. Bei etwas konzentrierterer Spielweise hätte der Erfolg noch deutlicher ausfallen können. Aber mit der hohen Führung im Rücken wurden auch einige Kabinettstückchen probiert, die nicht alle gelangen. Aber das muss auch mal sein!</p><p>Es spielten: Becker (1 Tor), Birli (2), Feldmann (4), Flügger (1), Fritzsche (1), Hartmann (1), Jacquot (9), Posocco, Reuter, Schupp (3) und Türke (9)</p>', '84.58.250.230'),
(116, 9, 12, '2008-04-13 22:26:48', '2007-11-04 00:00:00', 'article', 'mJugendA - TSG Münster	28:31', 'Die A-Jugend hatte den Tabellenführer der Oberliga, den TSG Münster zu Gast. Für die erkrankten Tim Ulmrich und Lukas Baier spielten die beiden B-Jugendlichen Marvin Gernandt und Fabian Seigfried. Beide konnten sich in die Torschützenliste eintragen und ernteten dafür viel Applaus. Die Griesheimer hatten einen fulminanten Start und leisteten sich in Abwehr und Angriff keinerlei Fehler. Hinzu kam, das Torhüter Steffen Vogel hervorragende Leistung brachte und einige 100%ige vereitelte. So konnte man 6:3 in Führung gehen, die man bis kurz vor der Pause halten konnte. Erst eine Manndeckung des besten Griesheimer Torschützen Tim Rinschen brachte den Angriff ins stocken und in Folge den Gegner zum Halbzeitstand von 16:16 heran. Die zweite Hälfte verlief mit ständig wechselnder Führung hochspannend und auf hohen Niveau. Münster hatte die besseren Einzelspieler, Griesheim das bessere Zusammenspiel und mehr Treffer aus dem Rückraum. Beim Spielstand von 28:28 konnte Münster kurz vor Schluß in Führung gehen. Die folgende offene Deckung brachte nur weitere Gegentreffer, sodaß man schließlich mit 28:31 verlor. Trotz der Niederlage gebührt der Mannschaft ein großes Lob, denn das knappe Ergebnis hätte so vorher keiner erwartet. Es spielten: Arenz, Bork (2), Ehmke (5), Gernandt (1), Herr (2), Hinkel (3), Patrzalek (2), Rampelt (1), Rinschen (9), Seigfried (1), Siebert, v. Stein (2) sowie Hassenzahl und Vogel im Tor. vo', '192.166.56.36'),
(117, 5, 17, '2008-04-13 22:26:48', '2007-11-04 00:00:00', 'home', 'Herren 1 - HSG Stockstadt / Mainaschaff	28:32', '<p style="font-size: 11pt; font-family: Arial" class="headline1">Heimspielniederlage gegen HSG Stockstadt /  Mainaschaff</p> <p style="font-size: 11pt; font-family: Arial" class="headline2">Erste Herren der TuS  verlieren 28:32</p> <p style="font-size: 11pt; font-family: Arial">&nbsp;</p> <p style="font-size: 11pt; font-family: Arial">Nach einem spannenden Spiel  verlor die erste Mannschaft des TuS Griesheim am Sonntagabend mit 28:32 (12:14)  gegen HSG Stockstadt / Mainaschaff. </p> <p style="font-size: 11pt; font-family: Arial">Verletzungs- bzw.  Arbeitsbedingt musste man auf Zarko, Mischler und Torhüter Kuhnke verzichten.  Dafür stießen Sirker und Bär nach Verletzung, sowie die Jugendspieler Bork und  Rinschen zum Kader.</p> <p style="font-size: 11pt; font-family: Arial">Die TuS''ler starteten stark  in die Partie. Gestützt von einer starken Abwehr kam man über die flinken  Außenspieler Müller und Mehring zu Gegenstoßtoren. Nach dem 7:4 (13. Minute)  stellten sich die Gäste auf die Konterattacken ein und zwangen die Griesheimer  zu gebundenem Spiel. In Folge dessen konnten die Gäste mit 7:8 das erste Mal in  Führung gehen. Unkonzentriertheiten in Gegenstoß- und Aufbauspiel ließen die  TuS''ler einem Rückstand hinterherlaufen. Insbesondere die Schussauswertung im Gegenstoßspiel verhinderte eine  mögliche Führung des TuS. Beim Stande von 12:14 wurden die Seiten  gewechselt.</p> <p style="font-size: 11pt; font-family: Arial">Den Beginn der zweiten  Hälfte verschliefen die Heimischen komplett. Der kompakte Abwehrverband, der in  der ersten Hälfte noch gut stand, verlor jegliche Zuordnung und im Angriff lud  man die Gäste durch Fehlschüsse zu einfachen Gegenstoßtoren ein. Nach wenigen  Minuten musste man nun einem Rückstand um sechs Tore hinterherlaufen (13:19, 37.  Minute). Dieser Rückstand wurde zwar in der Folgezeit auf drei Tore verkürzt,  jedoch gelang es den Gästen stets dieses Polster zu halten. Bei der Aufholjagd  deutete Jugendspieler Rinschen mit sehenswerten Aktionen sein Potential an.  Umstellungen in der Abwehr bis hin zur offenen Manndeckung wollten nicht  fruchten. Doch plötzlich keimte Minuten vor Schluss nochmals Hoffnung auf, als  man in der 57. Minute auf 28:30 verkürzen konnte. Doch die Partie wollte in  diesem Moment nicht kippen, wieder wurden beste Chancen liegen gelassen. So  musste man sich am Ende in eine vermeidbare Niederlage fügen.</p> <p style="font-size: 11pt; font-family: Arial">Die hohe Fehlerquote im  Gegenstoßspiel der ersten Halbzeit und der schwache Start in die zweite Hälfte  verhinderten einen möglichen Punktgewinn. Am kommenden Wochenende hat die erste  Mannschaft spielfrei, dass nächste Spiel steht am Sonntag, den 18.11.07 beim  Aufsteiger TSV Modau an.</p> <p style="font-size: 11pt; font-family: Arial">Torschützen: Mehring (6),  T.Müller, Hamel, S. Müller, Sirker (je 4), Rinschen, Max (je 3)</p>', '130.83.196.30'),
(118, 6, 5, '2008-04-13 22:26:48', '2007-11-04 00:00:00', 'article', 'TUS Griesheim II - HSG Fürth/Krumbach	18:29', ' <p><strong>2. Mannschaft Chancenlos</strong></p><p>Konnte man am letzten Wochenende mit dem Sieg gegen Bensheim-Auerbach noch für eine Überraschung sorgen, hatte man gegen den Tabellenführer aus Fürth/Krumbach keine reelle Chance. Nach ausgeglichenem Start konnten die Odenwälder mit 5:3 in Führung gehen. Mangelnde Chancenauswertung und individuelle Fehler in der Abwehr führten zum 7:11 Halbzeitstand. Nach dem Seitenwechsel kam die Mannschaft zwar noch einmal kurzzeitig auf 3 Tore heran. Mit andauernder Spieldauer setzte sich der Tabellenführer aber Zug um Zug ab und nur ein verworfener 7m in den Schlusssekunden verhinderte die 30 Tor-Marke für die Gäste.</p><p>Es spielten:</p><p>Kay Grund und Michael Helfmann im Tor, Martin Simmermacher 1, Dennis Killer, Marcel Feldmann 2, Uwe Drechsler 2, Christian Döll 2, Dirk Höhl 3, Ronald Bausch 1, Sascha Weikert 1, Sven Schürer 1, Alex Maschkow 3, Benny Sirker1 und Christian Lehmkühler 1.</p>', '84.167.87.35'),
(119, 9, 12, '2008-04-13 22:26:48', '2007-11-07 00:00:00', 'article', 'Vorschau: mA-Jugend - TV Breckenheim', 'Am Samstag um 15:00 Uhr muss die A-Jugend des TuS in der Handball Oberliga Hessen beim TV Breckenheim antreten. Das starke Breckenheimer Team hat bisher nur gegen die favorisierten Teams aus Münster und Gensungen verloren. Andere Teams wie die HSG Langen wurden dagegen deutlich geschlagen. Somit müssen die Griesheimer Jungs wieder einen guten Tag erwischen, um im Taunus nicht unter die Räder zu kommen.', '217.224.119.148'),
(140, 8, 11, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'article', 'HSG Weiterstadt/Braunshardt - Damen	22:18', ' <p><strong>Spielbericht TUS Griesheim Damen</strong></p><p>Die Handballerinnen des TUS Griesheim unterlagen in Ihrem Spiel bei der HSG Weiterstadt/Braunshardt mit 18:22 Toren und verpassten damit eine dicke Überraschung beim Tabellenführer. Zur Halbzeite führte die Heimische HSG mit 12:11 Toren.</p><p>Der Klassenprimus legt sofort vor, doch die guten Griesheimerinnen waren von Beginn an sehr konzentriert und schafften durch Susen Schäfer das 1:1 und Brigitte Suchland den 2:2 Ausgleich. Per 7 Meter legte die HSG nun vor und wieder war es S. Schäfer die zunächst ausgleichen konnte und schließlich die Griesheimer Damen mit 4:3 in Führung brachte. Jetzt hatten die Gastgeberinnen eine starke Phase glichen aus zum 4:4 und trafen in Serie zum 9:4. Doch Griesheim konterte und kam durch zwei weitere Tore von S.Schäfer und einen Gegenstoß von B. Suchland auf 10:7 heran. Und die Griesheimerinnen setzten nach und kamen ihrerseits zum 11:8 und bis zur Pause noch zum 12:11 heran. B. Suchland gelang per 7 Meter der Halbzeitstand. </p><p>Die TUS Mädels um Trainer Christian Matzel blieben weiter sehr gut im Spiel und schafften den 13:13 Ausgleich. Der Tabellenprimus schien geschockt. Griesheim vergab jetzt zwei so genannte Hundertprozentige und schaffte es dennoch durch Marion Feldmann und S. Schäfer auf 15:13 davonzuziehen. Jetzt fingen sich die heimischen HSGÂ´lerinnen wieder und schafften es in der 45 Minute auszugleichen und nur wenig später mit Toren in Serie ihrerseits mit 18:15 in Führung zu gehen. Trainer Christian Matzel powerte seine Mädels wieder nach vorne und tatsächlich brachte ein Doppelpack von B. Suchland den 18:16 Anschluss.Vielleicht war es nun die fehlende Kondition und Kraft bei den Gästen, denn nun war es wieder die Spielgemeinschaft die sich mit einem Doppelpack zum 21:17 absetzte und nach dem erneuten Anschluss durch S. Schäfer noch einen Gegenstoß 22:18 Entstand verwandelte</p><p>Nochmals der Griesheimer Trainer, großes Kompliment an die Mädels, mit einem Quäntchen mehr Glück holen wir hier die zwei Punkte und damit eine fette Überraschung.</p><p>Am kommenden Wochenende geht es für die Griesheimerinnen im Heimspiel gegen die TGB Darmstadt um Punkte. Das Spiel ist am 25.11.2007 bereits um 14:00 diesmal in der Heimischen Kirchberghalle.</p><p>Tina Thiele und Stefanie Rau im Tor</p><p>Brigitte Suchland 5/1, Paola Vladimirov 1, Marion Feldmann 2, Meike Dornbach, </p><p>Vanessa Gandenberger , Laura Posteraro, Sandra Ribbe, Claudia Domes, Susen Schäfer 9/2, Anne Rochna, Isabell Haym</p><p>Trainer Christian Matzel</p>', '89.13.82.25'),
(121, 11, 6, '2008-04-13 22:26:48', '2007-11-10 00:00:00', 'outwards', 'TS Steinheim - mJugendC1	18:30', 'TS Steinheim - mC\r\n\r\n18 : 30 (7 : 12)\r\n\r\n \r\n\r\n10.11.2007 - 17.45 Uhr\r\n\r\n\r\nMit einer geschlossenen Mannschaftsleistung konnten die Griesheimer zwei Punkte aus Steinheim mitnehmen. Mit einer konzentrierten Abwehrleistung ab der ersten Minute wurde die Grundlage gelegt; im Spielverlauf entwickelte sich auch das Gegenstoßspiel und die Sicherheit im Positionsangriff.\r\n\r\nEs spielten: Max Schielke; Malte Just, Sven Rinschen (9 Tore), Kai Feldmann (3 Tore), Darren Weber (6 Tore), Ricardo Wilhelm (2 Tore), Jan Döll (7 Tore), Sebastian Groll und Patrick Pollner (3 Tore).', '84.58.236.233'),
(123, 15, 12, '2008-04-13 22:26:48', '2007-11-11 00:00:00', 'article', 'HSG Langen - mJugendE1	9:30', '<table border="0"><tbody><tr><td><blockquote><blockquote><p align="justify">Am vergangenen Sonntag reisten die E1-Handballer vom TuS in früher Morgenstunde zur HSG Langen. Der Griesheimer Nachwuchs scheinte zu Beginn des Spieles aber ausgeschlafener gewesen zu sein, denn bevor Langen sich versah, lag der TuS schon mit 6:0 in Front. Auch in der Folgezeit konnte die HSG dem Angriffsspiel der Griesheimer kaum etwas entgegensetzen. Auch die Abwehr stand diesmal ausgezeichnet. So konnte der Schiedrichter beide Mannschaften beim Stand von 17:3 für die TuS-Kids in die Halbzeit schicken.</p><p align="justify">Wie üblich taten sich die Schützlinge von Christian Rechner dann in der zweiten Spielhälfte schwerer. Obwohl viele freie Torwürfe zu verzeichnen waren, konnten doch weit nicht alle genutzt werden. Auch fanden einige Pässe nicht immer ihren Adressaten. Wenn das Team im Training noch an der Ballsicherheit arbeitet, kann diese Schwäche aber bestimmt in den nächsten Spielen erkennbar verbessert werden. Letztendlich konnte aber mit 30:9 ein deutlicherAuswärtssiegverbucht werden. </p><p align="justify">Es spielten: Leichtweis (Torwart), Becker, Blum, Fritzsche (8 Tore), Hartmann (3), Jacquot (7), Posocco, Schupp (5) und Türke (7)</p></blockquote></blockquote></td></tr></tbody></table>', '192.166.56.36'),
(124, 9, 12, '2008-04-13 22:26:48', '2007-11-10 00:00:00', 'article', 'TV Breckenheim - mJugendA	28:32', 'In einem spannenden Spiel gewann die A-Jugend des TuS beim TV Breckenheim in der Handball Oberliga mit 28:32 Toren. Von Beginn an gingen die Griesheimer, dieDaniel Arenz, Dennis Bork, Kevin Herr und Tim Ulmrich ersetzen mussten, konzentriert zu Werke. In der Abwehr wurde konsequent agiert, im Angriff wurde schnell kombiniert. Auf die wechselnden Abwehrformationen hatte das Team von Uwe Rinschen jeweils die passende Antwort. Hätte man in der ersten Halbzeit die erspielten Torchancen und die 4 vergebenen 7m-Würfe verwandelt, hätte man mit einem größeren Vorsprung in die Pause gehen können. So wurden bei 12:13 die Seiten gewechselt. Nach der Pause konnte sich zunächst keine Mannschaft richtig absetzen. Die offene Manndeckung gegen Tim Rinschen konnten Björn Ehmke, Lucas Baier und Miro Hinkel gut nutzen. Auch die Außen und der Kreislaüfer wurden nun besser in Szene gesetzt, sodass das Spiel aufgrund der geschlossenen Mannschaftsleistung, jeder Feldspieler erzielte Tore, hochverdient mit 28:32 gewonnen werden konnte. Es spielten: Steffen Vogel und Yannick Hassenzahl im Tor, Stefan Siebert (2), Benjamin v. Stein (5), Tim Patrzalek (3), Lucas Baier (3), Björn Ehmke (5), Christoph Rampelt (5), Tim Rinschen (6) und Miro Hinkel (3) (UR)', '217.224.70.16'),
(125, 8, 11, '2008-04-13 22:26:48', '2007-11-11 00:00:00', 'article', 'Damen - HSG Fürth/Krumbach	14:23', ' <p><strong>Spielbericht TUS Griesheim Damen</strong></p><p>Die Handballerinnen des TUS Griesheim unterlagen in Ihrem Heimspiel gegen die HSG Fürth/Krumbach mit 14:23 Toren und verpassten es damit sich im vorderen Tabellendrittel festzusetzen. Dabei sahen die zahlreichen Handballfans zwei gänzlich unterschiedliche Halbzeiten denn zum Pausenpfiff lag Griesheim noch mit 9:8 in Führung.Die Griesheimerinnen waren von Beginn an hellwach und sehr konzentriert. Claudia Domes gelang von der linken Seite der erste Treffer. Nach vergebener 7 Meter Chance legte die HSG vor und diesmal passte der 7 Meter von Paola Vladimirov zum 2:2. Vor allem die Abwehrreihen machten es den Stürmern in der ersten Halbzeit schwer die Lücken zu finden, so dass es viele 7 Meter Würfe gab. Der nächste Griesheimer Siebener wurde wieder gehalten und jetzt machten es die Gäste besser. Den Ausgleich besorgte Susen Schäfer die einen schönen Spielzug erfolgreich abschloss. P. Vladimirov traf mit einem Gegenstoß zum 4:3 für die Gastgeber, doch erneut per 7 Meter das 4:4. Nun holte sich die beste Griesheimerin Torfrau Tina Thiele den nächsten 7 Meter, doch die Gäste legten nach und gingen durch ihre beste Werferin in Führung. Marion Feldmann glich zum 5:5 aus und Brigitte Suchland erzielte aus der Distanz das 6:6. Per 7 Meter traf S. Schäfer zum 7:7 Ausgleich. In der Vorwärtsbewegung dann ein Griesheimer Ballverlust und die erfahrenen Gästedamen ließen sich diese Chance nicht entgehen. Doch die Griesheimer Mädels spielten stark in den ersten 30 Minuten. In Unterzahl schaffte es Vanessa Gandenberger sich auf der linken Seite durchzusetzen und schließlich schaffte B. Suchland die 9:8 Halbzeitführung.Die zweite Hälfte sollten die TUS Mädels um Trainer Christian Matzel weiter Konzentriert in der Abwehr Arbeiten und im Sturm durch bewegliches Spiel weitere Lücken beim Gegner finden. Doch manchmal kommt es anders. Zwei Schlafmützigkeiten in der Abwehr und die Gäste führten mit 9:10. S. Schäfer wuchtete einen Gegenstoß zum Ausgleich ins Netz.Per 7 Meter und durch einen Abpraller nach einer weiteren guten Parade von Goalie T. Thiele hatten die HSG Mädels dann mit 2 Toren die Nase vorn. Jetzt holte sich T. Thiele noch einen 7 Meter doch die Griesheimer Gegenstoßchance wurde vergeben, Die Gäste setzten nach und trafen wieder zum 10:13. 7 Meter für die Tus und wieder verworfen und die Gäste trafen zum 10:14 was in dieser zweiten Hälfte schon eine Vorentscheidung bedeutete. T. Thiele hielt noch einen 7 Meter und B. Suchland konnte auf 11:14 verkürzen. Die Gäste trafen dann doppelt und Griesheim mit einem Gegenstoß nur die Torfrau des Gegners, der dann seinerseits per Gegenstoß auf 11:17 erhöhte. Aus dem Rückraum traf nun nochmals S. Schäfer zum 12:17 doch jetzt brachen bei der Heimmannschaft alle Dämme. Einzig T. Thiele schien noch auf dem Platz und hielt ihren fünften 7 Meter, doch meine Mädels, so Coach Christian Matzel, haben nun kläglich versagt. Die weiteren Griesheimer Treffer erzielen S. Schäfer und Elisabeth (Bets) Kern zum 14:23 Entstand.Am kommenden Wochenende geht es für die Griesheimerinnen zum Klassenprimus HSG Weiterstadt/Braunshardt. Das Spiel ist am 18.11.2007 um 15:00 in der Sporthalle in der Forststrasse in Braunshardt. Es spielten:</p><p>Tina Thiele und Stefanie Rau im Tor Brigitte Suchland 3, Paola Vladimirov 2/1, Marion Feldmann 1, Meike Dornbach Vanessa Gandenberger 1, Laura Posteraro, Sandra Ribbe, Claudia Domes 1, Susen Schäfer 5/1, Bets Kern 1, Anne Rochna, Michele Bang</p><p>Trainer Christian Matzel</p>', '89.12.147.225');
INSERT INTO `articles` (`id`, `cat_id`, `editor_id`, `last_update`, `date`, `type`, `title`, `text`, `ip`) VALUES
(126, 13, 6, '2008-04-13 22:26:48', '2007-11-11 00:00:00', 'outwards', 'HSG Mörfelden/Walldorf - wJugendC	12:30', 'HSG Mörfelden/Walldorf - wC\r\n\r\n12 : 30 (5 : 11)\r\n\r\n \r\n\r\n11.11.2007 - 15.00 Uhr\r\n\r\n \r\n\r\n\r\nDas Auswärtsspiel im Mörfelden/Walldorf startete unter schlechten Vorzeichen, da sich Torhüterin Justine Liebald beim Aufwärmen verletzte und deshalb mit Lea-Maria Wenzel eine Feldspielerin ins Tor mußte. Durch die Unterstützung einer aktiven und aggressiven Abwehr fiel dieser Nachteil aber nicht ins Gewicht - mit zunehmender Spielzeit wurden immer mehr Ballgewinne erzeugt, die in Gegenstöße umgesetzt wurden. Auch im Positionsangriff wurden Tore durch sehenswerte Aktionen erzielt.\r\nEs spielten: Lea-Maria Wenzel; Katharina Schuldt (7 Tore), Katrin Feldmann (3 Tore), Deborah Berge (4 Tore), Denise Großheim (7 Tore), Mayra Janssen (1 Tor), Lena Kuhl (3 Tore), Fabienne Suhe, Chiara Janssen, Nadja Spilok (2 Tore), Tanja Birli (1 Tor) und Lea Jung (2 Tore).', '84.59.28.154'),
(128, 10, 5, '2008-04-13 22:26:48', '2007-11-11 00:00:00', 'home', 'mJugendB - JSG Crumstadt/Goddelau	26:34', '<strong>B-Jugend mit schwacher 1. Halbzeit</strong> <p>Verletzungs- und krankheitsbedingt konnte die B-Jugend gegen Crumstadt/Goddelau nicht in bester Besetzung antreten. Besonders in der 1. Spielhälfte hatte man daher große Probleme in der Abwehr und bei der Chancenverwertung und so lag man zur Pause mit14:21in Rückstand. Mit Kampf und Einsatz konnte man dann die 2. Halbzeit ausgeglichen gestalten. Zu einer Resultatsverbesserung reichte die Leistungssteigerung allerdings nicht und so wurde das Spiel doch noch deutlich mit 26:34verloren.</p><p>Es spielten: </p><p>Christian Kindermann und Andreas Gerhard im Tor, Erik Neumann 7, Andreas Margarit 5, Fabian Seigfried 3, Marvin Gernandt 4, Jan Tachtler, Sven Rinschen, Jan Döll 5, Simon Lauer und Patrick Pollner 1.</p>', '84.167.78.45'),
(129, 6, 5, '2008-04-13 22:26:48', '2007-11-11 00:00:00', 'article', 'TUS Griesheim II - HSG Dornheim/Groß Gerau	17:13', '<strong>2. Mannschaft mit guter Abwehr zum Sieg</strong> <p>Gegen die noch Sieglose Mannschaft aus Dornheim/Groß Gerau wurde der Grundstock für den Sieg in der Abwehr und eine überragende Torhüterleistung von Kay Grund gelegt. Griesheim kam gut ins Spiel und führte schnell mit 5:3 Toren wobei die Gegentreffer aus 7m resultierten. Auch im weiteren Verlauf des Spiels kam Dornheim hauptsächlich über den Kreis und 7m zu Torerfolgen. Mit 9:6 wurden die Seiten gewechselt. Nach dem Wechsel wurde der Vorsprung auf 5 Tore ausgebaut und erst in den Schlussminuten kam Dornheim nochmals auf 2 Tore heran. Ein gehaltener 7m und ein abgewehrter Gegenstoß durch Kay Grund verhinderten hier den Ausgleich und in der verbliebenen Spielzeit gelang gegen die jetzt in Manndeckung operierenden Gäste noch ein 17:13 Erfolg.</p><p>Es spielten: </p><p>Kay Grund und Michael Helfmann im Tor, Martin Simmermacher, Dennis Killer, Marcel Feldmann 1, Uwe Drechsler, Christian Döll 1, Dirk Höhl 3, Ronald Bausch 4, Sascha Weikert 2, Sven Schürer 2, Alex Maschkow 2, Christian Lehmkühler 2 und Benny Sirker.</p>', '84.167.78.45'),
(130, 13, 12, '2008-04-13 22:26:48', '2007-11-12 00:00:00', 'article', 'wJugendC - SVC Gernsheim	31:18', 'wC - SVC Gernsheim 31 : 18 (14 : 8) 11.12.2007 - 17.30 Uhr Im Heimspiel gegen Gernsheim konnte sich wieder Lea-Maria Wenzel als Torhüterin auszeichnen. Gegen die bisher ungeschlagenen Gäste konnten auch drei Zeitstrafen die Griesheimer Mädchen nicht bremsen. Bis zur Pause konnte ein kleines Polster erspielt werden - nach der Halbzeit wurde das Spiel innerhalb von zehn Minuten entschieden. Die bessere Kondition gab den Ausschlag. Es spielten: Lea-Maria Wenzel; Katharina Schuldt (9 Tore), Katrin Feldmann (3 Tore), Deborah Berge (8 Tore), Denise Großheim (5 Tore), Mayra Janssen (2 Tore), Lena Kuhl (1 Tor), Fabienne Suhe (1 Tor), Chiara Janssen, Nadja Spilok (1 Tor), Mara König, Tanja Birli und Lea Jung (1 Tor).', '192.166.56.36'),
(136, 5, 3, '2008-04-13 22:26:48', '2007-11-15 00:00:00', 'article', 'Vorbericht 1. Mannschaft TSV Modau', '<p>TSV Modau- TuS Griesheim<br /> </p><p>Am kommenden Sonntag tritt die 1. Mannschaft des <span class="hm">TuS</span> <span class="hm">Griesheim</span> gegen den derzeitigen Tabellenführer an. Man braucht kein Fachmann zu sein, um zu sehen das ein Sieg eine schwierige Aufgabe werden wird. Doch wenn man sich die Ergebnisse der Liga genauer betrachtet, erkennt man recht schnell, dass dieses Jahr jeder jeden schlagen kann. Für die <span class="hm">Griesheimer</span> <span class="hm">Jungs</span> gilt es weiter an ihrem Angriffsspiel zu arbeiten, sowie die Form der letzten Saison wieder zu finden. Eine Niederlage wäre kein Beinbruch, ein Sieg hingegen könnte die Initialzündung für die 1. Mannschaft sein. Der Wille für diesen ist da, nun hoffen wir noch auf die nötige Unterstützung der Fans. <span class="hm">Anpfiff</span> ist am Sonntag, den 18.11.2007 um 18:00 Uhr in der Ballsporthalle Ober-<span class="hm">Ramstadt</span>.</p>', '81.210.158.126'),
(135, 3, 12, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'article', 'Vorschau: Oberliga-Sonntag bei der TuS Handballjugend', '<p>Vorschau: Oberliga-Sonntag bei der TuS Handballjugend</p><p>Einen sportlich attraktiven Tag können die Handball-Fans am kommenden Sonntag in der Sporthalle der GHS erleben. Alle Oberliga-Mannschaften spielen in der heimischen Halle. Beginnen wird um 10:00 Uhr die mC-Jugend gegen den TV Gelnhausen. Als Tabellenzweiter der Oberliga Süd ist das kombinationssichere Team stark favorisiert. Im Anschluß spielt die verlustpunktfreie wC-Jugend um 12:00 Uhr gegen die SG Arheilgen.Auch in diesem Spielkann mit einem deutlichen Sieg gerechnet werden. Um 14:00 Uhr tritt die B-Jugend gegen den Vertreter Nordhessens, demVFL Wanfried, an. Aufgrund der Verletzungsmisere ist mit einem spannenden Kampf um den Sieg zu rechnen. Die A-Jugend empfängt um 16:00 Uhrdie HSG Langen. In der bezirksinternen Qualifikation mussten die beiden stärksten Teams des Bezirk Darmstadt gegeneinander antreten. Damals gewannen die Griesheimer überzeugend. Natürlich möchten die Langener die Revanche nutzen und durch einen Sieg in der Tabelle zu den Griesheimern aufschließen. So bedarf es eine gute und konzentrierte Leistung der A-Jugend um wieder erfolgreich vom Platz gehen zu können. Alle Mannschaften, die die Zuschauer mit sehenswerten Leistungen begeistern möchten, würden sich über zahlreichen Besuch freuen.</p>', '192.166.56.36'),
(142, 9, 12, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'article', 'mJugendA - HSG Langen	36:31', '<p>In der Handball Oberliga feierte die A-Jugend einen 36:31 Erfolg im Lokalderby gegen die HSG Langen. Die Griesheimer begannen sehr nervös. Auch eine 6:3 Führung brachte zunächst keine Sicherheit in die Abwehr- und Angriffsaktionen. Beim Spielstand von 11:13 stellte Trainer Uwe Rinschen die Mannschaft um. Die Umstellungen griffen und so konnte das Team mit 18:14 in die Pause gehen. Nach dem Wechsel wurde die Führung auf 21:14 ausgebaut. Mangelnde Konzentration und fehlende taktische Disziplin brachte die HSG Langen wieder auf 26:23 heran. Gute Torhüterleistungen und eine bessere Chancenverwertung brachten die A-Jugend aber endgültig auf die Siegerstraße. Am Ende gewann man hochverdient mit 36:31 und konnte sich so auf den 4. Tabellenplatz in der Oberliga vorschieben.<br />Es spielten: Steffen Vogel und Yannick Hassenzahl im Tor, Stefan Siebert (1), Daniel Arenz (1), Dennis Bork, Benjamin v. Stein (2), Tim Patrzalek (4), Lucas Baier (4), Björn Ehmke (5), Christoph Rampelt (3), Kevin Herr (1), Tim Rinschen (12) und Miro Hinkel (3) - UR</p>', '217.224.81.13'),
(143, 10, 5, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'article', 'mJugendB - VfL Wanfried	30:33', '<strong>B-Jugend verliert in einem zerfahrenen Spiel</strong> <p>Gegen Wanfried konnte die B-Jugend nur bis zur Halbzeit mithalten. Über einen 2:2 Zwischenstand lag man Mitte der ersten Halbzeit 5:11 in Rückstand. Diesen Rückstand konnte man bis zur Pause zum 14:14 ausgleichen. Nach dem Wechsel war es bis zum 20:20 ein ausgeglichenes Spiel. Mangelnde Chancenverwertung, Abspielfehler und Patzer in der Abwehr brachte Wanfried wieder mit 5 Toren in Führung und gegen Ende gelang in einem alles in allem schwachen Spiel der B-Jugend nur noch eine Resultatsverbesserung zum 30:33.</p><p>Es spielten:</p><p>Christian Kindermann und Andreas Gerhard im Tor, Arseniy Zankov (6), Fabian Seigfried (4), Marvin Gernandt (4), Jan Döll (6), Erik Neumann (4), Jan Tachtler (1), Andreas Margarit (3), Simon Lauer, Sven Rinschen (2) und Patrick Pollner (1).</p>', '84.167.74.191'),
(144, 6, 5, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'article', 'HSG Nieder Liebersbach-Reisen - TUS Griesheim II	20:25', '<strong>2. Mannschaft verliert in Nieder Liebersbach</strong> <p>Gegen Nieder Liebersbach konnte die 2. Mannschaft nur bis Mitte der 1. Halbzeit mithalten. Mangelnde Chancenverwertung, unter anderen wurden zwei 7m und mehrere hundertprozentige Chancen vergeben, führten zum Pausenstand von 11:13 für die Odenwälder. Auch nach dem Wechsel bot sich das gleiche Spiel. Vergebene Chancen und eine schwache Leistung in der Abwehr waren der Grund für den Rückstand gegen einen an diesen Tag nicht überragenden Gegner. Beim Stand von 14:15 wurde ein 7m vergeben und im Gegenzug erzielte der Gegner wieder eine 2-Torevorsprung den Nieder Liebersbach bis zum Schluss auf 20:25 ausbauen konnte. </p><p>Es spielten: </p><p>Kay Grund und Michael Helfmann im Tor, Marcel Feldmann, Dirk Höhl 1, Christian Döll 3, Dennis Killer, Sven Schürer 4, Sascha Weikert 3, Uwe Drechsler 1, Christian Lehmkühler 3 und Martin Simmermacher 5.</p>', '84.167.74.191'),
(145, 5, 17, '2008-04-13 22:26:48', '2007-11-18 00:00:00', 'article', 'TSV Modau - Herren 1	28:28', '  <p><span><span class="headline1">Punkt beim Spitzenreiter entführt</span></span></p>  <p><span><span class="headline2">Griesheimer spielen beim 28:28 bei der TSV Modau stark auf</span></span></p>  <p><span> </span></p>  <p><span>Ein dramatisches Spiel erlebten die mitgereisten Fans am Sonntagabend beim Auswärtsspiel gegen den Aufsteiger und Spitzenreiter TSV Modau. Der TSV verstärkte sich mit einigen bekannten Spielern, wie Trautmann, Seeger und Wolf, die Dreh- und Angelpunkt des Spiels der Gastgeber sind. Dazu kommen weitere gestandene Spieler, so dass die Spitzenposition in der Tabelle nicht überraschend ist.</span></p>    <p><span>Die Griesheimer waren nach vermeidbaren Heimniederlagen, wie zuletzt gegen Stockstadt/Mainaschaff, in Zugzwang. Entsprechend nervös verlief der Auftakt und es dauerte bis zur 6. Spielminute, ehe der erste Treffer zum 1:1 gelang. Während die offene Abwehr gegen Wolf und Trautmann im Abwehrspiel zum Erfolg führte, war es wieder einmal die schwache Ausbeute im Angriff, welche die Griesheimer mit 5:9 ins Hintertreffen gerieten ließ. Zudem musste man bereits im frühen Stadium des Spiels einige Zeitstrafen durch die unsicher agierenden Schiedsrichter hinnehmen. Dennoch schaffte man in dieser Phase das Spiel auf 10:9 zu drehen. Absetzen konnte man sich jedoch nicht und so ging es beim Stand von 13:13 in die Kabinen.</span></p>  <p><span>Ausgeglichen verlief auch der Beginn der zweiten Halbzeit. Beim Stand von 19:20 für den TSV sollte das Spiel ab der 40. Minute an Dramatik und Spannung weiter zulegen. Griesheim erwischte, angetrieben von den gut kombinierenden Müller und Zarko ein starke Phase, die zur 22:20 Führung genutzt werden konnte. Anschließend geriet man in doppelte Unterzahl, die der Gastgeber zum Ausgleichen nutzen konnte.</span></p>  <p><span>In die letzten beiden Spielminuten ging es beim Stand von 27:27. Modau konnte ein Tor vorlegen und die Griesheimer waren gefordert. Eine überhastete Aktion bedeutete den Ballverlust und die Möglichkeit für die Gastgeber, den Sack zuzumachen. Durch einen technischen Fehler bekam man erneut eine Kontermöglichkeit, die jedoch zu eigensinnig abgeschlossen wurde und in einem weiteren Fehlwurf mündete. Eine weitere Chance für Modau wurde durch Torhüter Schmand vereitelt. Nun waren es noch 30 Sekunden und man kam zu einem Siebenmeter-Strafwurf. Doch sowohl der Strafwurf wie der folgende Nachwurf wurden vom gegnerischen Torhüter pariert. So war Modau 15 verbleibenden Sekunden vor Spielende in Ballbesitz und der Punktgewinn in weiter Ferne. Doch die Griesheimer steckten nicht auf. Timo Müller fing ein Ball an der Mittellinie ab, konnte ihn in einem Sprintduell sichern und zu Zarko spielen. Dieser setzte zum Verzweiflungswurf an. Per Aufsetzer sprang der Ball an die Unterkante der Latte, von dort hinter die Linie und aus dem Tor heraus. Die Schiedsrichter zögerten keine Sekunde und entschieden auf Tor.</span></p>  <p><span>Der Punktgewinn ist auch im anbetracht der Tatsache, dass in den letzten sieben Minuten drei Siebenmeter verworfen wurden, glücklich, aber mehr als verdient. Mit gesteigertem Selbstbewusstsein kann man nun in die kommende Begegnung am Sonntag gegen die zweite Mannschaft des TV Kirchzell gehen.</span></p>  <p><span>Torschützen: Sirker, S. Müller, Zarko (je 6); Wurth, Max, Hamel, T. Müller (je 2), Mehring (2/2) </span></p>  ', '130.83.196.30'),
(151, 8, 11, '2008-04-13 22:26:48', '2007-11-25 00:00:00', 'home', 'Damen - TGB Darmstadt	12:24', ' <p><strong>Spielbericht TUS Griesheim Damen</strong></p><p>Die Handballerinnen des TUS Griesheim unterlagen erneut in einem Heimspiel klar, diesmal gegen die TGB Darmstadt mit 12:24 Toren. Dabei sahen die Handballfans eine komplett verschlafene erste Halbzeit der TUS, denn zum Pausenpfiff lag Griesheim bereits mit 4:15 in Rückstand.</p><p>Dabei begann die Partie der Tabellennachbarn noch völlig ausgeglichen.</p><p>Die Gäste kamen per 7 Meter zur Führung, die Vanessa Gandenberger ausglich. Das 2:2 gelang Susen Schäfer aus dem Rückraum. Der erneute Ausgleich zum 3:3 gelang Laura Posteraro aus der zweiten Reihe.</p><p>In Unterzahl ergaben sich nun die Lücken für die Gäste mit ihren großen Rückraumspielerinnen und ihrem quirligen Kreisspieler, die sie auch benötigten und auch nutzten. </p><p>Denn bereits nach 15 Minuten lagen die Griesheimerinnen mit 3:8 in Rückstand. Auch nach mehreren Wechseln, einer grünen Karte und allen Anweisungen durch Trainer Christian Matzel zum trotz, blieben die Gäste am Drücker und erzielten Tor um Tor bis zum 3:12. Paola Vladimirov gelang das 4:12 bevor es im Kasten von Tina Thiele, die einem Leid tun musste, noch 3-mal einschlug, bevor die Unparteiischen zum 4:15 Halbzeitstand abpfiffen.</p><p>Sehr laut und deutlich wurde es in der Kabine der TUS Mädels um Trainer Christian Matzel.</p><p>Endlich kämpfen und ein schneller Ball nach vorne, so wollte Griesheim nun zu seinem Spiel finden. </p><p>P. Vladimirov kam am Kreis zum 5.15. Die TGB konterte zum 6:16. Marion Feldmann traf von hinten zum 6:16, ehe Meike Dornbach einen schnellen Gegenstoß nicht verwerten konnte. Den nächsten Gegenstoß verwandelte Brigitte Suchland dann sicher zum 7:16. </p><p>Zwei Unkonzentriertheiten im umgestellten Abwehrverband und die TGB führte mit 7:18.</p><p>Jetzt kamen die Griesheimerinnen noch mal richtig in Fahrt. Ein Doppelpack von V.Gandenberger und es stand 9:18. Durch Tore von B. Suchland und M. Dornbach verkürzten die Gastgeberinnen noch zum 11.19. Doch drei weitere Angriffschancen wurden nun wieder kläglich vergeben und die Darmstädterinnen zogen wieder bis auf 11.22 davon. Einzig S. Schäfer traf noch zum 12:22 ehe die Gäste mit zwei Toren den 12:24 Endstand besorgten.</p><p>Am kommenden Wochenende geht es für die Griesheimerinnen als klassischer Aussenseiter im Pokal weiter.</p><p>Zu Gast ist am kommenden Sonntag, den 2. Dezember, die TSG Worfelden, die in der Oberliga spielt. Das Spiel wird um 16:00 in der GHS Sporthalle angepfiffen.</p><p>Tina Thiele und Stefanie Rau im Tor</p><p>Brigitte Suchland 2, Paola Vladimirov 2, Marion Feldmann 1, Meike Dornbach 1,</p><p>Vanessa Gandenberger 3, Laura Posteraro 1, Sandra Ribbe, Susen Schäfer 2, Anne Rochna, </p><p>Isabell Haym</p><p>Trainer Christian Matzel</p>', '89.12.122.189'),
(152, 13, 6, '2008-04-13 22:26:48', '2007-11-25 00:00:00', 'outwards', 'HSG Bensheim/Auerbach 2 - wJugendC	18:45', 'HSG Bensheim/Auerbach 2 - wC\r\n\r\n18 : 45 (10 : 25)\r\n\r\n \r\n\r\n25.11.2007 - 15.30 Uhr\r\n\r\n \r\n\r\n\r\nTrotz des weiteren Fehlens der beiden Torhüterinnen und obwohl fast alle Spielerinnen tags zuvor beim 4-Bezirke-Turnier in der Bezirksauswahl aktiv waren, kamen die Griesheimer Mädchen zu einem ungefährdeten Sieg an der Bergstraße. Alle Balljäger zeigten sich lauffreudig in Abwehr und Angriff; viele Ballgewinne wurden in Gegenstöße umgesetzt.\r\nEs spielten: Lea-Maria Wenzel (6 Tore), Katharina Schuldt (4 Tore), Katrin Feldmann (4 Tore), Deborah Berge (5 Tore), Denise Großheim (7 Tore), Mayra Janssen (1 Tor), Lena Kuhl (4 Tore), Fabienne Suhe, Chiara Janssen, Nadja Spilok (2 Tore), Mara König und Lea Jung (12 Tore).', '84.59.26.116'),
(154, 6, 5, '2008-04-13 22:26:48', '2007-11-25 00:00:00', 'article', 'TUS Griesheim II - TV Gustavsburg	37:35', '<strong>Jugendspieler überzeugen</strong> <p>Im Spiel gegen den TV Gustavsburg spielten die A-Jugendlichen Tim Patrzalek, Kevin Herr und Böjrn Ehmke für die Verletzten bzw. Kranken A. Maschkow, J. Rauschkolb, D. Höhl und M. Schecker in der 2. Mannschaft. Im Nachgang eine richtige Entscheidung, da die Jugendlichen ihren Beitrag zum knappen Sieg gegen den TV Gustavsburg beisteuern konnten. In der ersten Spielhälfte hatte Gustavsburg mit der defensiven Abwehr der Griesheimer Mannschaft große Probleme und bei besserer Chancenauswertung hätte das Spiel schon in der 1. Halbzeit entschieden werden können. So wurden beim Stand von 20:17 die Seiten gewechselt. Nach dem Wechsel konnte der Vorsprung auf 5 Tore ausgebaut werden. Disziplinlosigkeiten und Zeitstrafen sowie Schwächen in der Abwehr brachten Gustavsburg wieder ins Spiel zum 28:28 Ausgleich. Überhastete Torwürfe seitens Gustavsburg brachte dann Griesheim mit 3 Gegenstoßtoren wieder in Front. Beim Stand von 36:35 kurz vor Spielende brachte Böjrn Ehmke mit seinem 11. Tor den TUS wieder mit 2 Toren und zum knappen aber verdienten Endstand in Front.</p><p>Es spielten:Kay Grund, Michael Helfmann im Tor. Dennis Killer 1, Martin Simmermacher 1, Marcel Feldmann 5, Sven Schürer 6, Sascha Weikert 4, Böjrn Ehmke 11, Christian Döll 2, Kevin Herr 5 und Tim Patrzalek 1.</p>', '84.167.83.131'),
(155, 5, 3, '2008-04-13 22:26:48', '2007-11-25 00:00:00', 'article', 'Herren 1 - TV Kirchzell II	39:29', '  <p align="justify">TUS Griesheim schlägt TV Kirchzell II </p><p align="justify">des TUS Griesheim endlich auch in eigener Halle eine ähnlich starke Leistung wie in den Auswärtsspielen in Büttelborn, Babenhausen und Modau zu zeigen. Gegen die zweite Mannschaft des TV Kirchzell, die in der Tabelle im oberen Drittel zu finden ist, kamen die Griesheimer zu einem deutlichen Sieg.</p><p align="justify">Von Beginn an war die Mannschaft hellwach und konnte durch eine konzentrierte Abwehrleistung den Gegner zu Ballverlusten zwingen. Diese wurden konsequent zu Tempogegenstößen genutzt und so setzte man sich über ein 5:2 bis auf 10:3 Tore ab.</p><div align="justify">    </div><p align="justify">Im Positionsangriff überzeugte besonders David Max, der insgesamt 10 Tore erzielen sollte. Auch Nicholas Wurth (5 Tore) zeigte eine ansprechende Leistung.</p><div align="justify">    </div><p align="justify">In der Folge wurden leider zu viele Großchancen vergeben und auch die Abwehr wurde etwas nachlässiger. Hierdurch baute man den Gegner unnötig auf und Kirchzell kam bis zur Halbzeit auf 19:14 heran.</p><div align="justify">    </div><p align="justify">Der Beginn der zweiten Hälfte verlief ausgeglichen, die Griesheimer schafften es aber, den Abstand stets bei 5 Toren oder mehr zu halten. Die Mannschaft blieb in Abwehr und Angriff konzentriert und war nun auch konsequenter im Abschluss. Daniel Mehring (10 Tore) zeigte sich nun spielfreudig und kam per Gegenstoß und von der Außenpostion zu Treffern. Zum Schluss kamen die Griesheimer zu einem auch in dieser Höhe verdienten 39:29 Sieg.</p><p align="justify">Nun gilt es nach dem spielfreien Wochenende auch in den letzten beiden Saisonspielen in Götzenhain und zu Hause gegen Pfungstadt zu punkten, um sich im gesicherten Mittelfeld etablieren zu können.</p><div align="justify">Torschützen: Max(10), Mehring (10/1), Wurth (5), Zarko (4/1), Hamel, T.Müller (je 3), S.Müller (2), Sirker und Vogt (je 1)  </div>', '81.210.159.159'),
(157, 9, 12, '2008-04-13 22:26:48', '2007-12-01 00:00:00', 'article', 'Vorschau: mA-Jugend bei HSG Gensungen/Felsberg', '<span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana">Am  kommenden Samtag tritt die </span></span><span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana">die A-Jugend des TuS  Griesheim</span></span><span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana"> gegen den derzeitigen  Tabellenzweiten der Handball Oberliga, der HSG Gensungen/Felsberg, an.  </span></span><span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana">Die Nordhessen sind gut in die Runde gestartet. Die Spielstärke des Gegners spiegelt sich in den Ergebnissen wieder, lediglich gegen den Tabellenführer konnte nicht gewonnen werden. Es gilt für die Griesheimer, die ohne ihren verletzten Haupttorschützen Tim Rinschen antreten müssen, weiter an sich zu Arbeiten und auf allen Positionen die bereits guten Leistungen wieder abzurufen.</span></span>', '192.166.56.36'),
(158, 11, 12, '2008-04-13 22:26:48', '2007-12-02 00:00:00', 'article', 'Vorschau: mC1 bei JSG Wallstadt', '<span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana">Zum Spitzenspiel der beiden in der  Tabelle führenden Mannschaften</span></span><span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana"> tritt am Sonntag die männliche  C-Jugend beim Tabellenführer, der JSG Wallstadt, i</span></span><span style="font-size: x-small; font-family: Verdana"><span style="font-size: 11pt; font-family: Verdana">n der  Handball Oberliga an. Bei den ungeschlagenen Wallstädtern bedarf es einer  geschlossenen und kämpferischen Mannschaftsleistung um den Sieg und damit die  Tabellenführung mit nach Griesheim zu nehmen.</span></span>', '192.166.56.36'),
(159, 8, 11, '2008-04-13 22:26:48', '2007-12-02 00:00:00', 'home', 'Damen - TSG Worfelden	25:44', ' <p><strong><u>Pokalspiel am 02.12.2007um 16:00 gegen TSG Worfelden</u></strong></p><p>&nbsp;</p><p><strong>Spielbericht Damen TUS Griesheim </strong></p><p>Pokalaus gegen Oberligisten.</p><p>Das Bezirksoberligateam hatte im Pokalspiel gegen Worfelden keine Chance und verlor letztlich ganz klar mit 25:44.</p><p>Die erste Hälfe war einfach nur schrecklich und ging mit 25:9 Toren klar an den zwei Klassen höher spielenden Oberligisten, befand Griesheims Trainer Christian Matzel.</p><p>Doch nicht das Pokalaus sondern die Schulterverletzung von Paola Vladimirov gegen Ende der Partie wogte am Ende noch viel schwerer. Sie verlängert die lange Verletztenliste der Griesheimerinnen noch weiter, die auch heute wieder auf insgesamt 8 Spielerinnen, also eine komplette Mannschaft verzichten musste, darunter leider auch die etatmäßige Nummer 1 im Tor, Tina Thiele, die mit Grippe ausfiel. </p><p>Die Favorisierten Gäste bestimmten von Anfang an die Partie. Brigitte Suchland gelang der 1:1 Ausgleich und Susen Schäfer per 7 Meter der 2:4 Anschluss.</p><p>Das 3:7 erzielte Meike Dornbach, die einen Abpraller verwerten konnte.</p><p>Zum vierten Griesheimer Treffer kam Paola Vladimirov mit einem schnellen Gegenstoß.</p><p>Laura Posteraro kam am Kreis zum 5:13. Worfelden dominierte die erste Halbzeit nach belieben und zog auf 5:20 davon. Plötzlich war bei Griesheim endlich wieder Biss drin. P.Vladimirov, M. Dornbach und S. Schäfer verkürzten zum 8:20 sowie B. Suchland zum 9:22 ehe der Favorit wieder Fahrt aufnahm und bis zum Halbzeitpfiff noch auf 9:25 davonzog.</p><p>Bezeichnend für die Griesheimer Mädels und die bisherige Saison, das man gegen den Goliath in der zweiten Hälfte noch 16 Tore erzielte und die zweiten 30 Minuten nur knapp verloren wurden.</p><p>Zunächst waren es die Gäste die nachlegten und 3-mal trafen ehe P. Vladimirov sowie B. Suchland zum 12:28 erfolgreich waren. Bis zum 14:29 trafen dann M. Dornbach und S. Schäfer, ehe die Gäste mit ihrem schnellen Spiel auf 14:32 erhöhten. Die Worfelden Damen spielten weiter ihren schnellen Handball und erhöhten auf 17:37 ehe L. Posteraro und S. Schäfer zum 19:37 trafen. Die letzten 12 Minuten verliefen dann ausgeglichen, sicher auch ein Verdienst von Goalie Nicole Spiller, die nun einige Bälle parieren konnte. Beim 25:44 pfiffen die beiden Unparteiischen ab und beendeten die Partie.</p><p>In der Punkterunde müssen die Griesheimerinnen auswärts ran und sind zu Gast beim Mitaufsteiger Siedelsbrunn. Die Griesheimer Damen spielen am 9. 12 2007 um 15:30 in der Großraumturnhalle in Wald-Michelbach.</p><p>Es spielen bei Tus Griesheim</p><p>Nicole Spiller im Tor</p><p>Brigitte Suchland 5</p><p>Susen Schäfer 5/1</p><p>Paola Vladimirov 7</p><p>Sandra Ribbe </p><p>Meike Dornbach 3</p><p>Vanessa Gandenberger 2</p><p>Laura Posteraro 3</p><p>Isabell Haym</p><p>Anne Rochna</p><p>Trainer Christian Matzel</p>', '89.12.156.212'),
(160, 13, 6, '2008-04-13 22:26:48', '2007-12-02 00:00:00', 'outwards', 'TSV Pfungstadt - wJugendC	14:29', 'TSV Pfungstadt - wC\r\n\r\n14 : 29 (9 : 13)\r\n\r\n \r\n\r\n02.12.2007 - 11.00 Uhr\r\n\r\n \r\n\r\n\r\nGegen die defensiv eingestellten Gastgeber zeigten die Griesheimer Mädchen eine engagierte Leistung. Nach der Halbzeit konnte die spielerische Überlegenheit in Abwehr und Angriff in einen deutlichen Vorsprung umgesetzt werden.\r\nEs spielten: Mayra Janssen, Lea-Maria Wenzel, Katharina Schuldt (9 Tore), Katrin Feldmann (7 Tore), Deborah Berge (4 Tore), Denise Großheim (3 Tore), Lena Kuhl (1 Tor), Fabienne Suhe (1 Tor), Chiara Janssen, Nadja Spilok, Tanja Birli (1 Tor), Mara König und Lea Jung (3 Tore).', '217.224.47.230'),
(161, 11, 6, '2008-04-13 22:26:48', '2007-12-02 00:00:00', 'outwards', 'JSG Wallstadt - mJugendC1	27:23', 'JSG Wallstadt - mC\r\n\r\n27 : 23 (12 : 10)\r\n\r\n \r\n\r\n02.12.2007 - 16.30 Uhr\r\n\r\n\r\nIm Auswärtsspiel beim ungeschlagenene Tabellenführer konnten die Griesheimer Jungs ihr Potential nicht abrufen. Nach einer zwischenzeitlichen 6:2-Führung ermöglichten zu viele einfache Fehler und Zaghaftigkeiten den Gastgebern den Sieg.\r\n\r\nEs spielten: Max Schielke; Malte Just (2 Tore), Sven Rinschen (2 Tore), Kai Feldmann (1 Tore), Darren Weber (3 Tore), Ricardo Wilhelm (4 Tore), Jan Döll (6 Tore), Sebastian Groll , Max Eidemüller, Lukas Katzenmeier und Patrick Pollner (5 Tore).', '217.224.47.230'),
(162, 9, 12, '2008-04-13 22:26:48', '2007-12-01 00:00:00', 'outwards', 'HSG Gensungen/Felsberg - mJugendA	39:28', '  <p><span style="font-size: 10pt; color: windowtext">Deutliche 39:28 Niederlage beim Tabellenzweiten</span></p>  <p><span style="font-size: 10pt; color: windowtext">Am Samtag trat die A-Jugend des TuS Griesheim gegen den Tabellenzweiten der Handball Oberliga, der HSG Gensungen/Felsberg, an. Das Team von Trainer Uwe Rinschen erwischte keinen guten Start, lag schnell 9:4 zurück. Ein Team Time Out brachte die kurzfristige Wende. So konnten die Griesheimer bis zur Pause auf 15:12 verkürzen. Nach der Halbzeit setzte sich der Nachwuchs des Bundesligisten dann aber stetig ab. Aus der Griesheimer Mannschaft, die ohne ihren verletzten Haupttorschützen Tim Rinschen und Christoph Rampelt antreten mußte, ragten Tim Patrzalek und Kevin Herr hervor, die sich mit großem Engagement gegen die Niederlage stemmten. Zu viele technische Fehler, Fehlwürfe und Zaghaftigkeiten in Abwehr und Angriff kosteten den Griesheimern an diesem Tag ein besseres Ergebnis. Ein besonderer Dank gilt Benedikt Lauer, der sich als Ersatztorhüter kurzfristig zur Verfügung gestellt hatte und den mitgereisten Fans.<br /> Es spielten: Yannick Hassenzahl im Tor, Stefan Siebert (1), Daniel Arenz (1), Dennis Bork (1), Benjamin v. Stein (2), Tim Patrzalek (7), Lucas Baier (1), Björn Ehmke (8), Kevin Herr (6) und Miro Hinkel (2) - UR</span></p>      ', '217.224.89.152'),
(163, 5, 3, '2008-04-13 22:26:48', '2007-12-03 00:00:00', 'article', 'Vorschau: HSV Götzenhain - Männer 1', '  <p>&nbsp;</p><p>Griesheim ist nach dem überzeugendem und wichtigen Sieg, gegen den TV Kirchzell II, auf<span>  </span>dem richtigen Weg. Am kommenden Samstag muss man Auswärts in Götzenhain antreten. Die Götzenhainer stehen mit dem Rücken an der Wand auf dem vorletzten Tabellenplatz. Sie konnten bisher nur gegen Groß-Zimmern und Mörfelden-Walldorf punkten. </p>  <p>In diesem Spiel müssen die Griesheimer Jungs 2 Punkte einfahren und die Leistung der letzten zwei Spiele bestätigen. Mit einem Sieg wäre auch ein entscheidender Schritt aus dem Tabellenkeller gemacht. </p>  ', '141.72.21.6'),
(169, 15, 14, '2008-04-13 22:26:48', '2007-12-08 00:00:00', 'home', 'mJugendE1 - SKG Ober-Mumbach	25:11', '<p align="justify">So unterschiedliche Angriffsleistungen in einem Spiel haben die Verantwortlichen und Eltern der E1 schon lange nicht mehr gesehen. Am vergangen Wochenende gastierte die SKG Ober-Mumbachin Griesheim. Die Gäste aus dem Odenwald belegten nach der Vorrunde punktgleich mit den Griesheimern den dritten Tabellenplatz, hatten aber im Vergleich zum TuS das wesentlich schlechtere Torverhältnis.Man durfte also auf ein spannendes Spiel gespannt sein. Aber was die Handball-Kids vom TuS in der ersten Halbzeit zeigten, hatte wirklich Klasse. Sie ließen dem Gegner weder im Angriff noch in der Abwehr eine Chance. Der Biss stimmte vorne wie hinten und der Ball lief hervorragend bis zum Torwurf durch die eigenen Reihen. Auch die Chancenauswertung war bis zur Halbzeit überraschend gut. So konnten die Schützlinge von Christian Rechner mit einem deutlichen 18:7 Vorsprung in die Pause gehen.</p><p align="justify">Im zweiten Durchgang sollten die Fehler der letzten Spiele vermieden werden. Entsprechend wurden die Griesheimer Spieler vom Trainer eingestellt. Durchkonsequente Abwehrarbeit, sichere Abspiele und konzentriertes Ausnutzen der Torchancen sollte der Vorsprung weiter ausgebaut werden. Zum Glück arbeitete die Abwehr weiterhin fast perfekt, sonst hätten sich die vielen, vielen technischen Fehler und ausgelassenen hunertprozentigen Einwurfmöglichkeiten am Ende vielleicht gerächt.Hier muss im Training intensiv gearbeitet werden. Ein stärkerer Gegner hätte in diesem Spiel sicher große Probleme gemacht. So reichte es am Ende aber doch zu einem 25:11Erfolg für den TuS.</p><p align="justify">Es spielten: Leichtweis (Torwart), Birli, Feldmann (1 Tor), Fritzsche (4), Grein, Hartmann (3), Jacquot (5), Reuter (1), Schupp (8), Türke (3)</p><p align="justify">&nbsp;</p>', '84.59.17.173'),
(168, 9, 12, '2008-04-13 22:26:48', '2007-12-09 00:00:00', 'article', 'Vorschau: mJugendA - HSG Baunatal', '<p>Am kommenden Sonntag um 16:00 Uhr muss die A-Jugend des TuS Griesheim in der Handball Oberliga Hessen gegen die HSG Baunatal antreten. Das Baunataler Team ist unglücklich in die Runde gestartet, konnte aber in den letzten Spielen punkten. So sind die Griesheimer gewarnt, die sicher die letzte Niederlage in Gensungen durch eine konzentrierte Spielweise und erhöhtem Siegeswillen ausbügeln wollen.</p>', '127.0.0.1'),
(171, 11, 6, '2008-04-13 22:26:48', '2007-12-09 00:00:00', 'home', 'mJugendC1 - TSG Bürgel	36:18', 'mC - TSG Bürgel\r\n\r\n36 : 18 (23 : 9)\r\n\r\n \r\n\r\n09.12.2007 - 12.00 Uhr\r\n\r\n\r\nNach einer starken 1. Halbzeit ließ die Konzentartion im zweiten Abschnitt nach. Max Eidemüller zeigte eine gute Leistung auf der Außenposition. Aller Feldspieler konnten sich in die Torschützenliste eintragen.\r\n\r\nEs spielten: Max Schielke; Malte Just (3 Tore), Sven Rinschen (6 Tore), Kai Feldmann (5 Tore), Darren Weber (3 Tore), Ricardo Wilhelm (5 Tore), Jan Döll (4 Tore), Sebastian Groll (1 Tor), Max Eidemüller (3 Tore), Lukas Katzenmeier (3 Tore) und Patrick Pollner (4 Tore).', '84.58.225.200'),
(172, 13, 6, '2008-04-13 22:26:48', '2007-12-09 00:00:00', 'home', 'wJugendC - HSG Bensheim/Auerbach 2	55:8', 'wC - HSG Bensheim/Auerbach 2\r\n\r\n55 : 8 (23 : 2)\r\n\r\n \r\n\r\n09.12.2007 - 14.00 Uhr\r\n\r\n \r\n\r\n\r\n\r\nEs spielten: Kim Becker, Justine Liebald; Mayra Janssen (3 Tore), Lea-Maria Wenzel (4 Tore), Katharina Schuldt (5 Tore), Katrin Feldmann (6 Tore), Deborah Berge (4 Tore), Denise Großheim (13 Tore), Fabienne Suhe (2 Tore), Chiara Janssen (2 Tore), Nadja Spilok (4 Tore), Tanja Birli (8 Tore) und Lea Jung (4 Tore).', '84.58.225.200'),
(174, 8, 11, '2008-04-13 22:26:48', '2007-12-09 00:00:00', 'outwards', 'TV Siedelsbrunn 2 - Damen	19:20', ' <p><strong><u>Spielbericht TUS Griesheim Handball Damen</u></strong></p><p><strong>TUS Damen Auswärts mit Sieg</strong></p><p>Die Handballerinnen des TUS Griesheim kamen beim Heimstarken Mitaufsteiger TV Siedelsbrunn 2 zu einem 20:19 Auswärtserfolg.</p><p>Auch ohne die verletzten Silke Drechsler, Paola Vladimirov und Claudia Domes, präsentierten sich die Griesheimer Mädels gut erholt von ihrem Pokal aus und legten durch Brigitte Suchland das 1:0 vor. Nun waren die Gastgeberinnen am Zug glichen aus und gingen ihrerseits mit 3:1 in Front. In einem flotten Spiel zweier am heutigen Tag fast gleichwertiger Mannschaften gelangen es den Griesheimerinnen durch ein Tor von Laura Posteraro und zwei Treffer von Susen Schäfer wiederum in Führung zu gehen, 4:3. Die Gastgeberinnen glichen aus doch wieder S. Schäfer traf für die TUS zum 5:4. Den Gästen gelang es nun immer wieder bis zum 8:8 ein Tor vorzulegen und die Odenwälderinnen glichen immer wieder aus. Durch einen Doppelpack von S. Schäfer und Vanessa Gandenberger gelang erstmals mit dem 10:8 eine 2 Tore Führung. Diesmal schaffte Siedelsbrunn den 9:10 Anschluss, doch wieder war es die beste Griesheimer Werferin S. Schäfer die zum erneuten zwei Tore Vorsprung zum 11:9 traf. Und die Griesheimerinnen waren kurz vorm Ende der 1. Halbzeit wieder am Ball, der jedoch viel zu früh abgeschlossen wurde und so doch noch der 11:10 Anschlusstreffer fiel. Die zweite Hälfe begann mit Vorteilen für die Heimmannschaft die 3 Tore in Serie warf und mit 13:11 in Führung gehen konnte. Zwei 7 Meter Chancen verwertete S. Schäfer und brauchte Griesheim auf 13:14 heran. L. Posteraro schaffte den 14:14 Ausgleich und setzte gleich noch einen drauf zum 15:14. Jetzt legten die Gastgeber zweimal vor und die Griesheimer Mädels glichen zum 16:16 aus. Binnen weniger Minuten schafften es nun die Gastgeberinnen mit 3 Toren davonzuziehen und es waren nur noch 7 Minuten zu spielen.</p><p>Griesheims Trainer Christian Matzel nahm nun sein Teamtimeout, um eine Mädels wieder auf Spur zu bringen und brachte noch mal seine 1. Sechs auf Feld. Bis zur 56 Minute trafen dann 2-mal L. Posteraro und Marion Feldmann 2-mal in Serie und Griesheim führte 20:19. Jetzt wurde es noch einmal richtig Spannend. 7 Meter für Siedelsbrunn, doch Goalie Tina Thiele konnte halten und es waren noch lange 3 Minuten zu spielen. Das Foul an Griesheims L. Posteraro wurde wieder nicht gepfiffen doch die letzte Chance der Heimmannschaft konnte geblockt werden und die TUS Mädels hielten die 20:19 Führung bis zum Abpfiff und durften sich über die beiden Punkte freuen.</p><p></p><p>Im letzten Rundenspiel 2007 gastieren die Griesheimer Damen bei der FSG Modau/Groß-Bieberau. Das Spiel, ist am 15.12.2007 und beginnt um 19:00 in der Ballsporthalle in Ober-Ramstadt.</p><p>Das TUS Team um Trainer Christian Matzel spielte mit</p><p>Tina Thiele und Nicole Spiller im Tor</p><p>Brigitte Suchland 2</p><p>Meike Dornbach 1</p><p>Laura Posteraro 5</p><p>Susen Schäfer 8/4</p><p>Marion Feldmann 3</p><p>Vanessa Gandenberger 1</p><p>Sandra Ribbe </p><p>Anne Rochna</p>', '89.12.155.195'),
(175, 9, 9, '2008-04-13 22:26:48', '2007-12-09 00:00:00', 'home', 'mJugendA - Baunatal	38:37', '<p>Die A-Jugend hatte es am Sonntag mit dem erwartungsgemäß starken Gegner aus Baunatal zu tun. Die weit angereisten Nordhessen erwiesen sich als kraftbetonte Truppe, die aber auch im Gegenstoß und auf den Außenpositionen ihre Stärken hatte. Die Schiedsrichter gingen recht kleinlich gegen jegliche Härte vor, wodurch beide Abwehrreihen nur sehr zaghaft zu Werke gehen konnten. In der ersten Halbzeit gab es zusammen 8 Strafzeiten, wobei die Gäste zeitweise nur gegen 3 Griesheimer leichtes Spiel hatten und sich so auf 10:15 absetzten konnten. Den 5-6 Tore-Vorsprung hielten Sie auch bis zum torreichen Halbzeitstand von 17:23. Nach der Pause kam eine besser aufgelegte und schneller spielende Griesheimer Mannschaft aus der Kabine, die alles daran setzte, um den Anschluß wieder zu erlangen. Nach nur etwa 10 Minuten konnte man zwar auf 25:26 herankommen, es dauerte jedoch weitere 10 Minuten bis zum 33:33 bevor die TusÂ´ler das erste Mal im Spiel zum 33:33 ausgleichen konnten. Kevin Herr provozierte in dieser Phase eine rote Karte eines Gegenspielers. Fortan legte man immer ein Tor vor aber die Gegner glichen postwendend aus. Im Angriff konnte Björn Ehmkeeinige Distanzschüsse im Tor unterbringen und in der Abwehr steigerte sich Yannick Hassenzahl im Tor zusehens, bis er 30 Sekunden vor Schluß wegen Meckerns hinausgestellt wurde. In Unterzahl konnte man jedoch ein weiteres Tor verhindern und gewann schließlich verdient mit 38:37 das letzte Spiel des Jahres und kann sich über einen guten 4. Tabellenplatz freuen. Es spielten: Steffen Vogel, Yannick Hassenzahl und Tim Ulmrich im Tor, Stefan Siebert, Daniel Arenz (3), Dennis Bork (5), Benjamin v. Stein, Tim Patrzalek (4), Lucas Baier (6), Björn Ehmke (14), Kevin Herr (2) Miro Hinkel (2) und Christoph Rampelt (2) - TV</p>', '84.58.232.224'),
(176, 6, 5, '2008-04-13 22:26:48', '2007-12-08 00:00:00', 'article', 'MSG Rüsselsheim/Bauschheim - TUS Griesheim II	22:25', '<p>&nbsp;</p><p><strong>2. Mannschaft vergibt Möglichkeit zum Sieg.</strong> </p><p>Gegen die 2. Mannschaft aus Rüsselsheim/Bauschheim vergab Griesheim einen möglichen Sieg kurz vor Spielende bei eigener Überzahl 6 gegen 3 bei einem Tor Rückstand. Statt die Überzahl in Ruhe auszuspielen wurde überhastet abgeschlossen und statt selbst in Führung zu gehen gelang es den in Unterzahl spielenden Rüsselsheimer Mannschaft mit 22:24 in Führung zu gehen. Bis zu diesem Zeitpunkt war das Spiel relativ ausgeglichen wobei die Gastgeber immer knapp in Führung lagen und in den Schlusssekunden den Sieg mit 22:25 verdientermaßen sicherstellten. Alles in allem eine enttäuschende Leistung gegen eine Mannschaft die den Sieg über eine gute Torhüterleistung sicherstellten.</p><p>Es spielten:</p><p>Kay Grund und Michael Helfmann im Tor, Martin Simmermacher 3, Ronald Bausch 2, Kevin Herr 4, Sascha Weikert 2, Sven Schürer 3, Christian Lehmkühler 5, Christian Döll, Tim Patrzalek 1, Miro Hinkel 1 und Daniel Arenz 1. </p>', '84.167.111.33'),
(177, 10, 5, '2008-04-13 22:26:48', '2007-12-09 00:00:00', 'outwards', 'HSG Wettenberg - mJugendB	28:34', ' <p><strong>B-Jugend ersatzgeschwächt gegen Wettenberg</strong></p><p>Ohne die verletzten und verhinderten Spieler Marvin Gernandt, Jan Eidemüller, Fabian Seigfried, Christian Kindermann und Simon Lauer spielte die Mannschaft gegen den Tabellennachbarn aus Wettenberg. Nach einem schnellen 0:4 Rückstand kam die Mannschaft besser ins Spiel und konnte den Rückstand teilweise bis auf 1 Tor aufholen. Zur Pause stand es allerdings 16:12 für Wettenberg die über die gut besetzte Bank ihre Leistung besser ausspielen konnten. Nach dem Wechsel war das Spiel grüßtenteils ausgeglichen. Einige überhastete Torwürfe und Fehler in der Abwehr führten letztendliche doch noch zu einer 28:34 Niederlage im letzen Spiel der Vorrunde.</p><p>Es spielten:</p><p>Andreas Gerhardt und Max Schielke im Tor, Erik Neumann 10, Malte Just 1, Andreas Margarit 3, Arseniy Zankov 5, Jan Tachtler 3, Sven Rinschen 1, Jan Döll 3 und Kai Feldmann</p>', '84.167.111.33'),
(178, 5, 3, '2008-04-13 22:26:48', '2007-12-12 00:00:00', 'article', 'Vorschau: Herren1 - TSV Pfungstadt', 'Derbystimmung in Griesheim. Am kommenden Sonntag Abend (18:00 Uhr) trifft die 1. Mannschaft des TuS Griesheim auf den TSV Pfungstadt. Das Spiel verspricht nicht nur wegen der lokalen Nähe ein spannendes zu werden, sondern auch aufgrund der aktuellen Tabellensituation. Die Griesheimer Jungs wollen in diesem Spiel zeigen, dass die Niederlage gegen den Tabellenvorletzten (HSV Götzenhain) nur ein Ausrutscher war.   <p>Der TSV Pfungstadt befindet sich weiterhin im Aufstiegskampf in der Landesliga Süd mit zwei Punkten Rückstand auf den Tabellenführer. Jedoch haben Sie ähnlich wie die Griesheimer schon vermeintlich sichere Punkte wie z.B. gegen Mörfelden/Walldorf abgegeben. Mit einem Sieg könnten sich die Griesheimer etwas von der Abstiegszone entfernen und die Winterpause mit 11:13 Punkten einläuten. Eine Niederlage hingegen würde den zehnten Tabellenplatz in Gefahr bringen.</p>  <p>Unter Betrachtung all dieser Vorzeichen dürfen wir uns auf eine spannende und umkämpfte Partie in der Griesheimer Großsporthalle freuen.</p>', '81.210.135.52'),
(186, 15, 14, '2008-04-13 22:26:48', '2007-12-16 00:00:00', 'article', 'JSG Bischofsheim/Gustavsburg - mJugendE1	16:33', '<p>Mit einer überzeugenden Leistung beendeten die E1-Handballer das Jahr 2007. Am vergangenen Sonntag trafen sie in Ginsheim auf die Mannschaft der JSG Bischofsheim/Gustavsburg. Das Hinspiel in eigener Halle verloren die TuS-Kids noch knapp mit einem Tor Rückstand. Dass einer Revanche nichts im Weg stand, sah man bei den Griesheimern von Anfang an. So konzentriert, abwehrbereit und spielfreudig hatte man sie schon lange nicht mehr gesehen. Sie ließen den Gastgebern nicht den Hauch einer Chance und setzten sich bis zur Pause schon 19:5 ab.</p><p>Nach dem Wechsel konnten die TuSler diesmal an die Leistungen der ersten Halbzeit anknüpfen. Verbissen wurde um jeden Ball geKämpft. Auch die beiden großen, körperlich überlegenen Spieler der JSG kamen diesmal nicht wie gewohnt zum Zug. Was die Abwehr nicht bremsen konnte, meisterte Michi Leichtweis im Tor, der ebenfalls einen ganz starken Tag erwichte. So trennten sich beide Mannschaften mit einem 33:16 aus Sicht des TuS.</p><p>Es spielten: Leichtweis (Torwart), Becker (1 Tor), Birli, Blum (1), Feldmann, Hartmann (2), Jacquot (9), Posocco, Schupp (14), Türke (6)</p>', '127.0.0.1'),
(185, 8, 11, '2008-04-13 22:26:48', '2007-12-15 00:00:00', 'article', 'FSG Modau/Groß-Bieberau - Damen	18:19', '  <p><strong><u>Spielbericht TUS Griesheim Handball Damen</u></strong></p><p><strong>TUS Damen Auswärts erneut erfolgreich</strong></p><p>Die TUS Handballerinnen gewannen auch bei der FSG Modau/Groß-Bieberau mit 19:18 Toren und beenden die Vorrunde als bester Aufsteiger mit 12:10 Punkten auf dem 6. Rang. Auch diesmal wieder hieß es Improvisieren für den TUS Trainer Christian Matzel. Zwar war Paola Vladimirov wieder an Board, doch diesmal fehlte auch noch Marion Feldmann und damit eine wichtige Stütze im Rückraum. Griesheim begann furios mit schnellem Spiel und Toren von Brigitte Suchland 2 mal, Susen Schäfer und Paola Vladimirov je 1-mal und führte schon nach 5 Minuten mit 4:0. Im Spiel der Unzulänglichkeiten, der Fehlwürfe und der technischen Fehler schafften die Gastgeber den 4:4 Ausgleich jedoch schon in der 10. Minute. Susen Schäfer legte per 7 Meter wieder vor doch der FSG wurde auf der rechten Außenbahn der Ausgleich zum 5:5 geschenkt. Danach verwerteten P.Vladimirov und Sandra Robbe ihre freien Gegenstoßchancen nicht und dennoch gelang wieder S. Schäfer das 6:5. Der Ausgleichstreffer lies auch diesmal nicht lange auf sich warten doch P. Vladimirov gelang prompt das 7:6. Per 7 Meter das 7:7 und ebenfalls mit einem 7 Meter das 8:7 durch S. Schäfer. Das 9:7 erzielt P. Vladimirov vom Kreis und damit einen 2 Tore Vorsprung. Doch die im Grunde überlegenen Griesheimerinnen kamen nach permanenter wechselnder kurzer Deckung nicht zu ihrer spielerischen Linie und kassierten einfache Tore in Folge bis zum 9:11. B Suchland schaffte aus dem Rückraum noch dem 10:11 Pausenstand. Nach Wiederbeginn verwertete S. Schäfer einen Gegenstoß zum 11:11 und P. Vladimirov setzte noch einen drauf zur 12:11 Führung. Nun traf die FSG doppelt und ging ihrerseits mit 13:12 in Front, doch S.Schäfer glich sofort aus, 13:13.  Mit einem einfachen Ball kam die Frauenspielgemeinschaft zum14:13 doch die vor allem im Angriff überragende S. Schäfer traf erst die Torfrau per Gegenstoß und dann 4-mal in Folge zur Griesheimer 16:15 Führung. Durch B. Suchland und M. Dornbach gelang gar die 18:15 Führung nach 47 gespielten Minuten. Jetzt machten es die Griesheimer Mädels wieder spannend. Zwar hielt Tina Thiele nochmals drei 7 Meter in Folge und P. Vladimirov erhöhte mit einem Gegenstoß auf 19:16 doch Griesheims Abwehr lies den Gegner immer wieder gewähren, der dann schließlich mit einem Abpraller nur noch auf 19:18 verkürzen konnte, ehe der Unparteiische die Partie beendete. Im neuen Jahr haben die TUS Mädels und ihr Trainer lange Zeit sich auf die Rückrunde vorzubereiten, denn erst am 10:02.2008 haben die Griesheimerinnen ihr erstes Spiel gegen die FSG Roßdorf/TG 75 Darmstadt. Spielbeginn ist um 14:00 Uhr in der GHS in Griesheim.</p><p>Das TUS Team um Trainer Christian Matzel spielte mit</p><p>Tina Thiele und Nicole Spiller im Tor</p><p>Brigitte Suchland 4, Meike Dornbach 1</p><p>Laura Posteraro, Susen Schäfer 9/2</p><p>Vanessa Gandenberger, Sandra Ribbe </p><p>Anne Rochna, Isabell Haym, Paola Vladimirov 5</p><p><strong>Die TUS Handballmädels und Ihr Trainer wünschen allen Handballfreunden und Gönnern eine frohe Weihnachtszeit und alles Gute für das neue Jahr 2008 !!!</strong></p>', '84.58.207.158');
INSERT INTO `articles` (`id`, `cat_id`, `editor_id`, `last_update`, `date`, `type`, `title`, `text`, `ip`) VALUES
(189, 5, 3, '2008-04-13 22:26:48', '2007-12-16 00:00:00', 'article', 'Herren 1 - TSV Pfungstadt	29:30', '<p><strong>Handballfest mit knappem Ende</strong></p><p>&nbsp;</p><p align="left"> Das Derby der 1.Mannschaft gegen den TSV Pfungstadt wurde seinem Namen gerecht, auch wenn Pfungstadt mit den Schlusssekunden das entscheidende Siegtor zum 29:30 Endstand erzielte.</p><p align="left">&nbsp;</p><div align="justify">  </div><p align="justify">Die 500 anwesenden Zuschauer sahen einen Handballkrimi von der ersten bis zu der letzten Sekunde. Beide Mannschaften starteten mit einer starken Abwehr in die Partie und kämpften um jeden Ball. Sehenswerte Spielzüge sowie Einzelaktionen brachten beide Mannschaften bis zur 10. Spielminute auf sieben Tore. Griesheim konnte aufgrund technischer Fehler auf Seiten Pfungstadts sowie guten Torhüterparaden von Simon Bär auf 12:8 davonziehen. Pfungstadt war nun in Zugzwang, konnte jedoch den Rückstand bis zu der Halbzeit nicht verkürzen, Griesheim setzte sogar noch einen drauf. So ging es mit 15:10 in die verdiente Halbzeit.</p><p align="justify">&nbsp;</p><div align="justify">      </div><p align="justify">Die zweite Halbzeit des Handballfestes sollte der ersten in nichts nachstehen. Die Pfungstädter starteten stark in die zweite Hälfte, vor allem Paul Schöber traf nun in wichtigen Situationen. Greisheim geriet durch einige Schnitzer in der Abwehr in doppelte Unterzahl, welches der TSV auszunutzen wusste und zum 18:18 in der 40. Spielminute ausglich. Das Angriffspiel der 1.Mannschaft kam nun ins Stocken. Lediglich sehenswerte Einzelaktionen brachten noch den gewünschten Torerfolg. Pfungstadt kam mehr und mehr in Fahrt und zog mit drei Toren auf ein 25:27 davon. Trainer, Spieler und Zuschauer wussten jedoch, dass in den verbleibenden sieben Spielminuten noch alles möglich ist und peitschten beide Mannschaften voran. Jedes Tor und jeder Ballgewinn wurde frenetisch gefeiert. Markus Kuhnke, der die Rolle des Keepers für Griesheim übernahm, brachte den TuS mit klasse Paraden wieder ran, so dass man zwei Spielminuten vor Ende auf ein 27:27 ausgleichen konnte. 20 Sekunden vor Spielende legten die Griesheimer im Ballbesitz, jedoch bei angezeigtem Zeitspiel, die Grüne Karte (29:29). Die Spannung in der Griesheimer Großsporthalle war zum greifen. Nun galt es alles oder nicht. Damir Zarko nahm sich den letzten Wurf der Griesheimer, welcher das Tor nur knapp verfehlte. Jetzt ging es schnell bei Pfungstadt, der Ball fand nach 4 Pässen Linksaußen Michael Kübler, der mit einem Heber das Siegtor erzielte (30:29). Der noch folgende schnelle Anwurf von Griesheim fand leider keinen Abschluss mehr, so dass man sich Pfungstadt am Ende geschlagen geben musste.</p><p align="justify">&nbsp;</p><div align="justify">      </div><p align="left">Es ist jedoch fest zu halten, das beide Mannschaften alles gegeben haben, und die Griesheimer gezeigt haben, dass mehr in Ihnen steckt als das Spiel gegen Götzenhain vermuten ließ. Das fachkundige Publikum in der Großsporthalle bedankte sich bei beiden Mannschaften für das starke Spiel mit anerkennendem Beifall. Jetzt müssen nach der Winterpause Punkte her, denn ein knapp verlorenes Spiel gibt bekanntlich Lob, aber auch keine Punkte.</p><div align="justify">      </div><p align="justify">Torschützen: Nicholas Wurth (2), David Max (2), Stefan Hamel (2), Benjamin Sirker (2), Sebastian Müller (3), Damir Zarko (3), Timo Müller (4), Daniel Mehring (11/5)</p><p align="justify">&nbsp;</p><div align="justify">    </div><p align="justify">Die 1.Mannschaft und Ihr Trainer wünschen allen Handballfans &amp; Gönnern eine frohe Weihnachtszeit und einen guten Rutsch in das neue Jahr 2008 !!! Die Rückrunde startet am 20. Januar mit einem Heimspiel und dem nächsten Derby gegen die SKG Roßdorf.</p>  ', '81.210.158.137'),
(190, 6, 5, '2008-04-13 22:26:48', '2007-12-16 00:00:00', 'article', 'TUS Griesheim II - TSV Pfungstadt II	28:25', ' <p><strong>2. Mannschaft erkämpft sich den Sieg gegen Pfungstadt II</strong></p><p>In einem von beiden Mannschaften wechselhaft geführten Spiel hatte die 2. Mannschaft am Ende glücklich einen wichtigen Sieg erkämpft. Zur Halbzeit lag man mit 11:13 gegen eine sicher spielende Mannschaft aus Pfungstadt zurück. Fehler in der 6:0 Abwehr und Schwächen beim Gegenstoß führten zum verdienten Rückstand zur Pause. In der 2. Spielhälfte besann sich die Mannschaft auf ihre kämpferischen Qualitäten und aufbauend auf einem starken Kay Grund im Tor konnte man das Spiel bis zur 50 Min ausgeglichen gestalten. In der Schlussphase vergaben die Pfungstädter Spieler reihenweise beste Chancen am starken Torhüter Grund. Die aus den Fehlwürfen resultierenden Gegenstoßchancen wurden jetzt konsequent genutzt und am Schluss konnte mit 28:25 ein wichtiger Sieg im letzten Spiel der Vorrunde eingefahren werden </p><p>Es spielten: Kay Grund und Michael Helfmann im Tor, Christian Lehmkühler 3, Martin Simmermacher 5, Alex Maschkow 4, Kevin Herr 1, Ronald Bausch 5, Sascha Weikert 1, Sven Schürer 8, Christian Döll 1, Dennis Killer, Uwe Drechsler und Marcel Feldmann. </p>', '84.167.65.230'),
(191, 10, 5, '2008-04-13 22:26:48', '2007-12-16 00:00:00', 'home', 'mJugendB - TSG Ober Ursel	27:26', ' <p><strong>B-Jugend gewinnt glücklich gegen Ober Ursel</strong></p><p>Im Spiel gegen die noch sieglose Mannschaft aus Ober Ursel lag man zur Pause nach einer schwachen Abwehr- und Angriffsleistung mit 10:13 in Rückstand. Fehlabgaben und Fehlwürfe sowie eine unsichere Abwehrleistung machten es den Spielern aus Ober Ursel leicht zu Torerfolgen zu kommen. Umstellungen in der Abwehr und im Angriff nach dem Seitenwechsel brachten die Griesheimer Mannschaft dann immer besser ins Spiel und beim Spielstand von 21:21 konnte man erstmals ausgleichen. Zeitstrafen des Gegners konnten kurz vor Schluss zum 27:25 genutzt werden. In der Schlussphase konnte Ober Ursel dann noch auf ein Tor verkürzen und so konnte man trotz Krankheit und Verletzungen einiger Spieler einen doch glücklichen Sieg im ersten Spiel der Rückrunde erzielen.</p><p>Es spielten: Andreas Gerhard und Christian Kindermann im Tor, Arseniy Zankov 4, Marvin Gernandt 5, Jan Tachtler 3, Erik Neumann 8, Andreas Margarit 3, Sven Rinschen 2 und Kai Feldmann 2</p>', '84.167.65.230'),
(192, 11, 12, '2008-04-13 22:26:48', '2007-12-16 00:00:00', 'home', 'mJugendC1 - JSG Crumstadt/Goddelau	45:16', '<p>Im letzten Vorrundenspiel der Oberliga Süd traf die mC1-Jugend des TuS Griesheim als Tabellenzweiter auf den Tabellenletzten von der JSG Crumstadt/Goddelau. Schnell zeigten die Griesheimer, dass sie in diesem Spiel die deutlich bessere Mannschaft ist. Über 4:1 und 16:2 setzte sich das Team überzeugend ab und ging mit 22:5 in die Pause. Auch in der 2. Halbzeit ließen die Griesheimer nicht nach, kombinierten sicher und spielten so den völlig überforderten Gegner immer wieder aus. Da jeder Feldspieler seine Spielanteile bekam, konnte sich jeder in die Torliste eintragen. Am Ende gewann das Griesheimer Team mit 45:16 Toren und untermauerte so den zweiten Tabellenplatz in der Oberliga Süd.</p><p>Es spielten: Max Schielke im Tor, Patrick Pollner (9),Lukas Katzenmeier (2), Malte Just (6),Darren Weber (6), Ricardo Wilhelm (6), Kai Feldmann (6), Sebastian Groll (3) und Sven Rinschen (7)  </p>', '217.224.67.22'),
(193, 3, 12, '2008-04-13 22:26:48', '2007-12-16 00:00:00', 'article', 'Griesheimer Handballjugend mit sehr guten Saisonergebnissen', 'Eine sehr zufriedenstellende Bilanz konnte Jugendleiter Uwe Rinschen zum Jahreswechsel ziehen. Die drei im oberen Leistungsbereich gestarteten Mannschaften haben sich zum Teil sehr erfolgreich geschlagen. Überraschend gut steht zur Zeit die A-Jugend, die einen tollen vierten Platz in der Oberliga erreichte. Die B-Jugend, die aufgrund des Verletzungspechs gleich mehrere Spieler dauerhaft ersetzen musste, steht zwar nur auf den 7. Platz der Oberliga, wird sicher aber mit allen Spielern an Bord noch einigen Boden gut machen können. Die ebenfalls in der Oberliga gestartete männliche C1 Jugend steht dort auf dem 2. Platz. Diesen gilt es in der Rückrunde zu bestätigen und wenn möglich, dem wohl sicheren Meister aus Wallstadt, im Rückspiel am letzten Spieltag zumindest 2 Punkte abzunehmen. In der Bezirksoberliga der weiblichen C-Jugend scheint die Mannschaft des TuS unbezwingbar. Alle Spiele der Hinrunde konnten deutlich gewonnen werden. Die Jungs der männlichen C2 halten sich wacker in der Bezirksliga auf einem vorderen Platz. Die Jungs der E1 sind ebenfalls toll im Rennen und konnten nach der 1. Saisonhälfte einen erfolgreichen 2. Tabellenplatz erreichen. Die E2 wird in der 2. Saisonhälfte in einer anderen Gruppe starten und so dann sicher auch ihre Erfolgserlebnisse feiern können. Die Handball Jugend wünscht allen Spielern, Trainern, Eltern und Freunden ein erfolgreiches und gesundes neues Jahr. <br /> ', '217.224.67.22'),
(194, 9, 12, '2008-04-13 22:26:48', '2007-12-17 00:00:00', 'article', 'Weihnachtsgrüße/Vorschau', 'Die Spieler und Trainer der A-Jugend wünschen allen Handballfans &amp; Freunden eine frohe Weihnachtszeit und einen guten Rutsch in das neue Jahr 2008 !!! Die Rückrunde in der hessischen Oberliga startet am 20. Januar um 14:00 Uhr mit einem Heimspiel gegen den starken Tabellennachbarn der MJSG Linden.', '84.58.241.32'),
(196, 9, 12, '2008-04-14 21:04:47', '2007-12-22 00:00:00', 'article', 'Weihnachtsfeier 2007 der A-Jugend', '<p>Am 22. Dezember feierte die A-Jugend gemeinsam mit der B-, mC- und wC-Jugend Weihnachten. Viele Eltern und Freunde der Mannschaften waren herzlich eingeladen. Besonders freute man sich über den Besuch von Alt-Jugendleiter Werner Schecker und Frau. Für den musikalischen Rahmen sorgte die tolle Band Silverslide. Um den Hunger zu vertreiben wurde ein großes Buffet aufgebaut. Eine tolle und besinnliche Rede zur Weihnachtszeit hielt Pfarrer Rampelt. Für Unterhaltung sorgten die Teams selber. Jede Mannschaft konnte mit einer Aufführung begeistern. Das abschließende Wichteln der Mannschaften läutete das Ende der Veranstaltung ein.</p><p>Den Eltern, der Band und den Organisatoren (besonders Rainer und Dieter), die diese schöne Weihnachtsfeier möglich gemacht haben, einen riesigen Dank.</p><p><img src="http://www.handball.griesm.de/images/gallery/2007/ma_jugend/misc/thumb_20071222_weihnachtsfeier_der_tus_jugend_021.jpg" alt="" title="Weihnachten 07 - Bild 1" width="181" height="120" />   <img src="http://www.handball.griesm.de/images/gallery/2007/ma_jugend/misc/thumb_20071222_weihnachtsfeier_der_tus_jugend_028.jpg" alt="Pfarrer Rampelt" title="Weihnachten 07 - Bild 2" width="184" height="121" /></p><p>Unsere Live Musik,die Band        Silverslide und Pfarrer Rampelt bei seiner tollen Rede   </p><p><img src="http://www.handball.griesm.de/images/gallery/2007/ma_jugend/misc/thumb_20071222_weihnachtsfeier_der_tus_jugend_035.jpg" alt="" title="Weihnachten 07 - Bild 3" width="377" height="250" /> </p><p><img src="http://www.handball.griesm.de/images/gallery/2007/ma_jugend/misc/thumb_20071222_weihnachtsfeier_der_tus_jugend_170.jpg" alt="" title="Weihnachten 07 - Bild 4" width="377" height="248" /> </p><p>Die A-Jugend beim mannschaftsinternen &quot;Wichteln&quot;</p><p><img src="http://www.handball.griesm.de/images/gallery/2007/ma_jugend/misc/thumb_20071222_weihnachtsfeier_der_tus_jugend_161.jpg" alt="" title="Weihnachten 07 - Bild 5" width="378" height="249" /></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '217.224.61.94'),
