(201, 15, 14, '2008-04-13 22:26:48', '2008-01-06 00:00:00', 'article', 'E-Jugend zeigt echte Klasse', '<p><strong></strong></p><p>Am Drei-Königs-Tag nahm die E1-Jugend der Handballer an einem stark besetzten Turnier der SG Nied in Frankfurt teil. Der Veranstalter bot sämtlichen Altersklassen der weiblichen und männlichen Jugend in 6 Sporthallen die Gelegenheit, um den Fraport-Niddacup zu spielen. Insgesamt nahmen 96 Mannschaften aus 10 Bundesländern teil, darunter so namhafte Vereine wie der VfL Gummersbach, JSG Wallstadt, SG Wallau-Massenheim und HG Oftersheim/Schwetzingen. Aber auch aus der Region waren einige starke Teams vertreten, die traditionell gute Nachwuchsarbeit leisten. Also ein echter Prüfstein für die jungen Griesheimer Talente.</p><p>Da die TuS-Kids ferienbedingt nicht komplett antreten konnten, halfen Philipp Flügger und Philipp Gromes von der E2 personell aus. Es sei vorweg genommen, die Beiden machten ihre Sache ausgezeichnet. Trotzdem gingen die Griesheimer mit gemischten Gefühlen in die Spiele.  In der ersten Begegnung hieß der Gegner TuS Nieder Eschbach. Diese Partie konnte 10:7 gewonnen werden. Danach wartete der TV Langenselbold auf die TuSler. Auch hier gingen sie mit 6:4 als Sieger vom Feld. Im dritten Spiel traf man auf die  SG Rot-Weiß Babenhausen. Ein spielerisch sehr starker Gegner. Mit einer bärenstarken Leistung gewannen die Heimischen mit 12:8 Toren. </p><p>Die nächste Partie hatte Derbycharakter! Es ging gegen die HSG Weiterstadt/Braunshardt. Hier ist zu erwähnen, dass sich beide Teams und deren Fangemeinde im Turnierverlauf immer gegenseitig anfeuerten und unterstützen. Bei aller sportlicher Rivalität eine Tatsache, die bemerkenswert ist. In einem wie immer spannenden Spiel hatten die Griesheimer an diesem Tag mit 6:5 die Nase vorne. Nach diesem Erfolg stand der TuS-Nachwuchs bereits als Gruppensieger fest. Trotzdem sollte auch im letzten Vorrundenspiel gegen den Veranstalter SG Nied gewonnen werden. Dies gelang auch mit 14:9 und die Griesheimer konnten ungeschlagen ins Halbfinale einziehen.</p><p>Nach einem Hallenwechsel wartete nun die HSG Nieder-Roden auf den TuS. Vor vollbesetzten Rängen wurde auch diese Begegnung mit 11:9 gewonnen. Im zweiten Halbfinale setzte sich die JSG Wallstadt mit 10:5 gegen Babenhausen durch. Vor dem Finale gegen den Bundesliganachwuchs schlotterten doch einigen Griesheimern leicht die Knie. Doch Betreuer Helmut Schupp konnte in der Mannschaftsbesprechung den nötigen Motivationsschub geben und die Taktik vermitteln. Die Griesheimer setzten sich schnell mit 2:0 ab und konnten die Führung bis zur 10 Minute halten. Dann glich die JSG aus und es wurde spannend. Am Ende reichten den spielerisch etwas reiferen Wallstädtern zwei schnelle Konter, um das Finale mit 10:7 für sich zu entscheiden. Aber auch der zweite Platz in diesem Turnier ist ein großer Erfolg für die Griesheimer Handball-Kids, der für die Zukunft hoffen lässt. </p><p>Es spielten stark im Tor Michael Leichtweis und stark im Feld Fabian Birli (2 Tore), Nikolas Blum (6), Philipp Flügger, Philipp Gromes (4), Tim Sören Hartmann (12), Lisa Jacquot (10), Leonardo Posocco (1), Colin Schupp (21) und Felix Türke (11).</p>', '84.58.233.17'),
(230, 5, 1, '2008-04-13 22:26:48', '2008-02-10 00:00:00', 'home', 'Herren 1 - TV Büttelborn	15:24', '<div><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''"><strong>Griesheim auf Abwegen</strong></p></div><div style="min-height: 14px"><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''">&nbsp;</p></div><div><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''">Der TuS Griesheim spielte am Sonntag Abend in heimischer Halle weit unter seiner Form. Der Kader war fast komplett, Klaus Feldmann musste lediglich auf Stefan Hamel  verzichten, der aufgrund von Krankheit fehlte. Ergänzt wurde das Team durch Tim Rinschen und Dennis Bork (beide A-Jugend). Das Derby gegen den TV Büttelborn verdiente den Namen kaum. Schon nach der 15. Spielminute lagen die Griesheimer Jungs mit 5 Toren zurück. Man gewann schnell den Eindruck, dass die 1. Mannschaft ohne Rückraum agierte, lediglich Zweikampfsituationen führten zu kleinen Erfolgen. Der Mittelblock der Griesheimer Abwehr war neu zusammengestellt und nicht eingespielt, so dass hier einige Fehler passierten, jedoch können 12 Tore in einer Halbzeit nicht der Grund für die Niederlage sein. Bis zum Halbzeitpfiff konnte man lediglich 6 mal den Ball im gegnerischen Tor versenken. So ging man mit 6:12 in die Pause.</p></div><div style="min-height: 14px"><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''">&nbsp;</p></div><div><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''">Auch nach der Halbzeit wurde das Angriffsspiel der Griesheimer nicht besser. Es war gezeichnet von Fehlwürfen und einem Mangel an Ideen. Der TV Büttelborn der keineswegs ein überragendes Spiel machte, verwaltet fortan seinen Vorsprung. Ein Aufbäumen der 1. Mannschaft gab es nur kurz, der Vorsprung der Büttelborner war um weiteren Kampfgeist zu Sammeln jedoch zu groß. Das Spiel endete mit 15:24.</p></div><div style="min-height: 14px"><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''">&nbsp;</p></div><div><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: ''Times New Roman''">Am kommenden Samstag (19:30) treten die Griesheimer gegen den TV Maintal an. Um dort einen Sieg zu erringen muss diese Woche hart gearbeitet werden.</p></div>', '84.58.209.144'),
(202, 9, 12, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'article', 'Vorschau: mA-Jugend gegen MJSG Linden', 'Am kommenden Sonntag um 14:00 Uhr muss die A-Jugend des TuS Griesheim in der Handball Oberliga Hessen gegen die MJSG Linden antreten. Das Team aus Linden ist gut in die Runde gestartet. Die Griesheimer unterlagen das Hinspiel bei der MJSG Linden mit 32:26 und sind daher gewarnt. Trotz des aktuellen Verletzungspech möchte die A-Jugend sicher die Niederlage durch eine konzentrierte Spielweise und erhöhtem Siegeswillen ausbügeln wollen.\r\n\r\n', '217.224.125.243'),
(204, 13, 6, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'home', 'wJugendC - JSG Crumstadt/Goddelau	42:6', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>wC - JSG Crumstadt/Goddelau</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>42 : 6 (20 : 2)</strong></span></p><p><span style="font-weight: normal; font-family: ''Comic Sans MS''; color: #ff6600" class="Apple-style-span">20.01.2008 - 11.00 Uhr</span></p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600" class="Apple-style-span">Es spielten: Kim Becker, Justine Liebald; Mayra Janssen (1 Tor), Lea-Maria Wenzel (2 Tore), Katharina Schuldt (9 Tore), Katrin Feldmann (5 Tore), Deborah Berge (6 Tore), Denise Großheim (9 Tore), Chiara Janssen, Mara König (1 Tor), Nadja Spilok (3 Tore), Tanja Birli (2 Tore) und Lea Jung (5 Tore). </span></p></span>', '84.59.22.143'),
(205, 11, 6, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'home', 'mJugendC1 - TV Gelnhausen	34:25', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">mC - TV Gelnhausen</span></strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">34</span></strong></span><span style="font-size: large; font-family: ''Comic Sans MS''; color: #339933"> : 25 (15 : 12)</span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #339933">20.01.2008 - 12.00 Uhr</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Trotz einer soliden Abwehrleistung in der 1. Halbzeit konnten sich die Griesheimer aufgrund mehrerer ausgelassener Chancen noch nicht entscheidend absetzen (15:12). Nach der Pause konnten die Gäste mit einem Zwischenspurt das Spiel ausgeglichen gestalten (17:17), bevor sich die Gastgeber in allen Mannschaftsteilen steigerten und trotz nur eines Auswechselspielers nocvh zu einem deutlichen Sieg kamen.</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933">Es spielten: Max Schielke; Sven Rinschen (9 Tore), Kai Feldmann (1 Tor), Darren Weber (6 Tore), Ricardo Wilhelm (6 Tore), Jan Döll (7 Tore), Sebastian Groll (1 Tor) und Patrick Pollner (4 Tore).</span></p></span>', '84.59.22.143'),
(206, 15, 14, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'home', 'mJugendE1 - HSG Bensheim/Auerbach	30:19', '<p>Zum ersten Pflichtspiel im neuen Jahr empfingen die E1-Handballer am vergangenen Wochenende die HSG Bensheim/Auerbach. Von Beginn an spielten die Handball-Kids zielstrebig nach vorne. Daher konnten sie sich auch schnell mit 5:0 absetzen. In der Folgezeit wurde von den Heimischen die Abwehrarbeit etwas vernachlässigt, was vermeidbare Gegentreffer einbrachte. Zur Pause stand es aber trotzdem schon 16:7 für den TuS. </p><p>In der zweiten Halbzeit lief das Spiel genau so weiter. Im Gefühl des doch leichten Erfolges ließen die Schützlinge von Christian Rechner die Bergsträßer viel zu leicht zu Torerfolgen kommen. Das bedeutete aber nur Ergebniskosmetik. Letztendlich konnten die Griesheimer das Spiel mit 30:19 für sich entscheiden.</p><p>Es spielten: Leichtweis (Torwart), Birli, Blum, Feldmann (2 Tore), Fritzsche (6), Hartmann (4), Posocco (1), Schupp (10) und Türke (7)</p>', '84.58.234.90'),
(207, 6, 5, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'article', 'TUS Griesheim II - TG Eberstadt	24:24', '<p><strong>2. Mannschaft vergibt möglichen Sieg</strong></p><p>Mit 4 Spielern aus der A-Jugend angetreten erreichte die 2. Mannschaft ein Unentschieden gegen den Tabellennachbarn aus Eberstadt. Eberstadt hatte den besseren Start und konnte schnell mit 3:1 in Führung gehen. In der Abwehr agierte man zu zögerlich und zu spät mit der Folge, dass Eberstadt mit einfachen Toren über den Kreis oder 7m Toren immer wieder in Führung gehen konnte. Eine Leistungssteigerung in der Abwehr verbunden mit Gegenstoßtoren führten zum 15:15 Pausenstand. Nach dem Wechsel entwickelte sich ein ausgeglichenes Spiel mit Vorteilen auf Griesheimer Seite. So führte man kurz vor Spielende mit 24:22 Toren. In Überzahl gelang Eberstadt der Ausgleich zum 24:24. Leider wurden in der Schussminute 3 klare Chancen auf Griesheimer Seite nicht genutzt und so musste man sich mit dem Unentschieden von 24:24  zufrieden geben. </p><p>Es spielten:</p><p>Kay Grund im Tor, Martin Simmermacher 5, Benjamin von Stein 2, Sven Schürer 11, Tim Rinschen 3, Kevin Herr 1, Miro Hinkel 1, Ronald Bausch 1, Dennis Killer, Uwe Drechsler und Mario Schecker.</p>', '84.167.83.87'),
(208, 9, 12, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'article', 'mJugendA - MJSG Linden	31:26', '  <p>In einem zerfahrenen Spiel gewann die A-Jugend des TuS Griesheim in der Handball Oberliga gegen die MJSG Linden mit 31:26. Von Beginn an konnte man der Mannschaft, die einige Spieler ersetzen musste und durch Marvin Gernandt aus der B-Jugend unterstützt wurde, ansehen, dass sie für die Niederlage in Linden Revanche nehmen wollte. Zunächst entwickelte sich ein spannendes Spiel. Beim Spielstand von 9:7 wurde Miro Hinkel wegen eines unnötigen Foulspiels disqualifiziert. Die anschließende Unterzahl nutzte der Gast zum 11:11 Ausgleich. Wieder vollzählig und mit gutem Einsatz erarbeitet sich das Team von Uwe Rinschen eine verdiente Pausenführung von 18:14. Auch nach der Pause setzten sich die Griesheimer weiter ab. In der 35. Minute, beim Spielstand von 20:15, dann eine weitere Schwächung. Tim Rinschen, der bis dahin 9 Tore erzielte, wurde nach einem harmlosen Foul disqualifiziert. Wieder konnten die Gäste verkürzen, jetzt zum 21:18. Mit guter Moral und Kampfkraft spielten aber nun die weiteren Spieler des TuS. Marvin Gernandt spielte auf der Rückraum Mitte ein tolles Spiel und setzte seine Nebenleute immer wieder gut in Szene. So gelang dem Gastgebern schließlich eine deutlich 29:21 Führung. Am Ende freute sich das Team über die gelungene und verdiente 31:26 Revanche.</p>  <p>Es spielten: Steffen Vogel und Yannick Hassenzahl im Tor, Marvin Gernandt (1), Stefan Siebert, Dennis Bork (1), Benjamin v. Stein (2), Tim Patrzalek (8), Lucas Baier (4), Christoph Rampelt (3), Kevin Herr (2), Tim Rinschen (9) und Miro Hinkel (1) - UR</p>  ', '192.166.56.36'),
(209, 5, 3, '2008-04-13 22:26:48', '2008-01-20 00:00:00', 'home', 'Herren 1 - SKG Roßdorf	30:31', '<p align="justify"><strong>Wieder mit einem Tor verloren</strong></p><div align="justify">Handballer des TUS verlieren mit 30:31 gegen die SKG Roßdorf<br />Im Derby gegen die SKG Roßdorf mussten die Handballer vom Tus Griesheim eine weitere knappe Niederlage einstecken. Auf Grund eines schwachen Starts und mangelnder Chancenauswertung konnten sich die Gäste aus Roßdorf am Ende knapp mit 30:31 (14:17) Toren durchsetzen.<br />Die Griesheimer fanden zu Beginn der ersten Hälfte ihren Rhythmus überhaupt nicht. In der Abwehr fehlte die nötige Einstellung und auch im Angriff wurden diverse Großchancen leichtfertig vergeben. So zog Roßdorf Tor um Tor davon. Selbst in Überzahl ließ Griesheim leichte Tore des Gegners zu. So stand es Mitte der ersten Hälfte 12:6 für Roßdorf.<br /> <br />Doch dann fanden die Griesheimer über den Kampf zurück ins Spiel, in der Abwehr konnten nun einige Angriffe des Gegners abgefangen werden und auch das Angriffsspiel wurde dynamischer. Bis zur Halbzeit konnte man den Rückstand auf 3 Tore verkürzen.<br /> <br />Den Beginn der zweiten Hälfte verschliefen die Griesheimer nicht und konnten sich in Überzahl näher an Rossdorf herankämpfen. Dazu trug auch die nun sehr offensive Abwehr bei. Allerdings stellte sich Roßdorf auf diese Variante ein und kam nun auch wieder vermehrt zu Treffern.<br /></div><div style="margin: 0px">Es entwickelte sich ein ausgeglichenes Spiel, allerdings verpasstem es die Griesheimer immer wieder die sich bietenden Chancen zu nutzen. Nach einem unnötigen Ballverlust konnte Roßdorf eine Minute vor Spielende in Führung gehen. Den Griesheimern gelang es, sich eine weitere Wurfchance herauszuspielen, doch leider blieb auch diese ungenutzt, und die Mannschaft aus Roßdorf konnte sich mit den zahlreichen mitgereisten Fans über zwei Punkte freuen.\\u003c/div\\u003e\\u003cdiv style\\u003d"margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px"\\u003eJetzt gilt es für die Griesheimer die Schwächen in der nächsten Woche abzustellen, wenn man beim derzeitigen Tabellenführer HSG Stockstadt/Mainaschaff die verlorenen Punkte gutmachen will.\\u003c/div\\u003e\\u003cdiv style\\u003d"margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px"\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv style\\u003d"margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px"\\u003eTorschützen: S.Müller (7), Zarko (7), Brandenburger (6/5), Mehring (3), Max (4), Hamel(1), Sirker(1), Wurth (1)\\u003c/div\\u003e\\u003c/div\\u003e",0] ); D(["ce"]);  //--></div><div style="margin: 0px">Es entwickelte sich ein ausgeglichenes Spiel, allerdings verpasstem es die Griesheimer immer wieder die sich bietenden Chancen zu nutzen. Nach einem unnötigen Ballverlust konnte Roßdorf eine Minute vor Spielende in Führung gehen. Den Griesheimern gelang es, sich eine weitere Wurfchance herauszuspielen, doch leider blieb auch diese ungenutzt, und die Mannschaft aus Roßdorf konnte sich mit den zahlreichen mitgereisten Fans über zwei Punkte freuen.</div><div style="margin: 0px"> </div><div style="margin: 0px">Jetzt gilt es für die Griesheimer die Schwächen in der nächsten Woche abzustellen, wenn man beim derzeitigen Tabellenführer HSG Stockstadt/Mainaschaff die verlorenen Punkte gutmachen will.</div><div style="margin: 0px"><br /></div><div style="margin: 0px">Torschützen: S.Müller (7), Zarko (7), Brandenburger (6/5), Mehring (3), Max (4), Hamel(1), Sirker(1), Wurth (1)</div>', '141.72.21.6'),
(210, 9, 12, '2008-04-13 22:26:48', '2008-01-26 00:00:00', 'outwards', 'Vorschau: TSG Bürgel - mJugendA', 'Am kommenden Samstag um 17:40 Uhr muss die A-Jugend des TuS Griesheim in der Handball Oberliga Hessen bei der TSG Bürgel antreten. Das Team aus Bürgel ist unglücklich in die Runde gestartet und steht auf dem letzten Tabellenplatz. In den letzten Spielen hat sich das Team aus Bürgel aber wieder gefangen und siegte überraschend gegen die HSG Langen. Die Griesheimer sollten daher gewarnt sein und den Gegner nicht unterschätzen, zumal gleich mehrere Spieler krankheitsbedingt ausfallen. Dennoch sollte mit konzentrierter Spielweise und erhöhtem Siegeswillen ein Sieg wiederholt werden können.', '217.224.106.81'),
(211, 15, 14, '2008-04-13 22:26:48', '2008-01-27 00:00:00', 'outwards', 'TGB 65 Darmstadt - mJugendE1	13:30', '<p>Mit einem deutlichen 30:13 konnte die E1 der Handballer am vergangenen Sonntag das Auswärtsspiel bei der TGB 65 Darmstadt gewinnen. Obwohl nicht komplett angetreten, waren die TuSler in allen Mannschaftsteilen überlegen und lagen bereits zur Pause mit 18:7 in Front. Auch in der zweiten Halbzeit kamen die &quot;Bessunger&quot; nicht besser ins Spiel, so dass der Erfolg in keiner Phase des Spiels in Frage stand. Die Griesheimer Handball-Kids behalten daher ihre weiße Weste. Nach dem spielfreien Faschingswochenende geht es dann in zwei Wochen gegen die HSG Weiterstadt/Braunshardt wahrscheinlich um den Staffelsieg. </p><p>Es spielten: Leichtweis (Torwart), Becker (3 Tore), Blum (3), Feldmann (1), Hartmann (3), Posocco (1), Schupp (11) und Türke (8)</p>', '84.58.223.241'),
(212, 13, 6, '2008-04-13 22:26:48', '2008-01-27 00:00:00', 'outwards', 'HSG Fürth/Krumbach - wJugendC	14:41', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>HSG Fürth/Krumbach - wC</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>14 : 41 (7 : 26)</strong></span></p><p><span style="font-weight: normal; font-family: ''Comic Sans MS''; color: #ff6600" class="Apple-style-span">27.01.2008 - 13.00 Uhr</span></p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600" class="Apple-style-span">Es spielten: Justine Liebald; Mayra Janssen (2 Tore), Lea-Maria Wenzel (3 Tore), Katharina Schuldt (6 Tore), Katrin Feldmann (8 Tore), Deborah Berge (5 Tore), Denise Großheim (10 Tore), Chiara Janssen, Mara König, Tanja Birli (3 Tore) und Lea Jung (4 Tore). </span></p></span>', '88.68.26.135'),
(213, 6, 5, '2008-04-13 22:26:48', '2008-01-27 00:00:00', 'outwards', 'HSG Langen - TUS Griesheim II  35:20', '<p><strong>Griesheim II kommt unter die Räder</strong></p><p style="margin-left: 0cm" class="MsoBodyTextIndent"><br />Gegen den  Tabellendritten aus Langen gabt es für die 2. Mannschaft des TUS nichts zu gewinnen. Bis zum 4:5 in der 10 Spielminute konnte man das Spiel offen gestalten. Zu diesem Zeitpunkt stimmte das Zusammenspiel in der Abwehr und auch im Angriff konnte man sich gut behaupten. Fehlabgaben und technische Fehler im Angriff ermöglichten es der Mannschaft aus Langen dann aber bis zur Pause auf 15:9 davonzuziehen. Auch nach dem Seitenwechsel hatte dann Langen mit 5 Toren in Folge den besseren Start. Erst beim Stand von 20:9 gelang der TUS das erste Tor. Dem schnellen Angriffsspiel der Langener hatte man in den letzten 15 Spielminuten nur noch wenig entgegenzusetzen und so wurde das Spiel deutlich mit 35:20 verloren.</p>  <p style="margin-left: 0cm" class="MsoBodyTextIndent">Es spielten: Kay Grund und Michael Helfmann im Tor, Kevin Herr 3, Sven Schürer 11, Benjamin von Stein 2, Dennis Killer 1, Miro Hinkel 1, Christian Lehmkühler 1, Ronald Bausch 1, Dirk Höhl, Sascha Weikert und Heiner Lenkering</p>  ', '84.167.81.241'),
(214, 9, 12, '2008-04-13 22:26:48', '2008-01-26 00:00:00', 'outwards', 'TSG Bürgel - mJugendA	35:30', '  <p><span style="font-size: 10pt; font-family: Arial">Eine unnötige 35:30 Niederlage mußte die A-Jugend des TuS in der Oberliga bei der TSG Bürgel hinnehmen. Bei den hoch motivierten Gastgebern fand das Team von Trainer Uwe Rinschen nie richtig ins Spiel. Die harte Gangart des Tabellenletzten, die die Griesheimer beeindruckte, wurde von den Schiedsrichtern weder unterbunden noch wurde das ballbezogene Abwehrverhalten der Griesheimer belohnt. Beim Spielstand von 25:27 für die Griesheimer mußten Kevin Herr und Tim Rinschen jeweils nach schweren Gesichtstreffern verletzungsbedingt auf die Bank. Diese Schwächung nutzte die TSG Bürgel zur erneuten Führung, die sie bis zum Abpfiff verteidigte.</span></p>    <p><span style="font-size: 10pt; font-family: Arial">Es spielten: Steffen Vogel, Tim Ulmrich und Yannick Hassenzahl im Tor, Maximilian Bopp, Stefan Siebert, Dennis Bork (3), Benjamin v. Stein (2), Tim Patrzalek (9), Lucas Baier (6), Christoph Rampelt, Kevin Herr, Tim Rinschen (5) und Miro Hinkel (5) - UR</span></p>  ', '192.166.56.36'),
(215, 9, 12, '2008-04-13 22:26:48', '2008-01-30 00:00:00', 'home', 'Vorschau: mJugendA - JSG Odenwald', '<p>Am kommenden Mittwoch um 19:00 Uhr muss die A-Jugend des TuS Griesheim in der Handball Oberliga Hessen gegen die JSG Odenwald in der Sporthalle der GHS antreten. Das Oderwälder Team konnte in der Qualifikations- und in der Hinrunde bereits gegen die Griesheimer gewinnen. So sind die Griesheimer gewarnt und wollen sicher die letzten Niederlagen  durch eine konzentrierte Spielweise und erhöhtem Siegeswillen ausbügeln.</p>', '192.166.56.36'),
(216, 5, 17, '2008-04-13 22:26:48', '2008-01-27 00:00:00', 'outwards', 'HSG Stockstadt/Mainaschaff - Herren 1	38:29', '<p><strong>Deutliche Auswärtsniederlage beim  Tabellenführer</strong></p> <p><strong>Handballer des TuS leisten nur in der ersten Hälfte Widerstand</strong></p> <p><strong> </strong></p>  <p><span>Eine schwere Niederlage musste die Handballmannschaft des TuS bei der HSG Stockstadt/Mainaschaff einstecken. Sie verlor nach ansprechender erster Halbzeit letztendlich deutlich und verdient mit 29:38 (14:16).</span></p>  <p><span>Da neben dem an der Hand verletzten David Max weitere Spieler fehlten oder angeschlagen waren, trat man mit nur drei Auswechselspielern an, darunter die beiden A-Jugendlichen Rinschen und Posocco.</span></p>  <p><span>Die erste Halbzeit verlief weitestgehend ausgeglichen. Griesheim setzte in der Abwehr auf eine offensive 3-3-Formation, die die Gastgeber jedoch wiederholt aushebelten. Nach dem 14:10 für Stockstatt stellte man auf eine defensivere 5-1 um und konnte auf ein 16:14 verkürzen. Daran hatte Rückraumspieler Zarko große Anteile, der seinerseits die offensive Abwehr der Hausherren ausnutzte.</span></p>  <p><span>Der spielentscheidende Einbruch folgte zu Beginn der zweiten Hälfte. Zarko wurde kurz gedeckt und den Griesheimern schwanden zusehends die Kräfte. Ein geordnetes Angriffspiel war kaum noch möglich und Stockstadt setzte viele Tempogegenstöße. Das 26:17 in der 42. Spielminute bedeutete eine Vorentscheidung. Auch die Abwehr musste der kräfteraubenden Formation Tribut zollen, so dass der Gegner nun leichtes Spiel hatte. Der Rückstand blieb fortan stetig bei 8-9 Toren, bis beim Stand von 29:38 der erlösende Schlusspfiff kam.</span></p>  <p><span>Nun gilt es am spielfreien Wochenende dieses Ergebnis zu verarbeiten und für die verletzten bzw. angeschlagenen Spieler sich auszukurieren. Denn nur mit einem vollzähligen Kader kann man die kommenden Spiele gewinnen. Allen voran gilt das für das nächste Heimspiel gegen den TV Büttelborn (So 10.02., 18:00, GHS).</span></p>  <p><span>Torschützen: Zarko (13/3); Wurth (5); Mehring (5/1); Rinschen (2); Sirker, T. Müller, S. Müller, Hamel (je 1).</span></p>  ', '130.83.196.30'),
(217, 9, 9, '2008-04-13 22:26:48', '2008-01-30 00:00:00', 'home', 'mJugendA - JSG Odenwald	32:38', '<p>Die A-Jugend hatte ihr Heimspiel gegen die JSG Odenwald auf Mittwoch abend vorgezogen. Die Partie verlief bis zum Halbzeitstand von 16:17 völlig ausgeglichen dank einer guten und variablen Angriffsleistung. Der Innenblock der Abwehr wurde jedoch von den durchsetzungsfähigen Odenwäldern immer wieder meist durch Mann-gegen-Mann Aktionen oder Kreisanspiele überwunden. In der zweiten Hälfte konnten sich die Gäste bis zur 45.Minute mit 5 Toren Vorsprung absetzen, da die Griesheimer Abwehr zwar besser zupackte, aber in dieser Phase drei 2-Minutenstrafen kassierte. Eine Aufholjagd scheiterte wiederum an der eigenen Abwehr, denn jedes Tor vorne wurde postwendend hinten wieder reingelassen. Schließlich verlor man in diesem torreichen Spiel mit 32:38.</p><p>Es spielte: Ulmrich und Vogel im Tor, Arenz (2), v.Stein (1), Patrzalek (6), Baier (4), Rampelt (5), Herr (3), Rinschen (7), Hinkel (3), Siebert (1), Bopp.   Vo  </p>', '84.58.194.148'),
(218, 11, 6, '2008-04-13 22:26:48', '2008-02-03 00:00:00', 'outwards', 'JSG Obernburg/Erlenbach - mJugendC1	21:35', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">JSG Obernburg/Erlenbach - mC</span></strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"></span><span style="font-size: large; font-family: ''Comic Sans MS''; color: #339933">21 : 35 (10 : 20)</span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #339933">03.02.2008 - 16.00 Uhr</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Mit einer soliden Mannschaftsleistung konnte sich die mC-Jugend bei der JSG Oberburg/Erlenbach mit 21:35 durchsetzen. Im Angriff wurde flüssig kombiniert und ab dem 6:6 steigerten sich die Abwehr und Torwart Max Schielke, so dass zur Pause eine 10-Tore-Führung erspielt werden konnte. Im zweiten Abschnitt ließ phasenweise die Konzentration beim Abschluß nach, doch die Führung konnte trotzdem noch ausgebaut werden.<br /></span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933">Es spielte: Max Schielke; Sven Rinschen (4 Tore), Jan Döll (4 Tore), Kai Feldmann (7 Tore), Patrick Pollner (5 Tore), Ricardo Wilhelm (8 Tore), Darren Weber (3 Tore), Malte Just (2 Tore), Lukas Katzenmeier (1 Tor), Sebastian Groll (1 Tor) und Max Eidemüller.</span></p></span>', '84.59.20.211'),
(219, 10, 5, '2008-04-13 22:26:48', '2008-02-04 00:00:00', 'home', 'mJugendB - TV Hersfeld	32:28', '          <p><strong>B-Jugend erspielt Sieg gegen Hersfeld</strong></p><p>Im Spiel gegen den TV-Hersfeld hatten die Gäste den besseren Start und führten schnell mit 2:0. Danach entwickelte sich in der ersten Hälfte ein ausgeglichenes Spiel mit leichten Vorteilen für die Gäste. Abstimmungsprobleme in der Abwehr und mangelnde Chancenverwertung prägten das Spiel der Griesheimer Mannschaft und so trennte man sich zur Pause mit 16:16. Nach dem Wechsel hatte Griesheim den besseren Start. Auch in der Abwehr hatte man sich besser auf die Rückraumspieler aus Hersfeld einstellt und über die Zwischenstände von 21:18 und 30:24 gab es einen verdienten Sieg gegen die Gäste aus Bad Hersfeld. In den Schlussminuten konnte Hersfeld das Ergebnis noch verbessern dem verdienten Sieg für Griesheim tat dies keinen Abbruch.</p>    <p>Es spielten: Andreas Gerhard und Christian Kindermann im Tor, Arseniy Zankov 5, Fabian Seigfried, Marvin Gernandt 5, Jan Tachtler 1, Jan Döll 4, Erik Neumann 12,  Kai Feldmann, Andreas Margarit 2, Ricardo Wilhelm, Sven Rinschen 2 und Darren Weber1.</p>  ', '84.167.101.203'),
(220, 9, 12, '2008-04-13 22:26:48', '2008-02-09 00:00:00', 'outwards', 'Vorschau: TV Petterweil - mJugendA', 'Am kommenden Samstag um 14:00 Uhr muss die A-Jugend des TuS Griesheim in der  Handball Oberliga Hessen beim TV Petterweil antreten. Das Team aus Petterweil ist schlecht in die Runde gestartet. In  den letzten Spielen hat sich das Team aus Petterweil aber wieder gefangen und siegte  deutlich gegen die MJSG Linden. Die Griesheimer sollten daher gewarnt sein  und den Gegner nicht unterschätzen. Obwohl gleich wieder mehrere Spieler  krankheitsbedingt ausfallen, sollte mit konzentrierter Spielweise ein Sieg wie im Hinspiel wiederholt werden können.<p>&nbsp;</p>', '217.224.113.249'),
(221, 5, 3, '2008-04-13 22:26:48', '2008-02-07 00:00:00', 'article', 'Vorschau: Herren1 - TV Büttelborn', '  <p>Am kommenden Sonntag (10.02.2008 18:00 Uhr) stehen die Handballer des TuS Griesheim wieder auf dem Parkett, um im Derby gegen den TV Büttelborn anzutreten. Nach der Spielpause über Fasching gilt es nun die ersten Punkte in der Rückrunde einzuholen. Dass dieses gegen den TV Büttelborn keine leichte Aufgabe wird, ist vorherzusehen, gerade unter Anbetracht der aktuellen Tabellensituation.</p>    <p>Die Hinrunde des TV Büttelborn glich ähnlich wie die der Griesheimer einer Achterbahnfahrt. Im Hinspiel holten die Griesheimer gegen Büttelborn die ersten Punkt der Runde. Das Ziel für das Rückspiel können nur zwei Punkten sein. Hierzu sind jedoch bedingungsloser Kampf und Einsatzwille gefordert, um als Mannschaft punkten zu können. Die Zuschauer können sich also auf ein spannendes Derby freuen.</p>  ', '92.50.82.190'),
(222, 7, 9, '2008-04-13 22:26:48', '2008-02-09 00:00:00', 'article', 'Termine und Neuerungen 2008', '<p>Am Donnerstag, 7.Februar trafen wir uns im TUS-Heim, um für dieses Jahr Termine und Vorgehensweisen abzustimmen. Anwesend waren: Klaus, Andy, Peter, Manfred, Dieter, Helmut, Martin, Lutte, Michael, Sebastian, Freddy, Thomas, Markus (13 und damit beschlußfähig). <br />Unsere Mannschaftskasse schloß leider mit 300€ minus ab (Die 20 Jahrfeier war doch recht teuer). Unser Beitrag bleibt dennoch stabil, aber für dieses Jahr werden wir für die Frauen an Weihnachten wieder einen Sonderbeitrag erheben müssen.<br />Glücklicherweise haben wir dieses Jahr 4 Jubiliare unter uns, wo wir auf die ein oder andere Feier in der ersten Jahreshälfte hoffen dürfen. <br />Daher wollen wir dieses Jahr kein Sommerfest mit Frauen veranstalten, aber nächstes Jahr wieder, denn da sieht es eher mau aus mit Jubiliaren. Den geplanten östereichischen Abend würden wir von Weihnachten in den Sommer vorverlegen und Paul hat sich da spontan als Veranstalter gemeldet.<br />Für die ersten Donnerstage im Monat behalten wir die Regelung bei, jedoch mit der Einschränkung, dass eine Woche zuvor im Trainng aufgrund zu geringer erwarteter Beteiligung oder mangelnder Ideen bzw. Organisation entschieden werden kann, zu trainieren.<br />Um unsere &quot;Passiven&quot; mehr einzubinden, werden wir verstärkt diese Homepage nutzen, damit wir Termine und Entscheidungen frühzeitig und vollständig verbreiten können.<br />Ferner haben wir ein Internet-Forum eingerichtet bekommen (siehe Link unter Navigation). Wenn sich dort jeder einmal anmeldet, können wir zwecks Donnerstagen oder dergleichen abstimmen, unsere Teilnahme bestätigen oder einfach so das ein oder andere Nennenswerte austauschen. Jeder der will wäre informiert. Da man dieses Forum auch unter Ausschluß der Öffentlichkeit führen kann, wäre es ein guter Ersatz für die diversen Rundmails. Schaue ´mer mal.</p><p><strong>Folgende Termine liegen fest:<br /></strong>Weihnachtsfeier mit Frauen     12.Dec im TUS Heim<br />Weihnachtsfeier ohne Frauen   9.Aug bei Paul (östereichischer Abend)<br />Skifahren Westendorf              5.-9. März</p><p>Termine die man sich freihalten sollte:        4.April, 31.Mai, 14.Juni </p>', '84.58.199.5'),
(223, 15, 14, '2008-04-13 22:26:48', '2008-02-10 00:00:00', 'home', 'mJugendE1 - HSG Weiterstadt/Braunshardt	29:22', '<p>Am vergangenen Wochenende war es so weit. Seit Wochen fieberte die E-1-Jugend vom TuS dem Derby gegen die Nachbarn von der HSG Weiterstadt-Braunshardt entgegen. Im Hinspiel noch deutlich unterlegen, so konnten die Griesheimer die Partie beim Nidda-Cup in Frankfurt gewinnen und Selbstvertrauen tanken. </p><p>Am Sonntag trafen dann die beiden stärksten E-Jugendmannschaften des Handballbezirks Darmstadt aufeinander. Die Griesheimer erwischten einen super Start und gingen schnell mit 4:0 in Führung. Doch die HSG hielt dagegen, konnte immer wieder ausgleichen und hielt das Spiel offen. Erst kurz vor der Halbzeit konnten sich die Schützlinge von Christian Rechner mit 2 Toren Vorsprung absetzen. Sie gingen mit 15:13 in die Pause. </p><p>Die zweite Halbzeit ist eigentlich nicht die Stärke der E1. Kann man sich doch normalerweise gegen schwächere Gegner im Gefühl des sicheren Sieges etwas zurücknehmen. Doch diesmal sahen die Zuschauer ein ganz anderes Team. Verbissen wurde jeder Zweikampf angenommen und so viele Bälle erkämpft. Im Angriff wurden die sich ergebenden Torchancen sicher genutzt. Tor um Tor konnten sich die Griesheimer absetzen, der Vorsprung betrug zeitweise 10 Treffer. Als der Schiedsrichter ab pfiff, konnte ein 29:22-Erfolg gefeiert werden. </p><div>Es spielten: Leichtweis (Torwart), Becker, Birli, Blum, Feldmann, Fritzsche (8), Hartmann (1), Jacquot (6), Schupp (7), Türke (7)</div>', '84.58.217.19');
