(227, 11, 6, '2008-04-13 22:26:48', '2008-10-02 00:00:00', 'outwards', 'TV Kirchzell - mJugendC1	23:31', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">TV Kirchzell - mC</span></strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"></span><span style="font-size: large; font-family: ''Comic Sans MS''; color: #339933">23 : 31 (12 : 14)</span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #339933">10.02.2008 - 14.30 Uhr</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Mit einem Auswärtswärtssieg beim Tabellendritten konnte sich die mC die Vizemeisterschaft in der Oberliga sichern. In einem umkämpften Spiel boten die Griesheimer mehr spielerische Substanz, ein geschlosseneres Team und die bessere Spielanlage. Nach der knappen 2-Tore-Führung zur Pause steigerte sich die Abwehr und Torwart Max Schielke, so dass in den letzten 10 Minuten der verdient deutliche 23:31-Erfolg erspielt werden konnte. Einziges Manko war die schlechte Chancenauswertung, ohne die das Spiel schon in der 1. Halbzeit hätte entschieden werden können.<br /></span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933">Es spielte: Max Schielke; Sven Rinschen (6 Tore), Jan Döll (8 Tore), Kai Feldmann (1 Tore), Patrick Pollner (7 Tore), Darren Weber (5 Tore), Malte Just (2 Tore), Lukas Katzenmeier), Sebastian Groll (1 Tor) und Max Eidemüller (1 Tor)</span><span style="font-family: ''Comic Sans MS''; color: #339933">.</span></p></span>', '84.59.4.253'),
(228, 6, 5, '2008-04-13 22:26:48', '2008-02-10 00:00:00', 'home', 'TUS Griesheim II - HSG Erfelden	28:35', '<p><strong>2. Mannschaft hält nur eine Halbzeit mit.</strong></p><p>Gegen den Tabellendritten aus Erfelden konnte die 2. Mannschaft nur in der ersten Spielhälfte mithalten. Erfelden hatte den besseren Start und führte schnell 2:0 und zwischenzeitlich mit 9:3. Eine Steigerung in der Abwehr verbunden mit einfachen Toren im Gegenstoß führten zum 17:17 Pausenstand. Nach dem Wechsel hatte wiederum Erfelden den besseren Start und konnte mit 19:17 in Führung gehen. Zwei verworfene 7m und Abschlussschwächen im Angriff brachten Erfelden dann immer besser ins Spiel und am Schluss gab es doch noch eine deutliche 28:36 Niederlage zu verzeichnen. Hervorzuheben sind die guten Leistungen der mit Doppelspielberechtigung eingesetzten A-Jugendlichen Daniel Arenz, Miro Hinkel und Benjamin von Stein.</p><p>Es spielten:</p><p>Kay Grund Tor, Benjamin von Stein 4, Dirk Höhl 1, Dennis Killer 2, Sascha Weikert 2, Sven Schürer 3, Christian Lehmkühler 3, Christian Döll,  Alex Maschkow 4, Miro Hinkel 3 und Daniel Arenz 6. </p>', '84.167.72.135'),
(226, 9, 9, '2008-04-13 22:26:48', '2008-02-10 00:00:00', 'home', 'TV Petterweil - mJugendA	41:34', '<p>Die A-Jugend mußte beim Tabellenletzten TV Petterweil antreten. Der Gastgeber hat Personalprobleme, aber drei verbliebene Leistungsträger sorgten für ein 7:11 Rückstand der Griesheimer. Nach einer Auszeit in der 19 Minute rappelte man sich zusammen, stellte sich auf die gefährlichen Spierler besser ein und konnte noch zur Halbzeit wieder den Ausgleich zum 16:16 erzielen.<br />In der zweiten Halbzeit gewann man deutliche Vorteile, nicht zuletzt wegen einer gut besetzten Auswechselbank und einem guten Rückhalt im Tor, sodass durch schnelles Spiel die Gegner außer Atem kamen. Zusätzliche Manndeckung sorgte schließlich für weitere Fehler des Gegners und so gelangte man über eine 9 Tore Führung schließlich zum Endstand von 41:34. Wie schon das Ergebnis vermuten lässt, war der Angriff zwar ok, aber in der Abwehr besteht noch Verbesserungspotenzial. Der Sieg war wichtig für die Moral, denn in den Spielen zuvor konnte man nicht so recht an die Leistungen der Vorrunde anknüpfen.</p><p>Es spielte: Hassenzahl und Vogel im Tor, Arenz, v.Stein (1), Patrzalek (12/4), Baier (1), Herr (3), Rinschen (7), Hinkel (8), Siebert (2), Bopp (2), Bork (4), Gernandt (2).   Vo </p>', '84.58.209.186'),
(229, 7, 9, '2008-05-01 22:39:32', '2008-02-07 00:00:00', 'article', 'Donnerstage & Events', '<p>Aktuelle Planung unter denen Ihr im AH-Forum auch abstimmen könnt. <a href="http://griesm.de/forum/viewtopic.php?f=23&amp;t=46" title="http://griesm.de/forum/viewtopic.php?f=23&amp;t=46">http://griesm.de/forum/viewtopic.php?f=23&amp;t=46</a></p>\r\n<p>Weitere Donnerstags-Vorschläge:</p>\r\n<p>Katakomben unter der Mathildenhöhe erkunden<br />Boule Spielen<br />Kikeriki Theater</p>\r\n<p>Donnerstags- Vorschläge vom 7.Feb.08:<br />AH-Triathlon (Fahrrad, Schwimmen, Biergarten)<br />Radtour Grube Prinz v. Hessen, schwimmen<br />Rad oder Wandern: Fischerhütte<br />Kletterwald DA<br />Saunaabend DA Jugenstilbad<br />Bogenschiessen<br />Tischtennis (Abtlg. fragen, in Halle)<br />Kino<br />Theater<br />Sportabzeichen abnehmen (in den Ferien)<br />Minigolf (Braunshardt)<br />Bowling<br />Kegeln<br />Boseln (mit Bier im Leiterwagen durch den Wald)</p>\r\n<p>Nicht Donnerstage:<br />Steigerts<br />Kanu Fahren<br />Kart fahren<br />Schlittschuh Fahren (Roßdorf, DA)<br />Klettern am Fels (Reichelsheim)<br />Tannenbaum schlagen</p>\r\n<p>Bereits gemacht:<br />Ki-Bar<br />Kadde-Abend im TUS Heim</p>', '84.58.209.60'),
(231, 13, 6, '2008-04-13 22:26:48', '2008-02-12 00:00:00', 'outwards', 'HSG Dornheim/Groß-Gerau - wJugendC	24:33', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>HSG Dornheim/Groß-Gerau - wC</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>24 : 33 (11 : 14)</strong></span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">12.02.2008 - 19.30 Uhr</span></p><p> </p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /><br />Beim Tabellendritten HSG Dornheim/Groß-Gerau setzten sich die Balljäger-Mädchen mit 24:33 durch. Gegen die motivierten Gastgeber unterliefen den Griesheimerinnen in der 1. Halbzeit einige Unkonzentriertheiten. Im zweiten Durchgang sorgten das aktivere Abwehrspiel und das gelungene Kombinationsspiel für den verdient deutlichen Erfolg.<br /></span></p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">Es spielten: Justine Liebald; Katharina Schuldt (9 Tore), Denise Grossheim (7 Tore), Katrin Feldmann (5 Tore), Deborah Berge (6 Tore), Mayra Janssen (2 Tore), Lea Jung (3 Tore), Nadja Spilok (1 Tor), Mara König und Chiara Janssen.</span></p></span>', '84.59.6.214'),
(235, 15, 14, '2008-04-13 22:26:48', '2008-02-16 00:00:00', 'outwards', 'HSG Erfelden - mJugendE1	20:29', '<p>Am vergangenen Samstag gastierten die E1-Handballer in Crumstadt bei der HSG Erfelden. Im Vorfeld war vom Tabellenführer ein klarer Erfolg zu erwarten. Aber duch den kurzfristigen Ausfall von vier Stammspielern mussten sich die Griesheimer mit Spielern von der E2 ergänzen. Im Spielverlauf zeigte sich, dass die TuSler dadurch vor allem im Abwehrverhalten mit Abstimmungsproblemen zu kämpfen hatten. Im Angriff waren aber wie gewohnt Felix Türke und Colin Schupp die treibenden Kräfte und so konnte sich der TuS bis zur Pause schon mit 18:11 absetzen. </p><p>In der zweiten Halbzeit machte es sich aber dann doch sehr bemerkbar, dass die Handball-Kids in dieser Form nicht oft zusammen spielen. Mit vielen Missverständnissen in der Abwehr und einigen technischen Fehlern machten sich die Griesheimer selbst das Leben schwer. Dennoch gelang es, den Vorsprung noch ein wenig auszubauen. Am Ende siegten die Heimischen mit 29:20 gegen die HSG. Die Tabellenführung konnte somit gehalten werden. </p><p>Es spielten: Leichtweis (Torwart), Becker, Blum (1 Tor), Feldmann (4), Gromes (2), Günther (2), Posocco (2), Reuter, Schupp (10), Türke (8)</p><p>&#160;</p>', '84.59.1.243'),
(233, 6, 5, '2008-04-13 22:26:48', '2008-02-16 00:00:00', 'home', 'HSG Fürth/Krumbach - TUS Griesheim II	37:19', '  <p><strong>2. Mannschaft unterliegt deutliche gegen Fürth/Krumbach</strong></p><p>Mit einem Minimalkader angereist konnte man gegen die im Gegenstoß stark spielenden Odenwälder nur 20 Minuten mithalten. Bis zum Spielstand von 10:11 konnte man das Spiel offen gestalten. Danach setzte sich die stärkere Physis der Gastgeber durch und schon zur Pause lag man mit 11:17 Toren zurück. Auch nach dem Wechsel bot sich das gleiche Bild. Fürth/Krumbach spielte schnell nach vorne und nutze jede Chance zu einfachen Toren im Gegenstoß. Da auch in der Abwehr ohne den nötigen Einsatz gespielt wurde, setzte es eine deutliche Niederlage mit 19:37 Toren.</p><p>Es spielten:</p><p>Kay Grund im Tor, Dennis Killer 1, Uwe Drechsler 2, Dirk Höhl 4, Ronald Bausch 1, Sascha Weikert 2, Sven Schürer 4, Mario Schecker 2 und Christian Lehmkühler 3.</p>', '84.167.119.228'),
(234, 10, 5, '2008-04-13 22:26:48', '2008-02-16 00:00:00', 'outwards', 'JSG Gersprenztal - mJugendB	40:16', '<p><strong>B-Jugend ohne Chance gegen Gersprenztal</strong></p><p>Gegen die HSG Gersprenztal gab es eine deutliche 40:16 Niederlage zu verzeichnen. Ohne die verletzten und erkrankten Jan Eidemüller, Arseniy Zankov und Jan Döll hatte man gegen die in der Abwehr sehr kompakt stehenden Odenwälder nicht viele Chancen zu Torerfolgen zu kommen. Da auch die Gegenstöße nicht verhindert werden konnten, lag man zur Pause schon deutlich mit 17:10 im Rückstand. Auch in der 2. Spielhälfte fand man kein Mittel gegen die 6:0 Abwehr der Gastgeber. Da man auch in der Abwehr ohne die nötige Härte spielte kam es zu der deutlichen Niederlage gegen den Tabellenführer aus dem Odenwald. </p><p>Es spielten:</p><p>Christian Kindermann und Andreas Gerhard im Tor, Fabian Seigfried (5), Marvin Gernandt (2), Erik Neumann (2), Jan Tachtler  (2), Kai Feldmann (1), Andreas Margarit (1), Sven Rinschen (3), Patrick Pollner, Malte Just und Darren Weber.</p>', '84.167.119.228'),
(236, 11, 6, '2008-04-13 22:26:48', '2008-02-17 00:00:00', 'home', 'mJugendC1 - TS Steinheim	24:19', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">mC - TS Steinheim</span></strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"></span><span style="font-size: large; font-family: ''Comic Sans MS''; color: #339933">24 : 19 (11 : 15)</span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #339933">17.02.2008 - 10.00 Uhr</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Wie verwandelt kamen die Griesheimer Jungs aus der Kabine. Nachdem in der 1. Halbzeit die Gäste aus Steinheim alles richtig gemacht hatten und folgerichtig mit vier Toren (11:15) führten, ging der zweite Durchgang mit 13:4 an die Gastgeber. Aufgrund von krankheitsbedingten Ausfällen und der Doppelbelastung von mehreren Spielern ist die Leistungssteigerung nach der Pause umso höher zu bewerten.</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Es spielten: Max Schielke; Sven Rinschen (7 Tore), Darren Weber (4 Tore), Kai Feldmann (7 Tore), Patrick Pollner, Malte Just (3 Tore), Ricardo Wilhelm (3 Tore), Lukas Katzenmeier und Sebastian Groll.</span></p></span>', '84.59.11.137'),
(237, 13, 6, '2008-04-13 22:26:48', '2008-02-15 00:00:00', 'outwards', 'SVC Gernsheim - wJugendC	26:33', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>SVC Gernsheim- wC</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>26 : 33 (15 : 19)</strong></span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">15.02.2008 - 19.00 Uhr</span></p><p> </p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /><br />Beim Tabellenzweiten konnten die Griesheimer Mädchen die Meisterschaft in der Bezirksoberliga unter Dach und Fach bringen. Überzeugend waren die spielerisches Momente im Kleingruppenspiel im Angriff. Allerdings fiel der Sieg bedingt durch einige Fehler im Tempospiel und inkonsequentes Abwehrspiel weniger deutlich als möglich aus.</span></p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br />Es spielten: Justine Liebald; Katharina Schuldt (5 Tore), Deborah Berge (3 Tore), Katrin Feldmann (9 Tore), Denise Großheim (8 Tore), Lea Jung (1 Tor), Mayra Janssen (4 Tore), Lea Maria Wenzel (2 Tore), Nadja Spilok (1 Tor ) und Mara König.</span></p></span>', '84.59.11.137'),
(238, 5, 17, '2008-04-13 22:26:48', '2008-02-16 00:00:00', 'outwards', 'HSG Maintal - Herren 1	30:32', '<span style="border-collapse: separate; font-size: 10px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; font-family: Verdana; color: #000000" class="Apple-style-span"><p style="font-size: 10pt; font-family: ''Courier New''"><span><span class="headline1">Überraschungserfolg bei der HSG Maintal</span></span></p><p style="text-align: justify" class="headline2"><span style="font-size: 13px; font-family: ''Courier New''">TUS-Handballer gewinnen mit einer starken Leistung 32:30</span> </p><p style="text-align: justify"><span style="font-size: 13px; font-family: ''Courier New''">Dank einer geschlossenen Mannschaftsleistung und guten Nerven gelang den Handballern vom TUS Griesheim ein Sieg bei der HSG Maintal. Mit diesem Sieg hätte vorher kaum jemand gerechnet, da Griesheim dieses Jahr bereits 3 Mal verlor, während sich Maintal in der Spitzengruppe der Landesliga etablierte. Es war eine Partie auf gutem Niveau, in der die Griesheimer der Spitzenmannschaft aus Maintal in nichts nachstand.</span></p><p style="text-align: justify; font-size: 10pt; font-family: ''Courier New''"><span>Griesheim war von Beginn an hellwach und startete gut in die Partie. Die Abwehr hatte den starken Rückraum von Maintal gut im Griff und verhinderte Anspiele auf den gefährlichen Kreisläufer der Gastgeber. So konnte man einige Male per Gegenstoß zu einfach erzielten Toren kommen. Auch im Angriff kam man von allen Positionen zum Torerfolg. So setzte man sich über ein 8:3 bis zum 11:6 ab. Nicholas Wurth konnte in dieser Phase mit beherzten Aktionen Akzente setzen.</span></p><p style="text-align: justify; font-size: 10pt; font-family: ''Courier New''"><span>Doch Maintal kämpfte weiter und steigerte sich in Abwehr und Angriff, während die Griesheimer nach der 20. Minute eine Schwächephase hatten. Maintal verkürzte den Rückstand Tor um Tor und schließlich stand es zur Halbzeit 15:15.</span></p><p style="text-align: justify; font-size: 10pt; font-family: ''Courier New''"><span>Nach der Pause entwickelte sich eine spannende Partie, in der die Führung ständig wechselte. Sogar in doppelter Unterzahl gelangen den Griesheimern zwei wichtige Treffer und man konnte eine 29:26 Führung herausspielen. Maintal konnte noch einmal bis auf 29:30 verkürzen, doch Griesheim behielt die Nerven und konnte den knappen Vorsprung bis zum Ende retten.</span></p><p style="text-align: justify; font-size: 10pt; font-family: ''Courier New''"><span>In der spannenden Schlussphase konnte sich besonders Torhüter Schmand auszeichnen, der einige hundertprozentige Chancen des Gegners entschärfen konnte. Der Schlüssel zum Erfolg der Griesheimer war die geschlossene Mannschaftsleistung sowohl in der Abwehr als auch im Angriff. Man war von allen Positionen gefährlich und alle eingesetzten Spieler konnten sich in die Torschützenliste eintragen. Im Gegensatz zu den letzten Spielen behielt man auch bei den Siebenmetern die Nerven, Daniel Mehring konnte alle sechs Siebenmeter verwandeln.</span></p><p style="text-align: justify; font-size: 10pt; font-family: ''Courier New''"><span>Nachdem man in dieser Saison nun zum wiederholten Male auswärts bei einer Spitzenmannschaft punkten konnte, gilt es im kommenden Heimspiel gegen Mörfelden eine ebenso starke Leistung vor eigenem Publikum abzurufen.</span></p><p style="text-align: justify; font-size: 10pt; font-family: ''Courier New''"><span>Torschützen: Mehring (9/6); Hamel, Wurth (je 4); Rinschen, S. Müller, Sirker (je 3); Zarko, Max, T. Müller (je 2)</span></p></span>', '130.83.196.30'),
(239, 9, 9, '2008-04-13 22:26:48', '2008-02-17 00:00:00', 'outwards', 'TSG Münster - mJugendA	27:39', 'Die A-Jugend mußte beim Tabellenführer der Oberliga, TSG Münster, antreten. Im Hinspiel schlug man sich beachtlich und verlor nur knapp, doch diesmal dauerte es lediglich 7 Minuten, bis man mit 0:8 in Rückstand fiel und eine Auszeit fällig war. Von nun an lief es besser und der eingewechselte Torhüter Yannick Hassenzahl konnte auch den ein oder anderen Schuß parieren, so dass man über ein 10:16 zum 13:22 Halbzeitstand kam. In der zweiten Halbzeit ließ es Münster etwas ruhiger angehen und das Spiel verlief weitgehend ausgeglichen bis zur 45. Minute. Erst dann schlichen sich mehr Fehler ins Griesheimer Spiel. Ein Zeichen davon war auch die schlechte Ausbeute von 4 Strafwürfen bei 8 Versuchen. Nach fragwürdigen Schiedsrichterentscheidung protestierte Trainer Uwe Rinschen wohl etwas zu lautstark und kassierte 2 min gegen die Bank, was beim Endstand von 27:39 jedoch nicht mehr entscheidend war. Bleibt zu hoffen, dass Tim Patrzalek, der sich gegen Ende ein Knieverletzung zuzog, zum nächsten Spiel gegen Breckenheim wieder fit ist.<br />Es spielten: Hassenzahl, Ulmrich und Vogel im Tor, Arenz (2), Patrzalek (3/1), Herr (3), Rinschen (9/1), Hinkel (4), Siebert, Bopp, Bork (2/2), Rampelt (4).   Vo', '84.58.210.59'),
(240, 13, 6, '2008-04-13 22:26:48', '2008-02-20 00:00:00', 'home', 'wJugendC - HSG Langen	32:18', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>wC - HSG Langen</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>32 : 18 (17 : 11)</strong></span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">20.02.2008 - 17.00 Uhr</span></p><p> </p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br />Es spielten: Justine Liebald; Katharina Schuldt (7 Tore), Deborah Berge (4 Tore), Katrin Feldmann (3 Tore), Denise Großheim (8 Tore), Lea Jung (3 Tore), Mayra Janssen (3 Tore), Lea Maria Wenzel (3 Tore), Nadja Spilok (1 Tor), Fabienne Suhe und Mara König.</span></p></span>', '84.59.30.209'),
(243, 15, 14, '2008-04-13 22:26:48', '2008-02-24 00:00:00', 'home', 'mJugendE1 - SG Egelsbach	40:8', '<p>Beim Spiel der E1-Jugend der TuS-Handballer gab es am Wochenende Tore im Minutentakt. Von Beginn an hatten sich die Heimischen vorgenommen, an diesem Tag die sich ergebenden Chancen auch konsequent zu nutzen. Obwohl nur mit sieben Spielern am Start, bestimmten die Griesheimer von Anfang an das Geschehen. Zur Pause stand es bereits 20:5, am Ende sogar 40:8 aus Sicht des TuS und das bei einer Spielzeit von nur 40 Minuten. Eine vorbildliche Abwehrarbeit ermöglichte den hohen Erfolg, bei dem sich alle Feldspieler in die Torschützenliste eintragen konnten.</p><p>Es spielten: Leichtweis (Torwart), Becker (8 Tore), Blum (7), Feldmann (9), Hartmann (3), Schupp (6) und Türke (7)</p><p>&nbsp;</p>', '84.58.250.116'),
(242, 11, 6, '2008-04-13 22:26:48', '2008-02-23 00:00:00', 'outwards', 'TV Gelnhausen - mJugendC1	23:31', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">TV Gelnhausen - mC</span></strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"></span><span style="font-size: large; font-family: ''Comic Sans MS''; color: #339933">23 : 31 (13 : 14)</span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #339933">23.02.2008 - 14.00 Uhr</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Nach einer ausgeglichenen 1. Halbzeit, in der die Griesheimer zwichenzeitlich mit vier Toren zurück lagen, steigerte sich die ganze Mannschaft im zweiten Durchgang deutlich. Gelnhausen konnte bis zum 19:20 mithalten - dann dominierte die variablere Abwehr mit dem guten Torwart Max Schielke und das effektiviere Kombinationsspiel der Gäste.</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Es spielten: Max Schielke; Sven Rinschen (8 Tore), Darren Weber (4 Tore), Kai Feldmann (8 Tore), Malte Just (4 Tore), Ricardo Wilhelm (3 Tore), Jan Döll (4 Tore), Max Eidemüller und Sebastian Groll.</span></p></span>', '84.59.1.64'),
(244, 13, 6, '2008-04-13 22:26:48', '2008-02-24 00:00:00', 'home', 'wJugendC - HSG Mörfelden/Walldorf	35:10', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>wC - HSG Mörfelden/Walldorf</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>35 : 10 (18 : 4)</strong></span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">24.02.2008 - 10.00 Uhr</span></p><p> </p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">Es spielten: Justine Liebald; Katharina Schuldt (6 Tore), Deborah Berge (2 Tore), Katrin Feldmann (5 Tore), Denise Großheim (7 Tore), Lea Jung (5 Tore), Mayra Janssen (4 Tore), Nadja Spilok (5 Tor3), Fabienne Suhe (1 Tor) und Mara König.</span></p></span>', '217.224.35.165'),
(245, 5, 3, '2008-04-13 22:26:48', '2008-02-25 00:00:00', 'home', 'Herren 1 - HSG Mörfelden-Walldorf	34:26', '<p align="justify"><strong>Zwei wichtige Punkte gegen den Abstieg</strong><br /><br />Nachdem man in der Vorwoche beim Dritten der Tabelle, der HSG Maintal, zwei wichtige Punkte gegen den Abstieg verbuchen konnte, erkämpfte sich die erste Mannschaft des TuS Griesheim zwei weitere Punkte gegen den direkten Konkurrenten HSG Mörfelden-Walldorf. Mit einer, vor allem in der ersten Halbzeit spielerisch und kämpferisch überzeugenden Leistung, gewann man verdient mit 34:26 (19:9).<br />Zu Beginn der Partie war beiden Mannschaften die Brisanz des Spiels anzumerken. Viele technische Fehler prägten das Bild der ersten fünf Minuten (3:2). Dann fanden die Griesheimer insbesondere in der Abwehr besser ins Spiel. Gestützt auf einen starken Torhüter Bär wurden viele Bälle erobert und per Tempogegenstoß verwandelt. Bis zur 25. Minute konnte man sich über 10:4 auf 16:6 absetzen. In dieser Phase gelang es auch aus dem gebundenen Spiel wichtige Treffer zu markieren. Mit einer beruhigenden 19:9 Führung ging es in die Kabinen.</p><p align="justify"><br />Nach dem Wechsel kamen die Gäste aus der Doppelstadt mit frischem Elan aus der Kabine und konnten auf 22:15 verkürzen. Auch wenn man sich durch die kurze Deckung gegen Spielmacher Müller beeindruckt zeigte, fanden die Griesheimer in diesem Spiel stets die passende Antwort. Selbst in doppelter Unterzahl wurden weitere Treffer markiert. Spätestens beim Stand von 29:21 zehn Minuten vor Schluss war die Partie entschieden.<br />Durch eine geschlossene mannschaftliche Leistung in Abwehr und Angriff gewann man letztlich hochverdient mit 34:26. Den Schwung der letzten beiden Siege gilt es nun in die kommenden beiden Spielen gegen HSG Nieder-Roden II und TV Groß-Zimmern mitzunehmen. Siege in diesen beiden Spielen würden den Anschluss an das gesicherte Mittelfeld bedeuten.</p><p align="justify"><br />Torschützen: Zarko (8/2); Mehring (7/1); S. Müller (5); Max, Wurth (je 4); Sirker, T. Müller, Hamel, Rinschen, Bork (je 1)</p>', '92.50.80.109'),
(246, 10, 5, '2008-04-13 22:26:48', '2008-02-24 00:00:00', 'home', 'mJugendB - HSG Nieder Roden	19:37', '<strong>Wieder deutliche Niederlage der B-Jugend</strong> <p>Mit überwiegend Spielern aus der C-Jugend angetreten hatte man gegen den Tabellenzweiten aus Nieder Roden keine Chance. Im Angriff tat man sich schwer gegen die großen Spieler aus dem Rodgau. Verworfene Bälle und technische Fehler ermöglichten es dem Gegner  zu einfachen Gegenstoßtoren zu kommen. Auch in der Abwehr hatte man Probleme mit den starken Außenspielern und nach einem Pausenstand von 9:20 wurde das Spiel deutlich mit 19:37 verloren. </p><p>Es spielten:</p>Christian Kindermann und Andreas Gerhard im Tor, Fabian Seigfried 7, Erik Neumann (2), Jan Tachtler 1, Kai Feldmann 2, Andreas Margarit, Sven Rinschen 4, Malte Just 1, Jan Döll 2, Sebastian Groll und Darren Weber.', '84.167.68.61'),
(247, 6, 5, '2008-04-13 22:26:48', '2008-02-24 00:00:00', 'home', 'TUS Griesheim II - HSG Mörfelden/Walldorf	26:16', '<strong>2. Mannschaft punktet gegen den Abstieg</strong> <p>Im Spiel gegen den Tabellenletzten aus Mörfelden/Walldorf hatte der Gegner den besseren Start und ging mit 2:0 in Führung. Danach bekam man den Gegner über eine gute Abwehrleistung immer besser in den Griff und zur Pause führte man mit 13:9 Toren. Auch nach dem Wechsel lagen die Vorteile auf Seiten des Tabellenletzten der mit 2 schnellen Toren auf 11:13 verkürzen konnte. Gut herausgespielte Tore aus dem Rückraum und über die Kreis führten dann aber wieder zu einem klaren Vorsprung und am Schluss wurde das Spiel deutlich mit 26:16 gewonnen.</p><p>Es spielten:</p><p>Kay Grund und Markus Kuhnke im Tor, Christian Lehmkühler 4, Dennis Killer 4, Sven Schürer 5, Martin Simmermacher 1, Benjamin von Stein 5, Mario Schecker 5, Kevin Herr 1, Daniel Arenz, Alex Maschkow, Sascha Weikert und Christian Döll.</p>', '84.167.68.61'),
(248, 9, 9, '2008-04-13 22:26:48', '2008-02-24 00:00:00', 'home', 'mJugendA - TV Breckenheim	32:37', '<p>Beim Heimspiel der A-Jugend gegen den TV Breckenheim ging es um Platz 3 der Oberliga. Das Hinspiel konnten die TUS''ler knapp für sich verbuchen. Es entwickelte sich ein spannendes Spiel auf hohem Niveau, in dem die Griesheimer in der 18. Minute  beim Stand von  9:10 erstmals die Führung abgaben. Beim Stand von 16:16 wurden die Seiten gewechselt. Erst in der 45. Minute konnte sich eines der Teams ein 2 Tore Vorsprung erarbeiten. Leider war es Breckenheim, die von Nachlässigkeiten in der Griesheimer Deckung profitierten. Erst 10 Minuten vor Schluß beim Stand von 27:27 konnte Breckenheim vier Tore in Folge erzielen. Die nun folgende offene Abwehr des TUS erwies sich nicht stabil genug, um das Blatt noch einmal zu wenden. Man verlor mit 32:37 deutlicher, als der Leistungunterschied in Wirklichkeit war. Vielleicht war es die besser besetzte Bank und die bessere körperliche Konstitution, die letztendlich den Ausschlag gab. Nun muß man sich mit dem 6. Tabellenplatz begnügen.</p> <p>Es spielte: Hassenzahl, Ulmrich und Vogel im Tor, Arenz, v.Stein, Patrzalek (1), Baier (3), Herr (5), Rinschen (8), Hinkel (6), Bork (4), Rampelt (5). Vo</p> ', '84.58.209.186'),
(250, 15, 14, '2008-04-13 22:26:48', '2008-03-01 00:00:00', 'outwards', 'TG Eberstadt - mJugendE1	19:30', '<p>Am vergangenen Samstag zur Mittagszeit gastierte die E1-Jugend der Handballer bei der TG Eberstadt. Die Griesheimer gingen zwar als klare Favoriten in die Begegnung, konnten aber wieder nicht komplett antreten. Trotzdem gab es am Ende einen klaren und verdienten 30:19 Erfolg für den TuS.</p><p>Es spielte: Leichtweis (Torwart), Becker (1 Tor), Blum (3), Feldmann (1), Hartmann (1), Jacqout (12), Posocco, Schupp (12)</p>', '84.58.230.48'),
(251, 11, 6, '2008-04-13 22:26:48', '2008-03-02 00:00:00', 'home', 'mJugendC1 - JSG Wallstadt	30:21', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong><span style="color: #339933">mC - JSG Wallstadt</span></strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"></span><span style="font-size: large; font-family: ''Comic Sans MS''; color: #339933">30 : 21 (17 : 9)</span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #339933">02.03.2008 - 10.00 Uhr</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Mit einem auch in der Höhe verdienten Sieg gegen die bisher ungeschlagenen Gäste krönte die mC-Jugend eine gute Saisonleistung, die mit einem zweiten Platz in der Oberliga belohnt wurde. Von Beghionn an nahmen die Griesheimer das Spiel in die Hand: Die Abwehr stand sicher, Torwart Max Schielke war ein starker Rückhalt und im Angriff wurde sehr effektiv kombiniert. Mit der 17:9-Führung zur Pause wurde der Grundstein für den Sieg gelegt. Die als feststehender Meister angereisten Gäste wehrten sich nur noch phasenweise durch Einzelaktikonen. Dem geschlossenen Mannschaftsspiel der Griesheimer hatten sue nichts entgegenzusetzen.</span></p><p><span style="font-family: ''Comic Sans MS''; color: #339933"><br />Es spielten: Max Schielke; Sven Rinschen (9 Tore), Darren Weber (6 Tore), Kai Feldmann (2 Tore), Malte Just (2 Tore), Ricardo Wilhelm (3 Tore), Jan Döll (6 Tore), Patrick Pollner (2 Tore), Max Eidemüller, Lukas Katzenmeier und Sebastian Groll.</span></p></span>', '217.224.34.19'),
(252, 13, 6, '2008-04-13 22:26:48', '2008-03-02 00:00:00', 'outwards', 'SG Arheilgen - wJugendC	14:50', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>SG Arheilgen - wC</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>14 : 50 (7 : 20)</strong></span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">02.03.2008 - 12.55 Uhr</span></p><p> </p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br />Es spielten: Justine Liebald; Deborah Berge (9 Tore), Katrin Feldmann (7 Tore), Denise Großheim (15 Tore), Lea Jung (6 Tore), Mayra Janssen (6 Tore), Lea Maria Wenzel (3 Tore), Tanja Birli (5 Tore), Fabienne Suhe, Chiara Janssen und Mara König.</span></p></span>', '84.58.237.130'),
(253, 5, 17, '2008-04-13 22:26:48', '2008-03-01 00:00:00', 'outwards', 'HSG Nieder-Roden II - Herren 1	32:25', '<span class="headline1">Am Ende fehlte die Kraft</span><br /><span class="headline2">TUS Griesheim verliert gegen HSG Nieder-Roden II mit 25:32</span><br /><br />Trotz zweier Siege in den letzten beiden Spielen war die Ausgangssituation für die 1. Herren der TUS-Handballer schlecht. Ein Grund war die knappe Personaldecke, mangelnde Chancenverwertung in der ersten Halbzeit ein weiterer. Oliver Schmand und Benjamin Sirker fielen aus und Simon Bär, Stefan Hamel und David Max gingen angeschlagen ins Spiel.<br />Dennoch gelang es den Griesheimern die Angriffsphase ausgeglichen zu gestalten. Die körperlich starken Rückraumspieler des Gegners wurden früh attackiert und Torwart Simon Bär konnte etliche Bälle des Gegners parieren. Allerdings wurden die Chancen zum Gegenstoß, die aus der starken Abwehr resultierten, nicht konsequent genutzt. So konnte sich keine der beiden Mannschaften absetzen. Als Griesheim im Angriff mit Dennis Bork einen zweiten Kreisläufer aufbot, funktionierte der gebundene Angriff in der 4-2-Formation besser und man setzte sich mit 2 Toren ab. Doch dann verletzte sich Dennis Bork am Fuß, so dass diese Angriffsvariante nicht mehr gespielt werden konnte. Dennoch ging Griesheim mit einer 12:11 Führung in die Kabine.<br />Auch zu Beginn der zweiten Halbzeit stand die Griesheimer Abwehr gut und es gelang eine 16:13 Führung herauszuspielen. Doch in der Folge wurden viele gut Chancen ausgelassen, was Nieder-Roden sofort bestrafte und schließlich selbst in Führung ging. Nun machten sich die mangelnden Wechselmöglichkeiten bemerkbar, der Mannschaft waren die schwindenden Kräfte anzumerken. Fast alle Spieler mussten 60 Minuten durchspielen. In der Abwehr konnte man dem körperlich starken Gegner immer weniger Paroli bieten und die Dynamik im Angriff ließ nach. Das nutzte die Regionalliga-Reserve von Nieder-Roden, um sich einen entscheidenden Vorteil herauszuspielen. Griesheim konnte nur noch wenig entgegensetzen und verlor schließlich etwas zu deutlich mit 25:32. Mit einem vollzähligen Kader wäre hierbei ein Sieg durchaus im Bereich des Möglichen gewesen.<br />Es bleibt zu hoffen, dass die angeschlagenen Spieler möglichst bald wieder einsatzfähig sind, um den Kampf um den Klassenerhalt erfolgreich zu gestalten. Sechs voll einsatzfähige Feldspieler stellen für die Mission Klassenerhalt eine zu dünne Personaldecke dar. Das nächste Spiel beim abgeschlagenen Tabellenletzten TV Groß-Zimmern ist dabei richtungweisend (Sonntag, 09.03., 17:30)<br /><br />Tore: Mehring (10/3), Wurth (7), Zarko (5), S.Müller (1), Bork (1)<br />', '130.83.196.30'),
(254, 6, 5, '2008-04-13 22:26:48', '2008-03-01 00:00:00', 'home', 'TV Groß Rohrheim - TUS Griesheim II	31:21', ' <strong>Niederlage gegen Groß Rohreim</strong> <p>Gegen Groß Rohrheim konnte die Mannschaft nur in der 1. Halbzeit einigermaßen mithalten. Dank einer guten Abwehrarbeit kam Groß Rohrheim nur zu 11 Treffern. Da man aber im Angriff ohne die nötige Durchschlagskraft agierte, gelangen nur 7 Tore zum 7:11 Pausenstand. Nach dem Wechsel konnte man das Spiel bis  zum 17: 20  offen gestalten. Danach hatte man dem Gegner nichts mehr zuzusetzen und verlor das Spiel noch deutlich mit 21:31.</p><p>Es spielten: </p><p>Kay Grund, Markus Kuhnke und Michael Helfmann im Tor, Dirk Höhl 9, Christian Döll 1,  Dennis Killer, Uwe Drechsler 3, Sven Schürer 4, Mario Schecker 1, Christian Lehmkühler 3 und Sascha Weikert</p>', '84.167.103.167'),
(255, 10, 5, '2008-04-13 22:26:48', '2008-02-29 00:00:00', 'outwards', 'JSG Crumstadt/Goddelau - mJugendB	33:18', '  <p><strong>Klare Niederlage gegen Crumstadt/Goddelau</strong></p><p>Mit überwiegend Spielern aus der C-Jugend angetreten hatte man gegen die durchwegs älteren Spieler aus  Crumstadt/Goddelau wenig entgegenzusetzen. Eine schwache Abwehrleistung und eine katastrophale Wurfauswertung in der ersten Halbzeit führten zum 9:14 Pausenstand. Nach dem Seitenwechsel das gleiche Spiel. In der Abwehr wurde nicht zugepackt und so kam Crumstadt zu einfachen Toren aus dem Spiel und auch im Gegenstoß. Das Spiel wurde so deutlich mit 18:33 verloren.</p><p>Es spielten:</p><p>Andreas Gerhard und Christian Kindermann im Tor, Malte Just, Arseniy Zankov, Marvin Gernandt 4, Jan Tachtler 1, Kai Feldmann 4, Patrick Pollner 1, Darren Weber 1, Jan Döll 3, Ricardo Wilhelm 1, Sven Rinschen 3.</p>', '84.167.103.167'),
(256, 10, 5, '2008-04-13 22:26:48', '2008-03-02 00:00:00', 'home', 'HSG Hochheim/Wicker - mJugendB	35:25', ' <strong>Steigerung gegen Hochheim/Wicker</strong> <p>Auch gegen Hochheim/Wicker mussten wieder Spieler aus der C-Jugend aushelfen. Und auch in diesem Spiel verschlief man die 1. Halbzeit in der Abwehr und auch die Chancenauswertung erinnerte an das Spiel gegen Crumstadt/Goddelau. Im Gegensatz zu diesem Spiel zeigte man sich in der 2. Halbzeit von der Einstellung in Abwehr und Angriff aber dann deutlich verbessert. In der Abwehr wurde entschlossen zugepackt und auch im Angriff trauten sich die Spieler mehr zu. Nach dem deutlichen 9:18 Pausenstand konnte man so die 2. Halbzeit, trotz der 25:35 Niederlage ausgeglichen gestalten und kann somit mit mehr Selbstvertrauen in die noch ausstehenden Spiele gegen Dutenhofen, Wanfried und Wettenberg gehen.</p><p>Es spielten: </p><p>Andreas Gerhard und Christian Kindermann im Tor, Malte Just, Arseniy Zankov 7, Marvin Gernandt 4, Jan Tachtler 3, Kai Feldmann 2, Patrick Pollner 3, Jan Döll 4,  Sven Rinschen 2.</p>', '84.167.103.167'),
(257, 9, 12, '2008-04-13 22:26:48', '2008-03-01 00:00:00', 'outwards', 'HSG Langen - mJugendA	31:30', '  <p>Am Samstag traf die A-Jugend in der Handball-Oberliga im Lokalderby auf die HSG Langen. Von Beginn an zeigten sich die Griesheimer hoch motiviert und hielten trotz zahlreicher Ausfälle gut mit. Leider konnte das Team eine 13:16 Führung nicht in die Pause retten und so ging es mit 17:16 in die 2. Halbzeit. Auch hier setzten sich die Griesheimer wieder mit 3 Toren ab. Aber wie schon in der ersten Halbzeit wurde dieser Vorsprung durch zu viele Fehler in der Endphase einer Halbzeit verspielt. Ab dem 26:26 konnte sich keine Mannschaft mehr entscheidend absetzen. Die letzten 2 Schlussminuten waren dann dramatisch. Die HSG Langen führte 30:28, als Griesheimer sich den Ball erkämpften und zum Anschusstreffer kamen. Ein nochmaliger Ballgewinn führte 20 Sekunden vor Schluss zum Strafwurf. Dieser wurde erfolgreich zum 30:30 Ausgleich verwertet. Leider war das Team von Uwe Rinschen in den letzten Sekunden des Spiels nicht konsequent genug und die HSG Langen erzielte mit dem Schlusssignal den 31:30 Siegtreffer. Die Enttäuschung über die unnötige Niederlage war allen Griesheimern ins Gesicht geschrieben. Sie zeigt aber auch, dass der kräftemäßige Verschleiß für die jungen A-Jugend Spieler, aufgrund der Doppelbelastung durch erforderliche Einsätze im Erwachsenenbereich, enorm hoch ist und mit allem Engagement und Einsatzwillen nicht auszugleichen ist.</p>  <p>Es spielten: Yannick Hassenzahl im Tor, Stefan Siebert (1), Daniel Arenz, Benjamin v. Stein (3), Tim Patrzalek (3), Björn Ehmke (4), Christoph Rampelt (1), Kevin Herr (2), Tim Rinschen (12) und Miro Hinkel (4) - UR</p>  ', '192.166.56.36'),
(258, 13, 6, '2008-04-13 22:26:48', '2008-03-03 00:00:00', 'home', 'wJugendC - TSV Pfungstadt	24:12', '<span style="font-size: 16px; font-family: Times" class="Apple-style-span"><strong><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>wC - TSV Pfungstadt</strong></span></p><p><span style="font-size: large; font-family: ''Comic Sans MS''; color: #ff6600"><strong>24 : 12 (10 : 4)</strong></span></p><p> </p></strong><p><span style="font-family: ''Comic Sans MS''; color: #ff6600">03.03.2008 - 19.00 Uhr</span></p><p> </p><p><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br /><br /></span><span style="font-family: ''Comic Sans MS''; color: #ff6600"><br />Es spielten: Justine Liebald; Deborah Berge (5 Tore), Katrin Feldmann (4 Tore), Denise Großheim (8 Tore), Katharina Schuldt (2 Tore), Lea Jung (1 Tor), Mayra Janssen, Lea Maria Wenzel (2 Tore), Tanja Birli, Fabienne Suhe (1 Tor), Nadja Spilok, Chiara Janssen (1 Tor) und Mara König.</span></p></span>', '84.58.237.130'),
(266, 15, 14, '2008-04-14 21:04:47', '2008-03-14 00:00:00', 'article', 'E-Jugend in der Kletterwand', '<img src="http://handball.griesm.de/images/gallery/2007/me_jugend/misc/thumb_pic00018.jpg" alt="Tim-Sören" title="Tim-Sören" width="450" height="600" />', '84.58.255.60'),
(267, 15, 14, '2008-04-14 21:04:47', '2008-03-14 00:00:00', 'article', 'Lisa', '<p><img src="http://handball.griesm.de/images/gallery/2007/me_jugend/misc/thumb_pic00015.jpg" alt="Lisa" title="Lisa" width="450" height="600" /></p>', '84.58.255.60'),
(268, 15, 14, '2008-04-14 21:04:47', '2008-03-14 00:00:00', 'article', 'Felix', '<img src="http://handball.griesm.de/images/gallery/2007/me_jugend/misc/thumb_pic00014.jpg" alt="Felix" title="Felix" width="450" height="600" />', '84.58.255.60'),
(261, 15, 14, '2008-04-13 22:26:48', '2008-03-09 00:00:00', 'home', 'mJugendE1 - HSG Dornheim/Groß-Gerau	32:22', '<p>Mit großer Spannung fieberten die E1-Handballer des TuS ihrem letzten Saisonspiel entgegen. Als Gäste empfingen sie am vergangenen Sonntag die HSG Dornheim/Groß-Gerau in der Großsporthalle. Von Anfang an war klar, dass dieses Spiel gewonnen werden musste, will man die Tabelle als Erster abschließen. So legten die Handball-Kids auch los. Es wurde schön kombiniert und deshalb konnten die Griesheimer bis zur Pause auch schon eine 17:10 Führung herauswerfen. </p><p>Nach dem Wechsel wurde es allerdings noch einmal spannend. Die HSG kam Tor auf Tor heran und als der Abstand nur noch drei Tore betrug, nahm Trainer Christian Rechner eine Auszeit. Danach lief es wieder besser und so konnte der TuS das Spiel am Ende mit 32:22 für sich eintscheiden. Damit konnte die E1 die Rückrunde als Tabellenführer abschließen.</p><p>Es spielten: Leichtweis (Torwart), Becker (1 Tor), Birli, Blum, Feldmann (1), Flügger (1), Fritzsche (2), Hartmann, Jacquot (10), Posocco, Schupp (10) und Türke (7)</p><p>Nach dem Spiel trafen sich die E-Jugendlichen mit ihren Angehörigen im Foyer der Halle, um den Saisonausklang noch gemütlich zu feiern. Bei einem kalten Buffet, Würstchen, Hot Dogs und kühlen Getränken wurde noch eine ganze Weile über die vergangene Runde diskutiert. Ein Höhepunkt war sicher auch das Spiel der Kinder gegen die Papas und eine Mama, das man als Unendschieden werten konnte. Für die meisten Handball-Kids heißt es jetzt, der E-Jugend adieu zu sagen. Nach den Osterferien suchen sie in der D-Jugend nach neuen Herausforderungen.</p>', '84.58.234.73'),
(262, 5, 3, '2008-04-13 22:26:48', '2008-03-10 00:00:00', 'outwards', 'TV Groß-Zimmern - Herren 1	28:49', '<p>Wichtige Punkte souverän erspielt (13:24) 28:49<br /> <br /> <br /> Am frühen Sonntagabend trat der TuS Griesheim beim Tabellenletzten TV Groß-Zimmern an. Man konnte im Vergleich zum letzten Spiel auf einen vollständigen Kader zurückgreifen, da auch drei A-Jugendspieler mitgereist sind.</p><div style="direction: ltr"> Die Griesheimer begannen konzentriert und erspielten sich in den ersten 10.Minuten eine klare 1:7 Führung. Der Schlüssel dazu lag in der Abwehr und in schnellen Gegenstößen. Der Spielstand pendelte sich nun bis zu der 21. Spielminute bei 6 Toren Führung ein. Dann suchten die Griesheimer die Entscheidung und zogen bis zum Halbzeitpfiff auf 13:24 davon. Nun war der Wiederstand der Gastgeber gebrochen. Hervorzuheben sind die starke Torhüterleistung von Simon Bär in der ersten Halbzeit und die souveränen Tore über rechts außen von Daniel Mehring.<br /> <br /> In der zweiten Halbzeit begann das Spiel, wie es in der ersten Halbzeit beendet wurde. Man spielte erneut konzentriert und baute die Führung weiter aus, was bei diesem Spielstand nicht selbstverständlich ist. Insbesondere die jungen Spieler des TuS konnten nun Akzente setzen. Tim  Rinschen kam durch schnelle Gegenstöße zum Torerfolg und Benjamin von Stein konnte in seinem ersten Spiel für die Aktiven schöne Tore über den Kreis erzielen. So baute der TuS Griesheim seine Führung weiter aus und verpasste die 50 Tore Marke am Ende nur hauchdünn. Das Spiel endete mit dem überragenden Ergebnis von 28:49 für die Griesheimer Jungs.<br /> <br /> Nun gilt es mit diesem starken Spiel im Rücken weiter auf Punktejagd in heimischer Halle zu gehen, in der man am kommenden Sonntag (18:00 Uhr) auf das Spitzenteam aus Babenhausen trifft. Wenn die Mannschaft wieder eine gute Leistung abrufen kann, ist ein spannendes Spiel gegen den<br /> Tabellenführer zu erwarten. Zudem gilt es Revanche für das Hinspiel zu nehmen, bei dem man nach starker Leistung durch einen Strafwurf in der letzten Sekunde noch den Ausgleich hinnehmen musste.<br /> <br /> Torschützen:<br /> <br /> Daniel Mehring (10), Damir Zarko (8), Tim Rinschen und Sebastian Müller (je 7), Nicholas Wurth und Till Brandenburger (je 5), Benjamin von Stein, Stefan Hamel, Timo Müller (je 2), Benjamin Sirker (1)<br /> </div>', '81.210.134.142'),
(264, 9, 12, '2008-04-13 22:26:48', '2008-03-11 00:00:00', 'home', 'mJugendA - HSG Gensungen/Felsberg	27:35', '  <p><span style="font-size: 12pt; color: windowtext">Am vergangen Sonntag empfing die männliche A-Jugend in der Oberliga den Tabellenzweiten HSG Gensungen/Felsberg. Die beiden B-Jugendlichen Arseniy Zankow und Marvin Gernandt vertraten Benjamin von Stein und Tim Rinschen, die beide bei der ersten Mannschaft aushalfen. Auch Dennis Bork konnte verletzungsbedingt nicht als Kreisläufer zum Einsatz kommen. Unbeeindruckt der fehlenden Spieler, vom Tabellenplatz des Gegners und den letzten verlorenen Spielen fanden die Griesheimer mit 6:3 gut ins Spiel. Fehler im Abwehrverband, der sich gegenüber den vorangegangenen Spielen verbessert zeigte, und Abschlußschwächen im Angriff ließen die TuSler zurückfallen. So musste zur Pause ein Rückstand von 12:17 verbucht werden. In der zweiten Halbzeit arbeitete sich die Mannschaft von Uwe Rinschen noch einmal auf einen 3 Tore Rückstand heran. Aber wieder waren es Unkonzentriertheiten, die das Team zurückfallen ließ. Dennoch kämpfte die A-Jugend gegen eine hohe Niederlage an. Zum Schluß verlor man achtbar mit 27:35. </span></p>  <span style="font-size: 12pt; font-family: Verdana">Es spielten: Yannick  Hassenzahl, Steffen Vogel und Tim Ulmrich im Tor, Stefan Siebert, Daniel Arenz (1), Maximilian Bopp (1), Lucas Baier (5), Arseniy Zankow (2), Marvin Gernandt (1), Tim Patrzalek (7), Björn Ehmke (6), Christoph Rampelt (1), Kevin  Herr (2), und Miro Hinkel (1) - SV</span>', '217.224.109.40'),
(265, 10, 12, '2008-04-13 22:26:48', '2008-03-09 00:00:00', 'home', 'mJugendB - HSG Dutenhofen/Münchholzhausen	30:30', '  <p><span style="font-size: 10.5pt; font-family: ''Helvetica Neue''">In einem spannenden und mit hoher Intensität geführten Spiel teilte sich die mB-Jugend die Punkte mit den Gästen <span style="color: navy">der </span>HSG Dutenhofen/Münchholzhausen. Die Griesheimer Abwehr, gestützt auf einen guten Max Schielke im Tor, hatte alle Hände voll zu tun, die körperlich deutlich überlegenen Gäste in den Griff zu bekommen. Im Angriff wurde flüssig kombiniert und mit hoher Konzentration abgeschlossen. Trotzdem lag die Mannschaft zur Pause mit einem Tor zurück. Nach dem Seitenwechselsetzte sich das knappe Spiel fort und eine Minute vor Schluß lagen die Gastgeber sogar in Führung. Doch ein Fehlwurf und ein schneller Gegenzug führten zum leistungsgerechten Remis.</span></p>    <p><span style="font-size: 10.5pt; font-family: ''Helvetica Neue''">Dabei waren: Max Schielke, Andreas Gerhard, Christian Kindermann; Sven Rinschen (6 Tore), Arseniy Zankov (11 Tore), Marvin Gernandt (7 Tore), Kai Feldmann, Darren Weber, Erik Neumann (3 Tore), Sebastian Groll, Patrick Pollner, Jan Tachtler und Malte Just.- KF</span></p>  ', '217.224.109.40'),
(270, 6, 5, '2008-04-13 22:26:48', '2008-03-16 00:00:00', 'home', 'TUS Griesheim II - HSG Bensheim/Auerbach	35:26', '<p>Wieder Sieg gegen Bensheim/Auerbach  </p><p>Gegen Bensheim/Auerbach gab es wie schon im Hinspiel einen deutlichen 35:26 Sieg. Die zweite Mannschaft hatte den besseren Start und konnte schnell mit 6:2 in Führung gehen. Gute Abwehrarbeit und eine ansprechende Chancenauswertung führten bis zur Pause zum 18:11 Pausenstand. Nach dem Wechsel kam Bensheim besser ins Spiel und konnte, auch dank der schlechten Chancenauswertung der TUS`ler, bis zum 25:22 verkürzen. Schwächen im Angriff auf Seiten der Gäste konnten dann in den letzten 10 Spielminuten für Gegenstoßtore genutzt werden. Auch eine Manndeckung der Gäste führten nicht zum gewünschten Erfolg und so konnte mit dem 35:26 ein deutlicher und wichtiger Sieg eingefahren werden.</p>  <p>Es spielten: </p>  <p>Kay Grund, Markus Kuhnke und Michael Helfmann im Tor, Martin Simmermacher 5, Dennis Killer 3, Ronald Bausch 6,  Dirk Höhl 4, Christian Döll 7,  Mario Schecker 6, Julian Vogt 4 und Uwe Drechsler</p>', '84.167.90.234'),
(271, 9, 12, '2008-04-13 22:26:48', '2008-03-15 00:00:00', 'outwards', 'HSG Baunatal - mJugendA	36:31', '  <p><span style="font-family: Arial">Am vergangen Samstag trat die männliche A-Jugend zum letzten Spiel in der Oberliga bei der HSG Baunatal an. Von Beginn an standen die Griesheimer unter Druck. Zur Mitte der ersten Halbzeit setzte sich Baunatal mit 6 Toren ab. Die Griesheimer ließen nicht nach und konnten bis zur Halbzeit auf 18:16 verkürzen. Fortan entwickelte sich ein spannendes Spiel, bei dem leider die Chancenverwertung auf Griesheimer Seite einen Ausgleich verhinderte. Alleine 4 Strafwürfe konnte nicht in Torerfolge umgesetzt werden. Dennoch gaben sich die Griesheimer nicht auf und versuchten in den letzten Minuten mit schnellen Abschlüssen noch zum verdienten Ausgleich zu kommen. Leider war das Glück in dieser Phase nicht mit den Griesheimern und so verlor man mit 36:31. </span></p>  <p><span style="font-family: Arial">Es spielten: Yannick Hassenzahl und Steffen Vogel im Tor, Daniel Arenz (1), Benjamin von Stein (2), Maximilian Bopp, Lucas Baier (2), Tim Patrzalek, Björn Ehmke (6), Christoph Rampelt (4), Kevin Herr, Tim Rinschen (12) und Miro Hinkel (4) - UR</span></p>  ', '192.166.56.36');
INSERT INTO `articles` (`id`, `cat_id`, `editor_id`, `last_update`, `date`, `type`, `title`, `text`, `ip`) VALUES
(272, 5, 3, '2008-04-13 22:26:48', '2008-03-18 00:00:00', 'home', 'Herren 1 - SG Babenhausen	32:38', '      <p>Starkes Spiel gegen den Tabellenführer (18:18) 32:38<br /><br />Griesheim empfing am gestrigen Abend den derzeitigen Tabellenführer SG Babenhausen. Wenn die Babenhäuser aufsteigen wollen konnte ihr Ziel nur der Sieg gegen die TuS Jungs sein. Die 1. Mannschaft findet jedoch mittlerweile immer ein Stückchen mehr zu ihrem „alten“ Spiel und wollte die zwei Punkte auf keinen Fall ohne Kampf abgeben, was schon in den ersten Minuten des Spiels deutlich wurde. Man konnte sich bis zur 15. Spielminute durch schöne Gegenstöße und einer soliden Abwehr eine 11:8 Führung erarbeiten. Neben einer erneut starken Leistung von Daniel Mehring konnte auch Sebastian Müller in dieser Phase überzeugen. </p>  <p>Babenhausen war sichtlich überrascht und musste erkennen das sie sich in Griesheim die Punkte schwer erarbeiten müssen. Sie nahmen den Kampf aber an und konnten bis zur Halbzeit ausgleichen. Dieses ist zum einen auf die stärker aufspielenden Gäste, die fortan gekonnt den Kreis in Szene setzten zurückzuführen, zum anderen aber auch auf Unkonzentriertheiten seitens der Griesheimer.</p>    <p>Die zweite Halbzeit begann wie die erste mit einem harten aber fairen und umkämpften Spiel. Jedes Tor wurde von den Fans gefeiert. Auch das von den Babenhäusern verstärkte Tempo konnte die Griesheimer nicht aus der Ruhe bringen. Zu diesem Zeitpunkt war es nicht ersichtlich, dass der Tabellenführer gegen den Tabellen zehnten spielte. Das Spiel war völlig offen und fand erst in den letzten 5. Minuten seine Vorentscheidung. Die Griesheimer Abwehr konnte nicht mehr richtig entgegenhalten und im Angriff wurde leichfertig Chancen vergeben, so dass Babenhausen von einem 29:30 auf ein 30:35 davon Ziehen konnte. </p>      <p>Das Spiel endete mit 32:38 für Babenhausen, die für einen Aufstieg aber noch hart arbeiten müssen. Für die Griesheimer ist über Ostern und am folgenden Wochenende erst einmal Spielpause. Am 06.04.2008 empfängt man den TSV Modau in heimischer Halle zu gewohnter Uhrezeit (18:00 Uhr). Mit der gleichen Leistung wie gegen Babenhausen ist auch hier ein Sieg möglich.</p>        <p>Torschützen:<br />Daniel Mehring (11/6) / Müller Timo u. Wurt Nicholas (je 5) / Damir Zarko (4) / Benjamin Sirker (3) / Müller Timo (2) / Ralf Höhl u. Tim Rinschen (je 1)</p>  <p>&nbsp;</p>  ', '195.212.29.179'),
(273, 10, 12, '2008-04-13 22:26:48', '2008-03-15 00:00:00', 'outwards', 'VfL Wanfried - mJugendB	34:27', '<div>Am vergangenen Samstag fuhr die B-Jugend gemeinsam mit der A-Jugend zu ihrem Auswärtsspiel nach Wanfried in Nordhessen. Nur phasenweise konnten die Griesheimer, die mit der B-Jugend der kommenden Saison antraten, ihr Potential abrufen. Aufgrund  von Fehlwürfen wurde die erste Halbzeit mit einem Rückstand von zwei Toren  beendet; das Spiel war zu diesem Zeitpunkt noch offen. Nach der Pause schlichen  sich Unkonzentriertheiten in der Abwehr und im Rückzugsverhalten ein, so dass  die ältern Gastgeber den Vorsprung ausbauen konnten.</div> <div><br /></div> <div>Es spielten: Max Schielke, Andreas Gerhard, Christian Kindermann; Arseniy  Zankov (8 Tore), Marvin Gernandt (2 Tore), Sven Rinschen (6 Tore), Kai Feldmann  (5 Tore), Erik Neumann (2 Tore), Jan Tachtler (2 Tore), Max Bopp  (2 Tore),  Malte Just und Andreas Margarit (1 Tor).</div>', '217.224.68.92'),
(276, 3, 12, '2008-04-13 22:26:48', '2008-03-24 00:00:00', 'article', 'Griesheimer Handballjugend mit sehr guten Saisonabschlüssen', '<p></p>\r\n<p><span style="font-size: 10pt;">Nachdem alle Jugendmannschaften, bis auf die männliche B-Jugend, d</span><span style="font-size: 10pt;">ie am 6.4.2008 ihr letztes Spiel austragen darf, die Saison 2007/2008 beendet haben, zog </span><span style="font-size: 10pt;">Jugendleiter Uwe Rinschen </span><span style="font-size: 10pt;">eine sehr zufriedenstellende\r\nBilanz</span><span style="font-size: 10pt;">. <br /> Alle drei in der hessischen Oberliga gestarteten Mannschaften haben eine gute\r\nSaison gespielt. Die A-Jugend, die sich bis zur Saisonmitte einen guten 3.\r\nPlatz erspielte, musste sich am Ende mit einem 8. Platz zufrieden geben. Sicher\r\nist diese Platzierung, man steht punktgleich mit dem Tabellensechsten, auch auf\r\ndie erforderlichen Doppelansetzungen im Erwachsenenbereich zurückzuführen. Im Gegenzug\r\ndurften die Spieler aber auch wichtige Erfahrungen aus diesen Einsetzen\r\nmitnehmen und werden sicher davon in der kommenden Saison provitieren. Die B-Jugend,\r\ndie aufgrund des Verletzungspechs nur auf dem 8. Platz der Oberliga steht, kann\r\nmit Hilfe der Spieler, die aus der C-Jugend kommen, noch den 7. Platz erzielen.\r\nDie männliche C-Jugend schloss die Saison mit einem sehr guten 2. Platz ab. Wäre\r\ndas unsportliche Verhalten des TV Kirchzell nicht gewesen, hätte die Mannschaft\r\nvielleicht noch einen besseren Saisonabschluß feiern können. In einem tollen\r\nSpiel schlug das Team die JSG Wallstadt, den späteren Hessenmeister, mit 30:21\r\nund fügte so den Wallstädtern die einzigste Saisonniederlage zu. In der\r\nBezirksoberliga der weiblichen C-Jugend war die Mannschaft des TuS\r\nunbezwingbar. Alle Spiele konnten deutlich gewonnen werden. So gewannen die\r\nMädchen verdient die Bezirksoberliga und durften die Ehrung vom\r\nBezirksjugendwart entgegennehmen. Die Jungs der männlichen C2 hielten sich\r\nwacker in der Bezirksliga und erreichten einen guten vierten Platz. Die Jungs\r\nder E1 haben ebenfalls eine toll verlustpunktfreie 2. Saisonhälfte gespielt und\r\nstehen so verdient auf dem ersten Tabellenplatz. Die E2 hat in der 2.\r\nSaisonhälfte in einer anderen Gruppe spielen dürfen und konnten so auch ihre\r\nErfolgserlebnisse feiern. </span></p>\r\n<p><span style="font-size: 10pt;">An dieser Stelle möchte die Jugendleitung\r\nden Trainern, Eltern und Fans wie natürlich auch allen Spielerinnen und\r\nSpielern für ihren Einsatz in der Saison 2007/2008 ganz herzlich danken. </span></p>', '217.224.73.242'),
(275, 3, 5, '2008-04-13 22:26:48', '2008-03-24 00:00:00', 'article', 'Sommer - Trainingszeiten der Handballjugend', '<p>Ab dem 07.04.2008 gelten für die Minis bis zur A-Jugend neue Trainingszeiten:</p>\r\n<p><span style="text-decoration: underline;">Mini</span></p>\r\n<p>Trainer: Manfred Lohnes<br />Freitag, 14:30 - 15:30 (GHS)</p>\r\n<p><span style="text-decoration: underline;">F-Jugend - Jg. 00/01</span></p>\r\n<p>Trainer: Frank Ritter<br />Dienstag, 15:30 - 17:00 (GHS)<br />Donnerstag, 14:30 - 16:00 (GHS)</p>\r\n<p><span style="text-decoration: underline;">E1-Jugend - Jg. 98/99</span></p>\r\n<p>Trainer: Klaus Feldmann<br />Montag, 15:30 - 17:00 (GHS)<br />Mittwoch, 15:30 - 17:00 (KBH)</p>\r\n<p><span style="text-decoration: underline;">E2-Jugend - Jg. 98/99</span></p>\r\n<p>Trainer: Christian Lehmkühler<br />Montag, 15:30 - 17:00 (GHS)<br /> Mittwoch, 15:30 - 17:00 (KBH)</p>\r\n<p><span style="text-decoration: underline;">D-Jugend - Jg. 96/97</span></p>\r\n<p>Trainer: Manfred Lohnes und Martin Wurdak<br />Dienstag, 17:30 - 19:00 (KBH)<br /> Donnerstag, 16:00 - 17:30 (KBH)</p>\r\n<p><span style="text-decoration: underline;">mC2-Jugend - Jg. 94/95 </span></p>\r\n<p>Trainer: Sascha Gleißner <br />Dienstag, 16:00 - 17:30 (KBH)<br />Freitag, 15:00 - 16:30 (GHS)</p>\r\n<p><span style="text-decoration: underline;">wC-Jugend - Jg. 94/95 </span></p>\r\n<p>Trainer: Klaus Feldmann <br />Mittwoch, 17:00 - 19:00 (GHS)<br />Freitag, 16:00 - 17:45 (GHS)</p>\r\n<p><span style="text-decoration: underline;">mC1-Jugend - Jg. 94/95 </span></p>\r\n<p>Trainer: Thomas Weber und Klaus Döll<br />Dienstag, 17:00 - 19:00 (GHS)<br />Freitag, 17:45 - 19:30 (GHS)</p>\r\n<p><span style="text-decoration: underline;">B-Jugend - Jg. 92/93</span></p>\r\n<p>Trainer: Klaus Feldmann und Uwe Rinschen <br />Montag, 17:00 - 18:30 (GHS)<br />Donnerstag, 17:30 - 19:00 (KBH)<br />Freitag, 17:45 - 19:30 (GHS)</p>\r\n<p><br /><span style="text-decoration: underline;">A-Jugend - Jg. 90/91 </span></p>\r\n<p>Trainer: Uwe Rinschen und Dennis Bork <br />Montag, 18:30 - 20:00 (GHS) <br />Donnerstag, 19:00 - 21:00 (KBH)<br />Freitag, 19:30 - 21:00 (GHS)</p>\r\n<p><br /><span style="text-decoration: underline;">Kontakt zu den Handballern: <br /></span><br />Für Mini-, F-, E- und D-Jugend:<br />Stellvertr. Jugendleiterin Claudia Döll, Tel. 06155/836515<br />E-Mail: claudia@asd-schaefer.de<br /><br />Für A-, B- und C-Jugend:<br />Jugendleiter Uwe Rinschen, Tel. 06155/79197 <br />E-Mail: tusgriesheim.jugendleiter@t-online.de <br /><br />Abteilungsleiter Manfred Lohnes, Tel. 06155/4506</p>', '84.167.82.130');
