(283, 10, 12, '2008-04-13 22:26:48', '2008-04-06 00:00:00', 'home', 'mJugendB - HSG Wettenberg	34:31', '<p>Im letzten Spiel der Oberliga-Saison konnte sich die B-Jugend gegen den Tabellenfünften aus Wettenberg durchsetzen. Trotz eingeschränkter Vorbereitung unter der Woche aufgrund von Verletzungen, Erkrankungen und Urlaub fand die Mannschaft zu einer geschlossenen Leistung in Abwehr und Angriff. Insbesondere die linke Seite mit Marvin Gernandt und  Sven Rinschen spielte sehr effektiv, so dass zur Halbzeit mit 17 : 14 schon ein kleiner Vorsprung erspielt werden konnte.<br />Nach der Pause konnten sich die Gastgeber nach 10 Minuten absetzen, doch nach einem Zwischenspurt waren die Gäste wieder auf ein Tor herangekommen. Mit konzentrierter Abwehr und gezielten Angriffen wurde aber der alte Abstand wieder  hergestellt. Insgesamt ein verdienter Sieg, mit dem in der Abschlußtabelle der 7. Platz erreicht werden konnte.<br /><br />Dabei waren: Max Schielke (im Tor); Marvin Gernandt (10 Tore), Sven Rinschen (7 Tore), Eric Neumann (7 Tore), Patrick Pollner (2 Tore), Ricardo Wilhelm, Kai Feldmann (3 Tore), Max Bopp (3Tore), Malte Just, Jan Döll (2 Tore) und Andreas Margarit. -KF</p>', '192.166.56.36'),
(307, 48, 1, '2008-04-19 19:38:47', '2008-04-14 00:00:00', 'home', 'mB Jugend - JSG Büttelborn	46:13', '<p>1. Spiel der Qualirunde OL/RL auf Bezirksebene</p>\r\n<p>TuS mB - JSG Büttelborn<br />14.04.2008 - 19.00 Uhr</p>\r\n<p>46 : 13 (21 : 9)</p>\r\n<p>Es spielten: Max Schielke, Christian Kindermann; Erik Neumann (13 Tore), Patrick Pollner (4 Tore), Andreas Margarit (3 Tore), Arseniy Zankov (6 Tore), Marvin Gernandt (4 Tore), Kai Feldmann (1 Tor), Malte Just (1 Tor), Darren Weber (1 Tor), Joschka Jankovic ( 2 Tore), Jan Döll (4 Tore), Sven Rinschen (5 Tore) und Max Damm (2 Tore).</p>', '84.59.12.132'),
(287, 6, 5, '2008-04-19 10:54:38', '2008-04-14 00:00:00', 'outwards', 'TV Gustavsburg - TuS Griesheim II	23:24', '<p></p>\r\n<p>Torhüter Kay Grund hält Sieg fest</p>\r\n<p>Ein gehaltener 7m von Kay Grund Sekunden vor dem Schlusspfiff sichert der zweiten Mannschaft den Sieg in Gustavsburg und somit auch den sicheren Klassenerhalt. In einem alles in allem sehr zerfahrenen Spiel ging Gustavsburg mit 2:0 in Führung. Danach kam Griesheim besser ins Spiel und konnte über 7:5 bis zum Pausenstand von 9:8 vorlegen. Nach dem Wechsel konnte Griesheim erstmals mit 3 Toren in Führung gehen. Auf Grund von Zeitstrafen und roten Karten gelang es nicht den Vorsprung auszubauen bzw. zu halten. Gustavsburg kam immer wieder heran und auch eine 20:17 Führung in den Schlussminuten konnte nicht gehalten werden zumal man zu diesem Zeitpunkt wegen der Zeitstrafen und den damit verbunden roten Karten nicht mehr wechseln konnte. Beim Stand von 24:23 konnte dann Kay Grund den letzten 7m abwehren und somit den verdienten Sieg sichern.</p>\r\n<p>Es spielten :Kay Grund, Michael Helfmann und Markus Kuhnke im Tor. Dennis Killer 3, Martin Simmermacher 2, Christian Döll 1, Ronald Bausch 2, Dirk Höhl 5, Uwe Drechsler 4, Mario Schecker 6 und Christian Lehmkühler 1.</p>', '84.167.91.35'),
(288, 5, 3, '2008-04-16 11:33:44', '2008-04-14 00:00:00', 'outwards', 'TV Kirchzell 2- Herren 1	30:31', '<p>Ein Krimi bringt den Klassenerhalt<br />TV Kirchzell - TuS Griesheim (30:31)<br /><br />„Auswärtssieg! Auswärtssieg!“ - schrieen die Spieler der 1.Mannschaft des TuS Griesheim am Samstag Abend im bayrischen Kirchzell und die Erleichterung war in ihren Gesichtern abzulesen.<br /><br />Um 20:00 Uhr erfolgte der Anpfiff in der für ihre Größe gut gefüllten Sporthalle. Beide Mannschaften begannen sehr konzentriert und schenkten sich in den ersten 15.Spielminuten nichts. Nur die Abwehr der Griesheimer lies zu wünschen übrig. Einige nicht genutzte hundertprozentige Torchancen gaben dem TV Kirchzell die Möglichkeit einen kleinen Vorsprung herauszuspielen, so dass sie auf 15:11 davonziehen konnten. Die Griesheimer Jungs ließen sich davon jedoch nicht aus der Ruhe bringen, die Abwehr wurde von Klaus Feldmann offensiver eingestellt um die Kirchzeller zu Fehlern zu zwingen. So konnten die Griesheimer bis zur Halbzeitpause den Vorsprung auf 17:15 verkürzen.<br /><br />Die Griesheimer kamen mit großem Selbstbewusstsein aus der Kabine und man konnte ihnen den Siegeswillen aus den Gesichtern ablesen, aber auch der TV Kirchzell hatte in seinem vorletztem Pflichtspiel in eigener Halle keine Punkte zu verschenken. Griesheim lief jedoch der Führung von Kirchzell kontinuierlich hinterher. Der verdiente Ausgleich lag in der Luft, ließ aber bis zur 55. Spielminute auf sich warten, bis Tim Rinschen aus dem Rückraum erfolgreich war. In der 57. Spielminute war es endlich soweit und der TuS Griesheim lag das erste mal in Führung (28:29). Jedes Tor und jede gelungene Abwehraktion wurde nun von den mitgereisten Fans bejubelt. Doch der Krimi hattte erst begonnen. <br /><br />Im folgenden Angriff des TV Kirchzell sah David Max eine 2.Minuten Zeitstrafe und Kirchzell bekam einen 7-Meter zugesprochen, der sicher verwandelt wurde. Nun war alles wieder offen. Der Gegenzug wurde Ausgespielt und Daniel Mehring war nur mit einem 7-Meterfoul zu stoppen, der erneut den Weg in das Tor zum 29:30 fand. Nach dem Wiederanwurf war jedoch auch der TV Kirchzell gegen fünf Griesheimer Feldspieler erfolgreich. Die 1. Mannschaft erneut gefordert, die letzte Spielminute war bereits angebrochen, als ein Anspiel zum Kreis in den Händen des Gegners landete. Der eingeleitete Gegenstoß des TV Kirchzell schlug jedoch Fehl, da er vom stark spielenden Sebastian Müller abgefangen wurde. Der Ball fand nach zwei Stationen den freistehenden Nicholas Wurth, der sicher zum 30:31 einnetzen konnte. Doch der TV Krichzell hatte noch 20 Sekunden Zeit um das Unentschieden zu erzielen, die nun wieder vollzählige Abwehr der TuS Griesheim war Hellwach und ließ keinen Torwurf mehr und der Schlusspfiff versank in Jubel der Griesheimer Mannschaft.<br /><br />Der Klassenerhalt ist nach der Niederlage von SKV Mörfelden /Walldorf am Sonntag sicher. Wir laden alle Zuschauer recht herzlich zu unserem letzten Heimspiel am kommenden Sonntag zu gewohnter Zeit (18:00 Uhr) gegen den HSV Götzenhain ein.<br /><br />Torschützen:<br />Daniel Mehring (7/4), Müller Sebastian, Wurth Nicholas, Tim Rinschen (je 5), Max David (4), Stefan Hamel, Benjamin Sirker (je 2), Damir Zarko (1)</p>', '195.212.29.163'),
(290, 39, 1, '2008-06-15 23:06:30', '2008-04-14 00:00:00', 'article', 'Willkommen bei den Handballern!', '<p>Liebe Handballfreunde,</p>\r\n<p>Willkommen auf der Homepage der Griesheimer Handballer, auf der wir Ihnen Informationen über die Spiele unserer Mannschaften und aus dem Abteilungsgeschehen bereitstellen. Beim Lesen der Berichte und beim Betrachten der Bilder wünschen wir Ihnen gute Unterhaltung und freuen uns natürlich auch über jeden Beitrag und Eintrag in unser Gästebuch.</p>\r\n<p><span style="text-decoration: underline;">Die Berichte der vergangenen Saison sind weiterhin über das Drop-Down Feld oben links erreichbar.</span></p>\r\n<p>Für alle Trainer, Eltern und Freiwillige, die noch keinen Account zum Erstellen und Bearbeiten von Berichten haben:<br />Mit einer Mail an die unten genannte Adresse könnt ihr mir euren Namen, Mailadresse und die eigene Mannschaft mitteilen.</p>\r\n<p>Diese Daten benötige ich dann, um den Account zu erstellen. Das Erstellen des Accounts wird durch eine Mail, die auch das Passwort enthält, bestätigt.</p>\r\n<p>Fehler und Bugs bitte an <a href="mailto:handball@tusgriesheim.de">handball@tusgriesheim.de</a> oder über das <a href="index.php?module=contact">Kontaktformular</a>.</p>', '84.58.210.204');
