(292, 41, 9, '2008-06-16 20:41:16', '2008-04-14 00:00:00', 'article', 'Erfolgreiche Handballjugend', '<p class="headline3;">Herzlich Willkommen bei der Jugendabteilung der TUS Handballer.</p>\r\n<p><span class="headline3;">Neben einem kompletten Unterbau von den Minis bis zur D-Jugend konnten sich die männliche A-, B-, und C-Jugend wie letzte Saison wieder für die hessische Oberliga qualifizieren. Erstmals gelang dies auch der weiblichen C-Jugend. Hier nimmt der TUS eine einzigartige Stellung im Handballbezirk Darmstadt ein. Insbesondere A- und B-Jugend hatten eine strapaziöse Qualifikation mit 11 Spielen in den letzten 2 Monaten zu bestreiten. Die Kader erlebte Höhen und Tiefen bei dem es auch zeitweise zu verletzungsbedingten Ausfällen kam, die aber durch Einsatz, Trainingsfleiß und mannschaftlichen Zusammenhalt wettgemacht wurden</span><span><span style="color: #000000;">. </span></span><span class="headline3;"><span style="color: #000000;">Nun hat man sich über die Sommerferien Ruhe verdient, bevor es mit der Vorbereitung zur Wintersaison losgeht.</span></span><span class="headline3;"><span style="color: #000000;"> <br /></span></span></p>\r\n<p class="headline3;">An dieser Stelle sei den engagierten Trainern und Betreuern gedankt, die zu diesem Erfolg beitrugen:</p>\r\n<p>Uwe Rinschen, Dennis Bork (mA), Klaus Feldmann, Axel Sturm (mB und wC),<br /> Thomas Weber, Klaus Döll (mC1) Sascha Gleißner (mC2) Manfred Lohnes (mD)<br /> Christian Lehmkühler (mE), Frank Ritter (Minis).</p>', '84.58.210.204'),
(293, 42, 1, '2008-04-14 21:10:07', '2008-04-14 00:00:00', 'article', 'TuS Griesheim Schiedsrichter', 'Dies ist die Default Page der neuen Saison. Ich bitte alle Trainer diese kurz zu verändern, bzw. über Neuigkeiten der neuen Saison zu informieren. Gegebenfalls könnt ihr auch den Inhalt der vergangen Saison übernehmen. Bitte auch den Titel anpassen.<br />Mit freudlichen Grüßen Steffen Vogel', '84.59.13.63'),
(294, 43, 5, '2008-07-06 20:10:41', '2008-07-06 00:00:00', 'article', '1. Mannschaft mit neuem Trainer', '<p>Nach der Ära Klaus Feldmann und Wolfgang Ittner hat der neue Trainer Stefan Beißer im Mai die Arbeit mit der Landesligamannschaft aufgenommen. Zur Zeit trainiert die Mannschaft 2 x in der Woche. Als Neuzugänge zu sind hinzugekommen Andreas Manhart und Mario Ubiparip von TSV Modau. Danilo Jaksic, HSG Mörfelden/Walldorf, Sebastian Trapmann, TGB Darmstadt und Tobias Stolz-Zwilling vom TV Groß Zimmern sowie Dennis Bork und Kevin Herr aus der eigenen Jugend. Nikolas Wurth und Stefan Hamel stehen Studien- und berufsbedingt nur eingeschränkt zur Verfügung. Verlassen hat den Verein Simon Bär (Groß Umstadt II).</p>\r\n<p>Wir wünschen dem Trainer und der Mannschaft alles Gute und viel Erfolg für die Saison 2008-2009</p>\r\n<p> </p>', '84.167.65.165'),
(295, 44, 5, '2008-07-06 20:11:36', '2008-07-06 00:00:00', 'article', '2. Mannschaft mit kleinem Kader für die neue Saison.', '<p>Mit zur Zeit 14 Spielern (auf dem Papier ?) startet die zweite Mannschaft in der A-Klasse in die neue Saison. Da einige Spieler berufsbedingt im Training und auch zu Spielen nicht immer zu Verfügung stehen, erwartet die Mannschaft wieder eine schwere Saison. Die Hoffnung auf Verstärkung liegt allein auf dem großen Kader der ersten Mannschaft und dem Einsatz von Spielern, die in der ersten Mannschaft nicht immer spielen können. Wichtig für die Mannschaft ist, die A-Klasse zu halten und im nächsten Jahr über den anstehenden Generationswechsel wieder eine schlagkräftige junge Truppe aufzubauen.</p>\r\n<p> </p>\r\n<p> </p>', '84.167.65.165'),
(296, 45, 9, '2008-07-27 11:00:15', '2008-04-14 00:00:00', 'article', 'TuS Griesheim Alte Herren', '<p>Link zum AH-Forum: <a href="http://griesm.de/forum/viewforum.php?f=23">http://griesm.de/forum/viewforum.php?f=23</a></p>\r\n<p>Sommerfest: 9.August 2008 19.00 bei Paul, ohne Frauen</p>\r\n<p>Oktoberfest: 11.Oktober, <a href="http://www.oktoberfest-in-mainz.de/index.htm "><span style="font-weight: bold;">http://www.oktoberfest-in-mainz.de/index.htm</span></a></p>\r\n<p>Weihnachtsfeier:12.Dezember. Tus Heim, mit Frauen</p>\r\n<p><img src="http://handball.griesm.de/images/gallery/2007/alte_herren/misc/alte_herren.jpg" alt="Mannschaftsfoto der AH" title="Mannschaftsfoto der AH" width="745" height="468" /><br />Die Alten Herren feierten 2007 ihr zwanzigjähriges Bestehen (hintere Reihe, v. l. n. r.): Andreas Bork, Thilo Stütze, Manfred Hamel, Thomas Vogel, Ludwig Merker, Werner Müller, Werner Gernand; mittlere Reihe; Manfred Lohnes, Dieter Gernand, Werner Gerhard, Freddy Naschert, Peter Killer, Jürgen Sporleder, Martin Wurdak; Michael Schroer-Becker; vordere reihe; Sebastian Naschert, René Groß, Gerhard Groß, Matthias Busch, Klaus Döll, Andreas Stösel, Helmut Schupp. Nicht auf dem Bild: Marcus Bars, Lothar Best, Dieter Belt, Heinz Diefenbach und Volker Sahr. Fotos: dg</p>', '84.58.211.255'),
(327, 51, 1, '2008-05-05 09:00:42', '2008-05-05 00:00:00', 'outwards', 'SG Arheilgen - wB Jugend	17:30', '<p>2. Spiel der Qualirunde BOL wB</p>\r\n<p>04.05.2008 - 14.00 Uhr<br />17 : 30 (4 : 19)</p>\r\n<p>Es spielten: <br />KimBecker, Justine Liebald; Mayra Janssen (3 Tore), Katharina Schuldt (2 Tore), Alessa Zimmer (4 Tore), Katrin Feldmann (3 Tore), Deborah Berge (5 Tore), Denise Großheim (6 Tore), Lea Maria Wenzel (1 Tor), Tanja Birli (1 Tor), Mara König (1 Tor), Nadja Spilok (2 Tore), Lea Jung (2 Tore).</p>', '84.58.221.113'),
(297, 46, 5, '2008-07-06 20:12:34', '2008-07-06 00:00:00', 'article', 'Frauenmannschaft mit neuem (alten) Trainer in die Saison 2008-2009', '<p>Nach der Trennung von Christian Matzel zum Jahreswechsel und Norbert Schäfer als Interimstrainer bis Rundenende, übernimmt Christian Mentges das Training der Mannschaft in der Bezirksoberliga 2008-2009. Mit Christian Mentges übernimmt ein alter Bekannter das Training der Mannschaft. Er war in den Jahren 2005 bis 2007 schon erfolgreich als Trainer der Frauenmannschaft tätig. Wir wünschen Ihm an seinem neuen/alten Betätigungsfeld alles Gute und viel Erfolg.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', '84.167.65.165'),
(298, 47, 12, '2008-07-30 15:16:08', '2008-04-14 00:00:00', 'article', 'TuS Griesheim mA Jugend', '<p>Nach einer langen Qualifikationsphase konnte sich die A-Jugend des TuS Griesheim wieder für die hessische Oberliga qualifizieren. Dies bestätigt weiterhin den positiven Trend in der Griesheimer Jugendarbeit. Die A-Jugend ist der einzige südhessische Vertreter und muss in der kommenden Saison gegen die JSG Bürgel, den TV Gelnhausen und den VfR Et. Wiesbaden aus dem Großraum Rhein Main antreten. Die HSG Wettenberg bei Gießen und die beiden nordhessischen Vereine HSG Gensungen/Felsberg und HSG Körle/Guxhagen komplettieren das 8ter Feld der Oberliga Hessen. Viele hessische Handballhochburgen mit guter Jugendarbeit in die sich der TuS Griesheim wieder eingereiht hat.</p>\r\n<p>Nach der ersten Qualifikationsphase belegte man nach den favorisierten Teams der JSG Gersprenztal und der TSG Bürgel den dritten Platz. In zwei Entscheidungsspielen gegen die HSG Nieder Roden konnte sich das Team von Trainer Uwe Rinschen mit einem 30: 26 Sieg in Griesheim und einem 21:20 Sieg bei der HSG für die Oberliga qualifizieren.</p>\r\n<p>Nach dem umjubelten Aufstieg in die Oberliga und einer 4 wöchigen Erholungsphase startet das Team ihre Vorbereitung auf die kommende Saison. In dieser Phase treten die Griesheimer gegen die SKG Bonsweiher (9.8., 16:00 Uhr), die JSG Crumstadt/Goddelau (10.8., 16:00 Uhr), den HC Oftersheim /Schwetzingen (17.8., 16:00 Uhr) und den VfL Goldstein (24.8., 16:00 Uhr) in der heimischen Halle in Griesheim an.</p>\r\n<p>Die Mannschaft, die zum Großteil von der letztjährigen A-Jugend gestellt wird, besteht im Wesentlichen aus den Griesheimer Eigengewächsen: Steffen Vogel und Tim Ulmrich im Tor, Daniel Arenz, Lucas Baier, Tim Patrzalek, Christoph Rampelt, Jan Tachtler und Tim Rinschen. Wie schon in den letzten Jahren sind Benjamin von Stein, Yannick Hassenzahl im Tor, Björn Ehmke und Maximilian Bopp für den TuS am Start. Mit Marvin Haller aus Pfungstadt und Felix Krell aus Groß Bieberau schlossen sich noch zwei weitere Spieler dem TuS an. Mit großer Freude konnte der letztjährige Mannschaftskapitän, Dennis Bork, als Betreuer gewonnen werden. Als einzigen Abgang hat die kammeradschaftlich gut zusammenhaltende Truppe nur Miro Hinkel zu verzeichnen, der einem Angebot des Regionalligisten TSG Münster folgte.</p>\r\n<p>Nach den Leistungsvergleichen in der Qualifikation darf man wohl nicht mit einem Spitzenplatz in der kommenden Saison rechnen, aber einen guten Mittelfeldplatz möchte die engagierte Truppe erreichen. Ferner bekommen alle Spieler die Möglichkeit, regelmäßig im Erwachsenenbereich bei der Landesliga-Mannschaft des TuS mitzutrainieren und gelegentlich in den Meisterschaftsspielen eingesetzt zu werden. Besonders den älteren Spielern des Jahrganges 1990 soll so der Wechsel in die 1. Mannschaft im kommenden Jahr erleichtert werden.</p>\r\n<p><img src="http://handball.griesm.de/images/gallery/2008/ma_jugend/misc/thumb_a_jugend_2008.jpg" alt="das Mannschaftsbild zur neuen Saison" title="mA Jugend" width="700" height="466" /></p>\r\n<p> Das Team von links nach rechts: Oben - Trainer Uwe Rinschen, Tim Rinschen, Björn Ehmke, Christoph Rampelt, Maximilian Bopp, Betreuer Dennis Bork. Mitte - Benjamin von Stein, Felix Krell, Steffen Vogel, Yannick Hassenzahl, Lucas Baier, Tim Patrzalek. Unten - Jan Tachtler, Miro Hinkel, Daniel Arenz und Marvin Haller. Auf dem Bild fehlt Tim Ulmrich</p>', '62.225.37.72'),
(299, 48, 3, '2008-06-16 13:38:19', '2008-04-14 00:00:00', 'article', 'TuS Griesheim mB Jugend', '<p>Den Aufstieg in die hessische Oberliga schaffte die mB-Jugend souverän. Trotz verletzungsbedingter Ausfälle konnte das homogene Team in den Spielen immer wieder durch eine geschlossene Mannschaftsleistung überzeugen. Auf dieser Grundlage kann die Mannschaft in die vorderen Tabellenplätze der Oberliga vordringen.</p>\r\n<p><br />stehend v.l.n.r: Joschka Jankovic, Sven Rinschen, Andreas Margarit, Kai Feldmann, Jan Eidemüller, Max Damm;<br />sitzend v.l.n.r.: Malte Just, Jan Döll, Andreas Gerhard, Christian Kindermann, Max Schielke, Arseniy Zankov, Fabian Seigfried;<br />knieend v.l.n.r.: Erik Neumann, Patrick Pollner, Darren Weber, Ricardo Wilhelm, Raphael Sturm, Marvin Gernandt;</p>\r\n<p><img src="http://handball.griesm.de/images/gallery/2008/mb_jugend/misc/thumb_mb_teamfoto.jpg" alt="das Mannschaftsfoto zur neuen Saison" title="mB Jugend" width="700" height="525" /></p>', '84.58.210.204'),
(300, 49, 1, '2008-06-16 00:01:57', '2008-04-14 00:00:00', 'article', 'mC1 Jugend zur Oberliga qualifiziert', '<p>Nach einem erfolgreichen Abschluß der C-Jugend Oberliga Saison 2007/2008<br />mit dem 2.Platz, musste eine neue Mannschaft sowie ein neuer Trainer gefunden<br />werden. <br />Eine erfolgsorientierte Truppe Jahrgang 1994 sollte es werden und nur 2 Spieler der<br />alten C-Jugend blieben - alle anderen wurden B-Jugend.<br />Mit Thomas Weber aus Darmstadt konnten wir einen erfahrenen Trainer gewinnen <br />und das Ziel war ganz klar die Qualifikation für die spielhöchste Klasse <br />der C-Jugend ,nämlich  die Oberliga.<br />Es blieb kaum Zeit die neue Mannschaft zu formieren und doch wurden die <br />notwendigen Spiele klar von unserer Mannschaft bestimmt.Das notwendige<br />Qualifikationsturnier der Gruppenbesten wurde in Griesheim ausgetragen.<br />Unser Gegner hieß Nieder Liebersbach/Reisen der klar mit 41-19 geschlagen wurde.<br />Die Quali war geschaftt !<br />Die Zeit bis zu den Sommerferien wurde intensiv genutzt um das Spielverständnis <br />untereinander zu verbessern.<br />Man nahm in dieser Zeit an einem Turnier in Ulzburg-Henstedt bei Hamburg teil.<br />Wir spielten in einem starken Feld als B-Jugend Mannschaft. <br />Man schlug sich in diesem Starterfeld sehr gut und wurde durchweg mit Lob versehen.<br />Das Ziel der neuen C-Jugend ist es , in der kommenden Spielrunde eine gewichtige<br />Rolle bei der Vergabe der Meisterschaft mitzureden.</p>\r\n<p>Zur Truppe gehören:</p>\r\n<p><img src="http://handball.griesm.de/images/gallery/2008/mc1_jugend/misc/thumb_jan_handball_05_2008_015.jpg" alt="das Mannschaftsfoto zur neuen Saison" title="mC1 Jugend" width="700" height="468" /></p>\r\n<p>oberste Reihe von links: <br />Lukas Kovar , Tom Sommer TW, Anton Hanisch TW , Jan Döll  Trainer Thomas Weber<br />mittlere Reihe von links<br />Darren Weber, Lars Friedrich , Sebastian Groll, Fabian Dose<br />untere Reihe von links<br />Amin Ghalamchi, Max Eidenmüller, Lars Birkenbahc, Cedric Coors <br />Auf dem Bild fehlt. Betreuer Klaus Döll</p>', '84.58.210.204'),
(351, 50, 5, '2008-08-07 12:22:15', '2008-08-07 00:00:00', 'article', 'Die männliche C-Jugend stellt sich vor.', '<p>Die männl. C2-Jugend konnte die abgelaufene Saison mit einem tollen 4. Platz abschließen.</p>\r\n<p>Die Mannschaft besteht überwiegend aus Spielern, die altersmäßig sogar noch in der D-Jugend eingesetzt werden könnten, dennoch entschloss man sich vor Rundenbeginn, das "Abenteuer" C-Jugend zu beginnen.</p>\r\n<p>In den ersten Spielen merkten die TuS´ler schon einen großen Unterschied, doch man konnte die Begegnungen gegen die körperlich stark überlegen Gegner mit Technik und Spielwitz offen gestalten und einige Spiele sogar gewinnen.</p>\r\n<p>Im Training wurde fleißig versucht, die körperlichen Defizite mit Gewichtbällen und Ausdauertraining wettzumachen - mit Erfolg, denn die Griesheimer legten eine Siegesserie hin und überraschten selbst Trainer und Betreuer.</p>\r\n<p>Der Höhepunkt der Saison war sicherlich die Begegnung gegen den ungeschlagenen Staffelsieger TSV Pfungstadt. Hier brachte man den Gegner mit tollen Spielzügen und starkem Einsatz an den Rand einer Niederlage, doch letzten Endes siegte die körperliche Überlegenheit über die Technik.</p>\r\n<p>Diese gute Leistung lobten sogar die Gegner, die mit soviel Gegenwehr nicht gerechnet hatten.</p>\r\n<p>Das Ziel für diese Mannschaft muss lauten, in dieser neuen Saison die technischen Fähigkeiten auszubauen und ihre hervorragende mannschaftliche Geschlossenheit weiter zu fördern.</p>\r\n<p> Die Spieler der C2: Simon Steininger (Tor), Daniel Röder, Lars Birkenbach, Amin Ghalamchi, Janik Wagner, Jan Sluka, Niklas Kolb, Nikos Mertens, Marc Keller, Marvin Busch, Can-Luca Liberati, Martin Kohler, Bastian Schermann, Valentin Koch, Tobias Lücke, Christian Roth</p>', '84.167.113.60'),
(302, 51, 1, '2008-06-16 13:49:26', '2008-04-14 00:00:00', 'article', 'TuS Griesheim wC Jugend', '<p>Die wC-Jugend wird in der Hallenrunde 2008/09 in der Oberliga Gruppe Süd antreten, nachdem in der letzten Saison die Bezirksmeisterschaft erreicht wurde. Die Mannschaft blieb dabei in 18 Spielen ungeschlagen und erzielte ein Torverhältnis von 684:253. Dieser erfolgreiche Weg soll nun fortgesetzt werden; die stärksten Gegner in der neuen Hallensaison werden aus Bruchköbel und Groß-Umstadt/Habitzheim kommen.</p>\r\n<p><br />stehend v.l.n.r: Mara König, Lea Jung, Katrin Feldmann, Alessa Zimmer, Denise Großheim, Katharina Schuldt, Lea Maria Wenzel;<br />sitzend v.l.n.r.: Deborah Berge, Chiara Janssen, Kim Becker, Justine Liebald, Tanja Birli, Mayra Janssen;<br />es fehlt: Nadja Spilok;</p>\r\n<p><img src="http://handball.griesm.de/images/gallery/2008/wb_jugend/misc/thumb_wc_team.jpg" alt="das Mannschaftsfoto zur neuen Saison" title="wC Jugend" width="700" height="525" /></p>', '84.58.210.204'),
(353, 53, 5, '2008-08-07 12:29:38', '2008-08-07 00:00:00', 'article', 'Unsere E-Jugend stellt sich vor.', '<p>Für die E-Jugend begann die neue Saison Ende Mai mit einem Rasenturnier in Einhausen. Frisch aus der F-Jugend feierten hier die jüngeren Spieler ihren Einstand und fügten sich gut in die Mannschaft ein. Trotz der kurzen Spieldauer kam jeder zum Einsatz und gab auf dem Platz vollen Einsatz gegen starke Gegner. So konnte am Ende ein guter sechster Platz erreicht werden.</p>\r\n<p>Wegen der großen Anzahl von Spielern, stellt der Tus Griesheim auch in diesem Jahr zwei E-Jugendmannschaften, die in den Spielklassen Bezirk B (E1) und Bezirk C (E2) ihr Können unter Beweis stellen wollen.</p>\r\n<p>Bis die Wettkampfrunde im September startet, bleibt noch etwas Zeit zum Trainieren. Das Training findet immer Montags und Mittwochs 15.30-17.00 in der GHS bzw. Kirschberghalle statt und Interessierte der Geburtsjahrgänge ´98 und ´99 sind herzlich willkommen. </p>\r\n<p>Im Kletterwald Darmstadt haben die Spieler bereits Mut und Stärke bewiesen. Wir wünschen den Spielern beider Teams, dass sie dies beibehalten und viel Erfolg in der Saison 2008/09!</p>\r\n<p> </p>\r\n<p> </p>', '84.167.113.60'),
(305, 54, 1, '2008-04-14 21:10:07', '2008-04-14 00:00:00', 'article', 'TuS Griesheim mE2 Jugend', 'Dies ist die Default Page der neuen Saison. Ich bitte alle Trainer diese kurz zu verändern, bzw. über Neuigkeiten der neuen Saison zu informieren. Gegebenfalls könnt ihr auch den Inhalt der vergangen Saison übernehmen. Bitte auch den Titel anpassen.<br />Mit freudlichen Grüßen Steffen Vogel', '84.59.13.63'),
(349, 55, 5, '2008-08-07 12:04:01', '2008-08-07 00:00:00', 'article', 'Minis in Aktion', '<p>Die Minis  (F-Jugend) sind Kinder zwischen sechs und acht Jahren, die mit viel Motivation und großer Begeisterung Handball spielen. Das Training ist vielfältig und bietet von Handball über Schuhhockey bis hin zum Fußball alles was den Kinder Spaß macht.</p>\r\n<p>An Ergeiz und Spielwitz kann sich mancher Profi hier eine Scheibe abschneiden. Trainer Frank Ritter versucht durch verschiedenen Übungen mit Ball den Kindern das notwendige Ballgefühl zu vermitteln. Die primäre Zielsetzung ist es, die koordinativen und motorischen Fähigkeiten in Verbindung mit Fangen und Werfen zu stärken. Diese Grundschule ist der Garant für eine spätere erfolgreiche Weiterentwicklung der Kinder. Die Kinder lernen den</p>\r\n<p>Kameradschaftlichen Umgang miteinander durch das Training und die Turnier die übers Jahr gespielt werden.</p>\r\n<p>Die Turniere, die in regelmäßigen Abständen bei den Vereinen aus der Umgebung stattfinden sind auch die Highlights der Kids. Einige der Turniere konnte die F1-Jugend im vergangenen Jahr gewinnen. Auch die F2-Jugend konnte schon einige Spiele recht erfolgreich gestalten.</p>\r\n<p>Bedanken möchte ich mich auch bei Ricardo Posocco, der mich im Training teilweise tatkräftig unterstützt hat und auch bei Claudia Faust, die die Betreuung einer Mannschaft übernahm als es zu Terminüberschneidungen kam.</p>\r\n<p>Die Minis Trainieren Dienstags von 15:00 bis 16:30 Uhr in der Kirchberghalle und von</p>\r\n<p>14:30 bis 16:00 Uhr Donnerstags in der Gerhard-Hauptmann-Schule. Änderungen entnehmen sie unseren Homepage unter „ tusgriesheim.de/handball". Ein Schnuppertraining ist jederzeit möglich, auch Mädchen sind willkommen.</p>', '84.167.113.60'),
(308, 48, 1, '2008-04-19 19:41:21', '2008-04-15 00:00:00', 'outwards', 'HSG Weiterstadt/Braunshardt - mB Jugend	18:35', '<p>1. Spiel der Qualirunde OL/RL auf Bezirksebene</p>\r\n<p>HSG Weiterstadt/Braunshardt - TuS mB<br />15.04.2008 - 19.00 Uhr</p>\r\n<p>18 : 35 (10 : 15)</p>\r\n<p>Es spielten: Max Schielke, Christian Kindermann; Erik Neumann (4 Tore), Patrick Pollner (2 Tore), Andreas Margarit (3 Tore), Arseniy Zankov (5 Tore), Ricardo Wilhelm (1 Tor), Marvin Gernandt (7 Tore), Kai Feldmann (1 Tor), Malte Just (2 Tor), Joschka Jankovic (1 Tor), Sven Rinschen (5 Tore) und Max Damm (4 Tore).</p>', '84.59.12.132'),
(309, 47, 1, '2008-04-19 20:37:49', '2008-04-19 00:00:00', 'outwards', 'HSG Crumstadt-Goddelau - mA Jugend	27:35', '<p>Die A-Jugend startete in die Qualifikation zur neuen Saison 2008/2009<br />mit einem Auswärtsspiel bei der HSG Crumstadt-Goddelau. Die Mannschaft<br />verzeichnet zwei Neuzugänge mit Marvin Haller aus Pfungstadt und Jan<br />Tachtler aus der B-Jugend, der gleich im ersten Spiel mit drei Toren zu<br />überzeugen wußte. Trotz drei Abgängen bleibt die Mannschaft auf<br />entscheidenden Positionen sehr gut besetzt und darf sich zurecht wieder<br />Hoffnungen auf die Oberliga machen. Der Weg dahin führt bis Anfang Juni<br />über 4 Spiele auf Bezirks- und etwa 5 Spielen auf Landesliga-Ebene. <br />Im ersten Spiel konnte man den Gegner von Anfang an unter Kontrolle<br />halten und war in allen Belangen überlegen. Über einen Halbzeitstand von<br />17:13 war man bis zur 50. Minute ständig mit 3-4 Toren in Führung und<br />konnte schließlich auf einen Endstand von 35:27 davon ziehen. Für<br />Aufregung sorgten nur die Schiedsrichter, was in einer unverständlichen<br />roten Karte für den Gegner kurz vor der Pause gipfelte.<br />Es spielten: Yannick Hassenzahl und Steffen Vogel im Tor, Daniel Arenz<br />(1), Benjamin v. Stein (1), Tim Patrzalek (5), Maximilian Bopp (4),<br />Lucas Baier (4), Björn Ehmke (5), Jan Tachtler (3), Christoph Rampelt<br />(3), Tim Rinschen (8), Miro Hinkel (1) und Marvin Haller - TV</p>', '84.59.12.132'),
(310, 47, 9, '2008-04-20 14:19:01', '2008-04-19 00:00:00', 'home', 'mA Jugend - TSV Fürth-Krumbach	38:35', '<p>Im zweiten Spiel der Bezirksqualifikation spielte die A-Jugend gegen die bis dahin 2-mal siegreichen Gegner aus Krumbach. Die Gäste waren körperlich überlegen, doch die Griesheimer gingen Dank einer schnelleren Spielweise in Führung. Nach ca. 20 min. gerieten die Greisheimer mit 11:15 in Rückstand, weil Krumbach mehrmals erfolgreich aus dem Rückraum abschließen konnte und die eigenen Chancen im Angriff nicht mehr genutzt wurden. Das Halbzeitresultat  von 15:18 wurde in den ersten 5 min. der zweiten Halbzeit zum 19:19 ausgeglichen, aber die Gäste behielten dann wieder die Oberhand, sodaß nach ca. 50 Minuten beim Spielstand von 30:33 langsam die Hoffnungen auf einen Sieg schwanden. Trainer Uwe Rinschen stellte die Abwehr auf offene Manndeckung um. Damit konnten die Gäste nicht umgehen und den Griesheimern gab das noch mal einen Motivationsschub, denn man konnte wieder zum 33:33 ausgleichen. Die Gegner waren aus dem Konzept gebracht, bei Griesheim klappte alles, so dass schließlich auch der Sieg mit 38:35 möglich war.</p>\r\n<p>Es spielten: Yannick Hassenzahl, Tim Ulmrich und Steffen Vogel im Tor, Daniel Arenz (1), Benjamin v. Stein (5), Tim Patrzalek (4), Maximilian Bopp (4),<br />Björn Ehmke (7), Jan Tachtler, Christoph Rampelt<br />(4), Tim Rinschen (8), Miro Hinkel (4) und Marvin Haller (1) - TV</p>', '84.58.238.27'),
(312, 2, 5, '2008-04-22 10:57:21', '2008-04-22 00:00:00', 'article', 'Trainerwechsel zum Ende der Saison', '<p> </p>\r\n<p>Die Zusammenarbeit mit dem Trainergespann Klaus Feldmann und Wolfgang Ittner endet nach acht gemeinsamen und erfolgreichen Jahren zum Saisonende. Wie immer in den letzten Jahren hat  sich die Abteilungsleitung mit den Trainern zum Jahreswechsel zusammengesetzt um die weitere Zusammenarbeit zu besprechen. War man in den letzten Jahren schnell zu einer weiteren Zusammenarbeit übereingekommen, kam man in diesem Jahr überein, die gemeinsame Arbeit zu beenden. Seitens der Abteilungsleitung werden dafür subjektive Verschleißerscheinungen und Kommunikationsproblemen nach acht gemeinsamen Jahren zwischen Teilen der Mannschaft und den Trainern als Gründe genannt. Auch für die Trainer ist der Wechsel nicht ungewöhnlich und verständlich. An dieser Stelle muss auch deutlich gesagt werden, dass der aktuelle Tabellenstand und die Leistung der Mannschaft mit dem Zeitpunkt und der Bekanntgabe des Wechsels nichts zu tun haben. Allen beteiligten war vor der Saison klar, dass es keine einfache Runde geben wird. Die Beteiligten und Verantwortlichen werden ihrerseits alles tun, dass die Saison mit einem entsprechenden Tabellenplatz zu einen guten Ende kommt.</p>\r\n<p>Dem Trainergespann danken wir für die geleistete gute Arbeit und wünschen ihnen auf ihrem weitern sportlichen Weg alles Gute.</p>\r\n<p> </p>\r\n<p>Manfred Lohnes</p>\r\n<p>Abteilungsleiter</p>\r\n<p> </p>', '84.167.100.114'),
(314, 2, 5, '2008-04-22 11:00:50', '2008-04-22 00:00:00', 'article', 'Stefan Beißer wird Trainer der ersten Mannschaft', '<p>Neuer Trainer für die erste Männermannschaft</p>\r\n<p>Nachdem die Zusammenarbeit mit dem Trainergespann Feldmann/Ittner, wie auch schon in der örtlichen und regionalen Presse berichtet, zum Saisonende nach acht gemeinsamen und erfolgreichen Jahren zum Saisonende beendet wird, war die Abteilungsleitung in den letzten Wochen bemüht einen adäquaten Ersatz zu finden. Ab der neuen Saison wird nunmehr Stefan Beißer das Training der 1. Mannschaft in der Landesliga übernehmen. Mit Stefan Beißer konnten wir einen kompetenten und erfahrenen Trainer verpflichten, der über lange Jahre bei der SKV Mörfelden erfolgreich gearbeitet hat und mit Mörfelden auch  in die Landesliga aufgestiegen ist. Als  ehemaliger Regionalliga- und Bundesligaspieler in Groß Bieberau und Groß Wallstadt  bringt er auch die nötige Erfahrung als Spieler in das Amt des Trainers mit. Erste Gespräche mit Stefan Beißer wurden schon im Januar geführt und jetzt erfolgreich zum Abschluss gebracht. Stefan Beißer wird das Training der 1. Mannschaft ab Mai übernehmen.</p>\r\n<p>Manfred Lohnes</p>\r\n<p>Abteilungsleiter</p>', '84.167.100.114'),
(315, 2, 5, '2008-04-22 11:03:46', '2008-04-22 00:00:00', 'article', 'Neuer Trainer bei den Frauen', '<p>Trennung von Frauentrainer Christian Matzel</p>\r\n<p>Wegen unüberbrückbaren Differenzen zwischen der Mannschaft und demTrainer,die auch nach mehreren Gesprächen nicht auszuräumen waren, wurde die Zusammenarbeit in gegenseitigem Einvernehmen noch vor dem Start in die Rückrunde aufgekündigt. Nachdem Wechsel von Christian Mentges auf Christian Matzel zu Beginn dieser Saison, kam die Kritik der Mannschaft am Trainer für die Abteilungsleitung kurz nach dem Jahreswechsel sehr überraschend. Da in Gesprächen mit der Mannschaft und dem Trainer, seitens der Mannschaft kein Konsens zur weiteren Zusammenarbeit auszumachen war, wurde die Trennung von Trainer Christian Matzel sofort vollzogen. Bis zum Rundenende wird die Mannschaft übergangsweise von ihren früheren Trainer Norbert Schäfer trainiert und betreut.</p>\r\n<p>Manfred Lohnes</p>\r\n<p>Abteilungsleiter</p>', '84.167.100.114'),
(316, 6, 5, '2008-04-28 09:35:13', '2008-04-22 00:00:00', 'home', 'TUS Griesheim II - HSG Rüsselsheim/Bauschheim	23:26', '<p>Spiel der vergebenen Chancen</p>\r\n<p>Gegen die Gäste aus Rüsselsheim/Bauschheim verspielte die zweite Mannschaft mit der Niederlage eine bessere Platzierung in der Abschlusstabelle vor dem letzten Spiel in Pfungstadt. Nach ausgeglichenem Start konnte sich Rüsselsheim in der ersten Spielhälfte zur Halbzeit mit 15:11 absetzen. Schon hier war die mangelnde Chancenauswertung für den Rückstand verantwortlich. Nach dem Wechsel kam die zweite Mannschaft besser ins Spiel und konnte zum 17:17 ausgleichen. Zwei verworfene 7m und das reihenweise auslassen bester Chancen führten zum 22:24 Rückstand kurz vor Schluss. Ein weiterer verworfener 7m ermöglichten den Gästen noch die abschließende Führung zum 26:23 Endstand.</p>\r\n<p> Es spielten: Kay Grund und Markus Kuhnke im Tor, Uwe Drechsler 1, Julian Vogt 2, Ronald Bausch 2, Martin Simmermacher 2, Dennis Killer 1, Dirk Höhl 1 und aus der A-Jugend Tim Patrzalek 3, Benjamin von Stein 2, Miro Hinkel 2 und Björn Ehmke 7.</p>', '84.167.82.15'),
(320, 48, 1, '2008-04-28 08:39:07', '2008-04-28 00:00:00', 'outwards', 'JSG Siedelsbrunn/Wald-Michelbach - mB Jugend	20:34', '<p>4. Spiel der Qualirunde OL/RL auf Bezirksebene</p>\r\n<p>27.04.2008 - 15.00 Uhr<br />20 : 34 (11 : 12)</p>\r\n<p>Es spielten: Max Schielke, Christian Kindermann, Andreas Gerhard; Erik Neumann (5 Tore), Patrick Pollner (3 Tore), Andreas Margarit (1 Tor), Ricardo Wilhelm (2 Tore), Kai Feldmann (6 Tore), Malte Just (1 Tor), Joschka Jankovic (2 Tore), Jan Döll (6 Tore), Sven Rinschen (4 Tore) und Max Damm (4 Tore).</p>', '84.58.219.130'),
(321, 51, 1, '2008-04-28 08:56:25', '2008-04-28 00:00:00', 'home', 'wB Jugend - SKG Rossdorf	24:16', '<p>1. Spiel der Qualirunde BOL wB</p>\r\n<p>27.04.2008 - 12.00 Uhr<br />24 : 16 (13 : 17)</p>\r\n<p>Es spielten: Kim Becker, Justine Liebald; Mayra Janssen (3 Tore), Katharina Schuldt (2 Tore), Alessa Zimmer (3 Tore), Katrin Feldmann (2 Tore), Deborah Berge (4 Tore), Denise Großheim (6 Tore), Lea Maria Wenzel (2 Tore), Tanja Birli, Mara König (1 Tor), Nadja Spilok und Lea Jung (1 Tor).</p>', '84.58.219.130'),
(322, 6, 5, '2008-04-28 09:34:15', '2008-04-28 00:00:00', 'outwards', 'TSV Pfungstadt II - TUS Griesheim II	29:20', '<p>Zweite Mannschaft ohne Chancen gegen Pfungstadt</p>\r\n<p>Gegen die zweite Mannschaft von Pfungstadt konnte man nur in der ersten Halbzeit mithalten. Pfungstadt hatte den besseren Start konnte sich aber nicht entscheidend absetzen. Ein verworfener 7m kurz vor der Pause beim Stand von 9:10 ermöglichten Pfungstadt die 9:13 Pausenführung. Nach dem Wechsel hatte man dem schnellen Spiel der Pfungstädter Mannschaft nichts mehr entgegenzusetzen und das Spiel wurde noch deutlich mit 20:29 verloren. Mit dieser Niederlage im letzten Spiel der Saison ist man in der Tabelle auf den 12 Tabellenplatz zurückgefallen.</p>\r\n<p>Es spielten: Kay Grund und Marcus Kuhnke im Tor, Tim Patrzalek 2, Daniel Arenz 1, Julian Vogt 5, Mario Schecker 7, Ronald Bausch 5, Christian Döll, Dennis Killer und Lukas Baier.</p>\r\n<p> </p>\r\n<p> </p>', '84.167.82.15'),
(323, 6, 5, '2008-04-28 09:39:04', '2008-04-28 00:00:00', 'article', 'Zweite Mannschaft schafft den Klassenerhalt', '<p>„Mission impossible 3.0 finished" - Die Zwote hat das Ziel erreicht!</p>\r\n<p>Das Saisonziel der zweiten Mannschaft, der Klassenerhalt, wurde geschafft. An den letzten zwei Spieltagen wurde allerdings mit der vermeidbaren Niederlage zu Hause gegen Rüsselsheim/Bauschheim und der Niederlage in Pfungstadt  der mögliche zehnte Tabellenplatz leichtfertig verspielt. Es war alles in allem eine wechselhafte Saison. Man pendelte öfter zwischen Platz 10 und 12. Obwohl das Team schon in der Hinrunde fast so viele Punkte wie in der gesamten letztjährigen Saison geholt hatte, war ein möglicher Abstieg bis drei Spieltage vor Schluss noch nicht gebannt. Erst der deutliche Sieg im Heimspiel gegen Nieder-Liebersbach/Reisen und der knappe aber verdiente Sieg am drittletzten Spieltag in Gustavsburg ließen das Punktekonto auf 19: 29 Punkte ansteigen. Leider wurde der Einsatz der Spieler, ihres Trainers und der Anhänger nicht immer belohnt, und auch gute Spiele gingen verloren. Aufgrund von personellen Engpässen wurden des Öfteren auch Spieler aus der A-Jugend eingesetzt. Ihre Unterstützung wirkte sich oft sehr positiv auf die Spiele aus. An dieser Stelle ein Dank an die Jungs, die sich dort immer voll reingehängt haben. Und ein Dank für Ihre Unterstützung an unsere treusten Fans, die uns auch bei den Auswärtsspielen (egal wie weit) immer begleitet haben.  </p>\r\n<p> </p>\r\n<p>Kapitän Kay Grund</p>\r\n<p>Trainer Manfred Lohnes</p>\r\n<p> </p>', '84.167.82.15'),
(350, 40, 5, '2008-08-07 12:32:07', '2008-08-07 00:00:00', 'article', 'Informationen zu unseren Mannschaften', '<p>Nach acht erfolgreichen Jahren mit dem Trainergespann Klaus Feldmann und Wolfgang Ittner startet unsere erste Mannschaft mit einem neuen Trainer in die Saison 2008/2009. Als neuen Trainer konnten wir Stefan Beißer aus Büttelborn gewinnen.  Mit dem Trainerwechsel verbunden waren auch einige Veränderrungen im Kader der Mannschaft. Verlassen hat uns Simon Bär nach Groß Umstadt. Aus Beruflichen- und Studiengründen stehen Stefan Hamel und Nicolas Wurth nur noch eingeschränkt zur Verfügung. Neu Kader der Mannschaft sind Kevin Herr und Dennis Bork aus der A-Jugend sowie Mario Ubiparip und Andreas Manhart (TSV Modau), Danilo Jaksic (Mörfelden/Walldorf), Sebastian Trapmann (TGB 65 Darmstadt) und Tobias Stolz-Zwilling aus Groß Zimmern. Saisonziel für 2008/2009ist ein Platz im sicheren/vorderen Mittelfeld.</p>\r\n<p>Die zweite Mannschaft spielt mit einem kleinen Kader weiterhin in der Bezirksliga A Darmstadt. Hier geht es von Anfang an wieder gegen den Abstieg, bevor man im nächsten Jahr verstärkt wieder mit eigenen Nachwuchskräften planen kann.</p>\r\n<p>Unsere Frauenmannschaft spielt weiter in der Bezirksoberliga Darmstadt. Hier gab es nach der vergangenen Saison auch einen Trainerwechsel. Nach Christian Matzel und Norbert Schäfer (als Interimstrainer) wird die Mannschaft wieder von Christian Mentges trainiert und sollte in der Bezirksoberliga eine gute Rolle spielen.</p>\r\n<p>Von unseren Jugendmannschaften gibt es nur positives zu berichten. Mit der A-Jugend, der B-Jugend der weiblichen- und männlichen C-Jugend spielen vier Griesheimer Mannschaften in der hessischen Oberliga. Auch bei der D-, E- und F-Jugend spielen wir teilweise mit zwei Mannschaft in den Spielrunden.</p>\r\n<p>Diese Leistungen stellen die Abteilung aber auch vor große organisatorische (Hallenzeiten, Trainer, Betreuer usw.) und finanzielle Anforderungen. Es müssen Fahrten mit den Oberligamannschaften bis nach Oberhessen organisiert und letztlich auch finanziert werden. Hier suchen wir verstärkt noch nach Sponsoren, die uns bei dieser Aufgabe unterstützen.</p>\r\n<p>An dieser Stelle möchte ich mich bei Ihnen für ihr Interesse an unsere Seite bedanken und wünschen Ihnen beim lesen der Artikel noch viel Spaß und Freude.</p>\r\n<p>Manfred Lohnes</p>', '84.167.113.60'),
(326, 47, 9, '2008-05-01 22:26:45', '2008-04-30 00:00:00', 'outwards', 'SKG Bonsweiher - mA Jugend	22:39', '<p>Die A-Jugend mußte am Mittwoch Abend in Mörlenbach gegen die SKG Bonsweiher antreten. Während in der ersten Halbzeit nur eine 16:14 Führung erspielt wurde, konnten die TUSĺer in der zweiten Hälfte Dank einer defensiveren Abwehr, die in Steffen Vogel im Tor noch dazu einen sicheren Rückhalt fand, gleich zu Anfang 10 Tore ohne Gegentreffer erzielen. Die Gastgeber wurden überrannt und verloren die 2. Halbzeit deutlich mit 15 Toren Unterschied. Mit dem 39:22 Sieg belegen die TUSĺer zum Ende der Qualifikation des Bezirks Darmstadt den 1. Rang. Die Qualifikation auf Hessenebene beginnt Ende Mai, wobei aus 6 gelosten Mannschaften der Sieger in der Regionalliga und der Zweitplatzierte in der Oberliga spielen wird.</p>\r\n<p>Gegen Bonsweiher spielten: Yannick Hassenzahl und Steffen Vogel im Tor, Benjamin v. Stein (1), Tim Patrzalek (6), Maximilian Bopp (5), Lukas Baier (3), Björn Ehmke (5), Jan Tachtler (1), Christoph Rampelt (2), Tim Rinschen (10), Miro Hinkel (4) und Marvin Haller (2) - TV</p>', '84.58.209.60'),
(324, 2, 5, '2008-04-28 09:57:10', '2008-04-28 00:00:00', 'article', 'Jahreshauptversammlung 2008', '<p>            Der Vorstand der Handballabteilung lädt ein zur</p>\r\n<p>                          Jahreshauptversammlung 2008      </p>\r\n<p>                                   der Handballabteilung</p>\r\n<p>am Mittwoch, den 28. Mai 2008 um 20:00 Uhr im TuS-Heim in Griesheim</p>\r\n<p>Tagesordnung:</p>\r\n<p>                    1.  Begrüßung</p>\r\n<p>                    2. Berichte</p>\r\n<p>                        a) Gesamtüberblick</p>\r\n<p>                        b) Sport mit Jugend</p>\r\n<p>                        c)  Schiedsrichterwesen</p>\r\n<p>                        d)  Rechner - Finanzen</p>\r\n<p>                        e)  Kassenprüfung</p>\r\n<p>                    3. Aussprache zu den Berichten</p>\r\n<p>                    4. Entlastung des Rechners</p>\r\n<p>                    5. Neuwahl eines Kassenprüfers</p>\r\n<p>                   6. Neuwahl eines Pressewartes</p>\r\n<p>                   7. Anträge</p>\r\n<p>                   8. Verschiedenes</p>\r\n<p> Anträge müssen bis 10 Tage vor der Jahreshauptversammlung schriftlich bei Abteilungsleiter Manfred Lohnes, Mozartstraße 10 E, 64347 Griesheim, eingehen.</p>\r\n<p>Wir bitten alle Mitglieder, Eltern und  Mannschaften an der Jahreshauptversammlung teilzunehmen.</p>\r\n<p>Für den Abteilungsvorstand</p>\r\n<p>Manfred Lohnes </p>', '84.167.82.15'),
(325, 1, 5, '2008-04-28 10:20:36', '2008-04-28 00:00:00', 'article', 'Kein einfaches Jahr', '<p>Kein einfaches Jahr für die Handballabteilung.</p>\r\n<p>Eine für die Handballabteilung nicht einfache Saison ist zu Ende. Einfach deshalb nicht, weil für die Erste und Zweite Herrenmannschaft der Klassenerhalt bis zum Schluss auf Messers Schneide stand. Beide Mannschaften werden in der neuen Saison aber wieder in der Landesliga bzw. in der Bezirksliga A antreten Bei der ersten Mannschaft gibt es nach 8 erfolgreichen Jahren mit dem Trainergespann Klaus Feldmann und Wolfgang Ittner einen Wechsel. Ab der neuen Saison wird die Mannschaft von Stefan Beißer aus Büttelborn trainiert. Die Mannschaft bleibt in ihrer derzeitigen Zusammensetzung zusammen und wird weiter ergänzt. Bei der Frauenmannschaft gab es nach der Vorrunde einen Trainerwechsel. Die Mannschaft belegt nach Abschluss der Saison einen ungefährdeten Platz im Mittelfeld. Hier wird eine neuer Trainer gesucht. Positives ist aus der Jugend zu berichten. Mit der A-, B- und C-Jugend spielten drei Mannschaften in der hessischen Oberliga. Die weibliche C-Jugend wurde in der Bezirksoberliga mit großem Vorsprung Meister.</p>\r\n<p>Für die abgelaufene Saison 2007/2008  möchte ich mich an dieser Stelle bei allen Förderern, Fans und Zuschauern, die uns über die Saison hinweg begleitet haben, herzlich bedanken.</p>\r\n<p>Manfred Lohnes</p>\r\n<p>Abteilungsleiter</p>', '84.167.82.15'),
(329, 52, 5, '2008-08-07 12:38:45', '2008-05-05 00:00:00', 'home', 'mD Jugend - HSG Weiterstadt/Braunshardt II	21:27', '<p>Am vergangenen Sonntag begann für die D-Jugend der Handballer die Qualifikation  zur Bezirksoberliga. Hier traf man in eigener Halle auf das Team der HSG Weiterstadt/Braunshardt II, also ein Spiel mit Derbycharakter. Für die neu formierte Griesheimer Mannschaft war dieser Gegner an diesem Tag eine Nummer zu groß. Ein Großteil der Mannschaft bestritt mit dieser Begegnung das erste Spiel seit über einem Jahr. Daher fehlte es unter anderem am Spielverständnis untereinander. Zu dem kam eine neue taktische Grundausrichtung, die den Kids bei Weitem noch nicht in Fleisch und Blut übergegangen ist. Außerdem mangelte es an Spielwitz und Bewegung im Angriff. Auch im Abwehrverhalten traten noch Fehler auf. Dies soll letztendlich aber die Leistung der HSG nicht schmälern, die das Spiel mit  27:21 (Halbzeit 14:9) verdient als Sieger beenden konnten.</p>\r\n<p>Für das neue Trainergespann Lohnes/Wurdak bleibt also noch viel Arbeit. Mit der HSG Weiterstadt/Braunshardt I erwarten die TuS-Kids nach Pfingsten eine Mannschaft, die noch weit aus stärker einzuschätzen ist. Da sich nur die beiden Gruppenbesten für die Bezirksoberliga qualifizieren, ist bereits jetzt klar, dass dieses Ziel sehr schwer zu erreichen sein wird.</p>\r\n<p>Es spielten: Leichtweis (Torwart), Alberti (1 Tor), Birli, Blum, Borger, Feldmann, Flügger, Fritzsche (9), Hartmann, Hohorst, Jacquot (4), Reitenbach, Schnell, Schupp (2), Türke (5) und Wurdak</p>', '84.167.113.60'),
(330, 52, 14, '2008-05-18 23:11:15', '2008-05-18 00:00:00', 'home', 'mD Jugend - HSG Weiterstadt/Braunshardt I	15:28', '<p> </p>\r\n<p><span style="text-decoration: underline;">Zweite Niederlage in der Quali</span></p>\r\n<p> </p>\r\n<p>Nachdem sich im ersten Spiel der Qualifikation zur Bezirksoberliga schon eine Niederlage gegen die zweite Mannschaft der HSG Weiterstadt/Braunshardt ergab, hatte die D-Jugend der TuS-Handballer nun die erste Mannschaft zu Gast. Bereits im Vorfeld war klar, dass dieser Gegner wahrscheinlich eine Nummer zu groß sein würde. Zwar spielten die Griesheimer diesmal stark verbessert gegen die körperlich weit überlegene HSG, konnten die Niederlage aber trotzdem nicht vermeiden. Bereits zur Halbzeit lagen die Heimischen mit 7:12 im Hintertreffen.</p>\r\n<p>Nach dem Wechsel gelangen den Handball-Kids einige sehenswerte Aktionen, die zeigten, dass sie sich langsam auf die neue Spielausrichtung einstellen. So konnte ein um das andere Mal die gegnerische Abwehr sehr stark mit Doppelpässen ausgespielt werden.Allerdings konnte die HSG auch einige Bälle abfangen und diese mit Gegenstößen in Tore umsetzen.  Zum Schluss hieß es 15:28 aus Sicht des TuS.</p>\r\n<p>Nachdem sich nun die zwei besten Mannschaften der Qualifikationsgruppe in der Großsporthalle vorgestellt haben, heißt es in den verbleibenden zwei Spielen zu punkten, um die letzte Chance auf einen Platz in der Bezirksoberliga  zu behalten. Am nächsten Sonntag reisen die Schützlinge von Manfred Lohnes und Martin Wurdak nach Bonsweiher. Mit der richtigen Einstellung ist dort sicher ein Erfolg möglich.</p>\r\n<p>Es spielten: Leichtweis (Torwart), Alberti (1Tor), Feldmann, Fritzsche (4), Grein, Hartmann (1), Reitenbach (1),  Schafhausen, Schnell, Schupp (5), Türke (1) und Wurdak (2)</p>', '84.58.228.188'),
(331, 47, 9, '2008-05-25 09:01:21', '2008-05-25 00:00:00', 'home', 'mA Jugend - SG Arheilgen	36:24', '<div>\r\n<p>Im ersten Regionaliga-Qualifikations-Spiel hatte die A-Jugend, wie schon vor wenigen Wochen auf Bezirksebene, die SG Arheilgen zu Gast. Damals verlor man nach einem hektischen Spiel mit einem Tor. Diesmal wollte man Revanche. Die Griesheimer waren spielerisch den Gästen überlegen und konnten sich in der ersten Hälfte über ein 12:7 zum 17:13 Pausenstand absetzen. Zu Beginn der zweiten Halbzeit konnten die Gäste noch mal auf 2-3 Tore verkürzen. In der 40. Minute verschoss Tim Rinschen einen Siebenmetern. Den Abpraller bekam er zuerst und wurde wiederum siebenmeterreif gefoult. Nun hätte besser ein anderer Spieler werfen sollen, doch er versuchte es nochmal, diesmal am Kopf vorbei. Der vorzügliche Torhüter bewegte sich aber leicht und bekam den Ball ins Gesicht, weswegen die Schiedrichter Tim die rote Karte wegen Unsportlichkeit zeigten. Griesheim behielt jedoch im weiteren Verlauf die Oberhand und konnte den Vorsprung kontinuierlich auf letztendlich 36:24 ausbauen.</p>\r\n<p>Es spielten: Tim Ulmrich und Steffen Vogel im Tor, Daniel Arenz (1), Benjamin v. Stein (4), Tim Patrzalek (3), Maximilian Bopp (2), Lukas Baier (3), Björn Ehmke (4), Marvin Haller (2), Christoph Rampelt (9), Tim Rinschen (5), und Miro Hinkel (3)</p>\r\n<p>Bereits am Mittwoch um 19.00 findet das zweite von insgesamt fünf Quali-Spielen in Niederrhodenbach statt. - TV</p>\r\n</div>', '84.58.224.231'),
(332, 48, 3, '2008-05-25 10:42:18', '2008-05-25 00:00:00', 'home', 'mB Jugend - JSG Crumstadt/Goddelau	38:21', '<p><span style="font-family: Helvetica;">\r\n<div>Mit einem konzentrierten Start (12 : 0) legten die Griesheimer Jungs den Grundstein für den ersten Sieg in der Qualifikation auf Landesliga-Ebene. Die Gastgeber überzeugten mit aktiver Abwehr, gelungenen Kombinationen im Angriff und einer geschlossenen Mannschaftsleistung.</div>\r\n<div></div>\r\n<div>Es spielten: Max Schielke, Christian Kindermann, Andreas Gerhard; Erik Neumann (5 Tore), Max Damm (1 Tor), Patrick Pollner (4 Tore), Andreas Margarit (1 Tor), Arseniy Zankov (5 Tore), Ricardo Wilhelm (3 Tore), Marvin Gernandt (4 Tore), Kai Feldmann (4 Tore), Joschka Jankovic (6 Tore), Sven Rinschen (4 Tore) und Raphael Sturm (1 Tor).</div>\r\n</span></p>', '81.210.158.237'),
(334, 52, 14, '2008-05-25 14:31:08', '2008-05-25 00:00:00', 'outwards', 'SKG Bonsweiher - mD Jugend	19:16', '<p> </p>\r\n<p><span style="text-decoration: underline;">D-Jugend unterliegt im Odenwald</span></p>\r\n<p>Am letzten Sonntag spielte die D-Jugend der TuS-Handballer in Mörlenbach gegen die SKG Bonsweiher. Das Team reiste eigentlich recht optimistisch in den Odenwald, man rechnete sich sogar Chancen auf einen Sieg aus. Wie zu erwarten war, trafen die Griesheimer wieder auf einen körperlich überlegenen Gegner.  Diesen Vorteil konnte Bonsweiher zunächst auch nutzen und ging in Führung. Doch verbissen kämpften sich die Schützlinge von Manfred Lohnes und Martin Wurdak wieder heran und konnten bis zur Halbzeit das Spiel mit  7:7 ausgeglichen halten.</p>\r\n<p>Nach dem Wechsel setzten sich die Gastgeber wieder schnell mit zwei bis drei Toren ab. Doch auch in Halbzeit zwei kamen die Griesheimer wieder zum Ausgleich. In der 58. Spielminute beim Stand von 16:16 nahm der Trainer von Bonsweiher eine Auszeit. Scheinbar fand er für die letzten zwei Minuten die richtigen Worte, denn bis zum Schlusspfiff konnten sich die Hausherren auf 19:16 absetzen. Schade für den TuS, es wäre bei einer besseren Chancenverwertung und weniger Fehlpässen wirklich ein Erfolg möglich gewesen.</p>\r\n<p>Es spielten: Leichtweis (Torwart), Alberti, Feldmann, Flügger, Fritzsche (10 Tore), Hartmann (2), Hohorst, Reitenbach, Schnell, Schupp (1), Türke (2) und Wurdak (1)</p>', '84.58.233.94'),
(335, 48, 1, '2008-05-28 09:29:11', '2008-05-27 00:00:00', 'outwards', 'SG Bruchköbel - mB Jugend	24:26', '<p>24 : 26 (12 : 13)</p>\r\n<p>27.05.2008 - 19.15 Uhr</p>\r\n<p>In einem intensiven und guten Spiel konnten die Griesheimer einen wichtigen Auswärtserfolg verbuchen. Trotz einer guten Abwehrleistung vor der Pause verhinderten unvorbereitete Abschlüsse eine höhere Führung zur Halbzeit. Im zweiten Abschnitt verlief das Spiel sehr lange ausgeglichen; erst fünf Minuten vor Ende konnten sich die Griesheimer mit mehreren konzentrierten Angriffen entscheidend absetzen.</p>\r\n<p>Dabei waren: Max Schielke, Christian Kindermann, Andrea Gerhard; Erik Neumann (6 Tore), Patrick Pollner, Arseniy Zankov (6 Tore), Ricardo Wilhelm (4 Tore), Marvin Gernandt (4 Tore), Kai Feldmann (1 Tor), Joschka Jankovic (2 Tore), Sven Rinschen (3 Tore) und Raphael Sturm.</p>', '84.58.246.202'),
(336, 48, 3, '2008-05-29 13:14:07', '2008-05-29 00:00:00', 'outwards', 'SG Bruchköbel - mB Jugend	24:26', '<div>In einem intensiven und guten Spiel konnten die Griesheimer einen wichtigen Auswärtserfolg verbuchen. Trotz einer guten Abwehrleistung vor der Pause verhinderten unvorbereitete Abschlüsse eine höhere Führung zur Halbzeit. Im zweiten Abschnitt verlief das Spiel sehr lange ausgeglichen; erst fünf Minuten vor Ende konnten sich die Griesheimer mit mehreren konzentrierten Angriffen entscheidend absetzen.</div>\r\n<div><br /></div>\r\n<div>Dabei waren: Max Schielke, Christian Kindermann, Andrea Gerhard; Erik Neumann (6 Tore), Patrick Pollner, Arseniy Zankov (6 Tore), Ricardo Wilhelm (4 Tore), Marvin Gernandt (4 Tore), Kai Feldmann (1 Tor), Joschka Jankovic (2 Tore), Sven Rinschen (3 Tore) und Raphael Sturm.</div>\r\n<div><br /></div>', '141.72.21.3'),
(337, 47, 9, '2008-06-01 14:49:43', '2008-05-31 00:00:00', 'outwards', 'TSG Bürgel - mA Jugend	38:29', '<p>Im dritten Regionaliga-Qualifikations-Spiel stand die A-Jugend vor Ihrer bislang schwersten Aufgabe gegen die TSG Bürgel. Es entwickelte sich ein kampfbetontes Spiel indem die Gäste trotz einer Griesheimer 6:0 Deckung immer wieder über die Außenposition zum Torerfolg kamen. Die TUS''ler konnten bis zum 7:7 mithalten, mußten dann aber bis zur Pause ein Rückstand von 20:16 verkraften. Auffällig war bis dahin, das Griesheim deutlich mehr 7m zugesprochen bekam, was durch die vielen gelungenen Einzelaktionen erklärbar war, die Bürgel nur sehr regelwidrig stoppen konnte. Bis zur 40. Minute konnte man durch eine konsequentere Abwehr zwar wieder auf 23:22 verkürzen, doch die Gäste fanden wieder zu ihrem Spiel und konnten sich bis zur 50.Minute wieder auf 28:24 absetzen. Die nun folgende offene Manndeckung konnte das Spiel nicht mehr kippen und Griesheim verlor dadurch deutlicher als verdient mit 38:29.</p>\r\n<p>Wegen dieser Niederlage muß man in den zwei verbleibenden Spielen am Donnerstag 20.00 in der GHS gegen TV Bürgstadt und am Sonntag in Ober-Ramstadt gegen die starke Truppe von JSG Gersprenztal noch punkten, um sich noch Hoffnungen auf die Oberliga machen zu können.</p>\r\n<p>Es spielten: Tim Ulmrich und Steffen Vogel im Tor, Daniel Arenz, Benjamin v. Stein (4), Tim Patrzalek (5), Maximilian Bopp (1), Lukas Baier (3), Björn Ehmke (2), Marvin Haller (2), Jan Tachtler, Christoph Rampelt (2), Tim Rinschen (7), und Miro Hinkel (5) - TV</p>', '84.58.196.220');
INSERT INTO `articles` (`id`, `cat_id`, `editor_id`, `last_update`, `date`, `type`, `title`, `text`, `ip`) VALUES
(338, 52, 14, '2008-06-01 18:54:59', '2008-06-01 00:00:00', 'home', 'mD Jugend - TGB 65 Darmsatdt	15:21', '<p><span style="text-decoration: underline;">Leider wieder nicht gewonnen</span></p>\r\n<p> </p>\r\n<p>Am letzten Sonntag empfing die D-Jugend der Handballer das Team der TGB 65 Darmstdt. Wie in fast allen Qualifikationsspielen zur Bezirksoberliga stellte sich diesmal auch wieder ein körperlich überlegener Gegner vor. Aber es zeigte sich, dass die Griesheimer in den letzten Wochen viel gelernt haben. Die Vorteile der Bessunger an Kraft konnten die TuSler mit schönen Ballwechseln und Doppelpässen kompensieren und kamen immer wieder zu Torerfolgen. Besonders interessant war das Abwehrverhalten von Tim Sören Hartmann. Der kleinste Griesheimer Spieler hatte es mit einem Kreisläufer zu tun, der zwei Köpfe länger war. Aber meistens blieb der Griesheimer erfolgreich. Allerdings mussten die Heimischen trotz allen Kampfes mit einem 9:10 in die Kabine.</p>\r\n<p> </p>\r\n<p>Nach dem Wechsel gab das Trainergespann Lohnes/Wurdak allen Spielern Gelegenheit, sich zu beweisen. Dadurch riss etwas der Spielfaden und die TGB konnte sich bis zum Ende deutlich absetzen. So endete das Spiel mit 15:21 aus Sicht des TuS. Besonders zu erwähnen ist noch, dass Michael Leichtweis im Tor  zwei Siebenmeter meistern konnte.</p>\r\n<p> </p>\r\n<p>Die D-Jugend konnte sich somit nicht für die Bezirksoberliga qualifizieren. Dies ist allerdings kein Beinbruch. Bei konsequenter Trainingsarbeit kann man auch ein Klasse tiefer eine sehr gute Rolle spielen und die Mannschaft für die übernächste Saison aufbauen.</p>\r\n<p> </p>\r\n<p>Es spielten: Leichtweis (Torwart), Alberti, Birli, Feldmann, Flügger (1), Fritzsche (4), Grein,  Hartmann, Hohorst, Jacquot (3), Schafhausen, Schnell, Schupp (2), Türke (4) und Wurdak (1)</p>', '84.58.194.18'),
(339, 51, 1, '2008-06-02 16:58:24', '2008-05-30 00:00:00', 'outwards', 'wJSG Lorsch/Heppenheim - wB Jugend	14:33', '<p>14 : 33<br />(7 : 16)</p>\r\n<p>30.05.2008 19.00 Uhr</p>\r\n<p>Dabei waren: Kim Becker, Justine Liebald; Mayra Janssen (2 Tore), Katharina Schuldt (5 Tore), Alessa Zimmer (5 Tore), Katrin Feldmann (3 Tore), Deborah Berge (5 Tore), Denise Großheim (8 Tore), Lea Maria Wenzel (2 Tore), Tanja Birli (1 Tor), Mara König und Lea Jung (2 Tore).</p>\r\n<p> </p>', '84.58.206.72'),
(340, 48, 1, '2008-06-02 16:59:27', '2008-05-31 00:00:00', 'outwards', 'TV Gelnhausen - mB Jugend	20:30', '<p>20 : 30<br />(7 : 16)</p>\r\n<p>31.05.2008 14.00 Uhr</p>\r\n<p>Mit einem verdienten Sieg kehrten die Griesheimer Jungs vom dritten Qualispiel aus Gelnhausen zurück. Im Spiel war schon nach zwölf Minuten eine Vorentscheidung gefallen - die Gäste führten 10:1 und sechs Feldspieler hatten sich schon in die Torschützenliste eingetragen. Am Ausgang des Spiel änderte auch die grobe Spielweise der Gastgeber nichts; die Griesheimer waren in allen Mannschaftsteilen besser besetzt.</p>\r\n<p>Dabei waren: Max Schielke, Christian Kindermann, Andreas Gerhard; Eric Neumann (3 Tore), Patrick Pollner (4 Tore), Arseniy Zankov (6 Tore), Ricardo Wilhelm (3 Tore), Marvin Gernandt (4 Tore), Kai Feldmann (2 Tore), Joschka Jankovic (1 Tor), Sven Rinschen (4 Tore) und Raphael Sturm (3 Tore).</p>', '84.58.206.72'),
(341, 47, 9, '2008-06-08 21:50:50', '2008-06-05 00:00:00', 'home', 'mA Jugend - TV Bürgstadt	42:44', '<p>Am Donnerstag hatte die A-Jugend gegen den TV Bürgstadt Heimrecht. In einem schnellen temporeichen Spiel legten die TUS''ler gleich richtig vor, sodass die Gegner nach 8 Minuten beim Stand von 9:4 gleich eine Auszeit nahmen. Leider wurde dieser Vorsprung insbesondere durch schlechte Abwehrarbeit leichtfertig verspielt. Nach der Halbzeit konnte man wiederum von 21:20 auf 26:21 vorlegen, aber auch dann holten die Gäste wieder auf und konnten in der 45. Minute zum 32:32 ausgleichen. Nach einer hektischen Schlußphase verlor man schließlich torreich 42:44. Leider brach sich Tim Patrzalek im letzten Angriff den Daumen und wird erst nach der Sommerpause wieder einsatzbereit sein.</p>', '84.58.195.164'),
(342, 47, 9, '2008-06-08 23:56:30', '2008-06-08 00:00:00', 'outwards', 'JSG Gersprenztal - mA Jugend	31:20', '<p>Im letzten Spiel der Qualifikationsrunde trat die A-Jugend ohne die Verletzten Tim Patrzalek und Tim Rinschen beim ungeschlagenen Tabellenführer JSG Gersprenztal an. Zu Anfang klappte alles prima und binnen 8 Minuten stand es überraschenderweise 8:2 für den TUS. Durch eine konsequentere und offenere Deckung der Gäste verunsichert, verloren die TUS''ler schnell den Vorsprung und mußten sogar mit 13:15 in die Pause gehen. In der zweiten Hälfte vergrößerte der Gegener seinen Vorsprung nunmehr kontinuierlich auf letztlich 31:20. Trotzdem behält man den 3. Tabellenplatz und spielt am nächsten Wochenende gegen den Drittplatzierten der parallelen Qualifikationsgruppe Süd, die HSG Nieder Roden, um den Einzug  in die Oberliga.</p>\r\n<p>Es spielten: Tim Ulmrich, Yannick Hassenzahl und Steffen Vogel im Tor, Daniel Arenz (1), Benjamin v. Stein (6), Maximilian Bopp, Lukas Baier (1), Björn Ehmke (3), Marvin Haller, Jan Tachtler, Christoph Rampelt (2),und Miro Hinkel (7) - TV</p>', '84.58.195.164'),
(343, 48, 3, '2008-06-11 13:27:50', '2008-06-05 00:00:00', 'home', 'mB Jugend - JSG Wallstadt	25:36', '<p><span style="font-family: Helvetica;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="color: #5f9934; font-family: ''Comic Sans MS'';"><span style="font-family: Helvetica; font-size: 12px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="font: normal normal normal 16px/normal ''Comic Sans MS'';"><span style="color: #000000;"><span style="font-family: Arial; font-size: small;"><span style="font-size: 12px;">Trotz einer guten Startphase und einer zwischenzeitlichen 4-Tore-Führung lagen die Griesheimer Jungs bis zur Halbzeit knapp mit zwei Toren zurück. Nach der Pause verhinderten unvorbereitete und unkonzentrierte Abschlüsse, dass das Spiel nochmal in Wendung erfahren konnte. </span></span></span></span></p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="font: normal normal normal 16px/normal ''Comic Sans MS'';"><span style="color: #000000;"><span style="font-family: Arial; font-size: small;"><span style="font-size: 12px;">Dabei waren: Max Schielke, Christian Kindermann; Max Damm, Patrick Pollner (1 Tor), Andreas Margarit, Arseniy Zankov (8 Tore), Ricardo Wilhelm (3 Tore), Marvin Gernandt (6 Tore), Kai Feldmann, Joschka Jankovic (1 Tor), Sven Rinschen (6 Tore) und Raphael Sturm.</span></span></span></span></p>\r\n</span></span></p>\r\n</span></p>', '92.50.86.158'),
(344, 48, 3, '2008-06-11 13:28:45', '2008-06-08 00:00:00', 'outwards', 'TV Groß-Zimmern - mB Jugend	30:31', '<p><span style="font-family: Helvetica; font-size: 12px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="font: normal normal normal 16px/normal ''Comic Sans MS'';"><span style="color: #000000;"><span style="font-family: Arial; font-size: small;"><span style="font-size: 12px;">Die Griesheimer Jungs nahmen das Spiel sofort in die Hand und sicherten sich einen deutlichen Vorsprung zur Pause. Inkonsequentes Abwehrspiel ermöglichte es den Gastgebern, die auch taktisch besser eingestellt aus der Kabine kamen, das Spiel ausgegleichen zu gestalten. Aufgrund unötiger Zeitstrafen schmolz der Vorsprung zum Spielende zusammen.</span></span></span></span></p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="font: normal normal normal 16px/normal ''Comic Sans MS'';"><span style="color: #000000;"><span style="font-family: Arial; font-size: small;"><span style="font-size: 12px;">Dabei waren: Max Schielke, Christian Kindermann, Andreas Gerhard; Erik Neumann (4 Tore), Max Damm (3 Tore), Patrick Pollner (3 Tore), Andreas Margarit (1 Tor), Arseniy Zankov (6 Tore), Ricardo Wilhelm (3 Tore), Marvin Gernandt (3 Tore), Kai Feldmann (4 Tore), Joschka Jankovic, Sven Rinschen (2 Tore) und Raphael Sturm (2 Tore)</span></span></span></span></p>\r\n</span></p>', '92.50.86.158'),
(345, 48, 3, '2008-06-11 13:29:25', '2008-06-11 00:00:00', 'outwards', 'HSG Kahl/Kleinostheim - mB Jugend	26:32', '<p><span style="font-family: Helvetica; font-size: 12px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="font: normal normal normal 16px/normal ''Comic Sans MS'';"><span style="color: #000000;"><span style="font-family: Arial; font-size: small;"><span style="font-size: 12px;">Mit einer konzentrierten Leistung konnte das erste Platzierungsspiel beid er HSG Kahl/Kleinostheim gewonnen werden. Trotz kleiner Fehler im Defensivbereich konnte die klare Pausenführung im zweiten Durchgang auf zehn Tore ausgebaut werden. Großer Anteil daran hatte auch Torwart Christian Kindermann.</span></span></span></span></p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;"><span style="font: normal normal normal 16px/normal ''Comic Sans MS'';"><span style="color: #000000;"><span style="font-family: Arial; font-size: small;"><span style="font-size: 12px;">Dabei waren: Max Schielke, Christian Kindermann, Andreas Gerhard; Erik Neumann (7 Tore), Max Damm, Patrick Pollner (2 Tore), Andreas Margarit, Arseniy Zankov (6 Tore), Ricardo Wilhelm (2 Tore), Marvin Gernandt (4 Tore), Kai Feldmann (7 Tore), Joschka Jankovic, Sven Rinschen (4 Tore) und Raphael Sturm.</span></span></span></span></p>\r\n</span></p>', '92.50.86.158'),
(346, 47, 9, '2008-06-15 17:07:36', '2008-06-15 00:00:00', 'home', 'mA Jugend - HSG Nieder Roden	30:26', '<p>Im Spiel der Drittplatzierten aus den Qualifikationsgruppen Süd mußte bei der A- Jugend ein Hin- und Rückspiel um den Einzug in die Oberliga entscheiden. Gegner war Nieder Roden, die mit vielen Spielern des jüngeren Jahrgangs 91 aufliefen. Griesheim war spielerisch und körperlich überlegen, doch der Gast fand immer wieder über die Außenpositionen zum Torerfolg, so dass man über einen Halbzeitstand von 16:13 nur ein 30:26  für das Rückspiel vorlegen konnte.</p>\r\n<p>Es spielten: Yannick Hassenzahl und Steffen Vogel im Tor, Daniel Arenz, Benjamin v. Stein (1), Lukas Baier (2), Björn Ehmke (3), Marvin Haller, Jan Tachtler, Christoph Rampelt (3), Tim Rinschen (12), Miro Hinkel (1), Arseniy Zankow (4), Marvin Gernandt (1) und Tim Patrzalek (3) - TV</p>', '84.58.210.204'),
(347, 47, 9, '2008-06-15 22:51:03', '2008-06-15 00:00:00', 'outwards', 'HSG Nieder Roden - mA Jugend	20:21', '<p>Mit 4 Toren Vorsprung aus dem Hinspiel des Vortages trat die A-Jugend in Nieder Roden an. Im Gegensatz zum Hinspiel konnte man sich nicht von Anfang an absetzen, was sicherlich auch an der vorgezogenen Sonderbewachung von Tim Rinschen lag. In der Abwehr, diesmal in 3:2:1 Formation, stand man insgesamt sicherer und insbesondere von aussen konnte  Yannick Hassenzahl viele Schüsse parieren. Über ein 5:5 gelangte man zur 11:8 Führung in der Halbzeit. In der zweiten Hälfte schmolz der Vorsprung zwar durch viele Fehlversuche an den starken gegnerischen Torhütern dahin, doch konnte auch eine offene Manndeckung ab der 56. Minute beim Stand von 18:18 das Spiel nicht mehr kippen und mann gewann verdient mit 21:20 Toren.</p>\r\n<p>Es spielten: Yannick Hassenzahl im Tor, Daniel Arenz, Benjamin v. Stein (2), Lukas Baier (5), Björn Ehmke (6), Maximilian Bopp, Marvin Haller, Jan Tachtler, Christoph Rampelt (1), Tim Rinschen (1), Miro Hinkel (1), Arseniy Zankow, Marvin Gernandt (1) und Tim Patrzalek (2) - TV</p>', '84.58.210.204'),
(348, 40, 5, '2008-07-06 20:14:52', '2008-07-06 00:00:00', 'article', 'Bericht zur Jahreshauptversammlung 2008', '<p>Zur Jahreshauptversammlung der Handballer am 28.05.08 konnte Abteilungsleiter Manfred Lohnes neben Sage und Schreibe <span style="text-decoration: underline;">vierzehn (14)</span> Mitgliedern auch den Vorsitzenden der Hauptvereins, Arnold Wessel begrüßen. Manfred Lohnes bedauerte das Desinteresse der Mitglieder der Abteilung an der Versammlung. In seinem Bericht ging er besonders auf die Probleme bei den aktiven Mannschaften (Tabellenstände, Trainerwechsel) in der letzten Saison ein.</p>\r\n<p>Aus dem Bereich der Jugend konnte viel Positives berichtet werden. Zu erwähnen ist an dieser Stelle, dass die Handballabteilung des TuS eine der ganz wenigen Abteilungen ist, in der der Jugendspielbetrieb noch ohne Spielgemeinschaften auskommt. Der Abteilungsleiter ging im Zusammenhang mit der erfolgeichen Jugendarbeit auch auf die damit verbundenen hohen Kosten und Belastungen ein. Innerhalb der Abteilung werden im Moment verstärkt Anstrengungen unternommen, die anfallenden Kosten im Bereich der verschiedenen Mannschaften zu decken.</p>\r\n<p>Für das Jahr 2009 stehen einige Personalentscheidungen an. Peter Killer als Abteilungsrechner und Uwe Rinschen als Jugendwart werden nicht mehr für eine weitere Mitarbeit auf ihren Posten zur Verfügung stehen. Als Pressewert trat Dieter Gernand von seinem Posten zurück. Ein Nachfolger konnte in der Versammlung nicht gefunden werden.</p>\r\n<p>Da keine Anträge vorlagen konnte die harmonisch verlaufende Versammlung vom Abteilungsleiter  gegen 22:00 Uhr geschlossen werden.</p>\r\n<p>Manfred Lohnes</p>', '84.167.65.165');
